INSERT INTO `quest_template_locale` VALUES (1, 'esES', 'Misin de Kanrethad', 'Habla con Kanrethad para que restaure tus talentos, armas y montura.', '$gBienvenido:Bienvenida; de vuelta del mundo de los muertos.$B$BHace mucho tiempo tus hermanos te consideraban $gun orgulloso hroe:una orgullosa herona;. Ahora has cado y ests $gdestrozado:destrozada;... no eres ms que una reliquia del pasado. Colcate ante m para que pueda volver a despertar la leyenda que fuiste antao.$B$BTe devolver los poderes y las armas que has perdido, y as volvers a estar $gcompleto:completa;.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (1, 'esMX', 'Misin de Kanrethad', 'Habla con Kanrethad para que restaure tus talentos, armas y montura.', '$gBienvenido:Bienvenida; de vuelta del mundo de los muertos.$B$BHace mucho tiempo tus hermanos te consideraban $gun orgulloso hroe:una orgullosa herona;. Ahora caste y ests $gdestrozado:destrozada;... no eres ms que una reliquia del pasado. Colcate ante m para que pueda volver a despertar la leyenda que alguna vez fuiste.$B$BTe devolver los poderes y las armas que perdiste y as volvers a estar $gcompleto:completa;. ', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (1, 'frFR', 'La qute de Kanrethad', 'Parlez  Kanrethad pour que vos talents, votre arme et votre monture vous soient rendus.', 'Bon retour du monde des morts.$B$BIl y a bien longtemps, vous tiez $gdroit et fier, un hros:droite et fire, une hrone; parmi les vtres. Aujourdhui, vous tes $gdchu et bris:dchue et brise;, une relique du pass. Tenez-vous devant moi, pendant que jveille la lgende que vous tiez autrefois.$B$BJe vous rendrai les armes et les pouvoirs que vous avez perdus, et vous serez  nouveau $gcomplet:complte;.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (1, 'itIT', 'Missione di Kanrethad', 'Parla con Kanrethad per ripristinare i tuoi talenti, armi e cavalcature.', '$gBentornato:Bentornata; dal mondo dei morti.$B$BUn tempo ti ergevi $gfiero:fiera;, $gun eroe:un\'eroina; tra i tuoi simili, ma ora non sei che un\'antica reliquia del passato. Osserva mentre riporto in vita la leggenda che eri tempo.$B$BRipristiner le armi e poteri che hai perso, per riportarti al tuo antico splendore. ', '', '', '', '', '', '', 0);
