INSERT INTO `quest_template_locale` VALUES (1, 'ptBR', 'A misso de Kanrethad', 'Fale com Kanrethad para restaurar seus talentos, seu armamento e sua montaria.', '$GBem-vindo:Bem-vinda; de volta ao mundo dos vivos.$B$BEm uma poca longnqua, voc se destacou orgulhosamente e foi $Gum heri:uma herona; entre seus pares. Agora, est $Gabatido:abatida; e $Genfraquecido:enfraquecida;, um mero resqucio do passado. Levante-se para que eu desperte a lenda que voc j foi.$B$BRestaurarei o armamento e os poderes que voc perdeu, tornando-$Go:a; um ser inteiro novamente. ', '', '', '', '', '', '', 0);
