INSERT INTO `quest_template_locale` VALUES (1, 'zhCN', 'Kanrethad\'s Quest', 'Speak to Kanrethad to restore your talents, weapon and mount.', 'Welcome back from the world of death. $B$BIn an age long past you stood proud, a hero among your brethren. Now you stand fallen and broken - a relic of the past. Stand before me, as I awaken the legend that you once were. $B$B I shall restore the weapons and powers you have lost, making you whole once again.', '', '', '', '', '', '', 0);
