INSERT INTO `quest_template_locale` VALUES (2, 'deDE', 'Klaue von Scharfkralle', 'Bringt Senani Donnerherz in der Silberwindzuflucht die Klaue von Scharfkralle.', 'Der mchtige Hippogryph Scharfkralle wurde gettet und die Klaue der erschlagenen Bestie dient als Beweis fr Euren Sieg.$b$bSenani Donnerherz in der Silberwindzuflucht wird zum Beweis Eurer Tat sicher gern diese Trophe sehen wollen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (2, 'esES', 'La garfa de Garfafilada', 'Llvale la garfa de Garfafilada a Senani Corazn Atronador en el Refugio Brisa de Plata, Vallefresno.', 'El poderoso hipogrifo Garfafilada ha sido ejecutado, con la garfa de la bestia derribada como testimonio de tu victoria. Seguro que Senani Corazn Atronador, del Refugio Brisa de Plata, estar interesado en ver este trofeo que prueba tus actos.', '', '', '', '', '', '', 0);
