INSERT INTO `quest_template_locale` VALUES (2, 'frFR', 'La griffe de Serres-tranchantes', 'Apportez la Griffe de Serres-tranchantes  Senani Cur-de-tonnerre, au Refuge de Vent-d\'Argent.', 'Le grand hippogriffe Serres-tranchantes a t tu, et la griffe arrache  son cadavre tmoigne de votre victoire. Senani Cur-de-tonnerre, au refuge de Vent-d\'Argent, sera sans doute intresse de voir ce trophe qui est la preuve de votre exploit.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (2, 'itIT', 'L\'Artiglio di Grinfiafina', 'Porta l\'Artiglio di Grinfiafina a Senani Cuore Tonante nel Rifugio Vento Argentato.', '<Il potente ippogrifo Grinfiafina  stato ucciso e l\'artiglio reciso dal suo corpo testimonia la tua gloriosa vittoria.>$b$b<Senani Cuore Tonante del Rifugio Vento Argentato sar senza dubbio interessata a ricevere questo trofeo come prova della tua impresa.>', '', '', '', '', '', '', 0);
