INSERT INTO `quest_template_locale` VALUES (5, 'deDE', 'Bibbers\' knurrender Magen', 'Sprecht mit Kchenchef Grual.', 'Ich verstecke mich jetzt schon seit Wochen in dieser Geisterstadt, und die ganze Zeit habe ich nichts gegessen auer Maden und Unkraut! Ich brauche was Anstndiges zum Essen, und ich werde mich nicht lumpen lassen.$B$BBringt mir ein Festessen, und ich bezahle Euch gut dafr.$B$BIch habe gehrt, dass Kchenchef Grual aus der Taverne \"Zum Roten Raben\" in Dunkelhain ganz ausgezeichnete schwrzliche Krebskchlein macht...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (5, 'esES', 'La hambruna de Alterio', 'Habla con el Chef Grual.', 'Llevo semanas escondindome en esta ciudad fantasma y no he comido ms que larvas y hierbajos! Necesito algo de comida decente. Estoy en disposicin de pagar bien.$B$BSi me traes un festn, te pagar generosamente.$B$BHe odo que el chef Grual del Mesn del Cuervo Escarlata de Villa Oscura hace unos estupendos pasteles de cangrejo oscuro...', '', '', '', '', '', '', 0);
