INSERT INTO `quest_template_locale` VALUES (5, 'frFR', 'L\'estomac qui gargouille', 'Parlez au Chef Grual.', 'Je suis rest cach dans cette ville fantme depuis des semaines.$B$BApportez-moi de quoi festoyer et je vous payerai gnreusement.$B$BJ\'ai entendu parler d\'un certain chef Grual qui fait de succulentes tourtes au crabe de la Pnombre,  la taverne du Corbeau carlate,  Sombre-Comt...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (5, 'itIT', 'Jitters\' Growling Gut', 'Speak with Chef Grual.', 'I\'ve been stuck hiding in this ghost town for weeks, and I haven\'t eaten anything but grubs and weeds!  I need some decent food, and I\'m willing to trade well for it.$B$BBring me a feast and I\'ll pay you handsomely.$B$BI heard Chef Grual at the Scarlet Raven Tavern in Darkshire makes very good Dusky Crab Cakes...', '', '', '', '', '', '', 0);
