INSERT INTO `quest_template_locale` VALUES (6, 'deDE', 'Kopfgeld auf Garrick Schleichfu', 'Ttet Garrick Schleichfu und bringt seinen Kopf zu Unteroffizier Willem in der Nhe der Abtei von Nordhain.', 'Garrick Schleichfu, ein Dieb und Halsabschneider, der schon seit Wochen unseren Bauern und Hndlern das Leben schwer macht, ist bei einem Schuppen in der Nhe der Weinberge gesehen worden. Die Weinberge liegen im Osten der Abtei, auf der anderen Seite der Brcke. Bringt mir den Kopf des Schurken und verdient Euch das Kopfgeld, das auf ihn ausgesetzt ist!$B$BDoch seht Euch vor, $n. Garrick hat eine Bande von Rohlingen um sich versammelt, also werdet Ihr nicht leicht an ihn herankommen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (6, 'esES', 'La recompensa por Garrick Piesuaves', 'Mata a Garrick Piesuaves y lleva su cabeza al ayudante de alguacil Willem a la Abada de Villanorte.', 'Garrick Piesuaves es un maleante que lleva semanas acosando a granjeros y mercaderes. Ha sido visto en una choza cerca de los viedos, cruzando el puente al este de la abada. Treme la cabeza de ese villano y podrs quedarte con su botn.$B$BPero ve con cuidado, $n. Garrick anda con una pandilla de matones. Puede que no te sea fcil llegar hasta l.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (6, 'esMX', 'La recompensa por Garrick Piesuaves', 'Mata a Garrick Piesuaves y lleva su cabeza al ayudante de alguacil Willem a la Abada de Villanorte.', 'Garrick Piesuaves es un maleante que lleva semanas acosando a granjeros y mercaderes. Ha sido visto en una choza cerca de los viedos, cruzando el puente al este de la abada. Treme la cabeza de ese villano y podrs quedarte con su botn.$B$BPero ve con cuidado, $n. Garrick anda con una pandilla de matones. Puede que no te sea fcil llegar hasta l.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (6, 'frFR', 'La prime pour Garrick Ladtrousse', 'Tuez Garrick Ladtrousse et rapportez sa tte  l\'Adjoint Willem de l\'Abbaye de Comt-du-Nord.', 'Garrick Ladtrousse  un brigand qui harcle les fermiers et les marchands de la rgion depuis des semaines  a t vu dans une cabane prs des vignes qui se trouvent  l\'est de l\'abbaye, juste aprs le pont. Rapportez-moi la tte de ce mcrant, et vous empocherez la rcompense!$B$BMais soyez $gprudent:prudente; $n. Garrick a rassembl une bande de voyous autour de lui. Il ne sera pas ais de l\'approcher.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (6, 'itIT', 'Bounty on Garrick Padfoot', 'Kill Garrick Padfoot and bring his head to Deputy Willem at Northshire Abbey.', 'Garrick Padfoot - a cutthroat who\'s plagued our farmers and merchants for weeks - was seen at a shack near the vineyards, which lies east of the Abbey and across the bridge.  Bring me the villain\'s head, and earn his bounty!$B$BBut be wary, $n.  Garrick has gathered a gang of thugs around him.  He will not be an easy man to reach.', '', '', '', '', '', '', 0);
