INSERT INTO `quest_template_locale` VALUES (7, 'deDE', '140513', 'Ttet 6 von dem Koboldgezcht und kehrt dann zu Marschall McBride zurck.', 'Eure erste Aufgabe ist eine Suberung, $n. Ein Koboldklan hat sich in den Wldern im Norden eingenistet. Begebt Euch dorthin und bekmpft das Koboldgezcht, das Ihr dort finden werdet. Dezimiert es, damit wir die Kobolde eines Tages gnzlich aus Nordhain vertreiben knnen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (7, 'esES', '140513', 'Mata a 6 alimaas kbold y ve a hablar con el alguacil McBride.', '$n, lo primero que tienes que hacer es limpiar; un clan de kbolds ha invadido los bosques del norte. Ve y liquida a todos los kbolds que encuentres; si reducimos sus filas podremos echarlos de Villanorte.', '', '', '', '', '', '', 0);
