INSERT INTO `quest_template_locale` VALUES (7, 'frFR', '140513', 'Tuez 6 Vermines kobolds, puis revenez voir le Marchal McBride.', 'Votre premier travail est de faire un peu de nettoyage, $n. Un clan de kobolds a envahi les bois, au nord. Allez l-bas et attaquez ces vermines. Affaiblissez-les assez, pour qu\'un jour nous puissions les repousser hors de Comt-du-Nord.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (7, 'itIT', '[DEPRECATED] Kobold Camp Cleanup', 'Kill 6 Kobold Vermin, then return to Marshal McBride.', 'Your first task is one of cleansing, $n.  A clan of kobolds have infested the woods to the north.  Go there and fight the kobold vermin you find.  Reduce their numbers so that we may one day drive them from Northshire.', '', '', '', '', '', '', 0);
