INSERT INTO `quest_template_locale` VALUES (8, 'deDE', 'Ein Schurkenhandel', 'Liefert den unscheinbaren Brief bei Gastwirtin Renee in Tirisfal ab.', 'Heda, Kamerad! Wollt Ihr nicht einem jungen Mann, der mehr als seinen Teil an hirnlosen Zombies und Spinnen umgelegt hat, einen Gefallen tun?$B$BIch hab hier einen Brief, der muss nach Brill... zu so einer Gastwirtin namens Renee Irgendwas. Ist eigentlich vllig egal, wie sie mit Nachnamen heit.$B$BNa egal, jedenfalls ist es ein netter kleiner Ort, wo lauter Opfer der Seuche wohnen, die versuchen, sich irgendwie durchs Leben zu schlagen. Und es wre ein toller Ort fr Euch, an dem Ihr Euch ausruhen knnt, falls das mal ntig wird. Ihr solltet Euch den wirklich mal anseh\'n - macht es, und ich bezahl Euch auch noch gut dafr.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (8, 'esES', 'Un trato de pcaro', 'Lleva la carta anodina a Claros de Tirisfal y entrgasela a la tabernera Renee.', 'Eh, colega! Le haras un favor a un joven hombre que ha combatido contra ms zombis y araas de los que puede contar?$B$BTengo una carta que tiene que llegar a Rmol... Es para una tabernera llamada Renee no s qu. No creo que importe cmo se apellida, la verdad.$B$BPero el sitio es muy acogedor y est lleno de vctimas de la Plaga que intentan abrirse paso en el mundo. Es el sitio ideal para descansar... si es que necesitas hacerlo. Anmate... si vas, te pagar bien.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (8, 'esMX', 'Un trato de pcaro', 'Lleva la carta anodina a Claros de Tirisfal y entrgasela a la tabernera Renee.', 'Eh, colega! Le haras un favor a un joven hombre que ha combatido contra ms zombis y araas de los que puede contar?$B$BTengo una carta que tiene que llegar a Rmol... Es para una tabernera llamada Renee no s qu. No creo que importe cmo se apellida, la verdad.$B$BPero el sitio es muy acogedor y est lleno de vctimas de la Plaga que intentan abrirse paso en el mundo. Es el sitio ideal para descansar... si es que necesitas hacerlo. Anmate... si vas, te pagar bien.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (8, 'frFR', 'Un march de voleur', 'Livrez une Lettre  Rene, dans les Clairires de Tirisfal.', 'H! Voudriez-vous faire une faveur  un homme qui a eu plus que sa part de combats contre des zombies et des araignes?$B$BJ\'ai ici une lettre qui doit tre livre  Brill...  une aubergiste du nom de Rene quelque chose. Enfin c\'est pas important son nom de famille.$B$BBref, c\'est un joli petit coin, plein de personnes victimes de la peste qui essayent de trouver leur voie en ce bas monde. De plus, cest un bon endroit pour se reposer. Vous devriez aller voir... D\'autant que je vous payerai bien.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (8, 'itIT', 'A Rogue\'s Deal', 'Deliver the Nondescript Letter to Innkeeper Renee in Tirisfal Glades.', 'Hey, mate! Do a favor for a young man who\'s been fighting more than his fair share of mindless zombies and spiders?$B$BI got this here letter that needs to go to Brill... to an innkeeper named Renee something-or-other. Don\'t really matter none what her last name is.$B$BAnyway, it\'s a nice cozy little place full of victims of the plague trying to make their way in the world. And it be a great spot for you to rest too if the need arises. You should check it out... you do and I\'ll pay you well.', '', '', '', '', '', '', 0);
