INSERT INTO `quest_template_locale` VALUES (9, 'deDE', 'Tod auf den Feldern', 'Bauer Saldean mchte, dass Ihr 20 Erntebehter ttet.', 'Jetzt seht Euch nur an, was aus diesem Ort geworden ist! In dieser Gegend lebten einst ehrbare Bauersleute. Die verdammten Diebe haben sie alle vertrieben. Aber mich nicht! Jetzt sieht es allerdings so aus, als htten einige Erntebehter sich in den Feldern breitgemacht.$b$bWenn Ihr Euch dem gewachsen fhlt, dann geht hinaus und ttet dort drauen 20 von ihnen. Wenn Ihr fertig seid, kommt zurck und holt Euch Eure Bezahlung ab. Und wenn Ihr alle in meinem Feld erwischt habt, dann rumt auch in den angrenzenden Feldern auf.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (9, 'esES', 'Campos de la muerte', 'El granjero Saldean quiere que mates a 20 vigas de la cosecha.', 'Mira lo que le ha ocurrido a este lugar! Estas tierras estaban antes en manos de buenos granjeros. Pero los condenados ladrones los han ahuyentado a todos. Pero no a m! Eso s, parece que algunos vigas de la cosecha han invadido los campos.$B$BSi ests $gpreparado:preparada; me gustara que fueras y mataras a 20 de ellos. Vuelve cuando hayas terminado y te pagar. Si terminas con los de mi campo, puedes limpiar tambin los campos vecinos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (9, 'esMX', 'Campos de la muerte', 'El granjero Saldean quiere que mates a 20 vigas de la cosecha.', 'Mira lo que le ha ocurrido a este lugar! Estas tierras estaban antes en manos de buenos granjeros. Pero los condenados ladrones los han ahuyentado a todos. Pero no a m! Eso s, parece que algunos vigas de la cosecha han invadido los campos.$B$BSi ests $gpreparado:preparada; me gustara que fueras y mataras a 20 de ellos. Vuelve cuando hayas terminado y te pagar. Si terminas con los de mi campo, puedes limpiar tambin los campos vecinos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (9, 'frFR', 'Les champs de mort', 'Le Fermier Saldean vous a demand de tuer 20 Gardiens des moissons.', 'Regardez ce qu\'il s\'est pass ici! Ces terres taient autrefois habites par de braves fermiers. Mais ces maudits voleurs les ont tous chasss. Pas moi, pour sr! Mais il semble que quelques Gardiens des moissons ont pris possession des champs.$b$bSi vous tes d\'accord, j\'aimerais que vous y alliez et que vous en dtruisiez une vingtaine. Revenez quand vous aurez fini pour recevoir votre d. Une fois que vous aurez dbarrass ceux de mon champ, occupez-vous des champs alentours.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (9, 'itIT', 'The Killing Fields', 'Farmer Saldean wants you to kill 20 Harvest Watchers.', 'Look at what has happened to this place!  These lands were once occupied by good farm folk.  But the damned thieves have driven them all off.  Not me, though!  But it seems some Harvest Watchers have taken over the fields.$b$bIf you\'re up for the work, I\'d like you to go out and kill twenty of them.  Come back when you\'re done for your pay.  If you finish up with the ones in my field, clear them from the neighboring fields as well.', '', '', '', '', '', '', 0);
