INSERT INTO `quest_template_locale` VALUES (10, 'deDE', 'Die Erlsung von Kieselschliff', 'Erforscht das Schicksal von Unterfeldmesser Kieselschliff und bringt entweder ihn oder seine Feldmesserausrstung nach Gadgetzan zum Leitenden Feldmesser Rutenwnschels.', 'Oh, das ist einfach schrecklich! Ich habe meinen besten Gehilfen, Unterfeldmesser Kieselschliff, in die Wste sdstlich von hier geschickt. Das ist ein Gebiet, das wir die Klaffende Schlucht nennen. Nun ja, er wird vermisst und in seinem letzten Bericht sprach er davon, dass es dort, wo er war, noch mehr dieser komischen Viecher gbe. Knnte es sein, dass sie sich jetzt in zwei groen Gebieten der Wste eingenistet haben?$B$BBegebt Euch bitte fr mich zur Klaffenden Schlucht und sucht nach Kieselschliff! Das... oder findet wenigstens seine Feldmesserausrstung. Ich frchte, das ist alles, was von dem Armen brig geblieben ist.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (10, 'esES', 'La redencin de Patagolpe', 'Descubre qu le ha ocurrido al perito adjunto Patagolpe y llvalo a l o su equipo de anlisis ante el perito jefe Picoflojo, en Gadgetzan.', 'Oh, esto es horrible! Envi a mi mejor ayudante, el perito adjunto Patagolpe, al desierto situado al sudeste de aqu, una zona que se conoce como Sima Abierta. Bien, pues ha desaparecido y su ltimo informe contena ms informacin acerca de esos extraos bichos que haba visto por la zona. Es posible que ya hayan infestado dos grandes regiones del desierto?$B$BPor favor, necesito que vayas a Sima Abierta en busca de Patagolpe! Y si no lo encuentras a l, al menos a ver si aparece su equipo de anlisis. Me temo que pueda ser lo nico que quede de ese pobre chico.', '', '', '', '', '', '', 0);
