INSERT INTO `quest_template_locale` VALUES (10, 'frFR', 'La rdemption de Scrimshank', 'Dcouvrez ce qu\'est devenu le Gomtre Scrimshank, et rapportez son quipement topographique au Grand gomtre Radisthflop,  Gadgetzan.', 'Oh, c\'est terrible! J\'ai envoy mon premier assistant, le gomtre novice Scrimshank, dans le dsert au sud-est d\'ici. C\'est un endroit appel le Gouffre bant. Et il est port disparu. Dans son dernier rapport, il faisait allusion  ces tranges insectes prs de l o il tait. Serait-il possible qu\'ils aient maintenant infest deux grandes rgions du dsert?$B$BJ\'ai besoin que vous alliez retrouver Scrimshank dans le Gouffre bant! Ou, au pire, que vous retrouviez son quipement topographique. Je crains que ce soit tout ce qu\'il reste de lui.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (10, 'itIT', 'The Scrimshank Redemption', 'Discover the fate of Junior Surveyor Scrimshank, and bring either him or his surveying equipment to Senior Surveyor Fizzledowser in Gadgetzan.', 'Oh, this is just terrible!  I sent out my top assistant, Junior Surveyor Scrimshank, into the desert southeast of here.  That\'s an area we call the Gaping Chasm.  Well, he\'s gone missing, and his last report had more of those weird bugs where he was.  Could it be that they\'ve infested two major regions of the desert now?$B$BI need you to head into the Gaping Chasm and look for Scrimshank, please!  That... or at least find his surveying equipment.  I fear that may be all that is left of the poor sod.', '', '', '', '', '', '', 0);
