INSERT INTO `quest_template_locale` VALUES (11, 'deDE', 'Kopfgeld auf die Flusspfotengnolle', 'Bringt Stellvertreter Rainer in der Kaserne 8 bemalte Gnollarmbinden.', 'Gnolle, brutale Wesen, die in dieser Gegend nichts zu suchen haben, sind entlang der Grenzen des Waldes von Elwynn gesehen worden. Ein groes Rudel, viel zu viele, als dass wir allein mit ihnen fertigwerden knnten, hat sich in den Wldern sdlich von jenem Wachturm dort eingenistet. Eine weitere Gruppe hat sich im Gebiet nahe des Steinhgelsees im Osten eingenistet.$B$BDie Armee von Sturmwind wird jeden belobigen, der dabei hilft, die Gnolle zu tten. Bringt mir ihre bemalten Gnollarmbinden als Beweis fr Eure Tat.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (11, 'esES', 'Recompensas por los gnolls Zarparro', 'Lleva 8 bandas gnoll pintadas al ayudante de alguacil Rainer al Cuartel.', 'En las fronteras del Bosque de Elwynn se han avistado gnolls, unas criaturas salvajes que seguramente no estn all por trabajo. Un grupo enorme de ellos, uno ms numeroso del que podemos contener solos, ha infestado los bosques que hay al sur de la torre de vigilancia. Otro grupo ha infestado las reas cercanas al Lago del Hito, al este.$B$BEl ejrcito de Ventormenta elogiar a quienquiera que le ayude a matarlos. Treme sus bandas gnoll pintadas como prueba de tu hazaa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (11, 'esMX', 'Recompensas por los gnolls Zarparro', 'Lleva 8 bandas gnoll pintadas al ayudante de alguacil Rainer al Cuartel.', 'En las fronteras del Bosque de Elwynn se han avistado gnolls, unas criaturas salvajes que seguramente no estn all por trabajo. Un grupo enorme de ellos, uno ms numeroso del que podemos contener solos, ha infestado los bosques que hay al sur de la torre de vigilancia. Otro grupo ha infestado las reas cercanas al Lago del Hito, al este.$B$BEl ejrcito de Ventormenta elogiar a quienquiera que le ayude a matarlos. Treme sus bandas gnoll pintadas como prueba de tu hazaa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (11, 'frFR', 'Une prime pour les Gnolls rivepatte', 'Apportez 8 Brassards peints de Gnoll  l\'Adjoint Rainer,  la Caserne.', 'Des Gnolls, des animaux brutaux qui n\'ont rien  faire ici, ont t aperus  la lisire de la fort d\'Elwynn. C\'est un trs grand groupe, bien trop nombreux pour que nous nous en occupions seuls. Ils ont envahi les bois au sud de la tour de garde. Un autre groupe a envahi la rgion autour du lac du Cairn,  l\'est.$B$BL\'arme de Hurlevent engage quiconque pourrait en tuer. Apportez-moi des brassards peints de Gnolls pour me prouver vos actions.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (11, 'itIT', 'Taglia sugli Gnoll Zampaumida', 'Porta 8 Polsiere degli Gnoll Dipinte al Vicesceriffo Rainer nella Caserma.', 'Gli Gnoll, delle creature selvagge che non dovrebbero abitare queste terre, sono stati avvistati lungo i confini della Foresta di Elwynn. Un grosso branco, composto da un numero di esemplari che non possiamo affrontare da soli, ha invaso i boschi a sud della torre di guardia. Un altro gruppo ha infestato le zone vicino al Lago del Memoriale a est.$B$BL\'Esercito di Roccavento ricompenser chiunque dia una mano a eliminarli. Portami le Polsiere degli Gnoll Dipinte come prova della loro uccisione.', '', '', '', '', '', '', 0);
