INSERT INTO `quest_template_locale` VALUES (11, 'ptBR', 'Caando gnolls', 'Leve 8 Braadeiras Pintadas dos Gnolls para o Delegado Ranieri no Quartel.', 'Aquelas criaturas brutas e indecentes, os gnolls, tem sido vistas por aqui, nos limites da Floresta de Elwynn. Uma matilha grande, maior do que podemos enfrentar sozinhos, infestou o bosque ao sul daquela torre de guarda. Outro grupo infestou as reas perto do Lago do Monumento, a leste daqui.$B$BO Exrcito de Ventobravo com certeza saber recompensar quem ajudar a matar esses gnolls. Traga-me as braadeiras pintadas que eles usam como prova.', '', '', '', '', '', '', 0);
