INSERT INTO `quest_template_locale` VALUES (12, 'deDE', 'Die Volksmiliz', 'Gryan Starkmantel mchte, dass Ihr 15 Fallensteller der Defias und 15 Schmuggler der Defias ttet und zu ihm auf die Spherkuppe zurckkehrt.', 'Die Volksmiliz hat nur ein einziges Ziel: Westfall zu verteidigen und den Frieden in dieses Land zurckzubringen. Doch leider muss der Frieden nur allzu oft mit Blut bezahlt werden. $b$bEiner meiner Spher hat uns Kunde davon gebracht, dass eine Fallenstellerbande der Defias hier in der Nhe verheerende Schden anrichtet. Mir liegen Berichte vor, dass einige Fallensteller der Defias in der Nhe des Jangoschachts im Nordwesten gesichtet wurden, ebenso bei Molsens Hof und bei Brauenwirbels Krbishof. Wenn Ihr unseren Reihen beizutreten wnscht, dann erschlagt 15 Fallensteller der Defias und 15 Schmuggler der Defias und kehrt zu mir zurck.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (12, 'esES', 'La Milicia Popular', 'Gryan Mantorrecio quiere que mates a 15 tramperos Defias y a 15 contrabandistas Defias. Cuando lo hayas hecho vuelve a verle en la Colina del Centinela.', 'La Milicia Popular solo tiene un objetivo: defender las tierras de los Pramos de Poniente y traer la paz a nuestro entorno. Por desgracia, el precio de la paz suele pagarse en sangre.$B$BSegn el informe de uno de mis exploradores, una banda de tramperos Defias ha sido vista cerca de la Mina de Jango al noroeste de aqu, en La Granja de Molsen y en la Plantacin de Calabazas de Cejade. Si quieres unirte a nuestras filas, acaba con 15 tramperos Defias y con 15 contrabandistas Defias y vuelve a verme.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (12, 'esMX', 'La Milicia Popular', 'Gryan Mantorrecio quiere que mates a 15 tramperos Defias y a 15 contrabandistas Defias. Cuando lo hayas hecho vuelve a verle en la Colina del Centinela.', 'La Milicia Popular solo tiene un objetivo: defender las tierras de los Pramos de Poniente y traer la paz a nuestro entorno. Por desgracia, el precio de la paz suele pagarse en sangre.$B$BSegn el informe de uno de mis exploradores, una banda de tramperos Defias ha sido vista cerca de la Mina de Jango al noroeste de aqu, en La Granja de Molsen y en la Plantacin de Calabazas de Cejade. Si quieres unirte a nuestras filas, acaba con 15 tramperos Defias y con 15 contrabandistas Defias y vuelve a verme.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (12, 'frFR', 'La milice du peuple', 'Tuez 15 Trappeurs dfias et 15 Contrebandiers dfias pour Gryan Roidemantel, puis retournez le voir sur la Colline des Sentinelles.', 'La milice du peuple n\'a qu\'un seul objectif: dfendre la marche de l\'Ouest et ramener le calme dans les environs. Malheureusement, le prix de la paix est souvent le sang.$b$bUn de mes claireurs rapporte qu\'une bande de trappeurs dfias sme le trouble dans le coin. Ils auraient t aperus prs de la mine Veine-de-Jango, au nord-ouest, ainsi que dans la ferme des Molsen et la ferme de potirons des Froncebouille. Si vous voulez rejoindre nos rangs, tuez quinze trappeurs dfias et quinze contrebandiers dfias, puis revenez me voir.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (12, 'itIT', 'The People\'s Militia', 'Gryan Stoutmantle wants you to kill 15 Defias Trappers and 15 Defias Smugglers then return to him on Sentinel Hill.', 'The People\'s Militia has but one goal:  To defend the lands of Westfall and return peace to our surroundings.  Unfortunately, the price of peace is often blood. $b$bOne of my scouts has brought word of a band of Defias Trappers wreaking havoc nearby.  I have reports of Defias Trapper sightings near the Jangolode Mine to the Northwest as well as at the Molsen Farm and Furlbrow\'s Pumpkin Farm. If you seek to join our ranks, slay 15 Defias Trappers and 15 Defias Smugglers then return to me.', '', '', '', '', '', '', 0);
