INSERT INTO `quest_template_locale` VALUES (13, 'deDE', 'Die Volksmiliz', 'Gryan Starkmantel mchte, dass Ihr 15 Plnderer der Defias und 15 Ausplnderer der Defias ttet und zu ihm auf die Spherkuppe zurckkehrt.', 'Eine Bande heimtckischer Plnderer der Defias ist dabei gesehen worden, wie sie den Goldkstensteinbruch, Mondbruch und Alexstons Bauernhof ausplnderten. Die Volksmiliz kann ein solches Verhalten nicht hinnehmen. Macht Euch unverzglich auf den Weg, $n, und zeigt, dass das Licht in Westfall zugegen ist.$b$bDer Goldkstensteinbruch befindet sich in der Nhe der Kste, westlich vom Turm. Im nchsten Schritt Eurer Ausbildung msst Ihr 15 dieser blen Plnderer der Defias und 15 Ausplnderer der Defias tten.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (13, 'esES', 'La Milicia Popular', 'Gryan Mantorrecio quiere que mates a 15 saqueadores Defias y a 15 despojadores Defias. Cuando lo hayas hecho vuelve a verle en la Colina del Centinela.', 'Una banda de despiadados saqueadores Defias ha sido vista saqueando la Mina de la Costa del Oro, el Arroyo de la Luna y la Hacienda de Alexston. La Milicia Popular no tolerarn ese comportamiento. Avisa inmediatamente, $n, y haz conocer la presencia de la Luz en los Pramos de Poniente.$b$bLa Mina de la Costa del Oro est cerca de la costa, al oeste de la torre. El siguiente paso de tu instruccin consistir en acabar con 15 de esos saqueadores Defias y con 15 despojadores Defias.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (13, 'esMX', 'La Milicia Popular', 'Gryan Mantorrecio quiere que mates a 15 saqueadores Defias y a 15 despojadores Defias. Cuando lo hayas hecho vuelve a verle en la Colina del Centinela.', 'Una banda de despiadados saqueadores Defias ha sido vista saqueando la Mina de la Costa del Oro, el Arroyo de la Luna y la Hacienda de Alexston. La Milicia Popular no tolerarn ese comportamiento. Avisa inmediatamente, $n, y haz conocer la presencia de la Luz en los Pramos de Poniente.$b$bLa Mina de la Costa del Oro est cerca de la costa, al oeste de la torre. El siguiente paso de tu instruccin consistir en acabar con 15 de esos saqueadores Defias y con 15 despojadores Defias.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (13, 'frFR', 'La milice du peuple', 'Tuez 15 Pilleurs dfias et 15 Pillards dfias pour Gryan Roidemantel, puis retournez le voir sur la Colline des Sentinelles.', 'Une bande de pilleurs dfias a t vue en train de saccager la carrire de la Cte de l\'or ainsi que Ruisselune et la ferme des Alexston. La milice du peuple n\'acceptera pas ce genre de comportement. Dployez-vous immdiatement, $n, et faites en sorte que l\'on sache que la Lumire est prsente dans la marche de l\'Ouest.$b$bLa carrire est prs de la cte,  l\'ouest de la tour. Comme tape de votre instruction, je veux que vous tuiez quinze pilleurs dfias et quinze pillards dfias.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (13, 'itIT', 'The People\'s Militia', 'Gryan Stoutmantle wants you to kill 15 Defias Pillagers and 15 Defias Looters and return to him on Sentinel Hill.', 'A band of vicious Defias Pillagers has been seen plundering the Gold Coast Quarry, Moonbrook and the Alexston Farmstead.  The People\'s Militia will not stand for such behavior.  Dispatch immediately, $n, and make the Light\'s presence known in Westfall.$b$bThe Gold Coast Quarry is near the shore, to the West of the tower.  As the next step of your training, I want you to kill 15 of those foul Defias Pillagers and 15 Defias Looters.', '', '', '', '', '', '', 0);
