INSERT INTO `quest_template_locale` VALUES (14, 'deDE', 'Die Volksmiliz', 'Gryan Starkmantel mchte, dass Ihr 15 Straenruber der Defias, 5 Pfadpirscher der Defias und 5 Knchelhauer der Defias ttet und zu ihm auf die Spherkuppe zurckkehrt.', 'Einige Defias konnten wir bislang nicht erwischen. Mein bester Spher berichtet, dass diese Defias in der ganzen Gegend auf Raubzug gehen und schon bis Sd-Westfall gekommen sind. Wir glauben, dass sie sich in den Dolchhgeln versteckt halten und dort ihren nchsten Schachzug planen. Schaltet diese Verbrecher im Namen der Volksmiliz aus.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (14, 'esES', 'La Milicia Popular', 'Gryan Mantorrecio quiere que mates a 15 bandoleros Defias, a 5 acechacaminos Defias y a 5 nudillos Defias. Cuando lo hayas hecho vuelve a verle en la Colina del Centinela.', 'Algunos Defias nos han esquivado. Segn informa mi mejor explorador, los Defias han estado saqueando y expoliando el campo, hasta la parte sureste de los Pramos de Poniente. Creemos que se estn ocultando en Las Colinas Afiladas, planeando sus siguientes pasos. Acaba con esos miserables en nombre de La Milicia Popular', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (14, 'esMX', 'La Milicia Popular', 'Gryan Mantorrecio quiere que mates a 15 bandoleros Defias, a 5 acechacaminos Defias y a 5 nudillos Defias. Cuando lo hayas hecho vuelve a verle en la Colina del Centinela.', 'Algunos Defias nos han esquivado. Segn informa mi mejor explorador, los Defias han estado saqueando y expoliando el campo, hasta la parte sureste de los Pramos de Poniente. Creemos que se estn ocultando en Las Colinas Afiladas, planeando sus siguientes pasos. Acaba con esos miserables en nombre de La Milicia Popular', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (14, 'frFR', 'La milice du peuple', 'Tuez 15 Malandrins dfias, 5 claireurs dfias et 5 Truands dfias pour Gryan Roidemantel, puis retournez le voir sur la Colline des Sentinelles.', 'Quelques dfias nous ont chapp. Mon claireur le plus fiable fait tat de pillages dfias dans les campagnes, au sud de la marche de l\'Ouest. Nous pensons qu\'ils se cachent dans les collines de la Dague, fomentant leur prochain coup. Dtruisez ces misrables au nom de la milice du peuple.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (14, 'itIT', 'The People\'s Militia', 'Gryan Stoutmantle wants you to kill 15 Defias Highwaymen, 5 Defias Pathstalkers and 5 Defias Knuckledusters then return to him on Sentinel Hill.', 'Some Defias have eluded us.  My most trusted scout reports that these Defias have been looting and pillaging the countryside, all the way into Southern Westfall.  We believe they are hiding out in the Dagger Hills, plotting their next move.   Slay the wretches in the name of The People\'s Militia.', '', '', '', '', '', '', 0);
