INSERT INTO `quest_template_locale` VALUES (15, 'deDE', 'berprfung der Echokammmine', 'Ttet 8 Koboldtagelhner und erstattet dann Marschall McBride Euren Bericht.', 'Wie mir meine Spher mitteilen, ist das Koboldproblem grer als wir dachten, $n. Eine Gruppe Koboldtagelhner hat ihr Lager in der Nhe der Echokammmine im Norden aufgeschlagen.$B$BBegebt Euch zu der Mine und entfernt die Kobolde. Wir wissen, dass sich mindestens 8 von ihnen dort aufhalten. Ttet sie, seht nach, ob dort noch mehr von ihnen sind, kommt dann zu mir zurck und erstattet Bericht.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (15, 'esES', '[DEPRECATED] Investigar la Mina del Eco', 'Mata a 8 trabajadores kbold y ve a hablar con el alguacil McBride.', '$n, los exploradores dicen que hay ms kbolds de lo que creamos. Un grupo de trabajadores ha acampado cerca de la Mina del Eco, al norte de aqu.$B$BVe a la mina y liqudalos; sabemos que hay al menos ocho. Comprueba que no quede ninguno ms y vuelve.', '', '', '', '', '', '', 0);
