INSERT INTO `quest_template_locale` VALUES (15, 'frFR', '[PRIM]Enqute sur la crte aux chos', 'Tuez 8 Ouvriers kobolds, puis revenez faire votre rapport au Marchal McBride.', '$n, mes claireurs me rapportent que l\'infestation kobold est d\'une plus grande envergure que nous le pensions. Un groupe d\'ouvriers kobolds a tabli son campement prs de la mine de la Crte aux chos au nord.$B$BAllez  la mine et faites en sorte qu\'il n\'y en ait plus. Nous savons qu\'il y en a au moins huit. Tuez-les, voyez s\'il y en a davantage, et revenez me prsenter votre rapport.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (15, 'itIT', '[DEPRECATED] Investigate Echo Ridge', 'Kill 8 Kobold Workers, then report back to Marshal McBride.', '$n, my scouts tell me that the kobold infestation is larger than we had thought.  A group of kobold workers has camped near the Echo Ridge Mine to the north.$B$BGo to the mine and remove them.  We know there are at least 8.  Kill them, see if there are more, then report back to me.', '', '', '', '', '', '', 0);
