INSERT INTO `quest_template_locale` VALUES (17, 'deDE', 'Reagenzsuche in Uldaman', 'Bringt zwlf Magentafunguskappen nach Thelsamar zu Ghak Heilsegen.', 'Ich habe von einer neu entdeckten Pilzsorte gehrt, den Magentafunguskappen. Sie wachsen in Kolonien bei der Uldaman-Grabungssttte. Man findet sie hufig in den vorderen Tunnelabschnitten und auch tief in den unerforschten Regionen der Grabungssttte. Ich mchte ihren potenziellen Nutzen fr die Alchemie erforschen und dafr brauche ich Euch.$B$BFindet die Magentafunguskappen-Kolonien und bringt mir ein Dutzend Kappen. Aber seid gewarnt - die Pilze stoen vielleicht Giftsporen aus, wenn man sie anstt.$B$BWenn Ihr das fr mich tut, dann braue ich Euch einen Schwung von meinem berhmten Regenerierungselixier!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (17, 'esES', 'Componentes de Uldaman', 'Lleva 12 setas magenta a Ghak Sanadn a Thelsamar.', 'Hace poco o hablar de un organismo recin descubierto: las setas magenta. Crecen arracimadas en la excavacin de Uldaman y pueden encontrarse en los tneles primitivos y en las profundidades de las zonas menos explotadas. Quiero ver qu usos potenciales pueden tener en la alquimia, por eso necesito tu ayuda.$B$BTreme una docena de setas magenta. Es posible que se defiendan con esporas venenosas; ten cuidado.$B$BA cambio, te dar uno de mis famosos elixires vigorizantes!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (17, 'esMX', 'Componentes de Uldaman', 'Lleva 12 setas magenta a Ghak Sanadn a Thelsamar.', 'Hace poco o hablar de un organismo recin descubierto: las setas magenta. Crecen arracimadas en la excavacin de Uldaman y pueden encontrarse en los tneles primitivos y en las profundidades de las zonas menos explotadas. Quiero ver qu usos potenciales pueden tener en la alquimia, por eso necesito tu ayuda.$B$BTreme una docena de setas magenta. Es posible que se defiendan con esporas venenosas; ten cuidado.$B$BA cambio, te dar uno de mis famosos elixires vigorizantes!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (17, 'frFR', 'Rechercher les composants  Uldaman', 'Apportez 12 Champignons magenta  Ghak Touchesoins,  Thelsamar.', 'On a dcouvert rcemment une nouvelle plante: les champignons magenta. Ils poussent en grappes au site de fouilles d\'Uldaman; on les trouve dans les premiers tunnels et loin dans des zones moins explores. Je veux tudier leur utilit ventuelle en alchimie, et c\'est l que vous entrez en scne.$B$BTrouvez les champignons magenta et rapportez-m\'en une douzaine. Attention, les grappes peuvent projeter des spores vnneuses quand on les manipule!$B$BRendez-moi ce service et je sortirai pour vous un petit lixir revigorant de derrire les fagots.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (17, 'itIT', 'Uldaman Reagent Run', 'Bring 12 Magenta Fungus Caps to Ghak Healtouch in Thelsamar.', 'I\'ve heard about a newly discovered plant called the magenta fungus caps.  They grow in clusters at the Uldaman dig site and can be found in the early tunnels and deep within the less-explored areas.  I want to study their potential use in alchemy, and that\'s where you come in.$B$BFind the magenta cap clusters and bring me a dozen caps.  Be warned, the clusters may spew out poison spores if jostled.$B$BDo this for me, and I\'ll whip up a batch of one of my famous restorative elixirs for you!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (17, 'ptBR', 'Uldaman Reagent Run', 'Bring 12 Magenta Fungus Caps to Ghak Healtouch in Thelsamar.', 'I\'ve heard about a newly discovered plant called the magenta fungus caps. They grow in clusters at the Uldaman dig site and can be found in the early tunnels and deep within the less-explored areas. I want to study their potential use in alchemy, and that\'s where you come in.$B$BFind the magenta cap clusters and bring me a dozen caps. Be warned, the clusters may spew out poison spores if jostled.$B$BDo this for me, and I\'ll whip up a batch of one of my famous restorative elixirs for you!', '', '', '', '', '', '', 0);
