INSERT INTO `quest_template_locale` VALUES (18, 'deDE', 'Bruderschaft der Diebe', 'Bringt 8 rote Sackleinenkopftcher zu Unteroffizier Willem in der Nhe der Abtei von Nordhain.', 'Seit Kurzem treibt sich eine neue Diebesbande in Nordhain herum. Sie nennen sich die Bruderschaft der Defias und sind auf der anderen Seite des Flusses im Osten gesehen worden.$B$BIch wei nicht genau, was sie vorhaben, aber ich bin mir sicher, es ist nichts Gutes! Bringt mir die Kopftcher, die sie tragen, und ich werde Euch mit einer Waffe belohnen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (18, 'esES', 'Hermandad de ladrones', 'Lleva 8 pauelos de arpillera roja al ayudante de alguacil Willem cerca de la Abada de Villanorte.', 'Hace poco lleg una banda de maleantes a Villanorte. Se hacen llamar la Hermandad Defias; se les ha visto cruzando el ro hacia el este.$B$BNo s qu estn haciendo, pero seguro que no es nada bueno! Treme sus pauelos y te dar un arma como recompensa.', '', '', '', '', '', '', 0);
