INSERT INTO `quest_template_locale` VALUES (18, 'frFR', 'La confrrie des voleurs', 'Apportez 8 Masques rouges  lAdjoint Willem,  l\'extrieur de lAbbaye de Comt-du-Nord.', 'Un groupe de voleurs trane depuis peu autour de Comt-du-Nord. Ils se nomment eux-mmes la Confrrie dfias, et ont t aperus de l\'autre ct de la rivire  l\'est.$B$BJe ne sais pas ce qu\'ils prparent, mais il est certain que ce n\'est rien de bon! Apportez-moi les masques qu\'ils portent, et je vous rcompenserai d\'une arme.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (18, 'itIT', 'Brotherhood of Thieves', 'Bring 8 Red Burlap Bandanas to Deputy Willem outside the Northshire Abbey.', 'Recently, a new group of thieves has been hanging around Northshire.  They call themselves the Defias Brotherhood, and have been seen across the river to the east.$B$BI don\'t know what they\'re up to, but I\'m sure it\'s not good!  Bring me the bandanas they wear, and I\'ll reward you with a weapon.', '', '', '', '', '', '', 0);
