INSERT INTO `quest_template_locale` VALUES (19, 'deDE', 'Tharil\'zun', 'Bringt den Kopf von Tharil\'zun ins Rotkammgebirge zu Marschall Marris.', 'Zwischen hier und Burg Steinwacht legen Kundschafter und Renegaten des Schwarzfels stndig Hinterhalte. Der Anfhrer der Kundschafter heit Tharil\'zun und diesen Orc wollen wir haben. Bringt mir den Kopf von Tharil\'zun!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (19, 'esES', 'Tharil\'zun', 'Lleva la cabeza de Tharil\'zun al alguacil Marris a Crestagrana.', 'Hay avanzados y renegados Roca Negra tendiendo emboscadas entre aqu y el Fuerte de Petravista. El jefe de los avanzados se llama Tharil\'zun y lo queremos muerto. Treme su cabeza!', '', '', '', '', '', '', 0);
