INSERT INTO `quest_template_locale` VALUES (19, 'frFR', 'Tharil\'zun', 'Apportez la Tte de Tharil\'zun au marchal Marris, dans les Carmines.', 'Les rengats et les estafettes Rochenoire tendent des embuscades entre ici et le donjon de Guet-de-pierre. Le chef des estafettes est un orc du nom de Tharil\'zun  nous voulons qu\'il meure. Rapportez-moi la tte de Tharil\'zun!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (19, 'itIT', 'Tharil\'zun', 'Bring Tharil\'zun\'s Head to Marshal Marris in Redridge.', 'Blackrock Outrunners and Renegades are running ambushes between here and Stonewatch Keep.  The leader of the Outrunners is an orc named Tharil\'zun--we want this orc.  Bring me the head of Tharil\'zun!', '', '', '', '', '', '', 0);
