INSERT INTO `quest_template_locale` VALUES (20, 'deDE', 'Bedrohung durch den Schwarzfelsklan', 'Bringt 10 kampferprobte xte nach Seenhain zu Marschall Marris.', 'Die Orcs des Schwarzfelsklans haben die Brennende Steppe verlassen und Burg Steinwacht im Norden besetzt. Von dort aus ziehen sie marodierend durch das Gebiet nrdlich von Seenhain, so dass dessen Bewohner sich nicht mehr aus der Stadt wagen und dort eingesperrt sind wie Vieh in einem zu engen Pferch.$B$BHelft uns, diese Bedrohung von Seenhain zu nehmen! Ttet diese Orcs des Schwarzfels und bringt mir 10 ihrer kampferprobten xte zum Beweis.$B$BUnd obwohl der Schwarzfelsklan uns vor allem aus dem Norden bedroht, haben wir auch gehrt, dass sich noch weitere Schwarzfelsorcs in der sdstlichen Ecke des Rotkammgebirges aufhalten. Wenn Ihr dort welche findet, solltet Ihr die auch jagen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (20, 'esES', 'La amenaza de los Roca Negra', 'Lleva 10 hachas desgastadas por la batalla al alguacil Marris a Villa del Lago.', 'Los orcos Roca Negra llegaron desde Las Estepas Ardientes y han invadido el Fuerte de Petravista, al norte de aqu. Andan merodeando por el norte de Villa del Lago y tienen a los ciudadanos encerrados como a ganado.$B$BLibra a Villa del Lago de esta amenaza. Mata a los orcos y treme 10 hachas desgastadas por la batalla como prueba.$B$BAunque nos amenazan desde el norte, sabemos que hay ms al sureste de Crestagrana. Si los encuentras, mtalos tambin.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (20, 'esMX', 'La amenaza de los Roca Negra', 'Lleva 10 hachas desgastadas por la batalla al alguacil Marris a Villa del Lago.', 'Los orcos Roca Negra llegaron desde Las Estepas Ardientes y han invadido el Fuerte de Petravista, al norte de aqu. Andan merodeando por el norte de Villa del Lago y tienen a los ciudadanos encerrados como a ganado.$B$BLibra a Villa del Lago de esta amenaza. Mata a los orcos y treme 10 hachas desgastadas por la batalla como prueba.$B$BAunque nos amenazan desde el norte, sabemos que hay ms al sureste de Crestagrana. Si los encuentras, mtalos tambin.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (20, 'frFR', 'La menace des Rochenoires', 'Rapportez 10 Haches dtriores au Marchal Marris,  Comt-du-Lac.', 'Les orcs rochenoires ont voyag depuis les steppes Ardentes et ont pris possession du donjon de Guet-de-pierre, depuis le nord. De cette base, ils patrouillent dans toutes les zones au nord de Comt-du-Lac et forcent les citoyens  rester en ville, parqus comme du btail.$B$BAidez  librer Comt-du-Lac de cette oppression. Tuez ces orcs rochenoires et rapportez-moi dix haches dtriores comme preuve de votre russite.$B$BBien que les orcs rochenoires nous menacent au nord, nous avons des informations disant quil y aurait aussi des orcs au sud-est des Carmines. Si vous en trouvez l-bas, tuez-les.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (20, 'itIT', 'Blackrock Menace', 'Bring 10 Battleworn Axes to Marshal Marris in Lakeshire.', 'The Blackrock orcs have travelled from the Burning Steppes and claimed Stonewatch Keep to the north.  From there they maraud the areas north of Lakeshire and keep its citizens in town, penned like cattle.$B$BHelp rid Lakeshire of this menace.  Kill these Blackrock orcs and bring me ten of their Battleworn Axes as proof.$B$BAnd although Blackrocks threaten us from the north, we\'ve received reports of more in the southeastern pocket of Redridge.  If you find any there, then they too should be hunted.', '', '', '', '', '', '', 0);
