INSERT INTO `quest_template_locale` VALUES (21, 'deDE', 'Scharmtzel in der Echokammmine', 'Ttet 8 Koboldhilfsarbeiter und kehrt dann zu Marschall McBride in der Abtei von Nordhain zurck.', 'Eure Untersuchungen beweisen, dass die Echokammmine gesubert werden muss. Kehrt in die Mine zurck und helft dabei, sie von den Kobolden zu befreien.$B$BIhr drft keine Zeit verlieren, $n. Je lnger die Kobolde sich ungehindert in der Mine aufhalten knnen, umso festere Wurzeln fassen sie in Nordhain.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (21, 'esES', '[DEPRECATED] Escaramuza en la Mina del Eco', 'Mata 8 obreros kbold y ve a hablar con el alguacil McBride a la Abada de Villanorte.', 'Ha quedado demostrado que tenemos que purgar la Mina del Eco. Vuelve all y ayuda a eliminar a los kbolds.$B$BDate prisa, $n. Cuanto ms tiempo dejemos a los kbolds en la mina, ms nos costar expulsarlos de Villanorte.', '', '', '', '', '', '', 0);
