INSERT INTO `quest_template_locale` VALUES (21, 'frFR', '[PRIM]Rglement de comptes  cho-Coron', 'Tuez 8 Travailleurs kobolds, puis revenez voir le Marchal McBride,  lAbbaye de Comt-du-Nord.', 'Vos dernires investigations ont prouv que la mine de la Crte aux chos devait tre nettoye. Retournez-y et chassez les kobolds.$B$BNe perdez pas de temps, $n. Plus les kobolds seront tranquilles dans la mine, plus ils renforceront leurs positions  Comt-du-Nord.', '', '', '', '', '', '', 0);
