INSERT INTO `quest_template_locale` VALUES (22, 'deDE', 'Pastete aus Geiferzahnleber', 'Salma Saldean braucht 8 Geiferzahnlebern fr ihre Pastete aus Geiferzahnleber.', 'Die Zwiebeln sind geschlt, der Knoblauch ist gehackt, der Rosmarin ist zerstoen, die Kruste ist gebacken, das Dillkraut ist gewiegt und die Sauce steht auf dem Herd. Jetzt brauche ich fr meine berhmte Fleischpastete nur noch 8 Geiferzahnlebern!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (22, 'esES', 'Pastel de hgado de dentosangre', 'Salma Saldean necesita 8 hgados de dentosangre para hacer un pastel de hgado de dentosangre.', 'Las cebollas estn peladas. El ajo machacado. La corteza est tostada. Las hierbas de eneldo picadas. Lo nico que me falta para mi famosa empanada de carne son 8 hgados de dentosangre!', '', '', '', '', '', '', 0);
