INSERT INTO `quest_template_locale` VALUES (22, 'frFR', 'La tourte au foie de broche-tripes', 'Salma Saldean a besoin de 8 Foies de broche-tripes pour faire une Tourte au foie de broche-tripes.', 'Les oignons sont pels et l\'ail minc. Le romarin est pil. La pte est cuite et le fenouil hach. La sauce finit de mijoter. Il ne me manque que huit foies de broche-tripes pour russir ma fameuse tourte  la viande!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (22, 'itIT', 'Goretusk Liver Pie', 'Salma Saldean needs 8 Goretusk livers to make a Goretusk Liver Pie.', 'The onions are peeled.  The garlic is minced.  The rosemary is crushed.  The crust has been baked.  The dill weed is chopped.  The gravy is simmering.  Now all I need for my famous meat pie are 8 Goretusk Livers!', '', '', '', '', '', '', 0);
