INSERT INTO `quest_template_locale` VALUES (23, 'deDE', 'Ursangus\' Tatze', 'Bringt Ursangus\' Tatze zu Hauptmann Tarkan in der Silberwindzuflucht.', 'Der mchtige Br Ursangus ist nicht mehr!$B$BDas kleine halbmondfrmige Emblem auf seiner Tatze bedeutet, dass das Tier von den Nachtelfen dazu abgerichtet wurde, den Wald zu durchstreifen und nach ihren Feinden zu durchsuchen. Niemand kann sagen, wie viele Eurer Hordebrder und -schwestern diesem Geschpf zum Opfer gefallen sind.$B$BIhr solltet die Tatze zu Tarkan in die Silberwindzuflucht bringen. Er wird sich freuen, zu erfahren, dass eine solche Waffe aus dem Arsenal des Feindes entfernt worden ist.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (23, 'esES', 'La pata de Ursangous', 'Llvale la pata de Ursangous al capitn Tarkan en el Refugio Brisa de Plata.', 'El poderoso oso Ursangous ya es historia!$b$bLa pequea media luna de su pata indica que a esta bestia la entrenaron los elfos de la noche para recorrer el bosque en busca de sus enemigos. Quin sabe cuntos de tus aliados de la Horda han cado ante esta criatura.$b$bDeberas llevarle la pata a Tarkan, en el Refugio Brisa de Plata.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (23, 'esMX', 'La pata de Ursangous', 'Llvale la pata de Ursangous al capitn Tarkan en el Refugio Brisa de Plata.', 'El poderoso oso Ursangous ya es historia!$b$bLa pequea media luna de su pata indica que a esta bestia la entrenaron los elfos de la noche para recorrer el bosque en busca de sus enemigos. Quin sabe cuntos de tus aliados de la Horda han cado ante esta criatura.$b$bDeberas llevarle la pata a Tarkan, en el Refugio Brisa de Plata.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (23, 'frFR', 'La patte dUrsangous', 'Apportez la Patte dUrsangous au Capitaine Tarkan au Refuge de Vent-dArgent.', 'Le puissant ours Ursangous nest plus!$b$bLe petit emblme en forme de croissant de lune sur sa patte indique que cette bte avait t dresse par les Elfes de la nuit pour traquer leurs ennemis dans la fort. Impossible de dire combien de vos allis de la Horde ont t tus par cette crature.$B$BVous devriez apporter cette patte  Tarkan au refuge de Vent-dArgent. Il sera heureux de voir quune arme pareille a t retire de larsenal ennemi.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (23, 'itIT', 'Zampa di Ursangous', 'Porta la Zampa di Ursangous al Capitano Tarkan nel Rifugio Vento Argentato.', '<Il potente orso Ursangous  morto!>$b$b<Il piccolo simbolo del quarto di luna crescente sulla sua zampa indica che questa bestia era stata addestrata dagli Elfi della Notte per pattugliare la foresta alla ricerca di nemici. Non  possibile dire quanti membri dell\'Orda siano stati sbranati da questa creatura.>$B$B<Bisogna portare la sua zampa a Tarkan, nel Rifugio Vento Argentato. Sar contento di sapere che l\'arsenale nemico adesso dispone di un\'arma in meno.>', '', '', '', '', '', '', 0);
