INSERT INTO `quest_template_locale` VALUES (23, 'ptBR', 'Pata de Ursangous', 'Leve a Pata de Ursangous para o Capito Tarkan no Refgio Brisaprata.', 'O poderoso urso Ursangous est morto!$b$bO pequeno emblema do quarto crescente de lua na pata do animal indica que ele foi treinado pelos elfos noturnos para espreitar seus inimigos na floresta.  impossvel dizer quantos de seus aliados da Horda morreram pelas garras desta criatura.$b$bVoc deve levar a pata para Tarkan, no Refgio Brisaprata. Ele ficar feliz em saber que tal arma foi removida do arsenal do inimigo.', '', '', '', '', '', '', 0);
