INSERT INTO `quest_template_locale` VALUES (24, 'deDE', 'Schattumbras Kopf', 'Bringt Schattumbras Kopf zu Hauptmann Goggath in Hllschreis Wacht.', 'Der einstmals so flinke Schattumbra liegt jetzt regungslos vor Euch und der Sieg ist Euer.$B$BDieses legendre Geschpf wird von den Nachtelfen verehrt. Sein Kopf drfte eine beeindruckende Trophe sein und als Zeichen fr das Ende der Allianz im Eschental dienen.$B$BHauptmann Goggath in Hllschreis Wacht wird zweifellos hoch erfreut sein, den Kopf des erschlagenen Nachtsblers entgegenzunehmen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (24, 'esES', 'La cabeza de Shadumbra', 'Llvale la cabeza de Shadumbra al Capitn Goggath en la Avanzada Grito Infernal.', 'El otrora veloz Shadumbra yace ahora inerte mientras t reivindicas tu victoria sobre l.$b$bLos elfos de la noche aprecian a esta criatura legendaria. Su cabeza servir como trofeo intimidatorio y como smbolo del fin de la Alianza en Vallefresno.$b$bEl Capitn Goggath, en la Avanzada Grito Infernal, estar encantado de recibir la cabeza del sable de la noche asesinado.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (24, 'esMX', 'La cabeza de Shadumbra', 'Llvale la cabeza de Shadumbra al Capitn Goggath en la Avanzada Grito Infernal.', 'El otrora veloz Shadumbra yace ahora inerte mientras t reivindicas tu victoria sobre l.$b$bLos elfos de la noche aprecian a esta criatura legendaria. Su cabeza servir como trofeo intimidatorio y como smbolo del fin de la Alianza en Vallefresno.$b$bEl Capitn Goggath, en la Avanzada Grito Infernal, estar encantado de recibir la cabeza del sable de la noche asesinado.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (24, 'frFR', 'La tte de Shadumbra', 'Apportez la Tte de Shadumbra au Capitaine Goggath au Guet de Hurlenfer.', 'Shadumbra, autrefois si rapide, gt immobile maintenant que vous l\'avez vaincu.$b$bCette crature lgendaire est chre aux Elfes de la nuit. Sa tte devrait servir de trophe pour les intimider et reprsenter la fin de l\'Alliance en Orneval.$b$bLe capitaine Goggath au guet de Hurlenfer sera sans aucun doute ravi de recevoir la tte de ce sabre-de-nuit.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (24, 'itIT', 'La Testa di Shadumbra', 'Porta la Testa di Shadumbra al Capitano Goggath nel Presidio di Malogrido.', '<L\'agile Shadumbra adesso giace morta ai tuoi piedi.>$b$b<Questa creatura leggendaria era molto cara agli Elfi della Notte. La sua testa costituir un ottimo trofeo intimidatorio e sar il simbolo della fine dell\'Alleanza a Valtetra.>$b$b<Senza dubbio, il Capitano Goggath al Presidio di Malogrido sar felice di ricevere la testa della Fiera della Notte uccisa.>', '', '', '', '', '', '', 0);
