INSERT INTO `quest_template_locale` VALUES (24, 'ptBR', 'Cabea de Shadumbra', 'Leve a Cabea de Shadumbra para o Capito Goggath no Posto de Vigia Grito Infernal.', 'Shadumbra, que j foi rpido como o vento, agora permanece parado aos seus ps aps ser derrotado.$b$bEssa criatura lendria  muito querida pelos elfos noturnos. A cabea dela deve servir como um timo trofu para intimidar a Aliana e como um sinal de que o domnio deles sobre o Vale Gris acabou.$b$bO capito Goggath no Posto de Vigia Grito Infernal ficar, sem dvida, extasiado ao receber a cabea do lendrio sabre-da-noite.', '', '', '', '', '', '', 0);
