INSERT INTO `quest_template_locale` VALUES (25, 'deDE', 'Und dann langsam abkhlen lassen', 'Hauptmann Tarkan in der Silberwindzuflucht mchte, dass Ihr Tideress sowie 12 beschmutzte Wasserelementare am Mystralsee erledigt.', 'Das httet Ihr sehen sollen, $C! Die Elfen dachten, Silberwind wre uneinnehmbar. Bei all ihren vielen Verteidigungsmanahmen und ihrer Armee von Wasserelementaren hat das auch beinahe gestimmt.$B$BBeinahe.$B$BEinem unserer Magier ist es gelungen, einen verderbten Elementar zu beschwren, der die anderen in wilde Raserei versetzte.$B$BAhh, Ihr httet nur deren Gesichter sehen sollen!$B$B <Tarkan lacht.>$B$BLeider ist der Magier, der die Beschwrung durchgefhrt hat, im Kampf gefallen. Jetzt bentige ich jemanden, der die Misere in Ordnung bringt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (25, 'esES', 'Un jarro de agua fra', 'El capitn Tarkan, en el Refugio Brisa de Plata, quiere que acabes con Marearess y con 12 elementales de agua podrida en el Lago Mystral.', 'Deberas haberlo visto, $c!$b$bLos elfos pensaban que Brisa de Plata era inexpugnable. Con sus fuertes defensas y su ejrcito de elementales de agua, casi tenan razn.$b$bCasi.$b$bUno de nuestros magos pudo invocar un elemental corrupto para sembrar el caos y la ira entre los dems.$b$bAh, la expresin de sus rostros!$b$b<Tarkan se re.>$b$bPor desgracia, el mago que lo invoc cay en combate. Ahora necesito que alguien acabe con nuestra creacin.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (25, 'esMX', 'Un jarro de agua fra', 'El capitn Tarkan, en el Refugio Brisa de Plata, quiere que acabes con Marearess y con 12 elementales de agua podrida en el Lago Mystral.', 'Deberas haberlo visto, $c!$b$bLos elfos pensaban que Brisa de Plata era inexpugnable. Con sus fuertes defensas y su ejrcito de elementales de agua, casi tenan razn.$b$bCasi.$b$bUno de nuestros magos pudo invocar un elemental corrupto para sembrar el caos y la ira entre los dems.$b$bAh, la expresin de sus rostros!$b$b<Tarkan se re.>$b$bPor desgracia, el mago que lo invoc cay en combate. Ahora necesito que alguien acabe con nuestra creacin.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (25, 'frFR', 'Y a du gaz dans leau', 'Le Capitaine Tarkan, du Refuge de Vent-d\'Argent, vous a demand de vaincre Maren, et de tuer 12 lmentaires deau souills, au lac Mystral.', 'Vous auriez d voir a, $c!$b$bLes Elfes pensaient que Vent-d\'Argent tait imprenable. Leurs lourdes dfenses et leur arme dlmentaires deau leur auraient presque donn raison.$b$bJai bien dit presque.$b$bLun de nos mages a russi  invoquer un lmentaire malfique avec pour seul objectif de semer le chaos.$b$bAhh, vous auriez d voir leur tte!$b$b<Tarkan rit.>$b$bMalheureusement, le mage qui la invoqu est mort au combat. Quelquun dautre doit tuer le monstre que nous avons cr!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (25, 'itIT', 'Calmare le acque', 'Il Capitano Tarkan al Rifugio Vento Argentato ti ha chiesto di uccidere Marea e 12 Elementali Contaminati dell\'Acqua al Lago Mystral.', 'Avresti dovuto vederlo, $C!$b$bGli Elfi pensavano che Vento Argentato fosse impenetrabile. E con le difese allestite e gli Elementali dell\'Acqua, avevano quasi ragione.$b$bQuasi.$b$bUno dei nostri Maghi  riuscito a evocare un elementale corrotto al fine di scatenare negli altri una rabbia caotica.$b$bAh, avresti dovuto vedere le loro facce!$b$b<Tarkan ride.>$b$bPurtroppo il Mago  morto in battaglia. Ora mi serve qualcuno che elimini la nostra creazione.', '', '', '', '', '', '', 0);
