INSERT INTO `quest_template_locale` VALUES (25, 'ptBR', 'Deixando a gua esfriar', 'O Capito Tarkan, no Refgio Brisaprata, quer que voc derrote Mareante e 12 Elementais da gua Contaminados no Lago Mistral.', 'Voc devia ter visto, $c!$b$bOs elfos pensavam que Brisaprata fosse impenetrvel. E olha que com aquelas defesas pesadas e um exrcito de elementais para defend-la, eles estavam quase certos.$b$bQuase.$b$bUm de nossos magos conseguiu evocar um elemental distorcido com o objetivo de levar os outros a um frenesi catico.$b$bAh, o terror na cara deles!$b$b<Tarkan d uma gargalhada.>$b$bInfelizmente, o mago que evocou o elemental morreu em combate. Agora, eu preciso que algum v at l dar um jeito na criatura.', '', '', '', '', '', '', 0);
