INSERT INTO `quest_template_locale` VALUES (26, 'deDE', 'Eine wertvolle Lektion', 'Sprecht mit Dendrite Sternenschauer im Dorf Nachthafen auf der Mondlichtung.', '$n, ich habe Euren Fortschritt mit groem Genuss verfolgt. Ihr entwickelt Euch definitiv zu einem wertvollen Beschtzer der Natur.$B$BEs ist an der Zeit fr Euch, mehr ber einen der diversen Tieraspekte zu lernen, in die wir uns dank Cenarius\' Segen verwandeln knnen... einen, der Euch die Beherrschung des Wassers ermglicht. Dazu msst Ihr zur Mondlichtung in das Dorf Nachthafen reisen und mit Dendrite Sternenschauer vom Zirkel des Cenarius sprechen. Er wird Euch weiter anleiten.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (26, 'esES', 'Una leccin que aprender', 'Ve a Claro de la Luna, al poblado Amparo de la Noche y habla con Dendrita Rafagaestelar.', '$n, he seguido tus progresos con gran gozo. Sin duda te ests convirtiendo en $gun valioso protector:una valiosa protectora; de la naturaleza.$B$BHa llegado el momento de que aprendas ms sobre una de las formas animales con las que Cenarius nos ha bendecido. Una forma que podemos adoptar y que nos permite controlar el agua. Tendrs que viajar al poblado Amparo de la Noche, que est en Claro de la Luna, y hablar con Dendrita Rafagaestelar del Crculo Cenarion. l ser tu gua.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (26, 'esMX', 'Una leccin que aprender', '$n, he seguido tus progresos con gran gozo. Sin duda te ests convirtiendo en $gun valioso protector:una valiosa protectora; de la naturaleza.$B$BHa llegado el momento de que aprendas ms sobre una de las formas animales con las que Cenarius nos ha bendecido. Una forma que podemos adoptar y que nos permite controlar el agua. Tendrs que viajar al poblado Amparo de la Noche, que est en Claro de la Luna, y hablar con Dendrita Rafagaestelar del Crculo Cenarion. l ser tu gua.', 'Ve a Claro de la Luna, al poblado Amparo de la Noche y habla con Dendrita Rafagaestelar.', '', '', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (26, 'frFR', 'Une leon  apprendre', 'Parlez  Dendrite Brastoile, au village de Havrenuit,  Reflet-de-Lune.', '$n, j\'ai suivi votre progression avec beaucoup de plaisir. Vous tes assurment en train de devenir $gun vritable gardien et protecteur:une vritable gardienne et protectrice; de la nature.$B$BLe temps est venu pour vous d\'en apprendre plus  propos de l\'une des nombreuses formes animales que nous pouvons revtir et dont nous gratifie Cnarius. Un aspect qui vous permettra de matriser l\'eau. Pour cela, vous devez voyager jusqu\'au village de Havrenuit,  Reflet-de-Lune, et parler  Dendrite Brastoile, du Cercle cnarien. Il vous guidera plus avant.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (26, 'itIT', 'A Lesson to Learn', 'Speak with Dendrite Starblaze in the village of Nighthaven, Moonglade.', '$n, I have been following your progress with much delight.  You are most assuredly developing yourself into a valued protector of nature.$B$BThe time has come for you to learn more about one of the various animal aspects that Cenarius has blessed us with the ability to change into - one that affords you command and mastery of the water.  For this, you must travel to the village of Nighthaven in Moonglade and speak with Dendrite Starblaze of the Cenarion Circle there.  He will guide you further.', '', '', '', '', '', '', 0);
