INSERT INTO `quest_template_locale` VALUES (28, 'deDE', 'Prfung des Sees', 'Sucht ein Schreinschmuckstck im See von Elune\'ara und bringt es zum Schrein von Remulos im Nordwesten der Mondlichtung. Wenn Ihr dort seid, benutzt das Schreinschmuckstck.$B$BIhr msst anschlieend mit Tajarri am Schrein sprechen, um die Prfung abzuschlieen.', 'Als Eure erste Prfung msst Ihr in den Tiefen des Sees von Elune\'ara nach einem Schreinschmuckstck suchen. Es zerfllt schnell, daher solltet Ihr Euch mit grter Eile zum Schrein von Remulos begeben. Benutzt das Schmuckstck am Schrein und sprecht dann dort mit Tajarri; sie ist eine der vertrauenswrdigsten Aufseherinnen der Mondlichtung.$B$BIhr habt nur eine gewisse Zeitspanne fr diese Aufgabe zur Verfgung, und Ihr knntet in Konkurrenz zu anderen Druiden stehen, die ebenfalls nach Schmuckstcken suchen. Geistiges wie krperliches Geschick wird fr Euren Erfolg unabdingbar sein.$B$BViel Glck, $n.', 'Schliet die Prfung des Sees ab.', '', '', '', '', 'Kehrt zu Tajarri am Schrein von Remulos auf der Mondlichtung zurck.', 0);
INSERT INTO `quest_template_locale` VALUES (28, 'esES', 'La prueba del lago', 'Lleva un adorno de altar del Lago Elune\'ara al Santuario de Remulos, al noroeste de Claro de la Luna. Usa el adorno en el santuario. $b$bDespus, habla con Tajarri en el santuario para completar la prueba.', 'En tu primera prueba, debes ir a las profundidades del Lago Elune\'ara y encontrar un adorno de altar. Se descompone rpidamente, por lo que debers ir inmediatamente al Santuario de Remulos. Coloca el adorno en el altar y habla con Tajarri; es una de las celadoras ms apreciadas de Claro de la Luna.$B$BTienes un tiempo limitado para completar la tarea y es probable que tengas que competir con otros druidas en busca de adornos. Necesitars toda tu destreza mental y fsica.$B$BSuerte, $n.', 'Completa la Prueba del Lago.', '', '', '', '', 'Vuelve con: Tajarri. Zona: Santuario de Remulos, Claro de la Luna.', 0);
INSERT INTO `quest_template_locale` VALUES (28, 'esMX', 'La prueba del lago', 'Lleva un adorno de altar del Lago Elune\'ara al Santuario de Remulos, al noroeste de Claro de la Luna. Usa el adorno en el santuario. $b$bDespus, habla con Tajarri en el santuario para completar la prueba.', 'En tu primera prueba, debes ir a las profundidades del Lago Elune\'ara y encontrar un adorno de altar. Se descompone rpidamente, por lo que debers ir inmediatamente al Santuario de Remulos. Coloca el adorno en el altar y habla con Tajarri; es una de las celadoras ms apreciadas de Claro de la Luna.$B$BTienes un tiempo limitado para completar la tarea y es probable que tengas que competir con otros druidas en busca de adornos. Necesitars toda tu destreza mental y fsica.$B$BSuerte, $n.', 'Completa la Prueba del Lago.', '', '', '', '', 'Vuelve con: Tajarri. Zona: Santuario de Remulos, Claro de la Luna.', 0);
INSERT INTO `quest_template_locale` VALUES (28, 'frFR', 'L\'preuve du lac', 'Trouvez un Colifichet du sanctuaire dans le Lac lune\'ara, et apportez-le au sanctuaire de Remulos, au nord-ouest de Reflet-de-Lune. Une fois sur place, utilisez le Colifichet du sanctuaire.$B$BVous devez parler  Tajarri, au sanctuaire, afin de terminer lpreuve.', 'Pour la premire preuve, vous devrez aller fouiller les profondeurs du lac lune\'ara, et trouver un Colifichet du sanctuaire. Attention, il se corrompt rapidement; aussi, ne tardez pas  l\'apporter au sanctuaire de Remulos. Utilisez le Colifichet sur le sanctuaire puis parlez  Tajarri; elle est l\'un des gardiens les plus fiables de Reflet-de-Lune.$B$BVous devez russir cette qute avant l\'expiration du temps imparti, et vous serez peut-tre en concurrence avec d\'autres druides, galement  la recherche de colifichets. Il vous faudra user de ruse et de dextrit pour russir dans cette mission.$B$BBonne chance, $n.', 'Accomplir l\'preuve du lac', '', '', '', '', 'Retournez voir Tajarri au Sanctuaire de Remulos, en Reflet-de-Lune.', 0);
INSERT INTO `quest_template_locale` VALUES (28, 'itIT', 'Trial of the Lake', 'Find a Shrine Bauble in Lake Elune\'ara, and take it to the Shrine of Remulos in northwestern Moonglade.  Once there, use the Shrine Bauble.$B$BYou must speak with Tajarri at the shrine afterwards in order to complete the trial.', 'For your first trial, search the depths of Lake Elune\'ara to locate a Shrine Bauble.  It decays rapidly, so proceed with it to the Shrine of Remulos post haste.  Use the bauble at the shrine, and then speak with Tajarri there; she is one of Moonglade\'s most trusted wardens.$B$BYou only have a set amount of time to complete the task, and you may be competing against other druids searching for baubles themselves.  Mental and physical dexterity will be critical to your success.$B$BGood luck, $n.', 'Complete the Trial of the Lake.', '', '', '', '', 'Return to Tajarri at the Shrine of Remulos in Moonglade.', 0);
INSERT INTO `quest_template_locale` VALUES (28, 'ptBR', 'Trial of the Lake', 'Find a Shrine Bauble in Lake Elune\'ara, and take it to the Shrine of Remulos in northwestern Moonglade. Once there, use the Shrine Bauble.$B$BYou must speak with Tajarri at the shrine afterwards in order to complete the trial.', 'For your first trial, search the depths of Lake Elune\'ara to locate a Shrine Bauble. It decays rapidly, so proceed with it to the Shrine of Remulos post haste. Use the bauble at the shrine, and then speak with Tajarri there; she is one of Moonglade\'s most trusted wardens.$B$BYou only have a set amount of time to complete the task, and you may be competing against other druids searching for baubles themselves. Mental and physical dexterity will be critical to your success.$B$BGood luck, $n.', 'Complete the Trial of the Lake.', '', '', '', '', 'Return to Tajarri at the Shrine of Remulos in Moonglade.', 0);
