INSERT INTO `quest_template_locale` VALUES (30, 'deDE', 'Prfung des Seelwen', 'Sucht die Anhngerhlfte der Wasserbeweglichkeit und die Anhngerhlfte der Wasserbelastbarkeit. Sprecht mit den Einwohnern der Mondlichtung, um Hinweise darauf zu erhalten, wo sich diese Gegenstnde befinden knnten.$B$BFormt den Anhnger des Seelwen aus den beiden Anhngerhlften. Ihr msst in der unmittelbaren Nhe des Schreins von Remulos sein, um dies zu tun.$B$BBringt den zusammengefgten Anhnger zu Dendrite Sternenschauer im Dorf Nachthafen auf der Mondlichtung.', 'Fr die zweite Prfung bentigt Ihr die zwei Hlften, aus denen der Anhnger des Seelwen besteht. Die eine Hlfte bezieht ihre Kraft aus der Beweglichkeit des Seelwen-Aspektes beim Gleiten durchs Wasser; die andere Hlfte bezieht ihre Kraft aus der unglaublichen Ausdauer des Seelwen-Aspektes. Druiden bedienen sich dieser beiden Eigenschaften gleichermaen, um den Aspekt ihrer Wassergestalt zu verkrpern.$B$BSprecht mit den Bewohnern der Mondlichtung, um herauszufinden, wo sich die Teile befinden knnten, und bringt beide hierher, um sie miteinander zu vereinen. Bringt den Anhnger zu Dendrite Sternenschauer, wenn Ihr ihn geschaffen habt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (30, 'esES', 'La prueba del len marino', 'Busca el colgante de Agilidad acutica y el colgante de Resistencia acutica. Habla con la gente de Claro de la Luna para conseguir pistas sobre la ubicacin de los colgantes. $b$bForma el colgante del len marino con los otros dos cuando ests cerca del Santuario de Remulos. $b$bLleva el colgante completo a Dendrita Rafagaestelar a Amparo de la Noche, en Claro de la Luna.', 'En tu segunda prueba debes encontrar las dos mitades del colgante del len marino. Una obtiene su poder de la agilidad del len marino cuando se desliza en el agua, la otra lo obtiene de su increble capacidad de resistencia. Los druidas se alimentan de ambos rasgos para asumir su forma acutica.$B$BHabla con la gente de Claro de la Luna para averiguar dnde estn las mitades y tremelas para que las unamos. Luego llevars el colgante a Dendrita Rafagaestelar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (30, 'esMX', 'La prueba del len marino', 'Busca el colgante de Agilidad acutica y el colgante de Resistencia acutica. Habla con la gente de Claro de la Luna para conseguir pistas sobre la ubicacin de los colgantes. $b$bForma el colgante del len marino con los otros dos cuando ests cerca del Santuario de Remulos. $b$bLleva el colgante completo a Dendrita Rafagaestelar a Amparo de la Noche, en Claro de la Luna.', 'En tu segunda prueba debes encontrar las dos mitades del colgante del len marino. Una obtiene su poder de la agilidad del len marino cuando se desliza en el agua, la otra lo obtiene de su increble capacidad de resistencia. Los druidas se alimentan de ambos rasgos para asumir su forma acutica.$B$BHabla con la gente de Claro de la Luna para averiguar dnde estn las mitades y tremelas para que las unamos. Luego llevars el colgante a Dendrita Rafagaestelar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (30, 'frFR', 'L\'preuve du lion de mer', 'Trouvez le Demi-pendentif d\'agilit aquatique et le Demi-pendentif d\'endurance aquatique. Parlez aux habitants de Reflet-de-Lune pour obtenir des indices quant  lendroit o ces objets se trouvent.$B$BReformez le Pendentif du lion de mer  partir des deux moitis. Vous devez vous trouver  proximit du sanctuaire de Remulos pour faire cela.$B$BApportez le Pendentif reform  Dendrite Brastoile, au village de Havrenuit,  Reflet-de-Lune.', 'Pour la seconde preuve, vous aurez besoin des deux moitis qui constitueront le Pendentif du lion de mer. L\'une des moitis emprunte au lion de mer son agilit  glisser  travers les eaux. L\'autre moiti emprunte  l\'animal son incroyable endurance. Les druides doivent revtir ces deux aspects pour pouvoir adopter leur forme aquatique.$B$BAllez parler aux rsidents de Reflet-de-Lune pour apprendre o les deux parties se trouvent, puis rapportez-les ici, afin de pouvoir les joindre ensemble. Quand vous aurez form le pendentif, apportez-le  Dendrite Brastoile.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (30, 'itIT', 'Trial of the Sea Lion', 'Find the Half Pendant of Aquatic Agility and the Half Pendant of Aquatic Endurance.  Speak with the residents of Moonglade to learn clues as to where these items may be located.$B$BForm the Pendant of the Sea Lion from the two pendant halves.  You need to be in proximity of the Shrine of Remulos to do this.$B$BBring the joined pendant to Dendrite Starblaze in the village of Nighthaven, Moonglade.', 'For the second trial, you\'ll need the two halves that make the Pendant of the Sea Lion.  One half draws power from the agility of the sea lion aspect, gliding through water; the other draws power from the incredible endurance of the sea lion aspect.  Druids draw on both these traits equally to embody the aspect of their aquatic form.$B$BSpeak with the locals of Moonglade to learn where the parts may lie, and bring both here to join them together.  Once formed, take the pendant to Dendrite Starblaze.', '', '', '', '', '', '', 0);
