INSERT INTO `quest_template_locale` VALUES (31, 'deDE', 'Wassergestalt', 'Ihr habt die notwendigen Lektionen gemeistert, die alle jungen Druiden lernen, bevor sie einen Wasseraspekt annehmen knnen. Kehrt jetzt zu Eurem Lehrer Turak Runentotem nach Donnerfels zurck. Zeigt ihm Euren Anhnger und beweist ihm damit, dass Ihr bereit seid zu lernen, was er Euch lehren kann. Er wird Eure Ausbildung abschlieen und Euch ermglichen, eins mit dem Wasser zu werden.$B$BAuf Wiedersehen. Wir werden uns wieder sprechen.', 'Kehrt nach Donnerfels zurck und zeigt Turak Runentotem den Anhnger des Seelwen.', '', '', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (31, 'esES', 'Forma acutica', 'Has completado tu formacin para la adopcin de una forma acutica. Ve a ver a tu instructor, Turak Ttem de Runa, a Cima del Trueno. Ensale el colgante y demustrale que puedes aprender lo que tenga que ensearte. l completar tu formacin para que puedas fundirte con el agua.$B$BBuena suerte, joven druida. Volveremos a vernos.', 'Vuelve a Cima del Trueno y ensale el colgante del len marino a Turak Ttem de Runa.', '', '', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (31, 'esMX', 'Forma acutica', 'Has completado tu formacin para la adopcin de una forma acutica. Ve a ver a tu instructor, Turak Ttem de Runa, a Cima del Trueno. Ensale el colgante y demustrale que puedes aprender lo que tenga que ensearte. l completar tu formacin para que puedas fundirte con el agua.$B$BBuena suerte, joven druida. Volveremos a vernos.', 'Vuelve a Cima del Trueno y ensale el colgante del len marino a Turak Ttem de Runa.', '', '', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (31, 'frFR', 'Forme aquatique', 'Vous avez termin les leons ncessaires, enseignes  tous les jeunes druides avant qu\'ils ne puissent adopter un aspect aquatique. Retournez voir votre Matre, Turak Totem-runique, aux Pitons-du-Tonnerre. Prsentez-lui votre pendentif et montrez-lui que vous tes en mesure d\'apprendre ce qu\'il est prt  vous enseigner. Il veillera  parachever votre entranement, vous permettant de revtir une forme aquatique.$B$BAu revoir, jeune druide. Nous nous reparlerons plus tard.', 'Retournez aux Pitons-du-Tonnerre et montrez le Pendentif du lion de mer  Turak Totem-Runique.', '', '', '', '', '', '', 18019);
