INSERT INTO `quest_template_locale` VALUES (32, 'deDE', 'Aufstieg der Silithiden', 'Bringt den Bericht nach Orgrimmar zu Zilzibin Tomtom.', 'Hier ist Euer Bericht. Ihr solltet damit zu jemandem gehen, der ausreichend Kenntnis von solchen Dingen hat.$B$BIch kenne da einen Trollgelehrten mit Namen Zilzibin Tomtom. Er hat viel Zeit mit dem Studium der Lebensformen verbracht, die in der kologie von Azeroth einzigartig sind, und er ist noch dazu Historiker! Wenn Euch jemand helfen soll herauszufinden, was genau diese Bedrohung ausmacht, und wie sie zu stoppen ist, gebt ihm diesen Bericht. Hilfe knnen wir gar nicht genug haben.$B$BZil lebt in einem Haus auf der zweiten Ebene der Gasse in Orgrimmar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (32, 'esES', 'La sublevacin de los siltidos', 'Entrgale el informe a Zilzibin Tambor Sabio en Orgrimmar.', 'Aqu tienes el informe. Te ruego que se lo entregues a alguien que tenga conocimientos de este tema.$B$BConozco a un trol erudito llamado Zilzibin Tambor Sabio que ha dedicado mucho tiempo al estudio de los seres vivos que solo se encuentran en Azeroth. Es un historiador de los pies a la cabeza! Entrgale este informe si quieres que te ayude a entender a qu te enfrentas y el modo de detener esta amenaza. Vamos a necesitar toda la ayuda que podamos conseguir.$B$BZil vive en una casa en el segundo nivel de La Calle Mayor en Orgrimmar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (32, 'esMX', 'La sublevacin de los siltidos', 'Entrgale el informe a Zilzibin Tambor Sabio en Orgrimmar.', 'Aqu tienes el informe. Te ruego que se lo entregues a alguien que tenga conocimientos de este tema.$B$BConozco a un trol erudito llamado Zilzibin Tambor Sabio que ha dedicado mucho tiempo al estudio de los seres vivos que solo se encuentran en Azeroth. Es un historiador de los pies a la cabeza! Entrgale este informe si quieres que te ayude a entender a qu te enfrentas y el modo de detener esta amenaza. Vamos a necesitar toda la ayuda que podamos conseguir.$B$BZil vive en una casa en el segundo nivel de La Calle Mayor en Orgrimmar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (32, 'frFR', 'L\'ascension des silithides', 'Apportez le Rapport  Zilzibin Kongadok,  Orgrimmar.', 'Voici votre rapport. Je vous demande de l\'apporter de toute urgence  quelqu\'un qui a de l\'exprience dans ce domaine.$B$BJe connais un troll rudit du nom de Zilzibin Kongadok. Il a pass beaucoup de temps  tudier les formes de vie exceptionnelles de l\'cologie d\'Azeroth; de plus, c\'est un historien! Si vous voulez rencontrer quelqu\'un capable de comprendre la nature de ce danger et comment l\'arrter, apportez-lui ce rapport. Nous allons avoir besoin de toute l\'aide disponible.$B$BZil rside dans une maison sur le niveau suprieur de la Herse,  Orgrimmar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (32, 'itIT', 'Rise of the Silithid', 'Take the report to Zilzibin Drumlore in Orgrimmar.', 'Here\'s your report.  I urge you to take it to someone who might have working knowledge in this kind of thing.$B$BI know this troll scholar named Zilzibin Drumlore.  He\'s spent a lot of time studying life forms that are unique to the ecology of Azeroth; he\'s a historian to boot!  If you want someone to help figure out what exactly this threat is and how to stop it, give this report to him.  We\'re going to need all the help we can get.$B$BZil lives in a house on the second tier of the Drag in Orgrimmar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (32, 'ptBR', 'Rise of the Silithid', 'Take the report to Zilzibin Drumlore in Orgrimmar.', 'Here\'s your report.  I urge you to take it to someone who might have working knowledge in this kind of thing.$B$BI know this troll scholar named Zilzibin Drumlore.  He\'s spent a lot of time studying life forms that are unique to the ecology of Azeroth; he\'s a historian to boot!  If you want someone to help figure out what exactly this threat is and how to stop it, give this report to him.  We\'re going to need all the help we can get.$B$BZil lives in a house on the second tier of the Drag in Orgrimmar.', '', '', '', '', '', '', 0);
