INSERT INTO `quest_template_locale` VALUES (33, 'deDE', 'Wlfe an der Grenze', 'Bringt Eagan Pelzschneider, den Ihr vor der Abtei von Nordhain findet, 8 Pelze von erkrankten Wlfen.', 'Was auch immer diese Wlfe sich eingefangen haben, es geht nicht weg. Jeden Tag tauchen weitere kranke Wlfe auf. Es tut mir in der Seele weh, dass jemand diese Schpfungen der Natur in meinem Namen tten muss, aber wir mssen die erkrankten jungen Wlfe erledigen, bevor die lokale Ansteckung zu einer Epidemie wird.$B$BTtet erkrankte junge Wlfe im Tal und bringt mir ihre Pelze als Beweis Eurer Tat.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (33, 'esES', '[DEPRECATED] Los lobos cruzan la frontera', 'Lleva 8 pelambres de lobo malsano a Eagan Desollapelambres junto a la Abada de Villanorte.', 'Sea lo que sea lo que est afectando a estos lobos, no se va. Cada da que pasa hay ms lobos enfermos. Me puede pedirle a alguien que mate a las bestias de la naturaleza, pero debemos acabar con los lobos jvenes malsanos antes de que esta pequea infeccin se convierta en una epidemia.$b$bMata lobos jvenes malsanos en el valle y treme pelambres de lobo malsano como prueba de tu hazaa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (33, 'esMX', '[DEPRECATED] Los lobos cruzan la frontera', 'Lleva 8 pelambres de lobo malsano a Eagan Desollapelambres junto a la Abada de Villanorte.', 'Sea lo que sea lo que est afectando a estos lobos, no se va. Cada da que pasa hay ms lobos enfermos. Me puede pedirle a alguien que mate a las bestias de la naturaleza, pero debemos acabar con los lobos jvenes malsanos antes de que esta pequea infeccin se convierta en una epidemia.$b$bMata lobos jvenes malsanos en el valle y treme pelambres de lobo malsano como prueba de tu hazaa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (33, 'frFR', '[PRIM]Les loups derrire la frontire', 'Apportez 8 Peaux de loup malade  Eagan Tannepeau,  l\'extrieur de lAbbaye de Comt-du-Nord.', 'Ce qui affecte ces loups nest pas prt de disparatre. Chaque jour, on voit davantage de loups malades. Lide de demander  quelquun de tuer des animaux innocents me dplat profondment, mais nous devons abattre les jeunes loups malades avant que cela ne tourne  lpidmie.$B$BTuez des jeunes loups malades dans la valle, et ramenez-moi leurs peaux comme preuve de vos exploits.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (33, 'itIT', '[DEPRECATED] Wolves Across the Border', 'Bring 8 Diseased Wolf Pelts to Eagan Peltskinner outside Northshire Abbey.', 'Whatever is affecting these wolves isn\'t going away. Each day that passes brings forth more sick wolves. It pains me to ask anyone to kill nature\'s beasts, but we must destroy the diseased young wolves before this little outbreak turns into an epidemic.$B$BKill diseased young wolves in the valley and bring me their diseased wolf pelts as proof of your deed.', '', '', '', '', '', '', 0);
