INSERT INTO `quest_template_locale` VALUES (34, 'deDE', 'Ein ungebetener Gast', 'Martie Jainrose aus Seenhain mchte, dass Ihr Stopfwanst ttet. Bringt ihr den Hauer des Ebers zum Beweis.', 'Mein Garten ist schon wieder zertrampelt und verwstet worden. Und ich wei genau, was fr ein Tier das getan hat. Das war dieser elende Eber, der, den Marschall Marris seit einer Weile immer Stopfwanst nennt.$b$bJetzt kann ich die Narzissen erst nchsten Herbst wieder anpflanzen. Hin! Alle hin, und das nur wegen dieses einen gefhrlichen Ebers. Bereitet dieser Plage ein Ende! Zeigt mir seinen Hauer und ich werde Euch nur zu gern belohnen. Die meiste Zeit scheint er damit zu verbringen, in den Feldern sdwestlich von Seenhain nach Futter zu suchen, doch gelegentlich verirrt er sich auch hierher und in meinen Garten.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (34, 'esES', 'Una visita poco grata', 'Martie Jainrose de Villa del Lago quiere que mates a Panzallena. Llvale un colmillo como prueba.', 'Han vuelto a arrasar mi jardn, y s quin es el responsable. Es ese maldito jabal, ese al que el alguacil Marris llama Panzallena.$B$BYa es demasiado tarde para replantar narcisos. Ese puerco ha devastado mis flores. Acaba con ese bicharraco! Si me traes un colmillo suyo, te recompensar. Dicen que anda husmeando por los campos que hay al suroeste de Villa del Lago, pero de vez en cuando viene a mi jardn.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (34, 'esMX', 'Una visita poco grata', 'Martie Jainrose de Villa del Lago quiere que mates a Panzallena. Llvale un colmillo como prueba.', 'Han vuelto a arrasar mi jardn, y s quin es el responsable. Es ese maldito jabal, ese al que el alguacil Marris llama Panzallena.$B$BYa es demasiado tarde para replantar narcisos. Ese puerco ha devastado mis flores. Acaba con ese bicharraco! Si me traes un colmillo suyo, te recompensar. Dicen que anda husmeando por los campos que hay al suroeste de Villa del Lago, pero de vez en cuando viene a mi jardn.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (34, 'frFR', 'Un invit indsirable', 'Martie Jainrose de Comt-du-Lac vous a demand de tuer Fouailleventre. Rapportez-lui ses dfenses comme preuve.', 'Mes jardins ont encore t saccags. Et je connais le responsable. C\'est ce satan sanglier, celui que le marchal Marris appelle Fouailleventre.$b$bJe ne vais pas pouvoir replanter mes jonquilles avant la prochaine saison maintenant. Ruine! Je suis compltement ruine  cause de ce sanglier! Mettez un terme  cette nuisance! Montrez-moi ses dfenses et je serai heureuse de vous rcompenser. Il semble qu\'il passe son temps dans les champs au sud-ouest de Comt-du-Lac, mais il vagabonde de temps en temps jusque dans mon jardin.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (34, 'itIT', 'An Unwelcome Guest', 'Martie Jainrose of Lakeshire wants you to kill Bellygrub.  Bring her his tusk as proof.', 'Once again my garden was trampled and pillaged.  And I know the brute who is doing it.  It\'s that forsaken boar, the one Marshal Marris has taken to calling Bellygrub.$b$bI won\'t be able to re-plant the daffodils until next season now.  Ruined!  All ruined by that one menacing boar.  Put an end to that pest!  Show me his tusk and I\'d be happy to reward you.  He seems to spend his time foraging in the field southwest of Lakeshire but occasionally he roams over here and into my garden.', '', '', '', '', '', '', 0);
