INSERT INTO `quest_template_locale` VALUES (35, 'deDE', 'Weitere Sorgen', 'Marschall Dughan mchte, dass Ihr mit Wache Thomas sprecht.', 'Falls Ihr befrchtet, dass die Gerchte ber das Auftauchen von Murlocs wahr sein knnten, dann tut das Folgende: Begebt Euch zur stlichen Brcke von Elwynn und sprecht mit Wache Thomas. Er ist seit einer Woche an der Brcke stationiert und wird deswegen wissen, wie es in der Gegend aussieht.$B$BIch habe hier ein Streitross aus Sturmwind, das Euch zur Wache Thomas tragen wird. Lasst es mich wissen, wenn Ihr das Pferd benutzen wollt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (35, 'esES', 'Ms preocupaciones', 'El alguacil Dughan quiere que hables con el guardia Thomas.', 'Si te preocupa que los rumores sobre los mrlocs sean ciertos, viaja al puente del este de Elwynn y habla con el guardia Thomas. Esta ltima semana se encuentra emplazado en el puente y sabr cul es el estado de la situacin.$B$BTengo un destrero de Ventormenta que te llevar hasta el guardia Thomas. Si quieres utilizar el caballo, dmelo.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (35, 'esMX', 'Ms preocupaciones', 'El alguacil Dughan quiere que hables con el guardia Thomas.', 'Si te preocupa que los rumores sobre los mrlocs sean ciertos, viaja al puente del este de Elwynn y habla con el guardia Thomas. Esta ltima semana se encuentra emplazado en el puente y sabr cul es el estado de la situacin.$B$BTengo un destrero de Ventormenta que te llevar hasta el guardia Thomas. Si quieres utilizar el caballo, dmelo.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (35, 'frFR', 'Inquitudes supplmentaires', 'Le Marchal Dughan vous a demand de parler au Garde Thomas.', 'Si vous voulez savoir si les rumeurs concernant les Murlocs sont vraies, allez donc au pont,  l\'est dElwynn, et parlez au garde Thomas. Il y est en poste depuis une semaine, il saura de quoi il retourne.$B$BJ\'ai l un destrier de Hurlevent qui vous conduira jusqu\'au garde Thomas. Vous n\'avez qu\' me dire si vous tes $gprt:prte;  l\'utiliser.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (35, 'itIT', 'Altre preoccupazioni', 'Il Maresciallo Dughan ti ha chiesto di parlare con la Guardia Thomas.', 'Se temi che le voci sui Murloc siano vere, puoi fare cos: dirigiti verso il ponte di Elwynn a est e parla con la Guardia Thomas.  di stanza al ponte dalla scorsa settimana e conoscer la situazione della zona.$B$BHo un Gran Destriero di Roccavento che ti porter dalla Guardia Thomas. Fammi sapere se hai intenzione di usarlo.', '', '', '', '', '', '', 0);
