INSERT INTO `quest_template_locale` VALUES (35, 'ptBR', 'Mais preocupaes', 'O Delegado Duro quer que voc fale com o Guarda Toms.', 'Se voc est $gpreocupado:preocupada; quanto aos rumores sobre os murlocs, faa o seguinte: v para a ponte leste de Elwynn e fale com o guarda Toms. Ele est l desde a semana passada e vai saber qual a situao do local.$B$BTenho aqui um corcel de Ventobravo que vai levar voc at o guarda Toms. Me avise quando quiser pegar o cavalo.', '', '', '', '', '', '', 0);
