INSERT INTO `quest_template_locale` VALUES (36, 'deDE', 'Westfalleintopf', 'Verna Brauenwirbel mchte, dass Ihr ihr Rezept fr Westfalleintopf bei Salma Saldean abliefert.', 'Ich htte nie gedacht, dass jemals der Tag kommen wrde, an dem ich den Hof verlasse. Aber in den Feldern wimmelt es nur so von Dieben und es ist hier fr uns viel zu gefhrlich geworden. Sobald Bauer Brauenwirbel den Wagen repariert hat, machen wir uns auf den Weg.$b$bKnntet Ihr mir vielleicht einen Gefallen tun? Ich schreibe Euch schnell mein Rezept fr Westfalleintopf auf. Seid so nett und bringt es Salma Saldean; sie wohnt auf dem Hof dort hinten. Ihr findet den Hof der Saldeans gleich hinter der Gabelung der Strae.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (36, 'esES', 'Estofado de los Pramos de Poniente', 'Verna Cejade quiere que le entregues su receta del estofado de los Pramos de Poniente a Salma Saldean.', 'Nunca pens que llegara el da en el que tuviera que dejar la granja. Pero los campos estn llenos de ladrones y es demasiado peligroso que sigamos aqu. En cuanto el granjero Cejade consiga arreglar el carro nos pondremos en marcha.$B$BPodras hacerme un favor? Deja que te escriba mi receta del estofado de los Pramos de Poniente. Por favor, llvasela a Salma Saldean, estar en la Finca de Saldean, nada ms pasar la bifurcacin del camino.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (36, 'esMX', 'Estofado de los Pramos de Poniente', 'Verna Cejade quiere que le entregues su receta del estofado de los Pramos de Poniente a Salma Saldean.', 'Nunca pens que llegara el da en el que tuviera que dejar la granja. Pero los campos estn llenos de ladrones y es demasiado peligroso que sigamos aqu. En cuanto el granjero Cejade consiga arreglar el carro nos pondremos en marcha.$B$BPodras hacerme un favor? Deja que te escriba mi receta del estofado de los Pramos de Poniente. Por favor, llvasela a Salma Saldean, estar en la Finca de Saldean, nada ms pasar la bifurcacin del camino.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (36, 'frFR', 'Le ragot de la marche de l\'Ouest', 'Verna Froncebouille vous a demand d\'apporter la Recette du ragot de la marche de l\'Ouest  Salma Saldean.', 'Je n\'avais jamais pens un jour quitter ma ferme. Mais les champs grouillent de voleurs, et cela devient vraiment trop dangereux pour nous. Ds que la charrette du fermier Froncebouille sera rpare, nous partirons. $b$bVous pourriez peut-tre me faire une faveur? Laissez-moi crire la recette du ragot de la marche de l\'Ouest. S\'il vous plat, apportez-la  Salma Saldean  la ferme de l\'autre ct, l-bas. La ferme des Saldean est un peu plus loin sur la route, juste aprs l\'embranchement.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (36, 'itIT', 'Westfall Stew', 'Verna Furlbrow wants you to deliver her recipe for Westfall Stew to Salma Saldean.', 'I never thought the day would come when I\'d leave the farm.  But the fields are overrun with thieves and it\'s far too dangerous for us here now.  As soon as Farmer Furlbrow gets the wagon fixed, we\'ll be on our way.  $b $bMaybe you could do me a favor?  Let me scribble down my recipe for Westfall stew.  Please take it to Salma Saldean over on the farm yonder.  The Saldean\'s farm is just beyond the fork in the road.', '', '', '', '', '', '', 0);
