INSERT INTO `quest_template_locale` VALUES (37, 'deDE', 'Suche nach den vermissten Wachen', 'Wache Thomas mchte, dass Ihr den Fluss in Richtung Norden nach Rolf und Malakai, den beiden vermissten Wachen, absucht.', 'Vor ein paar Tagen haben wir zwei Wachen, Rolf und Malakai, losgeschickt, damit sie entlang des Flusses Nachforschungen anstellen, aber bisher sind sie noch nicht zurckgekehrt. Damit ich meinen Bericht fertig schreiben kann, muss ich wissen, was den beiden Mnnern zugestoen ist.$B$BSucht den Fluss in Richtung Norden ab und seht zu, dass Ihr die Wachen findet... oder ihre berreste.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (37, 'esES', 'Encuentra a los guardias perdidos', 'El guardia Thomas quiere que viajes al norte, ro arriba, y busques a sus dos guardias, Rolf y Malakai.', 'Hace unos das mand a dos guardias, Rolf y Malakai, a investigar el ro. An no han regresado. Para completar mi informe necesito saber qu les ocurri a esos hombres.$B$BViaja al norte a lo largo del ro y encuentra a mis guardias... o lo que quede de ellos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (37, 'esMX', 'Encuentra a los guardias perdidos', 'El guardia Thomas quiere que viajes al norte, ro arriba, y busques a sus dos guardias, Rolf y Malakai.', 'Hace unos das mand a dos guardias, Rolf y Malakai, a investigar el ro. An no han regresado. Para completar mi informe necesito saber qu les ocurri a esos hombres.$B$BViaja al norte a lo largo del ro y encuentra a mis guardias... o lo que quede de ellos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (37, 'frFR', 'Trouver les gardes disparus', 'Le Garde Thomas vous a demand d\'aller au nord, le long de la rivire,  la recherche de deux gardes disparus, Rolf et Malakai.', 'Il y a quelques jours, j\'ai envoy deux gardes, Rolf et Malakai, patrouiller le long de la rivire, et ils ne sont toujours pas revenus. Afin de finaliser mon rapport, je dois absolument savoir ce qu\'il est advenu de ces hommes.$B$BAllez vers le nord, le long de la rivire, et trouvez les gardes... ou ce qu\'il en reste.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (37, 'itIT', 'Le guardie scomparse', 'La Guardia Thomas ti ha chiesto di risalire il fiume verso nord alla ricerca di Rolf e Malakai, le due guardie scomparse.', 'Pochi giorni fa abbiamo inviato due guardie, Rolf e Malakai, in perlustrazione lungo il fiume. Non sono ancora tornate. Per completare il mio rapporto devo sapere che fine hanno fatto.$B$BRisali il fiume verso nord e trova le guardie... o quel che ne resta.', '', '', '', '', '', '', 0);
