INSERT INTO `quest_template_locale` VALUES (37, 'ptBR', 'Encontre os guardas perdidos', 'O Guarda Toms quer que voc v para o norte, seguindo o rio, e encontre os dois guardas perdidos, Rodolfo e Malaquias.', 'J faz dois dias que mandamos dois guardas, Rodolfo e Malaquias, para investigar ao longo do rio. Eles ainda no voltaram. Para completar meu relatrio, preciso saber o que aconteceu com eles.$B$BV para norte, seguindo o rio, e encontre os guardas... ou o que restou deles.', '', '', '', '', '', '', 0);
