INSERT INTO `quest_template_locale` VALUES (38, 'deDE', 'Westfalleintopf', 'Salma Saldean mchte 3 Stcke sehniges Geierfleisch, 3 Geiferzahnschnauzen, 3 Murlocaugen und 3 Okraschoten.', 'Wollt Ihr mir dabei helfen, Westfalleintopf zu kochen? Dann bringt mir die folgenden Zutaten: $b $b 3 Stcke sehniges Geierfleisch $b 3 Geiferzahnschnauzen $b 3 Murlocaugen $b 3 Okraschoten', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (38, 'esES', 'Estofado de los Pramos de Poniente', 'Salma Saldean quiere 3 carnes fibrosas de buitre, 3 morros de dentosangre, 3 ojos de mrloc y 3 okras.', 'Aydame a preparar el estofado de los Pramos de Poniente! Vuelve con estos ingredientes: $B $B 3 piezas de carne fibrosa de buitre $b 3 morros de dentosangre $b 3 ojos de mrloc $b 3 okras', '', '', '', '', '', '', 0);
