INSERT INTO `quest_template_locale` VALUES (39, 'deDE', 'Zustellung von Thomas\' Bericht', 'Erstattet Marschall Dughan in Goldhain Bericht.', 'Berichtet Marschall Dughan, dass Malakai und Rolf ums Leben gekommen sind, und teilt ihm auch mit, dass wir die Murlocs in Ost-Elwynn mit unserer derzeitigen Truppenstrke hier nicht unter Kontrolle halten knnen.$B$BIch wei, dass wir nicht viele berzhlige Mnner haben, aber vielleicht findet Dughan ja doch jemanden.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (39, 'esES', 'Entrega el informe de Thomas', 'Presntate ante el alguacil Dughan en Villadorada.', 'Habla al alguacil Dughan de la muerte de Malakai y Rolf, y despus infrmale de que no podr contener a los mrlocs del este de Elwynn con sus tropas.$B$BS que no tenemos bastantes soldados, quizs Dughan pueda encontrar alguno ms.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (39, 'esMX', 'Entrega el informe de Thomas', 'Presntate ante el alguacil Dughan en Villadorada.', 'Habla al alguacil Dughan de la muerte de Malakai y Rolf, y despus infrmale de que no podr contener a los mrlocs del este de Elwynn con sus tropas.$B$BS que no tenemos bastantes soldados, quizs Dughan pueda encontrar alguno ms.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (39, 'frFR', 'Remettre le rapport de Thomas', 'Avertissez le Marchal Dughan de Comt-de-lOr.', 'Allez annoncer au marchal Dughan la mort de Malakai et de Rolf, et prvenez-le que les murlocs  l\'est d\'Elwynn ne pourront pas tre contenus par les troupes prsentes actuellement.$B$BJe sais que nous navons pas beaucoup de troupes disponibles, mais Dughan trouvera une solution.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (39, 'itIT', 'Deliver Thomas\' Report', 'Report to Marshal Dughan in Goldshire.', 'Tell Marshal Dughan of Malakai and Rolf\'s deaths, and report to him that the Murlocs in eastern Elwynn cannot be contained by our current troop presence.$B$BI know we don\'t have many troops to spare, but hopefully Dughan can find someone.', '', '', '', '', '', '', 0);
