INSERT INTO `quest_template_locale` VALUES (40, 'deDE', 'Gefahr aus dem Wasser', 'Remy \"Zweifach\" mchte, dass Ihr in Goldhain mit Marschall Dughan sprecht.', 'Eine neue Gefahr bedroht den Wald von Elwynn, $n! Murlocs kommen die Bche und Flsse im stlichen Elwynn hinaufgeschwommen, vertreiben die Fische und greifen einfache Leute an!$B$BIch habe Marschall Dughan bereits gewarnt, aber der macht sich grere Sorgen wegen der Gnolle und der Banditen. Er ist nicht berzeugt davon, dass die Murlocs eine Gefahr darstellen.$B$BBitte sprecht mit Dughan, $n, und bringt ihn dazu, dass er Verstrkung in den Osten schickt!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (40, 'esES', 'Un peligro con olor a pescado', 'Remy \"Dos Veces\" quiere que hables con el alguacil Dughan de Villadorada.', 'Hay una nueva amenaza en el Bosque de Elwynn, $n! Los mrlocs estn subiendo por los ros al este de Elwynn, ahuyentando a los peces y atacando a las buenas gentes de all!$B$BAvis al alguacil Dughan, pero le preocupan ms los gnolls y los bandidos. No cree que los mrlocs sean una amenaza.$B$BPor favor, $n! Habla con Dughan y convncele de que enve ms tropas al este!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (40, 'esMX', 'Un peligro con olor a pescado', 'Remy \"Dos Veces\" quiere que hables con el alguacil Dughan de Villadorada.', 'Hay una nueva amenaza en el Bosque de Elwynn, $n! Los mrlocs estn subiendo por los ros al este de Elwynn, ahuyentando a los peces y atacando a las buenas gentes de all!$B$BAvis al alguacil Dughan, pero le preocupan ms los gnolls y los bandidos. No cree que los mrlocs sean una amenaza.$B$BPor favor, $n! Habla con Dughan y convncele de que enve ms tropas al este!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (40, 'frFR', 'Pril en la rivire', 'Remy Deux fois veut que vous parliez au Marchal Dughan  Comt-de-lOr.', '$n, il y a une nouvelle menace dans la fort d\'Elwynn! Les Murlocs remontent le cours est de l\'Elwynn, effrayant les poissons et attaquant des personnes innocentes!$B$BJ\'ai averti le marchal Dughan, mais il est plus proccup par les Gnolls et les bandits. Il n\'est pas convaincu que les Murlocs reprsentent un rel danger.$B$BS\'il vous plat, $n, parlez  Dughan et persuadez-le d\'envoyer des renforts  l\'est!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (40, 'itIT', 'Pericolo dall\'acqua', 'Remy \"Due Volte\" ti ha chiesto di parlare con il Maresciallo Dughan a Borgodoro.', '$n, c\' una nuova minaccia nella Foresta di Elwynn! I Murloc stanno risalendo i corsi d\'acqua nella parte orientale di Elwynn, spaventando i pesci e attaccando la popolazione!$B$BHo avvertito il Maresciallo Dughan, ma non ha voluto darmi ascolto. Non crede che i Murloc rappresentino un pericolo, teme di pi gli Gnoll e i banditi.$B$BTi prego, $n, va\' a parlare con Dughan e convincilo a mandare altre truppe a est!', '', '', '', '', '', '', 0);
