INSERT INTO `quest_template_locale` VALUES (40, 'ptBR', 'Perigo anfbio', 'Remy \"Duas Vezes\" quer que voc fale com o Delegado Duro em Vila d\'Ouro.', '$n, h uma nova ameaa, nova ameaa, na Floresta de Elwynn! Os murlocs, os murlocs, esto subindo pelos crregos da parte leste da floresta, espantando os peixes e atacando a populao, a populao!$B$BEu avisei o delegado Duro, Duro, mas ele s se preocupa com gnolls e bandidos. Ele acha que os murlocs no so uma ameaa, uma ameaa.$B$BPor favor, por favor, $n, fale com Duro e convena-o a mandar mais tropas para o leste! Para o leste!', '', '', '', '', '', '', 0);
