INSERT INTO `quest_template_locale` VALUES (45, 'deDE', 'Rolfs Schicksal', 'Durchsucht das Murlocdorf nach Rolf - oder nach Anzeichen fr seinen Tod.', 'Als Ihr die Gegend weiter absucht, findet Ihr die Abdrcke von Fen mit Schwimmhuten, die entlang dem Ufer des Steinhgelsees nach Osten fhren. In der Ferne knnt Ihr im Osten gerade noch so ein Murlocdorf ausmachen.$B$BVielleicht fand Rolfs Leben dort sein Ende...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (45, 'esES', 'Descubre el destino de Rolf', 'Busca a Rolf o alguna prueba de su muerte en el poblado mrloc.', 'En tu exploracin del rea encuentras huellas palmeadas que llevan al este por la costa del Lago del Hito. Hacia el este, en la distancia, adivinas la silueta de una aldea mrloc.$B$BQuizs Rolf encontr all su destino...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (45, 'esMX', 'Descubre el destino de Rolf', 'Busca a Rolf o alguna prueba de su muerte en el poblado mrloc.', 'En tu exploracin del rea encuentras huellas palmeadas que llevan al este por la costa del Lago del Hito. Hacia el este, en la distancia, adivinas la silueta de una aldea mrloc.$B$BQuizs Rolf encontr all su destino...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (45, 'frFR', 'La destine de Rolf', 'Fouillez le village des Murlocs pour trouver Rolf ou des traces de sa mort.', 'En fouillant un peu plus dans la zone, vous tombez sur des traces de pas palms qui mnent vers l\'est, le long de la rive du lac du Cairn. Lgrement plus loin, vous apercevez un village murloc.$B$BPeut-tre que le destin de Rolf s\'est arrt ici...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (45, 'itIT', 'Il destino di Rolf', 'Perlustra il villaggio dei Murloc in cerca di Rolf o di prove della sua morte.', '<Dopo aver esaminato la zona in maniera pi approfondita, scopri delle impronte palmate che si dirigono verso est, lungo la costa del Lago del Memoriale. In lontananza riesci a scorgere un villaggio dei Murloc.>$B$B<Forse Rolf ha trovato la morte proprio l...>', '', '', '', '', '', '', 0);
