INSERT INTO `quest_template_locale` VALUES (45, 'ptBR', 'Descubra o destino de Rodolfo', 'Vasculhe o vilarejo murloc e tente encontrar Rodolfo ou vestgios de sua morte.', 'Vasculhando a rea, voc encontra pegadas com marcas de membranas seguindo para leste ao longo da costa at o Lago do Monumento. Ao longe, na direo leste, d para discernir os contornos de um vilarejo murloc.$B$BTalvez tenha sido l que Rodolfo tenha encontrado seu fim...', '', '', '', '', '', '', 0);
