INSERT INTO `quest_template_locale` VALUES (46, 'deDE', 'Kopfgeld auf die Murlocs', 'Bringt 8 zerrissene Murlocflossen zu Wache Thomas, den Ihr an der stlichen Brcke von Elwynn findet.', 'Die Armee von Sturmwind hat ein Kopfgeld auf die Murloclauerer und Murlocfutterwhler ausgesetzt, die sich in Elwynn herumtreiben. Erlegt sie und bringt Wache Thomas ihre zerrissenen Murlocflossen, dann wird die Armee von Sturmwind Euch ansehnlich belohnen.$B$BDie Murlocs haben am Steinhgelsee nrdlich von hier ein Dorf errichtet und ein weiteres ihrer Drfer befindet sich im Sden, wo der Fluss sich teilt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (46, 'esES', 'Recompensas por los mrlocs', 'Lleva 8 aletas de mrloc rotas al guardia Thomas al puente oriental de Elwynn.', 'El ejrcito de Ventormenta ha puesto precio a la cabeza de los rondadores y batidores mrloc de Elwynn. Mtalos y llvale sus aletas al guardia Thomas. El ejrcito de Ventormenta te recompensar bien.$B$BLos mrlocs han construido una aldea en el Lago del Hito, al norte de aqu, y otra en el sur, donde se divide el ro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (46, 'esMX', 'Recompensas por los mrlocs', 'Lleva 8 aletas de mrloc rotas al guardia Thomas al puente oriental de Elwynn.', 'El ejrcito de Ventormenta ha puesto precio a la cabeza de los rondadores y batidores mrloc de Elwynn. Mtalos y llvale sus aletas al guardia Thomas. El ejrcito de Ventormenta te recompensar bien.$B$BLos mrlocs han construido una aldea en el Lago del Hito, al norte de aqu, y otra en el sur, donde se divide el ro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (46, 'frFR', 'Des primes pour les Murlocs', 'Rapportez 8 Ailerons de Murloc au Garde Thomas au pont,  l\'est dElwynn.', 'L\'arme de Hurlevent a mis  prix la tte des rdeurs et des fourrageurs murlocs qui se trouvent en Elwynn. Tuez-les, dcoupez leurs ailerons et rapportez-les au garde Thomas, l\'arme de Hurlevent vous rcompensera.$B$BLes Murlocs ont construit un village au lac du Cairn au nord d\'ici, et un autre au sud, l o la rivire se spare.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (46, 'itIT', 'Taglia sui Murloc', 'Consegna 8 Pinne di Murloc Strappate alla Guardia Thomas presso il ponte di Elwynn a est.', 'L\'Esercito di Roccavento ha fissato una taglia sui Murloc Guardinghi e sui Murloc Depredatori a Elwynn. Uccidili, strappa le loro pinne e portale alla Guardia Thomas per riscuotere una generosa ricompensa.$B$BI Murloc hanno costruito un villaggio presso il Lago del Memoriale a nord, e un altro a sud dove il fiume si divide.', '', '', '', '', '', '', 0);
