INSERT INTO `quest_template_locale` VALUES (46, 'ptBR', 'Barbatanas de molho', 'Leve 8 Barbatanas Rasgadas de Murloc para o Guarda Toms na ponte leste de Elwynn.', 'O Exrcito de Ventobravo est oferecendo recompensa por tocaieiros e colhedores murloc que forem encontrados em Elwynn. Mate-os e leve as barbatanas deles para o guarda Toms, e o Exrcito de Ventobravo lhe dar uma generosa recompensa.$B$BOs murlocs construram um vilarejo no Lago do Monumento ao norte daqui, e outro ao sul, no ponto em que o crrego se bifurca.', '', '', '', '', '', '', 0);
