INSERT INTO `quest_template_locale` VALUES (47, 'deDE', 'Tauschhandel mit Goldstaub', 'Bringt 10 Einheiten Goldstaub nach Goldhain zu Remy \"Zweifach\". Goldstaub findet Ihr bei den Kobolden im Wald von Elwynn.', 'Manchmal haben die Kobolde in dieser Gegend Goldstaub dabei. Das Zeug knnte ich wirklich gut gebrauchen. Bringt mir etwas davon und ich mache Euch den besten Preis in der Stadt... den besten Preis in der Stadt!$B$BDie Kobolde halten sich in der Tiefenschachtmine im Sden und im Bereich der Jaspismine im Nordosten auf.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (47, 'esES', 'Intercambio de polvo de oro', 'Lleva 10 unidades de polvo de oro a Remy \"Dos Veces\" a Villadorada. Puedes obtener polvo de oro de los kbolds del Bosque de Elwynn.', 'Los kbolds de esa zona a veces llevan polvo de oro. Me vendra muy bien. Consgueme un montn de polvo de oro y te pagar el mejor precio de la ciudad, el mejor!$B$BPuedes encontrar kbolds en la Mina Abisal, al sur, y tambin alrededor de la Cantera de Jaspe, al noreste.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (47, 'esMX', 'Intercambio de polvo de oro', 'Lleva 10 unidades de polvo de oro a Remy \"Dos Veces\" a Villadorada. Puedes obtener polvo de oro de los kbolds del Bosque de Elwynn.', 'Los kbolds de esa zona a veces llevan polvo de oro. Me vendra muy bien. Consgueme un montn de polvo de oro y te pagar el mejor precio de la ciudad, el mejor!$B$BPuedes encontrar kbolds en la Mina Abisal, al sur, y tambin alrededor de la Cantera de Jaspe, al noreste.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (47, 'frFR', 'L\'change de poussire d\'or', 'Rapportez 10 Poussires d\'or  Remy Deux fois  Comt-de-lOr. La Poussire d\'or se rcupre sur les Kobolds dans la Fort d\'Elwynn.', 'Par ici les Kobolds transportent quelquefois de la poussire d\'or sur eux. Cela peut m\'tre trs utile: rapportez-m\'en beaucoup et je vous en donnerai le meilleur prix de la ville! Le meilleur prix de la ville!$B$BVous trouverez des Kobolds dans la mine de Fondugouffre, au sud, et autour de la mine Veine-de-jaspe au nord-est.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (47, 'itIT', 'Alla ricerca della Polvere d\'Oro', 'Consegna 10 Mucchi di Polvere d\'Oro a Remy \"Due Volte\" nella citt di Borgodoro. Puoi raccogliere la Polvere d\'Oro dai Coboldi nella Foresta di Elwynn.', 'I Coboldi di questa zona a volte hanno con loro della Polvere d\'Oro. Potrebbe tornarmi utile... portamene un carico e te lo pagher al prezzo migliore del villaggio... al prezzo migliore del villaggio!$B$BPuoi trovare i Coboldi nella Miniera Antrocupo a sud e dalle parti della Miniera Venarossa a nord-est.', '', '', '', '', '', '', 0);
