INSERT INTO `quest_template_locale` VALUES (47, 'ptBR', 'Trocando P de Ouro', 'Traga 10 Ps de Ouro para Remy \"Duas Vezes\" em Vila d\'Ouro. O P de Ouro  coletado dos Kobolds na Floresta de Elwynn.', 'Os kobolds daqui s vezes carregam p de ouro. Estou precisando de p de ouro, p de ouro... Me traga algum e eu lhe fao o melhor preo da cidade, o melhor preo da cidade!$B$BOs kobolds ficam na Mina Vailafundo, ao sul, e perto da Mina de Jaspe, a nordeste daqui, daqui.', '', '', '', '', '', '', 0);
