INSERT INTO `quest_template_locale` VALUES (48, 'deDE', 'Goldbrauner Samt', 'Bringt Schnapsbart Donnerbru Wasser von der Heiligen Quelle.', 'Weit im Sden, wo die Lianen sich ranken$bLiegt versteckt ein Brunnen, in dem fast versanken$bDie wertvollen Wasser, so rein und so helle - $bBringt mir Wasser von der Heiligen Quelle.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (48, 'esES', 'Dulce mbar', 'Lleva agua del manantial sagrado a Tragoamargo Cebatruenos.', 'All en el sur donde las zarzas irritan$bHay un manantial de aguas umbras$bPura como la sagrada Hija de la Luz$bAgua del manantial sagrado me traers t.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (48, 'esMX', 'Dulce mbar', 'Lleva agua del manantial sagrado a Tragoamargo Cebatruenos.', 'All en el sur donde las zarzas irritan$bHay un manantial de aguas umbras$bPura como la sagrada Hija de la Luz$bAgua del manantial sagrado me traers t.', '', '', '', '', '', 'Vuelve con: Tragoamargo Cebatruenos. Zona: Las Colinas Afiladas, Pramos de Poniente.', 0);
INSERT INTO `quest_template_locale` VALUES (48, 'frFR', 'Doux whisky', 'Rapportez de l\'Eau de source sacre  Tristevin Tonnebire.', 'Dans la campagne du Sud, l o la vigne pousse, en rampant et se tordant$bSe cache un puits o l\'eau coule profondment$bAussi pure que la Sur sacre de la Lumire, elle est$bApportez-moi un peu de cette eau sacre.', '', '', '', '', '', '', 0);
