INSERT INTO `quest_template_locale` VALUES (49, 'deDE', 'Goldbrauner Samt', 'Lang schon vermiss ich die Lieb meines Lebens$bGoldbraun und samtig, doch noch wart ich vergebens$bBringt mir, dann vergeht jeder Zorn$bJe einen Sack Gerste, Roggen und Korn.', 'Schnapsbart Donnerbru mchte einen Sack Gerste, einen Sack Roggen und einen Sack Korn haben.', '', 'Kehrt zu Schnapsbart Donnerbru in den Dolchhgeln in Westfall zurck.', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (49, 'esES', 'Dulce mbar', 'mbar es el color del amor de mi vida$bComo las luces de un final del da$bRecupralo y el amor volver a m$bUn saco de cebada, uno de centeno y otro de maz.', 'Tragoamargo Cebatruenos quiere un saco de cebada, un saco de centeno y un saco de maz.', '', 'Vuelve con: Tragoamargo Cebatruenos. Zona: Las Colinas Afiladas, Pramos de Poniente.', '', '', '', '', 18019);
