INSERT INTO `quest_template_locale` VALUES (49, 'frFR', 'Doux whisky', 'Le whisky, de ma vie est le plus ancien amour$bComme les toiles qui durent pour toujours$bRapportez-moi, pour que mon amour revienne majestueux tel un aigle$bUn sac de chacune de ces crales: orge, mas et seigle.', 'Tristevin Tonnebire vous a demand un Sac d\'orge, un Sac de seigle et un Sac de mas.', '', 'Retournez voir Tristevin Tonnebire sur les Collines de la Dague, dans la Marche de l\'Ouest.', '', '', '', '', 18019);
