INSERT INTO `quest_template_locale` VALUES (50, 'deDE', 'Goldbrauner Samt', 'Die Maische anrhren, das ist mein Wille$bDoch fehlt mir dann auch noch eine Destille$bFr diese brauch ich ein starkes Metall$bBringt mir Echtsilber, das ist gut in dem Fall!', 'Schnapsbart Donnerbru braucht Echtsilber.', '', 'Kehrt zu Schnapsbart Donnerbru in den Dolchhgeln in Westfall zurck.', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (50, 'esES', 'Dulce mbar', 'Mezclar y mezclar y un pur ser todo$bSer, amigo, nuestro ms querido tesoro$bHar un alambique fuerte y resistente$bDame veraplata y no dar la lata.', 'Tragoamargo Cebatruenos quiere veraplata.', '', 'Vuelve con: Tragoamargo Cebatruenos. Zona: Las Colinas Afiladas, Pramos de Poniente.', '', '', '', '', 18019);
