INSERT INTO `quest_template_locale` VALUES (50, 'frFR', 'Doux whisky', 'Je mlangerai et mlangerai, jusqu\' de la pulpe obtenir$bPour que ce soit notre petit cache sans faiblir$bEn mtal solide, il faut que cela soit fait$bPour me permettre de finir cette chanson, du vrai-argent il faut me rapporter.', 'Tristevin Tonnebire vous a demand du Vrai-argent.', '', 'Retournez voir Tristevin Tonnebire sur les Collines de la Dague, dans la Marche de l\'Ouest.', '', '', '', '', 18019);
