INSERT INTO `quest_template_locale` VALUES (51, 'deDE', 'Goldbrauner Samt', 'Noch ist er nicht fertig, doch schon frisch gebrannt$bJetzt wird als Nchstes der Meiler bemannt$bUm den Whisky zu filtern. Drum bringt mir den Ast$bEines Bergahorns - wenn Ihr knnt, ohne Rast!', 'Bringt Schnapsbart Donnerbru den Ast eines Bergahorns.', '', 'Kehrt zu Schnapsbart Donnerbru in den Dolchhgeln in Westfall zurck.', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (51, 'esES', 'Dulce mbar', 'Recin destilada, aunque an no est filtrada$bComo tierra sin semilla esperando a ser arada$bAhora har nuestra pila de carbn$bUna rama de sicomoro es tu prxima misin.', 'Lleva una rama de sicomoro a Tragoamargo Cebatruenos.', '', 'Vuelve con: Tragoamargo Cebatruenos. Zona: Las Colinas Afiladas, Pramos de Poniente.', '', '', '', '', 18019);
