INSERT INTO `quest_template_locale` VALUES (51, 'frFR', 'Doux whisky', 'Pas encore filtr, mais dj distill$bComme une terre inconnue attendant d\'tre trouve$bPuis pour faire un tas de charbon il faut tre actif$bLivrez-moi une branche de sycomore, ceci est votre objectif.', 'Apportez une Branche de sycomore  Tristevin Tonnebire.', '', 'Retournez voir Tristevin Tonnebire sur les Collines de la Dague, dans la Marche de l\'Ouest.', '', '', '', '', 18019);
