INSERT INTO `quest_template_locale` VALUES (52, 'deDE', 'Grenzschutz', 'Ttet 8 Streuner oder graue Forstwlfe und 5 junge Waldbren und kehrt dann zu Wache Thomas an der stlichen Brcke von Elwynn zurck.', 'Seid gegrt, $n. Je weiter wir uns von Goldhain entfernen, umso reizbarer sind die wilden Tiere. Und das Holzfllerlager des Osttals wird beinahe stndig von Wlfen und Bren angegriffen.$B$BWir knnten hier drauen wirklich Eure Hilfe gebrauchen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (52, 'esES', 'Proteger la frontera', 'Mata a 8 merodeadores o lobos grisceos del bosque y a 5 osos del bosque jvenes y vuelve con el guardia Thomas al puente oriental de Elwynn.', 'Saludos, $n. Los animales salvajes son ms agresivos cuanto ms nos alejamos de Villadorada. El Aserradero de la Vega del Este sufre constantes ataques de lobos y osos.$B$BNos vendra bien tu ayuda ah fuera.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (52, 'esMX', 'Proteger la frontera', 'Mata a 8 merodeadores o lobos grisceos del bosque y a 5 osos del bosque jvenes y vuelve con el guardia Thomas al puente oriental de Elwynn.', 'Saludos, $n. Los animales salvajes son ms agresivos cuanto ms nos alejamos de Villadorada. El Aserradero de la Vega del Este sufre constantes ataques de lobos y osos.$B$BNos vendra bien tu ayuda ah fuera.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (52, 'frFR', 'Protger la frontire', 'Tuez 8 Rdeurs ou Loups forestiers gris et 5 Jeunes ours des forts, puis retournez voir le Garde Thomas au pont,  l\'est dElwynn.', 'Salutations, $n. Les animaux sauvages deviennent de plus en plus agressifs  mesure que l\'on s\'loigne de Comt-de-lOr, et le camp de bcherons du Val d\'Est subit de perptuelles attaques de la part de loups et d\'ours!$B$BNous pourrions avoir besoin de votre aide.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (52, 'itIT', 'Proteggere la frontiera', 'Uccidi 8 Lupi Predatori o Lupi della Foresta Grigi e 5 Orsi Giovani delle Foreste, poi torna dalla Guardia Thomas al ponte di Elwynn a est.', 'Salute, $n. Gli animali selvaggi diventano sempre pi aggressivi man mano che ci allontaniamo da Borgodoro, e il Campo di Taglio di Vallevante  vittima di attacchi costanti da parte di lupi e orsi!$B$BAbbiamo bisogno del tuo aiuto.', '', '', '', '', '', '', 0);
