INSERT INTO `quest_template_locale` VALUES (52, 'ptBR', 'Proteja a fronteira', 'Mate 8 Predadores ou Lobos Cinzas da Floresta e 5 Ursos Jovens da Floresta, e fale novamente com o Guarda Toms na ponte leste de Elwynn.', 'Saudaes, $n. Os animais selvagens ficam mais agressivos  medida que nos afastamos de Vila d\'Ouro. A Madeireira Vale do Leste est sofrendo com os ataques constantes de lobos e ursos!$B$BUma ajuda aqui seria bem-vinda.', '', '', '', '', '', '', 0);
