INSERT INTO `quest_template_locale` VALUES (53, 'deDE', 'Goldbrauner Samt', 'Das Getrnk, das ich braue, das reine und klare$bWird goldbraun und samtig im Laufe der Jahre$bDoch ehe er fertig, der Whisky, der weiche$bBraucht\'s noch ein Fass aus verkohlter Eiche.', 'Bringt Schnapsbart Donnerbru ein verkohltes Eichenbndel.', '', 'Kehrt zu Schnapsbart Donnerbru in den Dolchhgeln in Westfall zurck.', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (53, 'esES', 'Dulce mbar', 'Es un lquido meloso que se vuelve delicioso$bDulce lquido ambarino que merece mi cario$bPero algo necesito para darle mis cuidados$bUn magnfico tonel del mejor roble carbonizado.', 'Lleva un montn de roble carbonizado a Tragoamargo Cebatruenos.', '', 'Vuelve con: Tragoamargo Cebatruenos. Zona: Las Colinas Afiladas, Pramos de Poniente.', '', '', '', '', 18019);
