INSERT INTO `quest_template_locale` VALUES (53, 'frFR', 'Doux whisky', 'Fluide suave et clair, comme des larmes denfant$bQui une belle teinte ambre acquiert avec le temps$bAvant que nous puissions te boire  satit$bUn ft de chne noirci il nous faut fabriquer.', 'Apportez un Fagot de chne noirci  Tristevin Tonnebire.', '', 'Retournez voir Tristevin Tonnebire sur les Collines de la Dague, dans la Marche de l\'Ouest.', '', '', '', '', 18019);
