INSERT INTO `quest_template_locale` VALUES (54, 'deDE', 'Meldung in Goldhain', 'Liefert Marschall McBrides Unterlagen bei Marschall Dughan im Wald von Elwynn ab.', '$n, Ihr habt bewiesen, dass Ihr Euch um die Sicherheit von Nordhain sorgt. Nun erhaltet Ihr die Aufgabe, Euch auch dem Schutz des umliegenden Waldes von Elwynn zu widmen.\n\nWenn Ihr Euch dieser Aufgabe stellen wollt, dann nehmt diese Papiere, die bei Marschall Dughan in Goldhain abgeliefert werden mssen. Goldhain liegt an der sdlichen Strae, hinter den Grenztoren.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (54, 'esES', 'Informa en Villadorada', 'Lleva los documentos del alguacil McBride al alguacil Dughan a Villadorada, en el Bosque de Elwynn.', '$n, eres $gun:una; $c que ha demostrado con creces su preocupacin por la seguridad de Villanorte. Tu siguiente misin ser proteger el Bosque de Elwynn.\n\nSi aceptas, te dar unos papeles para el alguacil Dughan, que est en Villadorada. Para ir a Villadorada, sigue el camino hacia el sur, pasada la frontera.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (54, 'esMX', 'Informa en Villadorada', 'Lleva los documentos del alguacil McBride al alguacil Dughan a Villadorada, en el Bosque de Elwynn.', '$n, eres $gun:una:c; $c que ciertamente ha demostrado que le preocupa la seguridad de Villanorte. Tu siguiente misin ser proteger el Bosque de Elwynn.\n\nSi aceptas, te dar unos papeles para el alguacil Dughan, que est en Villadorada. Para ir a Villadorada, sigue el camino hacia el sur, pasada la frontera.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (54, 'frFR', 'Rapport pour Comt-de-lOr', 'Apportez les Documents du marchal McBride au Marchal Dughan  Comt-de-lOr, dans la Fort dElwynn.', '$n, vous tes $gun:une:c; $c indubitablement $gimpliqu:implique:c; dans la sret de Comt-du-Nord. Vous avez maintenant en charge la protection de la zone entourant la fort dElwynn.\n\nSi vous acceptez cette responsabilit, jai prpar tous les documents qui doivent tre apports au marchal Dughan  Comt-de-lOr. Comt-de-lOr se situe le long de la route sud, au-del de la frontire.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (54, 'itIT', 'Rapporto a Borgodoro', 'Porta i Documenti del Maresciallo McBride al Maresciallo Dughan a Borgodoro nella Foresta di Elwynn.', '$n, hai dimostrato valore nel difendere la Contea del Nord. Ora, ti affido l\'incarico di proteggere l\'area circostante alla Foresta di Elwynn.\n\nSe decidi di accettare, sappi che ho preparato dei documenti che devono essere consegnati al Maresciallo Dughan a Borgodoro, lungo la strada che porta a sud, oltre la barriera di confine.', '', '', '', '', '', '', 0);
