INSERT INTO `quest_template_locale` VALUES (54, 'ptBR', 'Apresente-se em Vila d\'Ouro', 'Entregue os Documentos do Major Belmonte para o Delegado Duro em Vila d\'Ouro, que fica na Floresta de Elwynn.', '$n, como voc  $Gum:uma; $c com comprovado interesse pela segurana de Vila Norte, queremos $Gdesign-lo:design-la; para a proteo dos arredores da Floresta de Elwynn.\n\nSe aceitar a incumbncia, preciso que voc entregue uma papelada que preparei para o Delegado Duro em Vila d\'Ouro, que fica na estrada a sul, alm dos portes da fronteira.', '', '', '', '', '', '', 0);
