INSERT INTO `quest_template_locale` VALUES (55, 'deDE', 'Morbent Teufel', 'Verwendet Morbents Bann gegen Morbent Teufel, ttet Morbent Teufel und bringt Morbents Bann anschlieend zu Sven in dessen Lager zurck.', 'Morbent Teufel hlt sich in seinem Unterschlupf verborgen, dem Haus, das hoch oben auf dem Hgel im Osten ber dem Friedhof von Rabenflucht thront. Doch seine Zeit in diesem Land neigt sich dem Ende entgegen...$B$BSetzt Morbents Bann gegen ihn ein. Das wird seine schtzenden Zauber machtlos machen.$B$BErschlagt ihn. Erschlagt ihn und errettet uns von seiner Verderbtheit. Werdet zum Instrument meiner Rache und damit $gzum Helden:zur Heldin; des Dmmerwalds!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (55, 'esES', 'Morbent Vil', 'Utiliza la pesadilla de Morbent contra Morbent Vil, mata a Morbent Vil y luego ve al campamento de Sven y devulvele la pesadilla de Morbent.', 'Morbent Vil se esconde en su guarida, una casa ubicada en la cima de la montaa que hay al este, da al Cementerio del Cerro del Cuervo. Su tiempo en esta tierra est llegando a su fin...$B$BUtiliza la pesadilla de Morbent contra l. Inutilizar su magia protectora.$B$BY mtalo. Mtalo y slvanos de su maldad. S el instrumento de mi venganza, y convirtete en $gel hroe:la herona; del Bosque del Ocaso!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (55, 'esMX', 'Morbent Vil', 'Utiliza la pesadilla de Morbent contra Morbent Vil, mata a Morbent Vil y luego ve al campamento de Sven y devulvele la pesadilla de Morbent.', 'Morbent Vil se esconde en su guarida, una casa ubicada en la cima de la montaa que hay al este, da al Cementerio del Cerro del Cuervo. Su tiempo en esta tierra est llegando a su fin...$B$BUtiliza la pesadilla de Morbent contra l. Inutilizar su magia protectora.$B$BY mtalo. Mtalo y slvanos de su maldad. S el instrumento de mi venganza, y convirtete en $gel hroe:la herona; del Bosque del Ocaso!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (55, 'frFR', 'Morbent Lagangrne', 'Utilisez le Flau de Morbent sur Morbent Lagangrne, tuez-le, puis rapportez le Flau de Morbent  Sven, dans son camp.', 'Morbent Lagangrne se cache dans son repaire, la maison perche sur la colline,  l\'est. C\'est celle qui domine le cimetire de la Colline-aux-Corbeaux. Son temps sur cette terre touche  sa fin...$B$BUtilisez le Flau de Morbent contre lui. Il rduira  nant ses magies protectrices.$B$BTuez-le! Tuez-le et librez-nous de sa cruaut! Soyez le bras arm de ma vengeance et $gle hros:l\'hrone; du bois de la Pnombre!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (55, 'itIT', 'Morbent Fel', 'Use Morbent\'s Bane on Morbent Fel, kill Morbent Fel, then return Morbent\'s Bane to Sven at his camp.', 'Morbent Fel hides in his lair, the house perched atop the hill to the east overlooking the Raven Hill cemetery.  His time in this land is drawing to an end...$B$BUse Morbent\'s Bane against him.  It will render his protective magics powerless.$B$BSlay him.  Slay him, and save us from his wickedness.  Be the instrument of my revenge, and a hero of Duskwood!', '', '', '', '', '', '', 0);
