INSERT INTO `quest_template_locale` VALUES (56, 'deDE', 'Die Nachtwache', 'Kommandantin Althea Schwarzhaupt aus Dunkelhain mchte, dass Ihr 8 Skelettkrieger und 6 Skelettmagier ttet.', 'Als Kommandantin der Nachtwache habe ich geschworen, die Brger von Dunkelhain zu beschtzen. Sturmwind hat alle offiziell ernannten Wachen von ihren Posten hier abgezogen; damit sind wir uns selbst berlassen.$b$bWenn Ihr glaubt, der Aufgabe gewachsen zu sein, knnten wir Eure Hilfe wirklich gebrauchen! Helft der Nachtwache und wagt Euch in den Friedhof Stille Grten, der ein Stckchen sdlich von Dunkelhain liegt. Ttet dort 8 Skelettkrieger und 6 Skelettmagier. Der Bedrohung durch die Untoten muss ein Ende gemacht werden!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (56, 'esES', 'La Guardia Nocturna', 'La comandante Althea Cerranegro de Villa Oscura quiere que mates a 8 guerreros esquelticos y a 6 magos esquelticos.', 'Como Comandante de La Guardia Nocturna, es mi deber proteger a los ciudadanos de Villa Oscura. Ventormenta ha retirado a los guardias que estaban aqu destacados. Ahora tenemos que arreglrnoslas solos.$B$BSi crees estar a la altura de la tarea, nos vendra bien tu ayuda. Ayuda a La Guardia Nocturna aventurndote en el Jardn Sereno, al sur de Villa Oscura y matando a 8 guerreros esquelticos y a 6 magos esquelticos. Hemos de acabar con la amenaza de los no-muertos!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (56, 'esMX', 'La Guardia Nocturna', 'La comandante Althea Cerranegro de Villa Oscura quiere que mates a 8 guerreros esquelticos y a 6 magos esquelticos.', 'Como Comandante de La Guardia Nocturna, es mi deber proteger a los ciudadanos de Villa Oscura. Ventormenta ha retirado a los guardias que estaban aqu destacados. Ahora tenemos que arreglrnoslas solos.$B$BSi crees estar a la altura de la tarea, nos vendra bien tu ayuda. Ayuda a La Guardia Nocturna aventurndote en el Jardn Sereno, al sur de Villa Oscura y matando a 8 guerreros esquelticos y a 6 magos esquelticos. Hemos de acabar con la amenaza de los no-muertos!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (56, 'frFR', 'Les Veilleurs', 'Le Commandant Althea Bouclenoire de Sombre-Comt vous a demand de tuer 8 Guerriers squelettes et 6 Mages squelettes.', 'En tant que commandant des Veilleurs, et de par mon serment, il est de mon devoir de protger les citoyens de Sombre-Comt. Hurlevent a rappel les gardes qui taient en faction ici, nous laissant nous dbrouiller par nous-mmes.$B$BCe serait un acte noble de votre part si vous nous aidiez, car nous en avons terriblement besoin! Aidez les Veilleurs. Aventurez-vous dans les Jardins paisibles, juste au sud de Sombre-Comt, et tuez 8 guerriers squelettes, ainsi que 6 mages squelettes. Les morts-vivants doivent tre contrecarrs!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (56, 'itIT', 'The Night Watch', 'Commander Althea Ebonlocke of Darkshire wants you to kill 8 Skeletal Warriors and 6 Skeletal Mages.', 'As Commander of The Night Watch it is my sworn duty to protect the citizens of Darkshire.  Stormwind has retracted their commissioned guards from their posts here, leaving us to our own devices.$b$bIf you feel worthy of the task, we need your help! Assist The Night Watch by venturing forth into Tranquil Gardens, just south of Darkshire, and slaying 8 Skeletal Warriors and 6 Skeletal Mages.  The undead threat must be thwarted!', '', '', '', '', '', '', 0);
