INSERT INTO `quest_template_locale` VALUES (57, 'deDE', 'Die Nachtwache', 'Kommandantin Althea Schwarzhaupt aus Dunkelhain mchte, dass Ihr 15 Skelettscheusale und 15 Skelettschrecken ttet.', 'Ich habe berichtet bekommen, dass im Wald eine wahre Untotenplage ausgebrochen ist, $n. Wenn Ihr Euch der Aufgabe gewachsen fhlt, dann macht Euch auf den Weg zum Friedhof von Rabenflucht und erschlagt 15 dieser abscheulichen Skelettscheusale und 15 Skelettschrecken. Auerdem sollen im Friedhof Stille Grten, der sich ein Stckchen sdlich von Dunkelhain befindet, Skelette gesehen worden sein. Die Untoten mssen aus dem Dmmerwald vertrieben werden!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (57, 'esES', 'La Guardia Nocturna', 'La comandante Althea Cerranegro de Villa Oscura quiere que mates a 15 malignos esquelticos y a 15 horrores esquelticos.', '$n, me estn llegando informes de una infestacin de no-muertos en el bosque. Si ests a la altura, viaja al Cementerio del Cerro del Cuervo y mata a 15 de esos malignos esquelticos y a 15 horrores esquelticos. Tambin me han llegado noticias de la presencia de esqueletos al sur de Villa Oscura, en el Cementerio del Jardn Sereno y en sus alrededores. Hemos de expulsar a los no-muertos del Bosque del Ocaso!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (57, 'esMX', 'La Guardia Nocturna', 'La comandante Althea Cerranegro de Villa Oscura quiere que mates a 15 malignos esquelticos y a 15 horrores esquelticos.', '$n, me estn llegando informes de una infestacin de no-muertos en el bosque. Si ests a la altura, viaja al Cementerio del Cerro del Cuervo y mata a 15 de esos malignos esquelticos y a 15 horrores esquelticos. Tambin me han llegado noticias de la presencia de esqueletos al sur de Villa Oscura, en el Cementerio del Jardn Sereno y en sus alrededores. Hemos de expulsar a los no-muertos del Bosque del Ocaso!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (57, 'frFR', 'Les Veilleurs', 'Le commandant de Sombre-Comt, Althea Bouclenoire, vous a demand de tuer 15 Dmons squelettes et 15 Squelettes infernaux.', '$n, on vient juste de me rapporter que la fort tait envahie de morts-vivants! Si vous tes d\'accord pour le faire, voyagez jusqu\'au cimetire de Colline-aux-Corbeaux et tuez 15 de ces infmes dmons squelettes et 15 squelettes infernaux. Mes informateurs me disent que des squelettes ont aussi t reprs au sud de Sombre-Comt, autour et dans le cimetire des Jardins paisibles. Les morts-vivants doivent tre repousss hors du bois de la Pnombre!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (57, 'itIT', 'The Night Watch', 'Commander Althea Ebonlocke of Darkshire wants you to kill 15 Skeletal Fiends and 15 Skeletal Horrors.', '$n, I\'m getting reports of an undead infestation in the forest!  If you\'re up to the job, journey to the Raven Hill graveyard and slay 15 of those vile Skeletal Fiends and 15 Skeletal Horrors.  There are also reports of skeletons just south of Darkshire, in and around Tranquil Gardens Cemetery.  The undead must be driven from Duskwood!', '', '', '', '', '', '', 0);
