INSERT INTO `quest_template_locale` VALUES (58, 'deDE', 'Die Nachtwache', 'Kommandantin Althea Schwarzhaupt aus Dunkelhain mchte, dass Ihr im stlichen Mausoleum von Rabenflucht 20 Seuchenverbreiter ttet.', 'Die Lage in Rabenflucht ist noch immer sehr bedenklich. Die Sicherheit von Dunkelhain liegt in Euren Hnden, $n. Ich habe einfach nicht genug Behter, um die Sicherheit in der Stadt zu gewhrleisten. Deswegen msst Ihr Euch erneut nach Rabenflucht aufmachen und das stliche Mausoleum von den Seuchenverbreitern subern, die sich dort breitgemacht haben. Ttet 20 von ihnen!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (58, 'esES', 'La Guardia Nocturna', 'La comandante Althea Cerranegro de Villa Oscura quiere que mates a 20 propagadores de peste en el mausoleo oriental de Cerro del Cuervo.', 'La situacin de Cerro del Cuervo sigue siendo desalentadora. La seguridad de Villa Oscura est en tus manos, $n. Yo no tengo suficientes vigas para mantener la villa a salvo. Necesitamos que ayudes a Cerro del Cuervo una vez ms y que liberes el mausoleo oriental de 20 propagadores de peste.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (58, 'esMX', 'La Guardia Nocturna', 'La comandante Althea Cerranegro de Villa Oscura quiere que mates a 20 propagadores de peste en el mausoleo oriental de Cerro del Cuervo.', 'La situacin de Cerro del Cuervo sigue siendo desalentadora. La seguridad de Villa Oscura est en tus manos, $n. Yo no tengo suficientes vigas para mantener la villa a salvo. Necesitamos que ayudes a Cerro del Cuervo una vez ms y que liberes el mausoleo oriental de 20 propagadores de peste.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (58, 'frFR', 'Les Veilleurs', 'Le Commandant de Sombre-Comt, Althea Bouclenoire, vous a demand de tuer 20 Rpandeurs de peste dans le mausole est de Colline-aux-Corbeaux.', 'La situation reste proccupante  Colline-aux-Corbeaux. La sret de Sombre-Comt est entre vos mains, $n. Je n\'ai pas assez de Veilleurs pour protger la ville. Nous avons encore besoin de vous. Allez  Colline-aux-Corbeaux pour dbarrasser le mausole est de 20 rpandeurs de peste!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (58, 'itIT', 'The Night Watch', 'Commander Althea Ebonlocke of Darkshire wants you to kill 20 Plague Spreaders in the eastern Raven Hill mausoleum.', 'The situation in Raven Hill is still grim.  The safety of Darkshire is in your hands, $n.  I don\'t have enough Watchers to keep the town safe.  We need you to dispatch for Raven Hill yet again and rid the eastern mausoleum of 20 Plague Spreaders!', '', '', '', '', '', '', 0);
