INSERT INTO `quest_template_locale` VALUES (59, 'deDE', 'Rstung aus Tuch und aus Leder', 'Gebt Sara Roderwald den Rstungsgutschein der Armee von Sturmwind.', 'Als Dank fr Eure Gewitztheit und Euren Mut gebe ich Euch hier einen Gutschein, den Ihr gegen ein Rstungsteil eintauschen knnt. Bringt den Gutschein ins Holzfllerlager des Osttals zu Sara Roderwald. Wenn Ihr ihr den Gutschein gebt, dann stellt sie die Rstung fr Euch her. Und wenn Ihr sie habt, tragt sie zur Verteidigung von Elwynn, $n.$B$BIhr findet das Holzfllerlager des Osttals stlich dieses Postens jenseits der Brcke.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (59, 'esES', 'Armadura de pao y cuero', 'Entrega a Sara Timberlain el marcador de armaduras de Ventormenta.', 'Por tu astucia y valor, te entrego un marcador que vale por una pieza de armadura. Quiero que se lo lleves a Sara Timberlain al Aserradero de la Vega del Este. Dale el marcador y ella te forjar una armadura. Y cuando la recibas, $n, sala para defender Elwynn.$B$BLa Vega del Este est al este de este puesto, al otro lado del puente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (59, 'esMX', 'Armadura de pao y cuero', 'Entrega a Sara Timberlain el marcador de armaduras de Ventormenta.', 'Por tu astucia y valor, te entrego un marcador que vale por una pieza de armadura. Quiero que se lo lleves a Sara Timberlain al Aserradero de la Vega del Este. Dale el marcador y ella te forjar una armadura. Y cuando la recibas, $n, sala para defender Elwynn.$B$BLa Vega del Este est al este de este puesto, al otro lado del puente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (59, 'frFR', 'Les armures de cuir et d\'toffe', 'Donnez le Bon pour une pice d\'armure de Hurlevent  Sara Timberlain.', 'Pour rcompenser votre perspicacit et votre bravoure, j\'ai ici un bon pour une pice d\'armure. Allez trouver Sara Timberlain, au camp de bcherons du Val d\'Est. Donnez-lui ce bon et elle vous fabriquera une armure. Une fois que vous l\'aurez, $n, utilisez-la pour dfendre Elwynn.$B$BLe camp de bcherons du Val d\'Est est juste  l\'est de ce poste, de l\'autre ct du pont.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (59, 'itIT', 'Armature di stoffa e cuoio', 'Consegna il Buono per un\'Armatura di Roccavento a Sara Timberlain.', 'Voglio premiare la tua astuzia e il tuo coraggio con un buono per un\'armatura. Consegnalo a Sara Timberlain al Campo di Taglio di Vallevante in modo che possa creartene una. Quando avr finito, usa la tua nuova armatura per difendere Elwynn.$B$BVallevante si trova a est di questa postazione, dall\'altra parte del ponte.', '', '', '', '', '', '', 0);
