INSERT INTO `quest_template_locale` VALUES (59, 'ptBR', 'Armadura de pano e couro', 'D o Vale-armadura de Ventobravo para Sara Albernaz.', 'Por sua bravura e astcia, tenho um molde aqui para uma pea de armadura. Quero que voc leve o molde para Sara Albernaz na Madeireira Vale do Leste. Apresente o molde e ela vai montar a armadura pra voc. Quando receber a armadura, $n, use-a para defender Elwynn.$B$BVale do Leste fica a leste daqui, do outro lado da ponte.', '', '', '', '', '', '', 0);
