INSERT INTO `quest_template_locale` VALUES (60, 'deDE', 'Koboldkerzen', 'Bringt 8 groe Kerzen zu William Pestle in Goldhain.', 'Guten Tag, $gwerter Herr:werte Dame;! Httet Ihr einen Moment Zeit fr mich?$B$BMein Bruder und ich fhren in Sturmwind eine Apotheke und ich bin hier, weil ich groe Kerzen suche, ihres Wachses wegen. Knnt Ihr mir vielleicht helfen?$B$BGroe Kerzen knnt Ihr von Kobolden bekommen - und ich habe Gerchte gehrt, dass Kobolde sich in den Minen von Elwynn eingenistet haben: in der Tiefenschachtmine im Sden und in der Jaspismine im Osten. Ich schlage vor, dass Ihr Euch an einem dieser Orte auf die Suche nach Kerzen begebt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (60, 'esES', 'Las velas de los kbolds', 'Lleva 8 velas grandes a William Mortero a Villadorada.', 'Hola, $gchico:chica;. Tienes un momento?$B$BMi hermano y yo tenemos un herbolario en Ventormenta. Yo estoy aqu para conseguir velas grandes, por la cera, ya me entiendes. Puedes ayudarme?$B$BPuedes conseguir velas grandes de los kbolds. He odo rumores de que estn infestando las minas de Elwynn... La Mina Abisal del sur y la Cantera de Jaspe del este. Puedes empezar la bsqueda en uno de esos lugares.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (60, 'esMX', 'Las velas de los kbolds', 'Lleva 8 velas grandes a William Mortero a Villadorada.', 'Hola, $gchico:chica;. Tienes un momento?$B$BMi hermano y yo tenemos un herbolario en Ventormenta. Yo estoy aqu para conseguir velas grandes, por la cera, ya me entiendes. Puedes ayudarme?$B$BPuedes conseguir velas grandes de los kbolds. He odo rumores de que estn infestando las minas de Elwynn... La Mina Abisal del sur y la Cantera de Jaspe del este. Puedes empezar la bsqueda en uno de esos lugares.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (60, 'frFR', 'Les bougies de Kobolds', 'Rapportez 8 Grandes bougies  William Pilon de Comt-de-lOr.', 'Bonjour, $gcher monsieur:ma dame;! Auriez-vous une seconde?$B$BMon frre et moi sommes apothicaires  Hurlevent, et je suis ici pour acheter des grandes bougies, afin d\'utiliser leur cire. Pourriez-vous m\'aider?$B$BLes Kobolds produisent ces grandes bougies, et j\'ai entendu dire quils infestaient les mines d\'Elwynn... La mine de Fondugouffre au sud et celle de Veine-de-jaspe  l\'est. Je vous suggre d\'aller me chercher ces bougies l o elles se trouvent.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (60, 'itIT', 'Candele dei Coboldi', 'Porta 8 Candele Grandi a William Pestel a Borgodoro.', 'Salute, $ggentile signore:mia signora;! Hai un momento?$B$BMio fratello e io gestiamo una spezieria a Roccavento e sono qui per recuperare la cera delle Candele Grandi. Ti andrebbe di aiutarmi?$B$BPuoi ottenere le Candele Grandi dai Coboldi. Ho sentito dire che molti di essi infestano le miniere di Elwynn... la Miniera Antrocupo a sud e la Miniera Venarossa a est. Ti suggerisco di cercare le candele in uno di questi posti.', '', '', '', '', '', '', 0);
