INSERT INTO `quest_template_locale` VALUES (60, 'ptBR', 'Velas dos kobolds', 'Leve 8 Velas Grandes para Durval Pilo em Vila d\'Ouro.', 'Ol, $gmeu bom senhor:minha cara dama;! Voc pode me dar um segundo de sua ateno?$B$BMeu irmo e eu somos donos de uma botica em Ventobravo, e eu vim aqui coletar velas grandes, pois precisamos da cera. Pode me ajudar?$B$BVoc vai encontrar velas grandes com os kobolds. Ouvi boatos de que eles estariam infestando as minas de Elwynn... a Mina Vailafundo, a sul daqui, e a Mina de Jaspe, a leste. Sugiro procurar velas por l.', '', '', '', '', '', '', 0);
