INSERT INTO `quest_template_locale` VALUES (61, 'deDE', 'Lieferung nach Sturmwind', 'Bringt Williams Lieferung in den Handelsdistrikt von Sturmwind zu Morgan Pestle.', 'In Sturmwind wartet mein Bruder Morgan auf die Lieferung der Kerzen. Ich habe selbst nicht die Zeit, um mich auf die Reise zu begeben, aber wenn Ihr ihm die Lieferung berbringen wollt, so wird er Euch gut bezahlen.$B$BIch habe die Kerzen schon fertig verpackt. Ihr findet Morgan in unserem Geschft im Handelsdistrikt von Sturmwind. Es heit Pestles Apotheke.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (61, 'esES', 'Un envo para Ventormenta', 'Lleva el envo de William a Morgan Mortero al Distrito de Mercaderes de Ventormenta.', 'Mi hermano Morgan espera mi envo de velas en Ventormenta. No tengo tiempo para hacer el viaje en persona, pero si quisieras llevarle el envo, te pagara bien.$B$BHe empaquetado las velas. Encontrars a Morgan en nuestra tienda, Herbolario Mortero, en el Distrito de Mercaderes de Ventormenta.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (61, 'esMX', 'Un envo para Ventormenta', 'Lleva el envo de William a Morgan Mortero al Distrito de Mercaderes de Ventormenta.', 'Mi hermano Morgan espera mi envo de velas en Ventormenta. No tengo tiempo para hacer el viaje en persona, pero si quisieras llevarle el envo, te pagara bien.$B$BHe empaquetado las velas. Encontrars a Morgan en nuestra tienda, Herbolario Mortero, en el Distrito de Mercaderes de Ventormenta.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (61, 'frFR', 'Une cargaison pour Hurlevent', 'Livrez la Cargaison de William  Morgan Pilon dans le Quartier commerant de Hurlevent.', 'Mon frre Morgan attend ma cargaison de bougies  Hurlevent. Je n\'ai pas le temps de faire le voyage moi-mme, mais si vous livrez la cargaison  ma place, il vous paiera bien.$B$BJ\'ai empaquet les bougies, et vous pouvez trouver Morgan  notre magasin, les Apothicaires Pilon, dans le quartier commerant de Hurlevent.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (61, 'itIT', 'Shipment to Stormwind', 'Bring William\'s Shipment to Morgan Pestle in the Stormwind Trade District.', 'My brother Morgan is waiting in Stormwind for my shipment of candles.  I don\'t have enough time to make the trip myself, but if you\'d like to take him the shipment, he\'ll pay you well.$B$BI\'ve packed up the candles, and you can find Morgan in our shop, Pestle\'s Apothecary, in the Stormwind Trade District.', '', '', '', '', '', '', 0);
