INSERT INTO `quest_template_locale` VALUES (62, 'deDE', 'Die Tiefenschachtmine', 'Erforscht die Tiefenschachtmine und kehrt dann nach Goldhain zu Marschall Dughan zurck.', 'Die Mine in Nordhain ist nicht die einzige, mit der es Probleme gibt. Berichten zufolge ist auch die Tiefenschachtmine im Wald von Elwynn zu einem Tummelplatz fr Kobolde geworden.$B$BErforscht die Mine, besttigt diese Berichte und kehrt dann zu mir zurck. Die Mine liegt fast genau sdlich von Goldhain, zwischen den Hfen der Steinfelds und der Maclures.', 'Aussphen der Tiefenschachtmine', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (62, 'esES', 'La Mina Abisal', 'Explora la Mina Abisal y vuelve junto al alguacil Dughan a Villadorada.', 'La mina de Villanorte no es la nica que tiene problemas! Segn mis informes, la Mina Abisal de Elwynn tambin ha sido ocupada por los kbolds.$B$BExplora la mina y comprueba la veracidad de mis informes. Luego vuelve aqu. La mina est hacia el sur de Villadorada, entre La Granja Pedregosa y la granja Maclure.', 'Explora la Mina Abisal', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (62, 'esMX', 'La Mina Abisal', 'Explora la Mina Abisal y vuelve junto al alguacil Dughan a Villadorada.', 'La mina de Villanorte no es la nica que tiene problemas! Segn mis informes, la Mina Abisal de Elwynn tambin ha sido ocupada por los kbolds.$B$BExplora la mina y comprueba la veracidad de mis informes. Luego vuelve aqu. La mina est hacia el sur de Villadorada, entre La Granja Pedregosa y la granja Maclure.', 'Explora la Mina Abisal', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (62, 'frFR', 'La mine de Fondugouffre', 'Explorez la Mine de Fondugouffre, puis revenez voir le Marchal Dughan de Comt-de-lOr.', 'Comt-du-Nord n\'est pas le seul endroit  avoir des problmes avec ses mines! J\'ai des rapports disant que la mine de Fondugouffre  Elwynn est aussi infeste de Kobolds.$B$BAllez explorer la mine afin de confirmer ces rapports, puis revenez me voir. Elle se situe au sud de Comt-de-lOr, entre les proprits des Champierreux et des Maclure.', 'Explorer la mine de Fondugouffre', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (62, 'itIT', 'La Miniera Antrocupo', 'Esplora la Miniera Antrocupo, poi torna dal Maresciallo Dughan a Borgodoro.', 'La miniera della Contea del Nord non  l\'unica ad avere problemi! Secondo i rapporti che ho ricevuto, anche la Miniera Antrocupo a Elwynn  stata occupata dai Coboldi.$B$BLa miniera si trova a sud di Borgodoro, tra le fattorie dei Pietradura e dei Maclure. Vai l ed esplorala per confermare questi rapporti, poi torna da me.', 'Esplora la miniera Antrocupo.', '', '', '', '', '', 0);
