INSERT INTO `quest_template_locale` VALUES (62, 'ptBR', 'A Mina Vailafundo', 'Explore a Mina Vailafundo e depois fale novamente com o Delegado Duro em Vila d\'Ouro.', 'A mina de Vila Norte no  a nica com problemas! Tenho relatrios aqui dizendo que a Mina Vailafundo, em Elwynn, tambm se tornou um antro de kobolds.$B$BExplore a mina, confirme esses relatrios e volte a falar comigo. A mina fica ao sul de Vila d\'Ouro, entre as fazendas Campedra e Madruga.', 'Explore a Mina Vailafundo', '', '', '', '', '', 0);
