INSERT INTO `quest_template_locale` VALUES (63, 'deDE', 'Ruf des Wassers', 'Besiegt die verderbte Wassermanifestation und legt die Armschienen der verderbten Manifestation und die verbleibenden Tropfen reinsten Wassers im Silberwald auf die Kohlenpfanne von Immerquell.', 'An der Kste des Silberwalds befindet sich westlich des Grabmals ein Schrein, der von der Seuche besudelt ist. Die Geister dort sprechen nicht lnger zu unserem Volk und es ist jetzt an Euch, die Manifestation dort zu besiegen und den Teich zu subern.$B$BNehmt die Armschienen des Elementars und gebt sie zusammen mit den verbleibenden Tropfen von Brines Trank in die Kohlenpfanne. Das sollte ausreichen, um einen reinen Geist zu beschwren, mit dem Ihr kommunizieren knnt.$B$BBringt mir einen Beweis dafr, dass Ihr die Tat vollbracht habt, dann belohne ich Euch mit Eurem Totem.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (63, 'esES', 'La llamada del agua', 'Derrota a la manifestacin de agua corrupta y coloca los brazales de manifestacin corrupta con las gotas restantes del agua ms pura en el blandn de Siemprefuente en el Bosque de Argnteos.', 'Por la costa del Bosque de Argnteos, al oeste de El Sepulcro, vers un altar infestado por la peste. Los espritus de ese lugar ya no se comunican con nuestro pueblo y de ti depende acabar con esa manifestacin de la Plaga y limpiar el estanque.$B$BLlvate los brazales de elemental y las gotas restantes de la pocin de Salmuera y colcalos en el blandn. El ritual debera bastar para invocar a un espritu puro con el que comunicarte.$B$BTreme una prueba de haber completado la tarea y te recompensar con un ttem.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (63, 'esMX', 'La llamada del agua', 'Derrota a la manifestacin de agua corrupta y coloca los brazales de manifestacin corrupta con las gotas restantes del agua ms pura en el blandn de Siemprefuente en el Bosque de Argnteos.', 'Por la costa del Bosque de Argnteos, al oeste de El Sepulcro, vers un altar infestado por la peste. Los espritus de ese lugar ya no se comunican con nuestro pueblo y de ti depende acabar con esa manifestacin de la Plaga y limpiar el estanque.$B$BLlvate los brazales de elemental y las gotas restantes de la pocin de Salmuera y colcalos en el blandn. El ritual debera bastar para invocar a un espritu puro con el que comunicarte.$B$BTreme una prueba de haber completado la tarea y te recompensar con un ttem.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (63, 'frFR', 'L\'appel de l\'eau', 'Abattez la Manifestation d\'eau corrompue et placez les Bracelets de manifestation corrompue avec le reste d\'eau pure sur le brasero de la Fontaine ternelle, dans la fort des Pins-Argents.', 'Le long de la cte de la fort des Pins-Argents,  l\'ouest du Spulcre, vous trouverez un autel qui a t corrompu. Les esprits n\'y parlent plus aux gens. Vous devez rsoudre le problme en purifiant l\'autel.$B$BPrenez ces bracelets lmentaires et la potion de Brine, placez-les sur le brasero de lautel. Ce rituel devrait suffire  invoquer un esprit pur  qui vous pourrez parler.$B$BRapportez-moi une preuve de votre russite, et je vous rcompenserai avec un totem.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (63, 'itIT', 'Call of Water', 'Defeat the Corrupt Manifestation of Water and place the Corrupted Manifestation\'s Bracers along with the Remaining Drops of Purest Water on the Brazier of Everfount in Silverpine Forest.', 'Along the coast of Silverpine, west of the Sepulcher, you will find a shrine that has become tainted by the plague. The spirits there no longer speak to our people and it will be up to you to defeat the manifestation and cleanse the pool.$B$BTake the elemental\'s bracers, along with the remaining drops of Brine\'s potion, and place them on the brazier. The ritual should be enough to summon a pure spirit for you to communicate with.$B$BBring me proof the task is done, and I will reward you with your totem.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (63, 'ptBR', 'Call of Water', 'Defeat the Corrupt Manifestation of Water and place the Corrupted Manifestation\'s Bracers along with the Remaining Drops of Purest Water on the Brazier of Everfount in Silverpine Forest.', 'Along the coast of Silverpine, west of the Sepulcher, you will find a shrine that has become tainted by the plague. The spirits there no longer speak to our people and it will be up to you to defeat the manifestation and cleanse the pool.$B$BTake the elemental\'s bracers, along with the remaining drops of Brine\'s potion, and place them on the brazier. The ritual should be enough to summon a pure spirit for you to communicate with.$B$BBring me proof the task is done, and I will reward you with your totem.', '', '', '', '', '', '', 0);
