INSERT INTO `quest_template_locale` VALUES (64, 'deDE', 'Das vergessene Erbstck', 'Bauer Brauenwirbel mchte, dass Ihr seine Taschenuhr holt. Sie befindet sich im Kleiderschrank des Bauernhauses auf der Krbisfarm im Westen.', 'Es war frchterlich! Verna hat mich aufgeweckt, als sie drauen auf dem Feld so einen Radau gehrt hat. Das ganze Feld war voller Rowdys! Wir sind in solcher Eile aufgebrochen und da hab ich vergessen, meine Taschenuhr einzupacken. Die Uhr hat mir Vernas Vater an unserem Hochzeitstag geschenkt und es wird mir fast schlecht, wenn ich dran denke, dass diese Diebe sie jetzt haben. Ich hab die Taschenuhr im Kleiderschrank in unserem Haus liegen lassen. Haltet nach dem Krbisfeld im Westen Ausschau, dann kommt Ihr zu unserem Hof - Ihr knnt ihn gar nicht verfehlen. Wenn Ihr mir meine Uhr wiederbringen wrdet, wre ich Euch sehr dankbar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (64, 'esES', 'La reliquia olvidada', 'El granjero Cejade quiere que recuperes el reloj de bolsillo que dej olvidado en el guardarropa de su granja en la plantacin de calabazas del Oeste.', 'Fue horrible! Verna me despert cuando oy jaleo en los campos. Estaban llenos de gamberros. Nos fuimos corriendo y olvid recoger mi reloj de bolsillo. Me lo dio el padre de Verna el da de nuestra boda y es horrible saber que est en manos de esos ladrones. Dej el reloj de bolsillo en el guardarropa de la granja. Busca el campo de calabazas que est al Oeste... no tiene prdida. Si me lo devuelves te estar muy agradecido!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (64, 'esMX', 'La reliquia olvidada', 'El granjero Cejade quiere que recuperes el reloj de bolsillo que dej olvidado en el guardarropa de su granja en la plantacin de calabazas del Oeste.', 'Fue horrible! Verna me despert cuando oy jaleo en los campos. Estaban llenos de gamberros. Nos fuimos corriendo y olvid recoger mi reloj de bolsillo. Me lo dio el padre de Verna el da de nuestra boda y es horrible saber que est en manos de esos ladrones. Dej el reloj de bolsillo en el guardarropa de la granja. Busca el campo de calabazas que est al Oeste... no tiene prdida. Si me lo devuelves te estar muy agradecido!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (64, 'frFR', 'Le cadeau oubli', 'Le Fermier Froncebouille vous a demand de retrouver sa Montre, qui se trouve dans la penderie de sa ferme prs du champ de citrouilles,  l\'ouest.', 'C\'tait horrible! Verna m\'a rveill quand elle a entendu du grabuge dans les champs. Ils taient envahis par des vandales. Nous nous sommes enfuis  toutes jambes, du coup j\'ai oubli ma montre sur place. Le pre de Verna me l\'avait offerte pour notre mariage et je suis malade de savoir qu\'elle est entre les mains de ces voleurs. J\'ai laiss ma montre dans la penderie  la ferme. Cherchez le champ de citrouilles  l\'ouest  vous ne pouvez pas le manquer. Si vous me la rapportez, je saurai me montrer reconnaissant!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (64, 'itIT', 'The Forgotten Heirloom', 'Farmer Furlbrow wants you to retrieve his pocket watch from the wardrobe in his farmhouse at the pumpkin farm to the West.', 'It was horrible!  Verna woke me when she heard a ruckus in the fields.  The fields were full of hooligans.  We left in a rush and I forgot to pack my pocket watch.  Verna\'s pa gave me that watch on our wedding day and I feel just sick knowing those thieves have it.  I left the pocket watch in the wardrobe at the farmhouse.  Look for the field of pumpkins to the West -- you can\'t miss it.  If you bring it back to me, I\'d sure be grateful!', '', '', '', '', '', '', 0);
