INSERT INTO `quest_template_locale` VALUES (65, 'deDE', 'Die Bruderschaft der Defias', 'Gryan Starkmantel mchte, dass Ihr in Seenhain mit Wiley sprecht.', 'Die Bruderschaft der Defias nennt sich die Bande von Schuften, von der die braven Leute von Westfall aus dem Land vertrieben werden. Ihr msst fr mich diese Bande bespitzeln. Wir mssen erfahren, wer der Kopf der Gruppe ist und wo sie ihr Versteck hat. In Seenhain findet Ihr im Gasthaus einen Schurken namens Wiley, der mir noch einen Gefallen schuldet.$b$bBegebt Euch nach Seenhain im Rotkammgebirge, stlich von Elwynn, und findet heraus, was Ihr knnt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (65, 'esES', 'La hermandad de los Defias', 'Gryan Mantorrecio quiere que hables con Wiley en Villa del Lago.', 'La banda de desgraciados responsable de que las gentes de los Pramos de Poniente abandonaran sus tierras se llama a s misma la Hermandad Defias. Necesito que te infiltres en este clan de matones. Debemos averiguar quin lidera el grupo y dnde se esconden. En Villa del Lago, en la posada, encontrars a un pcaro que responde al nombre de Wiley; me debe un favor.$B$BViaja a Villa del Lago, en las Montaas Crestagrana, al este de Elwynn, y averigua todo lo que puedas.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (65, 'esMX', 'La hermandad de los Defias', 'Gryan Mantorrecio quiere que hables con Wiley en Villa del Lago.', 'La banda de desgraciados responsable de que las gentes de los Pramos de Poniente abandonaran sus tierras se llama a s misma la Hermandad Defias. Necesito que te infiltres en este clan de matones. Debemos averiguar quin lidera el grupo y dnde se esconden. En Villa del Lago, en la posada, encontrars a un pcaro que responde al nombre de Wiley; me debe un favor.$B$BViaja a Villa del Lago, en las Montaas Crestagrana, al este de Elwynn, y averigua todo lo que puedas.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (65, 'frFR', 'La Confrrie dfias', 'Gryan Roidemantel vous a demand de parler  Wiley  Comt-du-Lac.', 'La bande de misrables, responsable de la fuite des honntes gens de la marche de l\'Ouest, se fait appeler la Confrrie dfias. J\'ai besoin de vous pour infiltrer ces voyous. Nous devons connatre l\'identit de leur chef et o ils sont bass.  Comt-du-Lac, il y a un voleur nomm Wiley  l\'auberge qui me doit une faveur.$b$bAllez jusqu\' Comt-du-Lac dans les Carmines,  l\'est d\'Elwynn, et trouvez ce que vous pouvez.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (65, 'itIT', 'The Defias Brotherhood', 'Gryan Stoutmantle wants you to talk to Wiley in Lakeshire.', 'The band of wretches responsible for driving the good people of Westfall from the land call themselves The Defias Brotherhood.  I need you to infiltrate this clan of thugs.  We need to know who heads up the cartel and where they are hiding out.  In Lakeshire, in the inn, there is a rogue by the name of Wiley who owes me a favor.$b$bTravel to Lakeshire in the Redridge Mountains, east of Elwynn, and find out what you can.', '', '', '', '', '', '', 0);
