INSERT INTO `quest_template_locale` VALUES (66, 'deDE', 'Die Legende von Stalvan', 'Sucht Amtmann Daltry im Rathaus von Dunkelhain auf.', 'Letzte Nacht versprte ich in meinem Geist eine schreckliche Erschtterung. Ich wusste, dass sich meine Enkelin Alyssa in groer Gefahr befand. Ich befragte die Karten und aus ihnen starrte mich die Fratze des Todes hhnisch an.$b$bIch begab mich auf eine lange Reise durch eine dunkle Trance und schlielich gelang es mir, einen Hinweis auf dieses schreckliche Geheimnis zu erhaschen. Ein Name erschloss sich mir, der Name Stalvan.$b$bSucht den Amtmann im Rathaus auf und schaut, ob Ihr nicht mehr ber diese Person herausfinden knnt. Ich frchte um unser aller Leben.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (66, 'esES', 'La leyenda de Stalvan', 'Busca al secretario Daltry en el Concejo de Villa Oscura.', 'La otra noche, un terrible tumulto me recorri las venas. Sent que mi nieta Alyssa estaba en grave peligro. Consult las cartas y vi a la Muerte contemplndome desde la mesa.$B$BBusqu la luz en un largo y oscuro trance... intentaba encontrar algo concreto que me ayudara a calmar el espritu. Y un nombre vino a m. Stalvan.$B$BAcude al secretario del Concejo e intenta averiguar algo ms sobre ese nombre. Temo por todos nosotros.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (66, 'esMX', 'La leyenda de Stalvan', 'Busca al secretario Daltry en el Concejo de Villa Oscura.', 'La otra noche, un terrible tumulto me recorri las venas. Sent que mi nieta Alyssa estaba en grave peligro. Consult las cartas y vi a la Muerte contemplndome desde la mesa.$B$BBusqu la luz en un largo y oscuro trance... intentaba encontrar algo concreto que me ayudara a calmar el espritu. Y un nombre vino a m. Stalvan.$B$BAcude al secretario del Concejo e intenta averiguar algo ms sobre ese nombre. Temo por todos nosotros.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (66, 'frFR', 'La lgende de Stalvan', 'Allez voir le Greffier Daltry,  l\'htel de ville de Sombre-Comt.', 'La nuit dernire, j\'ai eu un mauvais pressentiment concernant ma petite-fille Alyssa. Elle serait en grand danger. J\'ai tir les cartes et la lame de la Faucheuse est sortie.$b$bAprs une longue et sombre transe, jai obtenu un indice. Un nom est apparu: Stalvan.$b$bAllez voir un greffier de la mairie et trouvez plus de dtails sur ce personnage. J\'ai peur pour tout le monde', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (66, 'itIT', 'The Legend of Stalvan', 'Seek out the Clerk Daltry in the Darkshire Town Hall.', 'Last night a horrible disturbance rippled through my veins.  I sensed that my granddaughter, Alyssa, was in great danger.  I consulted the cards and Death stared up at me from the table.$b$bAfter taking a long journey through a dark trance I was able to uncover a clue to this terrifying mystery.  A name came to me, the name of Stalvan.$b$bSeek out the Clerk in the Town Hall and see if you can find out more about this character.  I fear for us all.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (66, 'ptBR', 'The Legend of Stalvan', 'Seek out the Clerk Daltry in the Darkshire Town Hall.', 'Last night a horrible disturbance rippled through my veins. I sensed that my granddaughter, Alyssa, was in great danger. I consulted the cards and Death stared up at me from the table.$b$bAfter taking a long journey through a dark trance I was able to uncover a clue to this terrifying mystery. A name came to me, the name of Stalvan.$b$bSeek out the Clerk in the Town Hall and see if you can find out more about this character. I fear for us all.', '', '', '', '', '', '', 0);
