INSERT INTO `quest_template_locale` VALUES (67, 'deDE', 'Die Legende von Stalvan', 'Begebt Euch zur Schule in Mondbruch und bringt Amtmann Daltry alle neuen Informationen ber Stalvan Dunstmantel.', 'Stalvan, hm? Lasst mich im Stadtverzeichnis nachsehen.$b$bStalvan... Stalvan... mal sehen. Ah, hier ist es! Ich habe hier einen Eintrag ber einen gewissen Stalvan Dunstmantel. Die letzte bekannte Adresse ist die Schule in Mondbruch. Liebe Gte, das nenne ich veraltet!$b$bWrdet Ihr mir einen Gefallen tun? Falls Ihr zufllig nach Mondbruch kommt, dann lasst es mich wissen, wenn Ihr an neue Informationen ber diese Person geraten solltet. Ich habe meine Unterlagen gern auf dem neuesten Stand.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (67, 'esES', '[DEPRECATED]La leyenda de Stalvan', 'Viaja a la Escuela de Arroyo de la Luna y lleva cualquier informacin que descubras sobre Stalvan al secretario Daltry.', 'Stalvan, eh? Deja que consulte el registro.$B$BStalvan... Stalvan... Veamos... Ah! Aqu est! Tengo un seor Stalvan Mantoniebla. Segn consta aqu, su ltima direccin es la Escuela de Arroyo de la Luna. Pero este dato es de hace mucho tiempo!$B$BHazme un favor, quieres? Si pasas por Arroyo de la Luna, hazme saber si consigues informacin ms reciente sobre este tipo. Me gusta llevar los registros al da.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (67, 'esMX', '[DEPRECATED]La leyenda de Stalvan', 'Viaja a la Escuela de Arroyo de la Luna y lleva cualquier informacin que descubras sobre Stalvan al secretario Daltry.', 'Stalvan, eh? Deja que consulte el registro.$B$BStalvan... Stalvan... Veamos... Ah! Aqu est! Tengo un seor Stalvan Mantoniebla. Segn consta aqu, su ltima direccin es la Escuela de Arroyo de la Luna. Pero este dato es de hace mucho tiempo!$B$BHazme un favor, quieres? Si pasas por Arroyo de la Luna, hazme saber si consigues informacin ms reciente sobre este tipo. Me gusta llevar los registros al da.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (67, 'frFR', '[PRIM]La lgende de Stalvan', 'Allez  l\'cole de Ruisselune, et rapportez au Greffier Daltry des informations rcentes sur Stalvan.', 'Stalvan, hein? Laissez-moi vrifier dans les registres de la ville.$b$bStalvan. StalvanVoyons voir. Ah! Nous y voil. J\'ai la trace d\'un certain M. Stalvan Mantebrume. Sa dernire adresse connue est l\'cole de Ruisselune. Enfin, mon registre date un peu!$b$bFaites-moi une faveur, si vous allez  Ruisselune, renseignez-vous sur cette personne. Que je puisse mettre  jour mon registre.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (67, 'itIT', '[DEPRECATED]The Legend of Stalvan', 'Travel to the Moonbrook Schoolhouse and bring back any updated information about Stalvan to Clerk Daltry.', 'Stalvan, eh?  Let me check the town registry.$b$bStalvan. . .Stalvan. . .let\'s see.  Ah, here we go!  I have a record of a Mr. Stalvan Mistmantle.  The last recorded address is the Moonbrook Schoolhouse.  My, talk about outdated!$b$bDo me a favor will you, friend?  If you happen to go out to Moonbrook, let me know if you get any update on this fellow.  I like to keep the records clean.', '', '', '', '', '', '', 0);
