INSERT INTO `quest_template_locale` VALUES (69, 'deDE', 'Die Legende von Stalvan', 'Begebt Euch zum Gasthaus \"Zur Hhle des Lwen\" und fragt dort nach, ob jemand schon einmal den Namen Stalvan gehrt hat.', 'Ach du liebes bisschen! Das ist mir beim ersten Mal ja glatt entgangen! Hier im Verzeichnis steht beim Eintrag fr diesen Stalvan direkt unter der ersten Adresse noch eine weitere, die zum Teil durchgestrichen ist. Es scheint, als wre er zum Gasthaus \"Zur Hhle des Lwen\" drben in Goldhain unterwegs gewesen. Vielleicht solltet Ihr dort nachfragen, $n.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (69, 'esES', '[DEPRECATED]La leyenda de Stalvan', 'Ve a la Posada Orgullo de Len a ver si alguien ha odo el nombre de Stalvan.', 'Ay, ay! Esto se me debi de pasar la primera vez. En el registro, justo debajo de la primera direccin de Stalvan, hay otra direccin. Est tachada... Parece que se diriga a la Posada Orgullo de Len, en Villadorada. Quizs quieras comprobarlo, $n.', '', '', '', '', '', '', 0);
