INSERT INTO `quest_template_locale` VALUES (69, 'frFR', '[PRIM]La lgende de Stalvan', 'Allez  l\'Auberge de la Fiert du lion pour voir si quelqu\'un a entendu parler de Stalvan.', 'Ohnon! J\'ai d manquer a la premire fois. Dans le registre, juste en dessous de ladresse note pour Stalvan, il y en a une autre partiellement efface. Il semble quil sagisse de l\'auberge de la Fiert du lion  Comt-de-lOr. J\'aimerais vrifier cela, $n.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (69, 'itIT', '[DEPRECATED]The Legend of Stalvan', 'Go to The Lion\'s Pride Inn to see if anyone there has heard of the name Stalvan.', 'Oh my!  Must have missed this the first time.  In the registry, right beneath the first address for Stalvan there\'s another one listed, only partially scratched out.  Looks like he was headed to The Lion\'s Pride Inn over in Goldshire.  Might want to check there, $n.', '', '', '', '', '', '', 0);
