INSERT INTO `quest_template_locale` VALUES (70, 'deDE', 'Die Legende von Stalvan', 'Holt Stalvans niemals zugestellten Brief aus der Truhe und liefert ihn im Kanaldistrikt von Sturmwind ab.', 'Den Namen Stalvan hab ich schon mal gehrt... Ach, jetzt fllt\'s mir wieder ein.$b$bVor vielen Jahren betrat an einem strmischen Abend ein Bote dieses Haus, der Unterkunft fr die Nacht suchte. Es war noch nicht ganz Mitternacht, da kam der Mann schreiend die Treppe heruntergerannt. Er war bleich wie der Tod vor Angst. Nur mit seinem Nachtgewand bekleidet verschwand er im Regen.$b$bIn der Eile verga er seine Briefe in der Truhe oben und kam nie zurck, um sie abzuholen. Es ist ein Brief dabei von diesem Stalvan, den Ihr erwhntet, adressiert an den Kanaldistrikt in Sturmwind. Ihr drft ihn gern haben.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (70, 'esES', 'La leyenda de Stalvan', 'Recupera la carta sin enviar de Stalvan del cofre y entrgala en el distrito de Los Canales de Ventormenta.', 'Stalvan... ese nombre me suena de algo. Ya s de qu!$B$BUna noche de tormenta de hace muchos aos, lleg aqu un mensajero que buscaba refugio para la noche. Casi a medianoche, el hombre se precipit escaleras abajo gritando, plido de terror. Desapareci en la tormenta an en pijama.$B$BCon las prisas, se olvid sus cartas en el cofre de arriba. Y nunca volvi a buscarlas. Una de ellas es de ese tal Stalvan. Iba dirigida al distrito de Los Canales de Ventormenta. Puedes quedrtela.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (70, 'esMX', 'La leyenda de Stalvan', 'Recupera la carta sin enviar de Stalvan del cofre y entrgala en el distrito de Los Canales de Ventormenta.', 'Stalvan... ese nombre me suena de algo. Ya s de qu!$B$BUna noche de tormenta de hace muchos aos, lleg aqu un mensajero que buscaba refugio para la noche. Casi a medianoche, el hombre se precipit escaleras abajo gritando, plido de terror. Desapareci en la tormenta an en pijama.$B$BCon las prisas, se olvid sus cartas en el cofre de arriba. Y nunca volvi a buscarlas. Una de ellas es de ese tal Stalvan. Iba dirigida al distrito de Los Canales de Ventormenta. Puedes quedrtela.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (70, 'frFR', 'La lgende de Stalvan', 'Retrouvez la Vieille lettre de Stalvan dans le coffre, et remettez-la au quartier du Canal,  Hurlevent.', 'Oui, effectivement, je me rappelle de Stalvan!$b$bIl y a quelques annes, lors d\'une nuit d\'orage, un messager est venu,  la recherche d\'un abri pour la nuit. Vers minuit, l\'homme a dval les escaliers en hurlant, le visage terrifi. Il tait toujours en pyjama quand il a disparu en courant sous la pluie torrentielle.$b$bDans sa prcipitation, il a oubli ses lettres dans le coffre  l\'tage. Il n\'est jamais revenu. Une des lettres tait adresse au quartier du Canal  Hurlevent. Prenez-la si vous le voulez.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (70, 'itIT', 'The Legend of Stalvan', 'Retrieve Stalvan\'s Undelivered Letter from the chest and deliver it to the Canal District in Stormwind.', 'The name Stalvan rings a bell.  I remember now.$b$bMany years back, on a stormy night, a messenger came in, seeking refuge for the night.  Near the stroke of midnight, the man ran down the stairs screaming, his face pale with fear.  Still wearing his bedclothes, he disappeared into the downpour.$b$bIn his haste he forgot his letters in the chest upstairs.  He never returned for them. One remains from that Stalvan fellow, intended for the Canal District in Stormwind.  Help yourself to it.', '', '', '', '', '', '', 0);
