INSERT INTO `quest_template_locale` VALUES (71, 'deDE', 'Meldung an Thomas', 'Bringt die Medaillons von Rolf und Malakai zu Wache Thomas an die stliche Brcke von Elwynn.', 'Nun habt Ihr beide Medaillons. Bringt sie an die Brcke zu Wache Thomas, damit er erfhrt, welches Schicksal seine beiden Kameraden erlitten haben.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (71, 'esES', 'Informa a Thomas', 'Entrega los medallones de Rolf y Malakai al guardia Thomas. Lo encontrars en el puente oriental de Elwynn.', 'Ahora que tienes los dos medallones, llvaselos al guardia Thomas al puente. As sabr que sus guardias murieron asesinados.', '', '', '', '', '', '', 0);
