INSERT INTO `quest_template_locale` VALUES (71, 'frFR', 'Faire son rapport au garde Thomas', 'Rapporter les Mdaillons de Rolf et Malakai au garde Thomas au pont est dElwynn.', 'Maintenant que vous avez les deux mdaillons, apportez-les au Garde Thomas au Pont est, il saura peut-tre comment ces hommes ont t assassins.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (71, 'itIT', 'A rapporto da Thomas', 'Consegna i Medaglioni di Rolf e Malakai alla Guardia Thomas presso il ponte di Elwynn a est.', 'Ora che hai entrambi i medaglioni, consegnali alla Guardia Thomas presso il ponte, in modo che sappia che le sue guardie sono state uccise.', '', '', '', '', '', '', 0);
