INSERT INTO `quest_template_locale` VALUES (72, 'deDE', 'Die Legende von Stalvan', 'Durchsucht die verpackten Besitztmer nach Hinweisen.', 'Mein Vater war der Verwalter des Besitzes, lange bevor ich es wurde. Nach dem Massaker war er derjenige, der das Blut aufwischen und aufrumen musste. Aber das tut nichts zur Sache.$b$bDie letzten Gelder aus dem Flintridge-Fonds sind versiegt und jetzt mssen die letzten Stcke aus dem Familienbesitz versteigert werden. Daran sind nur diese Steuereintreiber schuld. Aber wenn Ihr wirklich dringend mehr erfahren wollt, dann drft Ihr diesen Kram hier gern durchsehen. Wer wei, was Ihr findet.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (72, 'esES', 'La leyenda de Stalvan', 'Busca una pista entre los objetos empaquetados.', 'Mi padre era el custodio de la propiedad mucho antes que yo. Tuvo que limpiar la sangre despus de la masacre. Pero eso ahora no viene al caso.$B$BEl fondo de Cresta Slex se ha agotado. Ahora, las ltimas pertenencias de la familia sern subastadas. Es culpa de esos buitres de los recaudadores de impuestos. Como veo que te mueres por saber ms, creo que puedes mirar entre toda esta basura. Quin sabe lo que puedes encontrar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (72, 'esMX', 'La leyenda de Stalvan', 'Busca una pista entre los objetos empaquetados.', 'Mi padre era el custodio de la propiedad mucho antes que yo. Tuvo que limpiar la sangre despus de la masacre. Pero eso ahora no viene al caso.$B$BEl fondo de Cresta Slex se ha agotado. Ahora, las ltimas pertenencias de la familia sern subastadas. Es culpa de esos buitres de los recaudadores de impuestos. Como veo que te mueres por saber ms, creo que puedes mirar entre toda esta basura. Quin sabe lo que puedes encontrar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (72, 'frFR', 'La lgende de Stalvan', 'Recherchez un indice dans le tas d\'affaires.', 'Mon pre fut le gardien de cette proprit bien avant que je ne le sois. Il a d tout nettoyer aprs le massacre.$b$bLes derniers fonds des Silecrte ont fondu comme neige au soleil. Le reste des affaires de la famille va partir aux enchres. La faute  ces vautours des impts. J\'imagine que vous tes $gimpatient:impatiente; de voir ce qu\'il y a, vous pouvez regarder dans le tas de vieilleries. Si a se trouve, quelque chose vous intressera.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (72, 'itIT', 'The Legend of Stalvan', 'Search through the packed up possessions for a clue.', 'My father was the caretaker of the estate long before I was.  He had to mop the blood up after the massacre.  But that\'s neither here nor there.$b$bThe last funds of the Flintridge trust have dried up.  Now the last of the family possessions are headed for auction.  Blame the tax vultures.  I guess if you\'re really itching to learn more you\'re free to look through this junk.  Who knows what you might find.', '', '', '', '', '', '', 0);
