INSERT INTO `quest_template_locale` VALUES (74, 'deDE', 'Die Legende von Stalvan', 'Die zerrissene Tagebuchseite, die Ihr gefunden habt, gibt Euch den nchsten Hinweis.', 'In der Kiste findet Ihr verschiedene Dinge: muffige Erbstcke, ein Familienportrait, einige Jagdtrophen und ein paar alte Bcher. Fast schon am Boden der Kiste findet Ihr unter einer Keramikvase eine zerrissene Tagebuchseite.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (74, 'esES', 'La leyenda de Stalvan', 'La pgina arrancada del diario que descubriste es tu siguiente pista.', 'Dentro de la caja encuentras varios objetos: reliquias familiares mohosas, unos trofeos de caza, un retrato de familia y algunos libros antiguos. Al fondo, debajo de un jarrn, descubres una pgina arrancada de un diario.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (74, 'esMX', 'La leyenda de Stalvan', 'La pgina arrancada del diario que descubriste es tu siguiente pista.', 'Dentro de la caja encuentras varios objetos: reliquias familiares mohosas, unos trofeos de caza, un retrato de familia y algunos libros antiguos. Al fondo, debajo de un jarrn, descubres una pgina arrancada de un diario.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (74, 'frFR', 'La lgende de Stalvan', 'La Page de journal dchire que vous avez dcouverte est votre deuxime indice.', 'Vous trouvez dans la caisse diverses choses: quelques objets moisis, un portrait de famille, des trophes de chasse et de vieux livres. Dans le fond, sous un vase en cramique, vous dcouvrez une page de journal dchire.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (74, 'itIT', 'The Legend of Stalvan', 'The Torn Journal page you discovered provides your next clue.', 'Inside the crate you find various objects: musty heirlooms, a family portrait, a few hunting trophies and some old books.  Near the bottom, underneath a ceramic vase, you uncover A Torn Journal Page.', '', '', '', '', '', '', 0);
