INSERT INTO `quest_template_locale` VALUES (75, 'deDE', 'Die Legende von Stalvan', 'Als ich hier eingezogen bin, stand oben schon eine Truhe mit Pergamenten darin. Kurz nach meinem Einzug habe ich sie mir einmal angesehen, aber bald darauf konnte ich nur noch verschwommen sehen und da hab ich\'s dann gelassen. $b$bTut einem alten, halb blinden Mann einen Gefallen und seht Euch selbst mal in der Kiste oben um, ob Ihr vielleicht etwas findet, das Euch bei Eurer Suche nach diesem Stalvan weiterhelfen kann. Ich bin mir ziemlich sicher, dass da eine verblasste Tagebuchseite dabei ist, die Euch interessieren msste. Bringt sie mir und ich werde sehen, was ich tun kann, um Euch zu helfen.', 'Marschall Haggard mchte, dass Ihr in der Kiste oben nach der verblassten Tagebuchseite sucht.', '', 'Kehrt zu Marschall Haggard ins Holzfllerlager des Osttals im Wald von Elwynn zurck.', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (75, 'esES', 'La leyenda de Stalvan', 'Cuando me mud aqu haba un fajo de papiros en el cofre de arriba. Empec a examinarlos, pero tuve que dejarlo cuando la niebla empez a nublarme la vista.$B$BHazle un favor a un pobre anciano ciego. Sube y busca en el cofre cualquier cosa que te pueda ayudar a descubrir ms sobre ese Stalvan. S que hay una pgina de un diario que, aunque est algo descolorida, podra interesarte mucho. Tremela. Yo te ayudar en lo que pueda.', 'El mariscal Haggard quiere que busques la pgina del diario descolorida en el cofre que hay arriba.', '', 'Vuelve con: Mariscal Haggard. Zona: Aserradero de la Vega del Este, Bosque de Elwynn.', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (75, 'esMX', 'La leyenda de Stalvan', 'Cuando me mud aqu haba un fajo de papiros en el cofre de arriba. Empec a examinarlos, pero tuve que dejarlo cuando la niebla empez a nublarme la vista.$B$BHazle un favor a un pobre anciano ciego. Sube y busca en el cofre cualquier cosa que te pueda ayudar a descubrir ms sobre ese Stalvan. S que hay una pgina de un diario que, aunque est algo descolorida, podra interesarte mucho. Tremela. Yo te ayudar en lo que pueda.', 'El mariscal Haggard quiere que busques la pgina del diario descolorida en el cofre que hay arriba.', '', 'Vuelve con: Mariscal Haggard. Zona: Aserradero de la Vega del Este, Bosque de Elwynn.', '', '', '', '', 18019);
INSERT INTO `quest_template_locale` VALUES (75, 'frFR', 'La lgende de Stalvan', 'Quand j\'ai emmnag ici, il y avait une liasse de lettres dans le coffre, en haut. Je les ai examines en arrivant, mais j\'ai abandonn quand mes yeux ont commenc  perdre de leur acuit.$b$bRendez service  un vieil aveugle, et allez voir dans le coffre,  l\'tage. Vous y trouverez peut-tre quelque chose qui vous en apprendra plus sur ce Stalvan. Je suis pratiquement sr qu\'il y a une page de journal dcolore qui peut tre trs intressante. Rapportez-la-moi et je vous aiderai de mon mieux.', 'Le Marchal Haggard vous a demand d\'aller chercher la Page de journal dcolore dans le coffre,  l\'tage.', '', 'Retournez voir le Marchal Haggard au Camp de bcherons du Val d\'Est, dans la Fort d\'Elwynn.', '', '', '', '', 18019);
