INSERT INTO `quest_template_locale` VALUES (76, 'deDE', 'Die Jaspismine', 'Erforscht die Jaspismine und kehrt dann nach Goldhain zu Marschall Dughan zurck, um ihm Bericht zu erstatten.', 'Dank Euch wissen wir jetzt, dass Kobolde sich in der Tiefenschachtmine eingenistet haben. Jetzt brauchen wir noch einen Spher, der die weiter entfernte Jaspismine untersucht.$B$BErforscht die Jaspismine und besttigt mir, ob sich dort tatschlich Kobolde aufhalten. Die Mine erreicht Ihr, indem Ihr der Strae nach Osten folgt, bis Ihr zum Turm von Azora kommt. Wenn Ihr Euch am Turm nach Norden wendet, dann findet Ihr die Mine im Vorgebirge.', 'Aussphen der Jaspismine', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (76, 'esES', 'La Cantera de Jaspe', 'Explora la Cantera de Jaspe y vuelve a informar al alguacil Dughan a Villadorada.', 'Gracias a ti, ahora sabemos que la Mina Abisal est infestada de kbolds. Ahora necesitamos un explorador que investigue la Cantera de Jaspe, que est ms lejos.$B$BExplora la Cantera de Jaspe e infrmame si ves algn kbold. Para llegar a la mina, viaja hacia el este por el camino hasta que llegues a la Torre de Azora. Cuando llegues all, dirgete hacia el norte. Encontrars la mina al pie de las colinas.', 'Explora la Cantera de Jaspe', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (76, 'esMX', 'La Cantera de Jaspe', 'Explora la Cantera de Jaspe y vuelve a informar al alguacil Dughan a Villadorada.', 'Gracias a ti, ahora sabemos que la Mina Abisal est infestada de kbolds. Ahora necesitamos un explorador que investigue la Cantera de Jaspe, que est ms lejos.$B$BExplora la Cantera de Jaspe e infrmame si ves algn kbold. Para llegar a la mina, viaja hacia el este por el camino hasta que llegues a la Torre de Azora. Cuando llegues all, dirgete hacia el norte. Encontrars la mina al pie de las colinas.', 'Explora la Cantera de Jaspe', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (76, 'frFR', 'La mine Veine-de-jaspe', 'Explorez la Mine Veine-de-jaspe, puis faites votre rapport au Marchal Dughan de Comt-de-lOr.', 'Merci, nous savons dsormais que la mine de Fondugouffre est infeste de Kobolds. Nous avons besoin maintenant d\'un claireur pour explorer la mine la plus loigne, celle de Veine-de-jaspe.$B$BExplorez-la et confirmez la prsence de Kobolds. Pour parvenir  la mine, allez vers l\'est le long de la route, jusqu\' la tour d\'Azora. De l prenez vers le nord et vous tomberez sur la mine dans les collines.', 'Explorer la mine Veine-de-jaspe', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (76, 'itIT', 'La Miniera Venarossa', 'Esplora la Miniera Venarossa, poi fai rapporto al Maresciallo Dughan nella citt di Borgodoro.', 'Grazie a te ora sappiamo che la Miniera Antrocupo  infestata dai Coboldi. Vorrei che esplorassi la Miniera Venarossa per verificare la presenza di quelle creature anche l.$B$BPer raggiungere la miniera, segui la strada a est fino alla Torre di Azora e da l dirigiti a nord. La miniera si trova ai piedi delle colline.', 'Esplora la miniera Venarossa.', '', '', '', '', '', 0);
