INSERT INTO `quest_template_locale` VALUES (76, 'ptBR', 'A Mina de Jaspe', 'Explore a Mina de Jaspe e, depois, fale com o Delegado Duro em Vila d\'Ouro.', 'Graas a voc sabemos que a Mina Vailafundo est infestada de kobolds. Agora, precisamos de um batedor para investigar a Mina de Jaspe, que fica mais longe.$B$BExplore a Mina de Jaspe e confirme se h presena de kobolds. Para chegar  mina, v para leste seguindo a estrada at que voc chegue  Torre de Azora. Da torre, siga para o norte e voc chegar  mina, ao p das montanhas.', 'Explore a Mina de Jaspe', '', '', '', '', '', 0);
