INSERT INTO `quest_template_locale` VALUES (77, 'deDE', 'Eine schleimige Angelegenheit', 'Holt 10 Flaschen Hinterlnder Honigwein aus den Kisten, die sich rund um den verlassenen Sttzpunkt der Horde am Lauerfels befinden.', 'Ich besitze Originalverpackungsmaterialien fr den Wein, den Dran Droffers will. Ich werde Euch dabei helfen, den Wein fr Maltons ungehobelten Vater zu verpacken... fr einen Unkostenbeitrag in Hhe zweier weiterer Flaschen besagten Weins. Sie befinden sich in Kisten, die Ihr in dem verlassenen Sttzpunkt der Horde in der Nhe vom Lauerfels findet.$B$BDas heit, dass es eine anstrengende Aufgabe wird. Ihr werdet bei den Ruinen stinkende Schleime und Schlamme vorfinden; angeblich werden sie von einer Art Oberschlamm gefhrt. Beschafft dessen ungeachtet den Wein und kehrt hierher zu mir zurck, um ihn zu verpacken.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (77, 'esES', 'Una situacin peliaguda', 'Recoge 10 botellas de calimocho dulce de las Tierras del Interior de las cajas de la base abandonada de la Horda en Roca Oculta.', 'Tengo material de empaquetado original para el calimocho que quiere Dran Droffers. Te ayudar a prepararlo para envirselo a ese grun del padre de Malton... a cambio de dos botellas del mismo. Estn en unas cajas en la base abandonada de la Horda cerca de Roca Oculta.$B$BSer muy dificultoso; habr babosas y mocos repugnantes por las ruinas. Dicen que su lder es una especie de jefe moco. Pero da igual; consigue el calimocho y vuelve aqu para empaquetarlo.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (77, 'esMX', 'Una situacin peliaguda', 'Recoge 10 botellas de calimocho dulce de las Tierras del Interior de las cajas de la base abandonada de la Horda en Roca Oculta.', 'Tengo material de empaquetado original para el calimocho que quiere Dran Droffers. Te ayudar a prepararlo para envirselo a ese grun del padre de Malton... a cambio de dos botellas del mismo. Estn en unas cajas en la base abandonada de la Horda cerca de Roca Oculta.$B$BSer muy dificultoso; habr babosas y mocos repugnantes por las ruinas. Dicen que su lder es una especie de jefe moco. Pero da igual; consigue el calimocho y vuelve aqu para empaquetarlo.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (77, 'frFR', 'Une situation dlicate', 'Rcuprez 10 bouteilles de Houle au miel des Hinterlands dans des caisses se trouvant aux environs de la base abandonne de la Horde, au rocher de lAfft.', 'Je possde lemballage dorigine ncessaire pour conditionner la Houle que Dran Droffers recherche. Je vais vous aider  lemballer pour le pre de Malton,  l\'humeur si caustique contre deux bouteilles de la susnomme Houle. Les bouteilles se trouvent dans une caisse, dans une base abandonne de la Horde, prs du rocher de lAfft.$B$BLa tche sera ardue: dimmondes geles et mme des limons infestent les ruines. On dit que ces cratures seraient commandes par une sorte de limon en chef. Quoi quil en soit, procurez-vous la Houle et revenez me voir ici pour la conditionner.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (77, 'itIT', 'A Sticky Situation', 'Recover 10 bottles of Hinterlands Honey Ripple from the crates located around the abandoned Horde base in Skulk Rock.', 'I possess original packaging materials for the ripple Dran Droffers seeks.  I will assist you in packaging the ripple for Malton\'s abrasive father... for a fee of two additional bottles of said ripple.  They are located in crates found in the abandoned Horde base near Skulk Rock.$B$BIt will be an arduous task, to wit; foul slimes and oozes will be found sticking to the ruins; rumor has it they are led by some sort of master ooze.  Regardless, procure the ripple and return to me here for packaging.', '', '', '', '', '', '', 0);
