INSERT INTO `quest_template_locale` VALUES (78, 'deDE', 'Die Legende von Stalvan', 'Bringt die verblasste Tagebuchseite zu Schankwart Smitts nach Dunkelhain im Dmmerwald.', 'Ich kenne jemanden, der Euch vielleicht helfen knnte. Damals, als ich noch die Wachen von Sturmwind kommandierte, haben wir immer in der Taverne \"Zum Roten Raben\" in Dunkelhain gesessen und etwas getrunken. Smitts, der Gastwirt dort, kannte sich mit den rtlichen Lehren ziemlich gut aus. Zeigt ihm diese Seite, mal sehen, was er dazu zu sagen hat.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (78, 'esES', 'La leyenda de Stalvan', 'Lleva la pgina de diario borrada al tabernero Smitts a Villa Oscura, en el Bosque del Ocaso.', 'S de alguien que probablemente podr ayudarte. Cuando yo comandaba la guardia de Ventormenta, iba con mis hombres a beber al Mesn del Cuervo Escarlata de Villa Oscura. El tabernero, Smitts, era todo un experto en las tradiciones de la zona. Ensale esta pgina y escucha lo que te pueda decir sobre ella.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (78, 'esMX', 'La leyenda de Stalvan', 'Lleva la pgina de diario borrada al tabernero Smitts a Villa Oscura, en el Bosque del Ocaso.', 'S de alguien que probablemente podr ayudarte. Cuando yo comandaba la guardia de Ventormenta, iba con mis hombres a beber al Mesn del Cuervo Escarlata de Villa Oscura. El tabernero, Smitts, era todo un experto en las tradiciones de la zona. Ensale esta pgina y escucha lo que te pueda decir sobre ella.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (78, 'frFR', 'La lgende de Stalvan', 'Prenez la Page de journal dcolore et montrez-la  Smitts l\'aubergiste  Sombre-Comt, au Bois de la Pnombre.', 'Je connais quelquun qui pourra peut-tre vous aider. Quand je commandais les gardes de Hurlevent, nous avions l\'habitude d\'aller boire un coup  la taverne du Corbeau carlate,  Sombre-Comt. L\'aubergiste, Smitts, connat nombre d\'histoires sur la rgion. Montrez-lui cette page, et voyez ce qu\'il vous dira.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (78, 'itIT', 'The Legend of Stalvan', 'Take the Faded Journal Page to Tavernkeep Smitts at Darkshire in Duskwood.', 'I know of someone who might be able to assist you.  Back when I was leading the Stormwind Guard, we used to get drinks at the Scarlet Raven Tavern in Darkshire.  The Innkeeper there, Smitts, was quite an expert on the local lore.  Show him this page and see what he has to say about it.', '', '', '', '', '', '', 0);
