INSERT INTO `quest_template_locale` VALUES (79, 'deDE', 'Die Legende von Stalvan', 'Bringt Kommandant Schwarzhaupt die schlammverschmierte Seite.', 'Ich habe die Geschichten um diesen Stalvan jahrelang verfolgt. Als vor ein paar Jahren diese Adligen, die hier zu Besuch waren, ermordet wurden, hab ich Haggard bei seinen Nachforschungen begleitet. Ich habe damals diese schlammverschmierten Seiten gefunden, aber es ist uns nie gelungen, die Handschrift mit diesem Verrckten in den Wldern in Verbindung zu bringen. Eure Spur der Beweise zeigt aber, dass er schuldig ist. Bringt dies sofort zu Kommandant Schwarzhaupt und sagt ihr, was Ihr entdeckt habt!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (79, 'esES', 'La leyenda de Stalvan', 'Lleva la pgina embarrada a la comandante Cerranegro.', 'Segu la leyenda del tal Stalvan durante aos. Hace unos aos, cuando asesinaron a aquellos nobles, yo fui con Haggard a investigar el asunto. Encontr estas pginas llenas de barro, pero nunca conseguimos relacionar la caligrafa con ese luntico. Tus pruebas demuestran su culpabilidad. Lleva esto a la comandante Cerranegro de inmediato e infrmale de lo que has descubierto.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (79, 'esMX', 'La leyenda de Stalvan', 'Lleva la pgina embarrada a la comandante Cerranegro.', 'Segu la leyenda del tal Stalvan durante aos. Hace unos aos, cuando asesinaron a aquellos nobles, yo fui con Haggard a investigar el asunto. Encontr estas pginas llenas de barro, pero nunca conseguimos relacionar la caligrafa con ese luntico. Tus pruebas demuestran su culpabilidad. Lleva esto a la comandante Cerranegro de inmediato e infrmale de lo que has descubierto.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (79, 'frFR', 'La lgende de Stalvan', 'Portez les pages au Commandant Bouclenoire.', 'Je m\'intresse  l\'histoire de ce personnage, Stalvan, depuis des annes. Le jour o ces nobles de passage furent massacrs, il y a quelques annes, je suis venu avec Haggard pour enquter. J\'ai trouv ces pages boueuses, mais je n\'ai jamais pu faire le lien avec l\'criture de cet homme fou dans les bois. Ce que vous m\'apportez l, prouve de toute vidence qu\'il est coupable. Portez immdiatement cela au commandant Bouclenoire et racontez-lui ce que vous avez dcouvert!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (79, 'itIT', 'The Legend of Stalvan', 'Take the muddy page to Commander Ebonlocke.', 'I followed the legend of that Stalvan character for years.  When those visiting nobles were slaughtered a few years back I went with Haggard to investigate.  I found these muddy pages but we were never able to link the handwriting to that crazy man in the woods.  Your trail of evidence proves his guilt.  Take this to Commander Ebonlocke immediately and fill her in on what you\'ve discovered!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (79, 'ptBR', 'The Legend of Stalvan', 'Take the muddy page to Commander Ebonlocke.', 'I followed the legend of that Stalvan character for years. When those visiting nobles were slaughtered a few years back I went with Haggard to investigate. I found these muddy pages but we were never able to link the handwriting to that crazy man in the woods. Your trail of evidence proves his guilt. Take this to Commander Ebonlocke immediately and fill her in on what you\'ve discovered!', '', '', '', '', '', '', 0);
