INSERT INTO `quest_template_locale` VALUES (80, 'deDE', 'Die Legende von Stalvan', 'Zeigt Amtmann Daltry die blutbefleckte Tagebuchseite.', 'Ich beobachte diesen Widerling Stalvan jetzt schon eine ganze Weile. Aber wenn diese Seite tatschlich von seiner Hand geschrieben wurde, dann beweist das seine Schuld ohne den letzten Zweifel.$b$bSo lange, wie Amtmann Daltry das Stadtverzeichnis jetzt schon verwaltet, ist er ein wahrer Experte darin geworden, Handschriften zu identifizieren. Zeigt ihm diese Seite und stellt fest, ob die Schrift dieselbe ist wie diejenige der Unterschrift im Verzeichnis.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (80, 'esES', 'La leyenda de Stalvan', 'Ensea la pgina del diario manchada de sangre al secretario Daltry.', 'Estuve vigilando a ese asqueroso de Stalvan durante mucho tiempo. Si est pgina fue escrita por la misma mano... tenemos una prueba de su culpabilidad ms all de una duda razonable.$B$BEl secretario Daltry, a lo largo de sus aos en el registro, se ha convertido en un experto calgrafo. Mustrale esta pgina y pdele que compruebe si la caligrafa coincide con la de la firma del registro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (80, 'esMX', 'La leyenda de Stalvan', 'Ensea la pgina del diario manchada de sangre al secretario Daltry.', 'Estuve vigilando a ese asqueroso de Stalvan durante mucho tiempo. Si est pgina fue escrita por la misma mano... tenemos una prueba de su culpabilidad ms all de una duda razonable.$B$BEl secretario Daltry, a lo largo de sus aos en el registro, se ha convertido en un experto calgrafo. Mustrale esta pgina y pdele que compruebe si la caligrafa coincide con la de la firma del registro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (80, 'frFR', 'La lgende de Stalvan', 'Montrez au Greffier Daltry la Page de journal macule de sang.', 'J\'avais dj l\'il sur ce sale type, Stalvan. Mais si les critures concordent, alors cela prouve sans l\'ombre d\'un doute qu\'il est coupable.$b$bAvec toutes ces journes  tenir le registre de la ville, le Greffier Daltry est devenu un expert dans l\'identification des critures. Montrez-lui ces pages pour vrifier si les critures concordent avec la signature prsente sur le registre.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (80, 'itIT', 'The Legend of Stalvan', 'Show Clerk Daltry the Bloodstained Journal Page.', 'I have had my eye on that creep, Stalvan, for quite sometime.  But if this page was written by the same hand it proves his guilt beyond a shadow of a doubt.$b$bIn all his days keeping the Town Registry, Clerk Daltry has become an expert at identifying handwriting.  Show him this page and see if the writing matches that of the registry signature.', '', '', '', '', '', '', 0);
