INSERT INTO `quest_template_locale` VALUES (81, 'deDE', 'Weinlieferung', 'Liefert das Fass nach Orgrimmar an Dran Droffers.', 'Ich habe zustzliche Vorsichtsmanahmen getroffen und nicht nur Drans verpackte Welle in dem Fass sicher untergebracht, sondern auch die zustzlichen Wellenflaschen, die er klaut. Auch wenn ich nicht viel von Dran halte, so gibt es doch nichts Schlimmeres als ein durchgeschtteltes Wellenbouquet. Bitte, bitte, keine Ursache.$B$BBringt jetzt Euer Fass zu Dran Droffers in seinem Kramladen in Orgrimmar. Entbietet meine besten Gre bitte auch Malton und lasst ihn wissen, dass uns sein Besuch eine groe Ehre wre, falls es ihn jemals nach einem feinen Getrnk und noch feineren Trinkkumpanen gelstet.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (81, 'esES', 'Entrega el calimocho', 'Entrega el barril a Dran Droffers en Orgrimmar.', 'He puesto la caja de calimocho y las otras botellas que se lleva Dran en el barril para que no se muevan. l no me cae muy bien, pero la verdad es que no hay nada peor que el calimocho agitado.$B$BLlvale el barril a su local en Orgrimmar. Y transmite mi afectuoso saludo a Malton; dile que si alguna vez tiene sed de bebida y de buena compaa, nos honrara mucho su visita.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (81, 'esMX', 'Entrega el calimocho', 'Entrega el barril a Dran Droffers en Orgrimmar.', 'He puesto la caja de calimocho y las otras botellas que se lleva Dran en el barril para que no se muevan. l no me cae muy bien, pero la verdad es que no hay nada peor que el calimocho agitado.$B$BLlvale el barril a su local en Orgrimmar. Y transmite mi afectuoso saludo a Malton; dile que si alguna vez tiene sed de bebida y de buena compaa, nos honrara mucho su visita.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (81, 'frFR', 'La livraison de Houle', 'Livrez le tonneau  Dran Droffers,  Orgrimmar.', 'J\'ai pris la peine de mettre  l\'abri dans le tonneau, en plus de la houle emballe de Dran, les bouteilles supplmentaires qu\'il veut faucher pour son propre compte. Je n\'aime pas beaucoup Dran, mais il n\'y a rien de pire que de la houle vente. Ne vous donnez pas la peine de me remercier.$B$BAllez maintenant livrer le baril  Dran Droffers,  sa boutique d\'Orgrimmar. Et passez le bonjour  Malton! Dites-lui que s\'il cherche d\'excellentes boissons et de sympathiques compagnons de beuverie, nous serions honors de recevoir sa visite.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (81, 'itIT', 'Ripple Delivery', 'Deliver the barrel to Dran Droffers in Orgrimmar.', 'I have taken the extra step of securing not only Dran\'s packaged ripple in the barrel, but also the extra bottles of ripple he is purloining.  While I may not hold Dran very highly, there is nothing worse than jostled ripple.  You\'re welcome.$B$BNow, deliver yon barrel to Dran Droffers in his salvage emporium in Orgrimmar.  Pray tell, please extend my warmest greetings to Malton; let him know that should he ever thirst for fine drink and finer drinking companions, we would be honored with his visit.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (81, 'ptBR', 'Ripple Delivery', 'Deliver the barrel to Dran Droffers in Orgrimmar.', 'I have taken the extra step of securing not only Dran\'s packaged ripple in the barrel, but also the extra bottles of ripple he is purloining. While I may not hold Dran very highly, there is nothing worse than jostled ripple. You\'re welcome.$B$BNow, deliver yon barrel to Dran Droffers in his salvage emporium in Orgrimmar. Pray tell, please extend my warmest greetings to Malton; let him know that should he ever thirst for fine drink and finer drinking companions, we would be honored with his visit.', '', '', '', '', '', '', 0);
