INSERT INTO `quest_template_locale` VALUES (82, 'deDE', 'Erkundung des Giftigen Unterschlupfes', 'Bringt fnf Centipaarinsektenteile vom Giftigen Unterschlupf nach Gadgetzan zum Alchemisten Stelbruch.', 'Tja, diese Berichte ber die Kfer... wir wissen, dass sie die Teiche trocken legen, die sich dort befanden, wo sich der Giftige Unterschlupf befindet. Was wir NICHT wissen, ist, na ja, alles andere.$B$BWir mssen als Erstes herausfinden, wer unser Feind ist! Begebt Euch bitte in den Giftigen Unterschlupf und besorgt ein paar Stcke dieser Tierwesen. Holt fnf von diesen Teilen von den dortigen Centipaar und bringt sie dem Alchemisten Stelbruch zur Untersuchung. Wenn er sich damit beschftigt, werden wir schon herausfinden, worum es sich handelt!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (82, 'esES', 'Investigacin en la Guarida Ponzoosa', 'Llvale 5 trozos de insectos centipaar de La Guarida Ponzoosa al alquimista Morterozugg de Gadgetzan.', 'A ver, en cuanto a estos informes sobre los bichos... lo que sabemos es que estn drenando las pozas de agua que antes estaban donde se ubica La Guarida Ponzoosa. Lo que NO sabemos es... bueno, todo lo dems.$B$BDescubramos en primer lugar a quin nos enfrentamos! Quiero que vayas a La Guarida Ponzoosa y que obtengas algunos trozos de esos bichos. Consigue 5 trozos de centipaar y llvaselos al alquimista Morterozugg para que se encargue de ellos. Con su ayuda podremos descubrir qu son.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (82, 'esMX', 'Investigacin en la Guarida Ponzoosa', 'Llvale 5 trozos de insectos centipaar de La Guarida Ponzoosa al alquimista Morterozugg de Gadgetzan.', 'A ver, en cuanto a estos informes sobre los bichos... lo que sabemos es que estn drenando las pozas de agua que antes estaban donde se ubica La Guarida Ponzoosa. Lo que NO sabemos es... bueno, todo lo dems.$B$BDescubramos en primer lugar a quin nos enfrentamos! Quiero que vayas a La Guarida Ponzoosa y que obtengas algunos trozos de esos bichos. Consigue 5 trozos de centipaar y llvaselos al alquimista Morterozugg para que se encargue de ellos. Con su ayuda podremos descubrir qu son.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (82, 'frFR', 'Enqute au Repaire nuisible', 'Apportez cinq morceaux de Centipaars du Repaire nuisible  l\'Alchimiste Pilonzugg,  Gadgetzan.', 'Trs bien, maintenant ces rapports  propos des insectes... Ce que nous savons, c\'est qu\'ils drainent l\'eau du rservoir qui se trouvait  l\'emplacement du Repaire nuisible. Ce que nous ne savons PAS... Tout le reste.$B$BEssayons tout d\'abord de savoir qui est notre ennemi! Je veux que vous alliez au Repaire nuisible et rameniez des bouts de ces bestioles. Rcuprez cinq morceaux de ces Centipaars et portez-les  l\'alchimiste Pilonzugg pour qu\'il voie de quoi il retourne. Avec lui sur l\'affaire, nous le saurons vite!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (82, 'itIT', 'Noxious Lair Investigation', 'Bring five Centipaar insect parts from the Noxious Lair to Alchemist Pestlezugg in Gadgetzan.', 'All right now, these reports about the bugs... what we know is that they are draining the water pools that used to be where the Noxious Lair is. What we DON\'T know is, well, everything else.$B$BLet\'s figure out who our enemy is first! I want you to head into the Noxious Lair and get some parts off of those critters. Get five from the Centipaar there and bring them to Alchemist Pestlezugg for him to dink with. With him on the case, we\'ll figure out what they are!', '', '', '', '', '', '', 0);
