INSERT INTO `quest_template_locale` VALUES (83, 'deDE', 'Feine Leinenwaren', 'Bringt 6 Leinenfetzen ins Holzfllerlager des Osttals zu Sara Roderwald.', 'Die Schlger in Elwynn tragen Leinenstoff, aus dem ich feine Leinenwaren herstellen kann.$B$BBringt mir Leinenfetzen und ich mache euch daraus etwas Ntzliches.$B$BIhr findet diese gesetzlosen Verbrecher in kleinen Lagern berall in Elwynn.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (83, 'esES', 'Pauelos de lino rojo', 'Lleva 6 pauelos de lino rojo a Sara Timberlain al Aserradero de la Vega del Este.', 'Los matones de Elwynn llevan lino, que me vendra bien para confeccionar prendas.$B$BSi me traes pauelos de lino rojo, los usar para hacerte algo bonito.$B$BEncontrars a esos criminales en campamentos repartidos por todo el Bosque de Elwynn.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (83, 'esMX', 'Pauelos de lino rojo', 'Lleva 6 pauelos de lino rojo a Sara Timberlain al Aserradero de la Vega del Este.', 'Los matones de Elwynn llevan lino, que me vendra bien para confeccionar prendas.$B$BSi me traes pauelos de lino rojo, los usar para hacerte algo bonito.$B$BEncontrars a esos criminales en campamentos repartidos por todo el Bosque de Elwynn.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (83, 'frFR', 'Articles en lin de qualit', 'Apportez 6 Chiffons en lin  Sara Timberlain, au Camp de bcherons du Val dEst.', 'Les bandits dElwynn portent du lin dont je pourrais tirer parti pour fabriquer des articles de qualit.$B$BRapportez-moi des chiffons de lin et je les utiliserai pour vous confectionner quelque chose.$B$BVous trouverez ces criminels sans foi ni loi dissmins dans toute la fort d\'Elwynn.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (83, 'itIT', 'Capi di lino eleganti', 'Porta 6 Avanzi di Lino a Sara Timberlain nel Campo di Taglio di Vallevante.', 'I banditi di Elwynn indossano indumenti di lino con cui potrei confezionare dei capi di lino eleganti.$B$BPortami degli Avanzi di Lino e li user per realizzare qualcosa per te.$B$BTroverai quei criminali sparsi in gruppi per la Foresta di Elwynn.', '', '', '', '', '', '', 0);
