INSERT INTO `quest_template_locale` VALUES (83, 'ptBR', 'Itens finos de linho', 'Leve 6 Retalhos de Linho para Sara Albernaz na Madeireira Vale do Leste.', 'Os meliantes de Elwynn usam linho. Eu preciso desse material pra fabricar itens finos.$B$BMe traga retalhos de linho e eu vou poder costurar alguma coisa pra voc usar.$B$BVoc vai encontrar aqueles foras-da-lei em bandos por toda a Floresta de Elwynn.', '', '', '', '', '', '', 0);
