INSERT INTO `quest_template_locale` VALUES (84, 'deDE', 'Zurck zu Billy', 'Bringt die Schweinebauchpastete zu Billy Maclure in den Weinbergen der Maclures.', 'Hier, bitte schn. Und wenn Ihr Billy die Pastete gebt, dann sagt ihm, ich hoffe, er erstickt daran!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (84, 'esES', 'Vuelve con Billy', 'Lleva el pastel de tripa de cerdo a Billy Maclure a Los Viedos de Maclure.', 'Aqu tienes. Y cuando le des el pastel a Billy, dile que espero que se atragante con l!', '', '', '', '', '', '', 0);
