INSERT INTO `quest_template_locale` VALUES (84, 'frFR', 'Revenir voir Billy', 'Apportez la Tourte de panse de porc  Billy Maclure, aux Vignes des Maclure.', 'Voil. Quand vous donnerez cette tourte  Billy, dites-lui de stouffer avec!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (84, 'itIT', 'Ritorno da Billy', 'Porta il Pasticcio di Carne di Cinghiale a Billy Maclure presso le Vigne dei Maclure.', 'Ecco qua. Quando consegnerai questo pasticcio a Billy, digli che spero gli vada di traverso!', '', '', '', '', '', '', 0);
