INSERT INTO `quest_template_locale` VALUES (85, 'deDE', 'Die verlorene Halskette', 'Sprecht mit Billy Maclure.', 'Ich habe meine Halskette verloren und ich glaube, dieser Tunichtgut Billy Maclure hat sie genommen! Normalerweise treibt er sich immer wie eine kleine Ratte in den Weinbergen der Maclures stlich von hier herum. $B$BBringt mir meine Halskette zurck, wenn Ihr das Herz einer alten Witwe erfreuen wollt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (85, 'esES', 'El collar perdido', 'Habla con Billy Maclure.', 'He perdido mi collar... creo que me lo rob ese granuja de Billy Maclure. Normalmente pasa el da escondido como una rata en Los Viedos de Maclure, al este de aqu.$B$BRecupera mi collar y dars una alegra al corazn de una anciana viuda.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (85, 'esMX', 'El collar perdido', 'Habla con Billy Maclure.', 'He perdido mi collar... creo que me lo rob ese granuja de Billy Maclure. Normalmente pasa el da escondido como una rata en Los Viedos de Maclure, al este de aqu.$B$BRecupera mi collar y dars una alegra al corazn de una anciana viuda.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (85, 'frFR', 'Le collier perdu', 'Parlez  Billy Maclure.', 'J\'ai perdu mon collier, et je pense que c\'est ce garnement de Billy Maclure qui l\'a pris! Gnralement, il vagabonde dans les Vignes des Maclure,  l\'est d\'ici.$B$BRapportez-moi mon collier, et vous rchaufferez le cur d\'une pauvre veuve.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (85, 'itIT', 'La collana rubata', 'Parla con Billy Maclure.', 'Ho perso la mia collana! Credo l\'abbia presa quella peste di Billy Maclure! Di solito si aggira come un topo nei pressi delle Vigne dei Maclure a est.$B$BRecupera la mia collana, ti prego... faresti felice questa vecchia vedova.', '', '', '', '', '', '', 0);
