INSERT INTO `quest_template_locale` VALUES (85, 'ptBR', 'O colar perdido', 'Fale com Guinho Madruga.', 'Eu perdi o meu colar... Aposto que foi aquele trombadinha do Guinho Madruga quem roubou! Ele est sempre saracoteando feito um rato nos Vinhedos dos Madruga, a leste daqui.$B$BRecupere meu colar, $n, e voc dar um alento a um pobre corao de viva...', '', '', '', '', '', '', 0);
