INSERT INTO `quest_template_locale` VALUES (86, 'deDE', 'Pastete fr Billy', 'Bringt 4 Portionen zartes Eberfleisch zu Tantchen Bernice Steinfeld auf dem Hof der Steinfelds.', 'Wenn ich \'ne Pastete kriegen wrde, dann knnte ich Euch vielleicht sagen, wer die Kette hat. Ach, und wisst Ihr was? Diese alte Dame Bernice auf dem anderen Hof da macht ganz tolle Schweinebauchpasteten. $B$BWenn Ihr ihr ein bisschen zartes Eberfleisch von den Ebern bringt, die immer um unsere Hfe herumstromern, und ihr sagt, dass es fr einen guten Zweck ist, dann backt sie Euch vielleicht eine Pastete.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (86, 'esES', 'Un pastel para Billy', 'Lleva 4 carnes de jabal tiernas a la ta Bernice Pedregosa a La Granja Pedregosa.', 'Si me das un pastel, puede que te diga quin tiene el collar. Bernice, esa anciana de la otra granja, hace unos pasteles de tripa de cerdo increbles...$B$BSi le llevas algo de carne de jabal tierna de los jabales que rondan por nuestras granjas, y le dices para qu es, seguro que te hace un pastel.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (86, 'esMX', 'Un pastel para Billy', 'Lleva 4 carnes de jabal tiernas a la ta Bernice Pedregosa a La Granja Pedregosa.', 'Si me das un pastel, puede que te diga quin tiene el collar. Bernice, esa anciana de la otra granja, hace unos pasteles de tripa de cerdo increbles...$B$BSi le llevas algo de carne de jabal tierna de los jabales que rondan por nuestras granjas, y le dices para qu es, seguro que te hace un pastel.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (86, 'frFR', 'Une tourte pour Billy', 'Apportez 4 morceaux de Viande de sanglier tendre  Tatie Bernice Champierreux,  la ferme des Champierreux.', 'Si je mangeais une tourte, je pourrais peut-tre vous dire qui a ce collier. Vous savez, je pense que cette vieille dame du nom de Bernice, dans l\'autre ferme, fait de formidables tourtes de panse de porc...$B$BSi vous lui apportiez quelques morceaux de viande tendre dun des sangliers qui tranent autour de notre ferme, et si vous lui expliquiez toute lhistoire, alors elle vous prparerait une tourte.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (86, 'itIT', 'Un pasticcio per Billy', 'Porta 4 Pezzi di Carne di Cinghiale Tenera a Zia Bernice Pietradura nella Fattoria dei Pietradura.', 'Ti dir chi  stato a rubare la collana in cambio di un pasticcio. L\'anziana Bernice nell\'altra fattoria cucina degli ottimi Pasticci di Carne di Cinghiale...$B$BPotrebbe preparartene uno, se le portassi della Carne di Cinghiale Tenera presa dalle bestie che vagano vicino alle nostre fattorie e le dicessi a cosa ti serve.', '', '', '', '', '', '', 0);
