INSERT INTO `quest_template_locale` VALUES (86, 'ptBR', 'Juntando a fome...', 'Leve 4 pedaos de Carne de Javali Macia para a \"Titia\" Berenice Campedra na Fazenda dos Campedra.', 'Se eu comesse tipo uma torta bem servida, acho que lembrava rapidinho de quem foi que pegou o colar. Sabe, a dona Berenice l da outra fazenda faz uma Torta de Barriga de Porco muito da gostosa...$B$BQuem sabe se voc no der pra ela uns nacos de carne de javali maciinha, desses que vivem rondando por aqui, ela no faz uma torta pra voc...?', '', '', '', '', '', '', 0);
