INSERT INTO `quest_template_locale` VALUES (87, 'deDE', 'Goldzahn', 'Bringt Berenices Halskette zu \"Tantchen\" Berenice Steinfeld auf dem Hof der Steinfelds.', 'Ich hab in der Nhe von der Tiefenschachtmine gespielt und da hab ich, glaub ich, die Kette von der alten Dame fallenge... h, gesehen. Fragt mich nicht, wie die dahin gekommen ist, ich war\'s nicht!$B$BNa egal, jedenfalls hab ich diesen groen Kobold gesehen, der hatte einen Goldzahn und der hat die Kette aufgehoben und ist zurck in seinen Bau ber der Mine gerannt. Wenn Ihr diesen Kobold findet, dann findet Ihr auch die Halskette, ehrlich! Ich schwr\'s!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (87, 'esES', 'Dientes de Oro', 'Lleva el collar de Bernice a ta Bernice Pedregosa a La Granja Pedregosa.', 'Estaba jugando cerca de la Mina Abisal y creo que se me cay... esto... quiero decir, creo que vi el collar de la seora. No me preguntes cmo lleg all... Yo no fui!$B$BPues eso, que vi a un enorme kbold con dientes de oro que lo recoga y volva corriendo a su cubil, encima de la mina. Si encuentras a ese kbold, encontrars el collar, lo juro!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (87, 'esMX', 'Dientes de Oro', 'Lleva el collar de Bernice a ta Bernice Pedregosa a La Granja Pedregosa.', 'Estaba jugando cerca de la Mina Abisal y creo que se me cay... esto... quiero decir, creo que vi el collar de la seora. No me preguntes cmo lleg all... Yo no fui!$B$BPues eso, que vi a un enorme kbold con dientes de oro que lo recoga y volva corriendo a su cubil, encima de la mina. Si encuentras a ese kbold, encontrars el collar, lo juro!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (87, 'frFR', 'Dent-d\'or', 'Rapportez le Collier de Bernice  Tatie Bernice Champierreux  la Ferme des Champierreux.', 'Je jouais prs de la mine de Fondugouffre, et je pense que j\'ai fait tomb... Euuuuh... Je veux dire que j\'ai vu le collier de la vieille dame. Ne me demandez pas comment il est arriv l... Ce n\'est pas moi qui l\'ai pris!$B$BQuoi qu\'il en soit, j\'ai vu cet norme Kobold avec une dent en or le prendre et s\'enfuir vers sa tanire au-dessus de la mine. Allez l-bas, trouvez le Kobold et vous trouverez le collier, c\'est jur!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (87, 'itIT', 'Dentedoro', 'Porta la Collana di Bernice a \"Zia\" Bernice Pietradura nella Fattoria dei Pietradura.', 'Stavo giocando vicino alla Miniera Antrocupo quando mi  caduta... ehm, cio, quando ho visto la collana di quell\'anziana signora. Non chiedermi come ha fatto ad arrivare l... non l\'ho presa io!$B$BA ogni modo, ho visto questo grosso Coboldo con un dente d\'oro raccogliere la collana e correre verso il suo covo sopra la miniera. Trova quel Coboldo e troverai anche la collana, te lo giuro!', '', '', '', '', '', '', 0);
