INSERT INTO `quest_template_locale` VALUES (87, 'ptBR', 'Dentadouro', 'Leve o Colar de Berenice para \"Titia\" Berenice Campedra na Fazenda dos Campedra, que fica na Floresta de Elwynn.', 'Eu tava brincando perto da Mina Vailafundo e acho que deixei o, ahm, quer dizer, vi o colar da dona Berenice l. No me pergunte como ele chegou l, no sei de nada!$B$BMas, enfim, eu vi um kobold grando, com um dente de ouro, pegando o colar e correndo de volta pra dentro da mina. Encontre o kobold e voc vai encontrar o colar, pode apostar!', '', '', '', '', '', '', 0);
