INSERT INTO `quest_template_locale` VALUES (88, 'deDE', 'Prinzessin muss sterben!', 'Ttet Prinzessin, nehmt ihr Halsband an Euch und bringt es zu Mutter Steinfeld auf dem Hof der Steinfelds.', 'Die Brackbrunns haben eine preisgekrnte Sau namens Prinzessin. Dass dieses Tier so riesig geworden ist, das kommt nur daher, dass es immer hier herbergeschlichen kommt und mein Gemse frisst!$B$BZufllig ist die Sau gerade hier. Sie muss sterben! Bringt mir ihr Halsband zum Beweis und ich werde Euch fr Eure Mhen entlohnen.$B$BIhr findet Prinzessin mitten in unserem Wassermelonenbeet. Schnappt sie Euch!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (88, 'esES', 'Princesa debe morir!', 'Mata a Princesa, coge su collera y llvasela a la abuela Pedregosa a La Granja Pedregosa.', 'Los Brackwell tienen una cerda que ganara cualquier concurso. Se llama Princesa. Est ENORME, y es gracias a m! Porque se alimenta de mis verduras!$B$BPrincesa debe morir antes de que llegue a nuestros campos! Treme su collera como prueba de que est muerta y te dar algo para recompensarte.$B$BPrincesa suele estar justo en medio de nuestro campo de sandas. Ve a por ella!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (88, 'esMX', 'Princesa debe morir!', 'Mata a Princesa, agarra su collera y llvasela a la vieja Pedregosa a La Granja Pedregosa.', 'Los Brackwell tienen una cerda que ganara cualquier concurso. Se llama Princesa. Est ENORME, y es gracias a m! Porque se alimenta de mis verduras!$B$BPrincesa debe morir antes de que llegue a nuestros campos! Treme su collera como prueba de que est muerta y te dar algo para recompensarte.$B$BPrincesa suele estar justo en medio de nuestro campo de sandas. Ve por ella!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (88, 'frFR', 'Princesse doit mourir!', 'Tuez Princesse, prenez son collier puis rapportez-le  Maman Champierreux,  la Ferme des Champierreux.', 'Les Saumepuits ont un cochon appel Princesse qui a gagn des tas de prix. C\'est une NORME truie qui sest engraisse sur mon dos en venant chaparder des lgumes dans mon potager !$B$BElle y est en ce moment mme ! Princesse doit mourir ! Rapportez-moi son collier pour preuve de son excution, et je vous rcompenserai pour votre travail !$B$BVous trouverez Princesse plante au beau milieu de notre carr de pastques. Allez l\'gorger !', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (88, 'itIT', 'Principessa deve morire!', 'Uccidi Principessa, prendi il suo collare e riportalo a Ma Pietradura nella Fattoria dei Pietradura.', 'I Pozzonero hanno una scrofa da competizione. Si chiama Principessa ed  ENORME, grazie anche a tutta la mia frutta che mangia di nascosto!$B$BPare che ora si trovi qui! La voglio morta! Portami il suo collare come prova della sua uccisione e ti dar qualcosa per il disturbo!$B$BTroverai Principessa al centro del nostro campo di angurie. Uccidila!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (88, 'koKR', ' !', '           .', '         ,             !$B$B        !        .$B$B       .', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (88, 'ptBR', 'Princesa tem que morrer!', 'Mate Princesa, pegue a coleira dela e leve-a para Mama Campedra na Fazenda dos Campedra.', 'Os Braga tm uma porca vencedora, a Princesa. Ela  ENORME, e ficou assim de tanto vir aqui e devorar minha horta!$B$BAlis, ela est aqui neste instante! Princesa tem que morrer! Me traga a coleira dela como prova, e eu lhe darei alguma coisa como pagamento!$B$BA Princesa est l no meio da nossa plantao de melancias. V peg-la!', '', '', '', '', '', '', 0);
