INSERT INTO `quest_template_locale` VALUES (89, 'deDE', 'Die Immerruhbrcke', 'Bringt 5 Eisenspitzen und 5 Eisennieten nach Seenhain zu Groknecht Oslow.', 'Whrend der letzten Invasion der Orcs waren wir gezwungen, unser Eisen einzuschmelzen, um Kugeln, Schwerter und Rstungen herzustellen. Wir haben Sturmwind benachrichtigt, dass wir eine neue Lieferung Materialien bentigen. Aber eine Bande von Rotkammgnollen hat die Karawane berfallen und sich dann in die Hgel hinter Seenhain zurckgezogen.$b$bJetzt gehen uns langsam die Vorrte aus, die wir brauchen, um die Brcke wieder aufzubauen. Wenn Ihr mir 5 Eisenspitzen und 5 Eisennieten bringt, $n, dann sollt Ihr dafr belohnt werden. $b$bUnd jetzt an die Arbeit!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (89, 'esES', 'El puente sempiterno', 'Lleva 5 picas y 5 remaches de hierro al supervisor Olento a Villa del Lago.', 'Durante la ltima invasin orca tuvimos que usar todo el hierro para fabricar balas, espadas y armaduras. Hicimos un pedido de materia prima a Ventormenta, pero unos gnolls Crestagrana secuestraron la caravana y se ocultaron en las colinas de detrs de Villa del Lago.$B$BY ahora estamos sin material para reconstruir el puente. Te recompensar, $n, si me traes 5 picas y 5 remaches de hierro.$B$BVenga, a trabajar!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (89, 'esMX', 'El puente sempiterno', 'Lleva 5 picas y 5 remaches de hierro al supervisor Olento a Villa del Lago.', 'Durante la ltima invasin orca tuvimos que usar todo el hierro para fabricar balas, espadas y armaduras. Hicimos un pedido de materia prima a Ventormenta, pero unos gnolls Crestagrana secuestraron la caravana y se ocultaron en las colinas de detrs de Villa del Lago.$B$BY ahora estamos sin material para reconstruir el puente. Te recompensar, $n, si me traes 5 picas y 5 remaches de hierro.$B$BVenga, a trabajar!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (89, 'frFR', 'Le pont sur le lac', 'Apportez 5 Clous en fer et 5 Rivets en fer au Contrematre Oslow,  Comt-du-Lac.', 'Lors de la dernire invasion des orcs, nous avons t obligs de fondre tout notre fer pour fabriquer des balles, des armures et des pes. Nous avons envoy une demande de ravitaillement  Hurlevent, mais une bande de gnolls des Carmines a dtourn la caravane puis s\'est enfuie dans les collines au-del de Comt-du-Lac.$B$BNous allons bientt tre  court de matriel pour reconstruire ce pont. Si vous pouviez me rapporter 5 clous en fer et 5 rivets en fer, $n, je ferais en sorte que l\'on vous rcompense.$B$BAllez, au travail!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (89, 'itIT', 'The Everstill Bridge', 'Bring 5 Iron Pikes and 5 Iron Rivets to Foreman Oslow in Lakeshire.', 'During the last orc invasion we were forced to smelt our iron down to make bullets, swords and armor.  We sent word to Stormwind for a new shipment of materials but a band of Redridge gnolls hijacked the caravan and ran off into the hills behind Lakeshire.$b$bNow we\'re coming up short on supplies to get this bridge rebuilt.  If you can bring me 5 iron pikes and 5 iron rivets, $n, I\'ll make sure you\'re rewarded. $b$bNow let\'s get to work!', '', '', '', '', '', '', 0);
