INSERT INTO `quest_template_locale` VALUES (90, 'deDE', 'Gewrzte Wolfkebabs', 'Beschafft Euch 10 magere Wolfflanken und Wrzkruter aus Sturmwind und kehrt dann zu Kchenchef Grual nach Dunkelhain zurck.', 'Gewrzter Wolfskebab ist eine Spezialitt des Hauses! Natrlich kann ich Euch welchen machen. Aber ich brauche erst die Zutaten dafr. Bringt mir 10 magere Wolfflanken sowie Wrzkruter aus Sturmwind. Hier im Wald streifen so viele Wlfe herum, da werdet Ihr kein Problem haben, an die Wolfflanken zu kommen, da bin ich mir sicher. Und fr die Kruter sucht ihr am besten Felicia Gump in ihrem Blumenladen im Kanaldistrikt von Sturmwind auf.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (90, 'esES', 'Kebab de lobo sazonado', 'Rene 10 ijadas magras de lobo y hierbas aromticas de Ventormenta y vuelve a Villa Oscura, a ver al Chef Grual.', 'El kebab de lobo sazonado es el especial de la casa! Claro que te puedo preparar un poco! Pero necesitar algunos productos. Treme 10 ijadas magras de lobo y algunas hierbas aromatizadas de Ventormenta. En el bosque hay muchsimos lobos; encontrar ijadas no ser un problema. Para las hierbas, busca a Felicia Gump. Tiene una floristera en el distrito de Los Canales de Ventormenta.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (90, 'esMX', 'Kebab de lobo sazonado', 'Rene 10 ijadas magras de lobo y hierbas aromticas de Ventormenta y vuelve a Villa Oscura, a ver al Chef Grual.', 'El kebab de lobo sazonado es el especial de la casa! Claro que te puedo preparar un poco! Pero necesitar algunos productos. Treme 10 ijadas magras de lobo y algunas hierbas aromatizadas de Ventormenta. En el bosque hay muchsimos lobos; encontrar ijadas no ser un problema. Para las hierbas, busca a Felicia Gump. Tiene una floristera en el distrito de Los Canales de Ventormenta.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (90, 'frFR', 'Kbab de loup assaisonn', 'Rcuprez 10 Steaks de loup et des Herbes aromatiques de Hurlevent, puis retournez voir le chef Grual  Sombre-Comt.', 'La spcialit de la maison est le kbab de loup assaisonn. Bien sr, je peux vous en faire! Mais j\'ai besoin de diffrents ingrdients. Apportez-moi 10 Steaks de loup ainsi qu\'un peu d\'Herbes aromatiques de Hurlevent. Il y a tellement de loups dans la fort que cela ne devrait pas tre un problme pour trouver la viande. Pour ce qui est des herbes, allez donc voir Felicia Gump, la fleuriste du quartier du canal  Hurlevent.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (90, 'itIT', 'Seasoned Wolf Kabobs', 'Gather 10 Lean Wolf Flanks and Stormwind Seasoning Herbs and return to Chef Grual in Darkshire.', 'Seasoned Wolf Kabobs are a house favorite!  Sure, I can make you some.  But first I\'ll need the supplies.  Bring me 10 Lean Wolf Flanks as well as some Stormwind Seasoning Herbs.  There are so many wolves here in the forest, I am sure finding the Flanks will be no problem.  For the herbs, seek out Felicia Gump in her canal district flower shop in Stormwind.', '', '', '', '', '', '', 0);
