INSERT INTO `quest_template_locale` VALUES (91, 'deDE', 'Das Gesetz des Solomon', 'Bringt 10 Schattenfellanhnger ins Rathaus von Seenhain zu Bttel Conacher.', 'Ein Feind Sturmwinds hat sich im stlichen Vorlufer des Rotkammgebirges niedergelassen. Dieser verderbte Schurke bedient sich des bernatrlichen, um unsere Stadt und ihre Einwohner in Angst und Schrecken zu versetzen. Er betreibt sein bles Geschft unter dem Namen Morganth.$b$bMorganth kontrolliert jetzt den Schattenfellklan. Die Gnolle tun alles, was er ihnen befiehlt. Wie es das Gesetz von Seenhain vorsieht, steht auf die Untersttzung eines im Knigreich gesuchten Verbrechers die Todesstrafe.$b$bDiese abscheulichen Gnolle verdienen den Tod!$b$bGebt 10 Schattenfellanhnger bei mir ab, dann erhaltet Ihr eine Belohnung.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (91, 'esES', 'Ley de Solomon', 'Lleva 10 colgantes Pielsombra a Bailiff Conacher al Concejo de Villa del Lago.', 'Se ha instalado un enemigo de Ventormenta en las laderas orientales de Crestagrana. Ese bellaco usa lo arcano para extender el terror entre nuestra gente. Se oculta bajo el nombre de Morganth.$B$BHa esclavizado al clan gnoll Pielsombra. De acuerdo con las leyes de Villa del Lago, asistir a un enemigo del Reino est penado con la muerte.$B$BEsos miserables gnolls deben morir!$B$BTreme diez colgantes Pielsombra y te recompensar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (91, 'esMX', 'Ley de Solomon', 'Lleva 10 colgantes Pielsombra a Bailiff Conacher al Concejo de Villa del Lago.', 'Se ha instalado un enemigo de Ventormenta en las laderas orientales de Crestagrana. Ese bellaco usa lo arcano para extender el terror entre nuestra gente. Se oculta bajo el nombre de Morganth.$B$BHa esclavizado al clan gnoll Pielsombra. De acuerdo con las leyes de Villa del Lago, asistir a un enemigo del Reino est penado con la muerte.$B$BEsos miserables gnolls deben morir!$B$BTreme diez colgantes Pielsombra y te recompensar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (91, 'frFR', 'La loi de Salomon', 'Apportez 10 Pendentifs sombrepoil au Bailli Conacher,  l\'Htel de ville de Comt-du-Lac.', 'Un ennemi de Hurlevent s\'est install dans les collines  lest des Carmines. Dinfmes voleurs utilisent les Arcanes pour rpandre la terreur et la misre sur notre ville et ses habitants. Derrire cela, il y a une personne, Morganth; c\'est lui qui dirige cette entreprise malfique.$b$bMorganth contrle maintenant le clan des gnolls Sombrepoil, quil utilise pour ses exactions. De par la loi de Comt-du-Lac, aider un ennemi du royaume est passible de la peine de mort.$b$bCes infmes gnolls doivent tre tus!$b$bRapportez-moi 10 pendentifs sombrepoil, et vous serez $grcompens:rcompense;.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (91, 'itIT', 'Solomon\'s Law', 'Bring 10 Shadowhide Pendants to Bailiff Conacher in the Lakeshire Town Hall.', 'An enemy of Stormwind has taken up residence in the eastern foothills of Redridge. This wicked villain uses the Arcane to spread terror and misery upon our town and our people. Under the name, Morganth, he conducts his evil business.$b$bMorganth now controls the Shadowhide Gnoll Clan to perform his biddings. As stated by the Law of Lakeshire, aiding a criminal of the Kingdom is punishable by death.$b$bThese vile gnolls must be killed!$b$bTurn in 10 Shadowhide Pendants to me, and you shall be rewarded.', '', '', '', '', '', '', 0);
