INSERT INTO `quest_template_locale` VALUES (92, 'deDE', 'Rotkammgulasch', 'Kchenchefin Breanna aus Seenhain mchte 5 Stcke zhes Kondorfleisch, 5 groe Geiferzahnschnauzen und 5 Portionen knuspriges Spinnenfleisch.', 'Ich wrde liebend gern Rotkammgulasch fr Euch kochen. Aber es gibt da ein kleines Problem. Erst krzlich musste ich whrend des Orcaufstands eine ganze Brigade von Soldaten der Armee von Sturmwind verpflegen. Jetzt ist meine Vorratskammer leer. Aber wenn Ihr mir die Zutaten besorgt, dann mache ich das gern fr Euch.$b$bBringt mir einfach 5 Stcke zhes Kondorfleisch, 5 groe Geiferzahnschnauzen und 5 Portionen knuspriges Spinnenfleisch.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (92, 'esES', 'Estofado Crestagrana', 'El chef Breanna de Villa del Lago quiere 5 piezas de carne de cndor dura, 5 morros de dentosangre grandes y 5 raciones de carne de araa crujiente.', 'Me encantara prepararte un estofado Crestagrana. Pero tengo un problemita; durante los disturbios con los orcos aliment a toda la guarnicin de Ventormenta. No me queda nada en la despensa, pero si t me traes los ingredientes, cocinar para ti.$B$BTreme cinco filetes de carne de cndor dura, cinco morros de dentosangre grandes y cinco raciones de carne de araa crujiente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (92, 'esMX', 'Estofado Crestagrana', 'El chef Breanna de Villa del Lago quiere 5 piezas de carne de cndor dura, 5 morros de dentosangre grandes y 5 raciones de carne de araa crujiente.', 'Me encantara prepararte un estofado Crestagrana. Pero tengo un problemita; durante los disturbios con los orcos aliment a toda la guarnicin de Ventormenta. No me queda nada en la despensa, pero si t me traes los ingredientes, cocinar para ti.$B$BTreme cinco filetes de carne de cndor dura, cinco morros de dentosangre grandes y cinco raciones de carne de araa crujiente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (92, 'frFR', 'Goulash des Carmines', 'Le chef Breanna de Comt-du-Lac vous a demand 5 morceaux de Viande de condor coriace, 5 Groins de grands Broche-tripes et 5 portions de Chair croustillante d\'araigne.', 'Rien ne me ferait plus plaisir que de vous faire du goulash des Carmines. Mais il y a un petit problme. Lors de la dernire attaque des orcs, j\'ai d nourrir la totalit des troupes de Hurlevent. Mon garde-manger est compltement vide. Mais si vous me rapportez les ingrdients, je me ferai un plaisir de vous en prparer.$b$bIl me faut seulement 5 morceaux de Viande de condor coriace, 5 Groins de grands Broche-tripes et 5 portions de Chair croustillante d\'araigne.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (92, 'itIT', 'Redridge Goulash', 'Chef Breanna of Lakeshire wants five pieces of Tough Condor Meat, five Great Goretusk Snouts and five helpings of Crisp Spider Meat.', 'Nothing would please me more than to make you some Redridge Goulash. But there\'s a slight problem. During the recent orc uprising I fed the entire brigade of Stormwind troops. My cupboard is now bare. But if you can provide me with the ingredients, I\'d be happy to oblige.$b$bJust bring me five pieces of Tough Condor Meat, five Great Goretusk Snouts and five helpings of Crisp Spider Meat.', '', '', '', '', '', '', 0);
