INSERT INTO `quest_template_locale` VALUES (93, 'deDE', 'Schwrzliche Krebskchlein', 'Beschafft 6 klebrige Spinnenbeine und bringt sie nach Dunkelhain zu Kchenchef Grual.', 'Ich verrate Euch ein kleines Geheimnis: Schwrzliche \"Krebs\"-Kchlein werden eigentlich aus Spinnenbeinen gemacht! Ich wei, das ist irgendwie eklig, aber die Kchlein schmecken lecker, ein bisschen scharf und eignen sich ganz ausgezeichnet zum Knabbern. Wenn Ihr mir einige klebrige Spinnenbeine bringt, dann zaubere ich Euch ein paar.$B$BIch habe gehrt, dass sich Giftweberspinnen ausgezeichnet dafr eignen - sie haben ihr Nest im Norden, zwischen dem Vorgebirge und dem Fluss.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (93, 'esES', 'Los pasteles de cangrejo oscuro', 'Rene 6 patas pegajosas de araa y llvaselas al Chef Grual a Villa Oscura.', 'Te voy a contar un secreto: los pasteles de \"cangrejo\" oscuro, en realidad se hacen con patas de araa! S que es un poco asqueroso, pero las patas de araa son muy sabrosas y los pasteles quedan estupendos. Treme patas pegajosas de araa y yo te preparo algunos pasteles.$B$BHe odo que las araas de hilo venenoso son las mejores para cocinar. Estn al norte, entre las laderas de las colinas y el ro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (93, 'esMX', 'Los pasteles de cangrejo oscuro', 'Rene 6 patas pegajosas de araa y llvaselas al Chef Grual a Villa Oscura.', 'Te voy a contar un secreto: los pasteles de \"cangrejo\" oscuro, en realidad se hacen con patas de araa! S que es un poco asqueroso, pero las patas de araa son muy sabrosas y los pasteles quedan estupendos. Treme patas pegajosas de araa y yo te preparo algunos pasteles.$B$BHe odo que las araas de hilo venenoso son las mejores para cocinar. Estn al norte, entre las laderas de las colinas y el ro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (93, 'frFR', 'Les tourtes au crabe de la Pnombre', 'Rcuprez 6 Pattes d\'araigne fondantes et apportez-les au chef Grual de Sombre-Comt.', 'Je vais vous confier un petit secret: ma tourte au crabe de la Pnombre est en ralit fait de pattes d\'araigne! C\'est vrai que cela semble un peu rpugnant, mais leur got est merveilleux! Apportez-moi des pattes d\'araignes fondantes et je vous en prparerai quelques-uns.$B$BVous en trouverez sur les araignes Tisse-venin qui nichent au nord, entre les collines et la rivire.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (93, 'itIT', 'Dusky Crab Cakes', 'Gather 6 Gooey Spider Legs and bring them to Chef Grual in Darkshire.', 'I\'ll let you in on a little secret - Dusky \"Crab\" Cakes are really made from spider legs!  I know it\'s a bit disgusting, but the cakes have a nice, tangy flavor and make great snacks!  Bring me Gooey Spider Legs and I\'ll whip you up a few of them.$B$BI hear Venom Web Spiders are a good source - they nest to the north, between the foothills and the river.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (93, 'ptBR', 'Dusky Crab Cakes', 'Gather 6 Gooey Spider Legs and bring them to Chef Grual in Darkshire.', 'I\'ll let you in on a little secret - Dusky \"Crab\" Cakes are really made from spider legs! I know it\'s a bit disgusting, but the cakes have a nice, tangy flavor and make great snacks! Bring me Gooey Spider Legs and I\'ll whip you up a few of them.$B$BI hear Venom Web Spiders are a good source - they nest to the north, between the foothills and the river.', '', '', '', '', '', '', 0);
