INSERT INTO `quest_template_locale` VALUES (94, 'deDE', 'Ein wachsames Auge', 'Bringt die Glyphe von Azora zur Lwenstatue in der Nhe des Turms von Ilgalar im Rotkammgebirge.', 'Mein Widersacher Morganth ist ein bser Magier von groer Macht, der im Turm von Ilgalar im Rotkammgebirge lebt. Ich habe eine Methode entwickelt, mit der ich ihn ausspionieren kann: Mit dem Auge von Azora ist es mir mglich, ihn von weitem zu sehen.$B$BDoch um seine Gedanken zu erforschen... ja, dazu bentige ich noch weitere Hilfe.$B$BWenn Ihr gewillt seid, dies zu tun, dann bringt meine Glyphe von Azora zum Turm von Ilgalar. Legt sie auf die Lwenstatue in der Nhe des Turms.$B$BSobald dieses getan ist, wird die Macht von Azora mir Visionen von Morganths zuknftigen Plnen gewhren.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (94, 'esES', 'Un ojo vigilante', 'Lleva el Glifo de Azora a la Estatua Leonida, cerca de la Torre de Ilgalar, en Crestagrana.', 'Mi rival, Morganth, es un malvado mago de gran poder que vive en la Torre de Ilgalar, en Crestagrana. He creado un dispositivo que me permitir espiar sus movimientos: el Ojo de Azora. Ahora puedo verlo desde lejos.$B$BPero no puedo saber lo que piensa... Necesito ms ayuda.$B$BSi quieres ayudarme t, lleva mi Glifo de Azora a la Torre de Ilgalar. Colcalo sobre la Estatua Leonida, cerca de la Torre.$B$BCuando lo hayas hecho, el poder de Azora me permitir ver los planes de Morganth para el futuro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (94, 'esMX', 'Un ojo vigilante', 'Lleva el Glifo de Azora a la Estatua Leonida, cerca de la Torre de Ilgalar, en Crestagrana.', 'Mi rival, Morganth, es un malvado mago de gran poder que vive en la Torre de Ilgalar, en Crestagrana. He creado un dispositivo que me permitir espiar sus movimientos: el Ojo de Azora. Ahora puedo verlo desde lejos.$B$BPero no puedo saber lo que piensa... Necesito ms ayuda.$B$BSi quieres ayudarme t, lleva mi Glifo de Azora a la Torre de Ilgalar. Colcalo sobre la Estatua Leonida, cerca de la Torre.$B$BCuando lo hayas hecho, el poder de Azora me permitir ver los planes de Morganth para el futuro.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (94, 'frFR', 'L\'il attentif', 'Placez le Glyphe d\'Azora sur la Statue de lion, prs de la Tour d\'Ilgalar dans les Carmines.', 'Mon adversaire, Morganth, est un puissant mage vicieux qui vit dans la Tour d\'Ilgalar dans les Carmines. J\'ai labor un moyen pour l\'espionner, l\'il d\'Azora, et je peux maintenant l\'observer de loin.$B$BMais pour connatre ses penses, j\'ai besoin d\'assistance.$B$BSi vous le voulez, portez mon Glyphe d\'Azora  la Tour d\'Ilgalar. Placez-le sur la Statue de lion prs de la tour.$B$BLorsque cela sera fait, j\'aurai une vision des plans futurs de Morganth.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (94, 'itIT', 'A Watchful Eye', 'Take the Glyph of Azora to the Lion Statue near the Tower of Ilgalar in Redridge.', 'My rival, Morganth, is a vicious mage of great power who lives in the Tower of Ilgalar in Redridge.  I have developed a means of spying on him, the Eye of Azora, and can now view him from afar.$B$BBut to study his thoughts ... I require further aid.$B$BIf you are willing, then take my Glyph of Azora to the Tower of Ilgalar.  Place it upon the Lion Statue near the Tower.$B$BWhen this is done, the power of Azora will grant visions of Morganth\'s future plans.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (94, 'ptBR', 'A Watchful Eye', 'Take the Glyph of Azora to the Lion Statue near the Tower of Ilgalar in Redridge.', 'My rival, Morganth, is a vicious mage of great power who lives in the Tower of Ilgalar in Redridge. I have developed a means of spying on him, the Eye of Azora, and can now view him from afar.$B$BBut to study his thoughts ... I require further aid.$B$BIf you are willing, then take my Glyph of Azora to the Tower of Ilgalar. Place it upon the Lion Statue near the Tower.$B$BWhen this is done, the power of Azora will grant visions of Morganth\'s future plans.', '', '', '', '', '', '', 0);
