INSERT INTO `quest_template_locale` VALUES (95, 'deDE', 'Svens Rache', 'Begebt Euch zu Svens Hof und findet heraus, was hinter dem alten Baumstumpf vergraben wurde.', 'Frher arbeitete ich auf einem der Hfe im Sdosten... bis einmal in meiner Abwesenheit Dunkle Reiter vom Gebirgspass der Totenwinde herunterkamen, meinen Hof berfielen und meine Familie abschlachteten.$B$BAls ich zurckkehrte, sah ich eine schattenhafte Gestalt, die sich bei meiner Scheune herumtrieb und dort etwas vergrub. Sie floh, ehe ich sie erreichen konnte, und ich hatte keine Zeit, mich mit ihr aufzuhalten, da ich den Dunklen Reitern dicht auf den Fersen war. Und so habe ich nie entdeckt, was die Gestalt dort versteckte.$B$BWenn Ihr herausfinden knntet, was jene schattenhafte Gestalt dort vergrub, dann wre ich Euch dankbar. Das Versteck befindet sich hinter dem alten Baumstumpf in der Nhe meiner Scheune.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (95, 'esES', 'La venganza de Sven', 'Ve a la granja de Sven y averigua qu haba enterrado detrs del viejo tocn.', 'Yo antes trabajaba en una granja al sureste... hasta que un da que tuve que ausentarme, los Jinetes Oscuros del Paso de la Muerte arrasaron mi granja y asesinaron a mi familia.$B$BCuando regres vi una figura misteriosa cerca de mi granero... enterrando algo. Huy antes de que pudiera llegar a l y tampoco quera entretenerme: quera ir tras los Jinetes Oscuros. As que nunca descubr qu se esconda all.$B$BTe agradecera que encontraras lo que enterr aquella figura misteriosa. El lugar en el que debes buscar est detrs del tocn que hay cerca de mi granero.', '', '', '', '', '', '', 0);
