INSERT INTO `quest_template_locale` VALUES (95, 'frFR', 'La vengeance de Sven', 'Allez  la ferme de Sven et trouvez ce qui a t enterr derrire la vieille souche d\'arbre.', 'Je travaillais dans une ferme, au sud-est... Des cavaliers noirs du dfil de Deuillevent sont venus dans ma ferme et ont massacr toute ma famille alors que j\'tais absent!$B$BQuand je suis rentr, j\'ai vu une silhouette indistincte rder prs de ma grange, en train d\'enterrer quelque chose. Il s\'est enfui avant que j\'aie pu l\'attraper, et je n\'ai pas pu m\'attarder, car je suis parti aussitt  sa poursuite. Du coup, je n\'ai pas vu ce qu\'il avait cach.$B$BSi vous pouviez dcouvrir ce qu\'a enterr le cavalier noir, je vous en serais reconnaissant. L\'endroit exact est derrire la vieille souche d\'arbre prs de la grange.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (95, 'itIT', 'Sven\'s Revenge', 'Go to Sven\'s Farm and find what was buried behind the old stump.', 'I used to work one of the farms to the southeast...until Dark Riders from Deadwind Pass descended upon my farm and slaughtered my family when I was away!$B$BWhen I returned I saw a shadowy figure skulking near my barn, burying something.  He fled before I could catch him, and I couldn\'t linger for I was hot on the heels of the Dark Riders.  So I never discovered what was hidden.$B$BIf you can find what that shadowy figure buried, I would be grateful.  The hiding spot is behind the old stump near my barn.', '', '', '', '', '', '', 0);
