INSERT INTO `quest_template_locale` VALUES (96, 'deDE', 'Ruf des Wassers', 'Bringt den Splitter des Wassers zu Islen Wasserdeuter am Tidustritt im Brachland.', 'Nehmt Splitter. Nehmt Splitter und gebt Leben.$B$BGebt Leben und versteht. Versteht, Wasser ist Leben... Verderbnis beendet Leben.$B$BIhr schtzt und gebt Leben mit der Macht des Wassers.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (96, 'esES', 'La llamada del agua', 'Llvale el fragmento de agua a Islen Vidente del Agua al Escaln de la Marea, en Los Baldos.', 'Llevar fragmento. Llevar fragmento y dar vida.$B$BDar vida y entender. Entender que el agua es vida... la corrupcin acaba con la vida.$B$BDas vida y la proteges con el poder del agua.', '', '', '', '', '', '', 0);
