INSERT INTO `quest_template_locale` VALUES (96, 'frFR', 'L\'appel de l\'eau', 'Apportez l\'clat d\'eau  Islen Oeil-des-rivires  l\'Escalier des mares, dans les Tarides.', 'Prendre l\'clat. Prendre l\'clat et donner la vie.$B$BDonner la vie et comprendre. Comprendre que l\'eau, c\'est la vie... La corruption dtruit la vie.$B$BLe pouvoir de l\'eau protge et donne la vie.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (96, 'itIT', 'Call of Water', 'Bring the Shard of Water to Islen Waterseer at the Tidus Stair in the Barrens.', 'Take shard. Take shard and give life.$B$BGive life and understand. Understand water is life... corruption stops life.$B$BYou protect and give life with water\'s power.', '', '', '', '', '', '', 0);
