INSERT INTO `quest_template_locale` VALUES (98, 'deDE', 'Die Legende von Stalvan', 'Ttet Stalvan Dunstmantel und zeigt Madame Eva den Ring seiner Familie.', 'Stalvan Dunstmantel hat ein Leben der Verworfenheit gelebt und unschuldige Opfer starben von seiner Hand. Zweifellos hat er noch zahllose andere Verbrechen begangen und nun wird Dunkelhain von diesem Wahnsinnigen bedroht. Das Licht allein wei, welche schmutzigen Plne er jetzt ausheckt. Deswegen brauche ich Eure Hilfe, $C. Begebt Euch zu seiner Htte ein kleines Stck nrdlich der Stadt und schaltet Stalvan ein fr alle Mal aus.$b$bSobald die Tat vollbracht ist, begebt Euch zu Madame Eva und zeigt Ihr den Ring seiner Familie. Schlielich war es ihre Vorahnung, die zu dieser entsetzlichen Entdeckung fhrte. Doch jetzt kann ganz Dunkelhain dank ihr wieder ruhiger schlafen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (98, 'esES', 'La leyenda de Stalvan', 'Mata a Stalvan Mantoniebla y muestra a Lady Eva su anillo familiar.', 'Stalvan Mantoniebla llev una vida de depravacin. Su mano sesg innumerables vidas inocentes. Es, sin duda alguna, culpable de incontables crmenes. Ahora ese luntico amenaza Villa Oscura. Solo la Luz sabe qu srdidas acciones est planeando. Debes ejecutar a Stalvan, $c. Lo encontrars en su casa, al norte de la ciudad.$B$BCuando lo hayas hecho, busca a Lady Eva y ensale este anillo familiar. Despus de todo, fue su premonicin lo que nos gui a este terrible descubrimiento. Gracias a ella, Villa Oscura ahora es ms segura.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (98, 'esMX', 'La leyenda de Stalvan', 'Mata a Stalvan Mantoniebla y muestra a Lady Eva su anillo familiar.', 'Stalvan Mantoniebla llev una vida de depravacin. Su mano sesg innumerables vidas inocentes. Es, sin duda alguna, culpable de incontables crmenes. Ahora ese luntico amenaza Villa Oscura. Solo la Luz sabe qu srdidas acciones est planeando. Debes ejecutar a Stalvan, $c. Lo encontrars en su casa, al norte de la ciudad.$B$BCuando lo hayas hecho, busca a Lady Eva y ensale este anillo familiar. Despus de todo, fue su premonicin lo que nos gui a este terrible descubrimiento. Gracias a ella, Villa Oscura ahora es ms segura.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (98, 'frFR', 'La lgende de Stalvan', 'Tuez Stalvan Mantebrume, et montrez son anneau familial  Madame Eva.', 'Stalvan Mantebrume est un dprav. De nombreuses victimes ont perdu la vie entre ses mains. Il est sans aucun doute coupable d\'un nombre incalculable de crimes et de mfaits. Et maintenant ce dment menace Sombre-Comt. Seule la Lumire sait quels actes abjects il prpare. Allez jusqu\' sa chaumire au nord de la ville, $c, et excutez Stalvan.$b$bLorsque ce sera fait, allez voir Madame Eva et montrez-lui son anneau familial. Aprs tout, c\'est elle qui a eu la prmonition qui nous a conduits jusqu\' cette terrible dcouverte. Mais Sombre-Comt est dsormais plus sre grce  elle.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (98, 'itIT', 'The Legend of Stalvan', 'Kill Stalvan Mistmantle and show Madame Eva his family ring.', 'Stalvan Mistmantle led a life of depravity.  Innocent victims died by his hand.  Undoubtedly he is guilty of countless crimes.  Now the lunatic threatens Darkshire.  The Light only knows what sordid acts he is plotting.  Travel to his cottage just north of town, $C, and execute Stalvan, once and for all.$b$bWhen the deed is done, travel to Madame Eva\'s and show her his family ring.  After all, it was her premonition that led to this gruesome discovery.  But Darkshire is safer because of her.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (98, 'ptBR', 'The Legend of Stalvan', 'Kill Stalvan Mistmantle and show Madame Eva his family ring.', 'Stalvan Mistmantle led a life of depravity. Innocent victims died by his hand. Undoubtedly he is guilty of countless crimes. Now the lunatic threatens Darkshire. The Light only knows what sordid acts he is plotting. Travel to his cottage just north of town, $C, and execute Stalvan, once and for all.$b$bWhen the deed is done, travel to Madame Eva\'s and show her his family ring. After all, it was her premonition that led to this gruesome discovery. But Darkshire is safer because of her.', '', '', '', '', '', '', 0);
