INSERT INTO `quest_template_locale` VALUES (99, 'deDE', 'Arugals Torheit', 'Bringt Dalar Morgenweber 6 Lohenscheitfesseln zum Grabmal.', 'Je mehr ich ber Arugals Magie erfahre, umso mehr wchst meine Verachtung fr diesen jmmerlichen Narren. Bald werde ich meine Studien zu seiner so genannten \'Arznei\' beendet haben.$b$bMein Wissen wird vollstndig sein, sobald ich herausgefunden habe, welche Verzauberung die seltsamen Zustnde in Lohenscheit verursacht. Tagsber scheinen die Arbeiter dort ganz gewhnliche Menschen zu sein. Doch sobald die Sonne untergeht, verwandeln sich die Dorfbewohner in Mondzornworgs.$b$bIch muss Energie aus den verzauberten Fesseln ziehen, die Arugal auf sie gewirkt hat. Bringt mir 6 verzauberte Lohenscheitfesseln, $n.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (99, 'esES', 'La locura de Arugal', 'Lleva 6 grilletes de Pirolea a Dalar Tejealba en El Sepulcro.', 'Segn aumenta mi conocimiento sobre la magia de Arugal, aumenta tambin mi desdn por el desafortunado necio. Estoy a punto de completar la investigacin de su Remedio... Bonito nombre...$B$BMi conocimiento ser completo cuando descubra qu encantamiento est causando el extrao comportamiento en la Aldea Pirolea. Por el da, los aldeanos parecen ser humanos. Pero, cuando el sol desaparece, se convierten en huargen Furia Lunar.$B$BNecesito extraer energa de los grilletes encantados que Arugal utiliz con ellos. Treme seis grilletes de Pirolea encantados, $n.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (99, 'esMX', 'La locura de Arugal', 'Lleva 6 grilletes de Pirolea a Dalar Tejealba en El Sepulcro.', 'Segn aumenta mi conocimiento sobre la magia de Arugal, aumenta tambin mi desdn por el desafortunado necio. Estoy a punto de completar la investigacin de su Remedio... Bonito nombre...$B$BMi conocimiento ser completo cuando descubra qu encantamiento est causando el extrao comportamiento en la Aldea Pirolea. Por el da, los aldeanos parecen ser humanos. Pero, cuando el sol desaparece, se convierten en huargen Furia Lunar.$B$BNecesito extraer energa de los grilletes encantados que Arugal utiliz con ellos. Treme seis grilletes de Pirolea encantados, $n.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (99, 'frFR', 'La folie d\'Arugal', 'Rapportez 6 Chanes enchantes de Bois-du-Bcher  Dalar Tisselaube, au Spulcre.', 'Mon mpris pour ce malheureux fou d\'Arugal augmente  mesure que je dchiffre son enchantement. J\'ai presque fini mes recherches pour y parvenir.$b$bMa comprhension sera totale quand j\'aurai compris ce qui cause l\'trange comportement des habitants de Bois-du-Bcher. Le jour, les paysans sont des gens normaux. Mais la nuit venue ils se transforment en worgens Ragelune.$b$bJe dois puiser l\'nergie des chanes qu\'a enchantes Arugal. Rapportez-moi six chanes enchantes de Bois-du-Bcher, $n.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (99, 'itIT', 'Arugal\'s Folly', 'Bring 6 Pyrewood Shackles to Dalar Dawnweaver at the Sepulcher.', 'As my understanding of Arugal\'s magic grows so does my disdain for the hapless fool.  I am close to completing my research on his so called remedy.$b$bMy knowledge will be complete when I learn what enchantment is causing the strange behavior going on in Pyrewood Village.  By day, the peasants appear to be Human.  But when the sun goes down the townsfolk turn into Moonrage Worgen.$b$bI need to draw energy from the enchanted shackles Arugal cast on them.  Bring to me six enchanted Pyrewood Shackles, $n.', '', '', '', '', '', '', 0);
