INSERT INTO `quest_template_locale` VALUES (100, 'deDE', 'Ruf des Wassers', 'Sprecht mit der schwachen Wassermanifestation am Nrdlichen Gezeitenstrom im Silberwald.', 'Noch whrend die Zauberformel, die Ihr gesprochen habt, verhallt, zuckt ein Meer von Lichtern um Euch herum auf. Das Zischen der Wassertropfen, die mit den Flammen in Berhrung kommen, lsst nach und Eure berreizten Sinne spren, wie die verderbten Geister in Eurer Nhe vernichtet werden.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (100, 'esES', 'La llamada del agua', 'Habla con la manifestacin de agua menor en la Cala Mareanorte, en el Bosque de Argnteos.', 'Hay un destello de luz cuando pronuncias las ltimas palabras del conjuro. Se desvanece el sonido de las gotas de agua sobre la llama y la emocin embarga tus sentidos conforme se aniquilan los espritus corruptos que te rodean.', '', '', '', '', '', '', 0);
