INSERT INTO `quest_template_locale` VALUES (100, 'frFR', 'L\'appel de l\'eau', 'Parlez  la Manifestation d\'eau infrieure sur la Cte nord, dans la fort des Pins-Argents.', ' la fin de votre incantation, une explosion lumineuse se produit. Le grsillement des gouttes dans les flammes s\'est arrt, et vos sens reviennent  mesure que les esprits corrompus autour de vous sont dtruits.', '', '', '', '', '', '', 0);
