INSERT INTO `quest_template_locale` VALUES (101, 'deDE', 'Das Totem des Gegenschlages', 'Bringt 10 Ghulfangzhne, 10 Skelettfinger und 5 Phiolen Spinnengift nach Dunkelhain zu Madame Eva.', 'Nun, da bernatrliche Mchte den Wald durchziehen, besteht ganz zweifellos die Notwendigkeit, sich zu schtzen, $n. Leise flstern mir die Winde von einer groen Gefahr, die auf Euch lauert und der Ihr Euch in nicht allzu ferner Zukunft gegenbersehen werdet.$b$bAuch $gein tapferer:eine tapfere:c; $C wie Ihr sollte sich schtzen. Falls Ihr dies wnscht, so bringt mir 10 Ghulfangzhne, 10 Skelettfinger und 5 Phiolen Spinnengift. Dann stelle ich Euch ein Totem des Gegenschlages her und belege es mit einem Zauber, durch den es all denjenigen schadet, die gegen Euch Gewalt anwenden wollen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (101, 'esES', 'El Ttem de castigo', 'Consigue 10 colmillos de necrfago, 10 dedos de esqueleto y 5 viales de veneno arcnido para Lady Eva en Villa Oscura.', 'A medida que la corrupcin mstica invade el bosque, la necesidad de autoproteccin se hace innegable, $n. El viento me susurra y me cuenta de grandes peligros que el futuro te depara.$B$BSi deseas protegerte, noble $c, treme 10 colmillos de necrfago, 10 dedos de esqueleto y 5 viales de veneno arcnido. Te encantar un ttem de castigo que daar a aquellos que intenten causarte dao a ti.', '', '', '', '', '', '', 0);
