INSERT INTO `quest_template_locale` VALUES (101, 'frFR', 'Le Totem d\'affliction', 'Apportez 10 Crocs de goule, 10 Doigts de Squelette et 5 Fioles de venin d\'araigne  Madame Eva,  Sombre-Comt.', ' mesure que la corruption mystique rampe  travers la fort, la ncessit dune protection devient indispensable, $n. Les vents m\'ont murmur qu\'un grand danger vous guette dans un avenir proche.$b$bSi vous voulez vous garder de ce danger, noble $c, apportez-moi 10 Crocs de goule, 10 Doigts de Squelette et 5 Fioles de venin d\'araigne. Jenchanterai alors un Totem d\'affliction qui blessera ceux qui tenteront de vous agresser.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (101, 'itIT', 'The Totem of Infliction', 'Bring 10 Ghoul Fangs, 10 Skeleton Fingers and 5 Vials of Spider Venom to Madame Eva in Darkshire.', 'As the mystical taint creeps through the forest, the need for self-protection is undeniable, $n.  The winds whisper to me and they speak of a great danger which waits patiently for you in the near future.$b$bIf you wish to protect yourself, noble $c, bring to me 10 ghoul fangs, 10 skeleton fingers and 5 vials of spider venom.  For you I shall enchant a Totem of Infliction which will harm those who attempt violent acts against you.', '', '', '', '', '', '', 0);
