INSERT INTO `quest_template_locale` VALUES (102, 'deDE', 'Auf Patrouille durch Westfall', 'Bringt 8 Gnolltatzen auf die Spherkuppe zu Hauptmann Danuvin.', 'Sturmwind hat uns im Stich gelassen. Der ble Gestank der Verderbtheit weht ber die Ebenen von Westfall. Dies war und ist mein Heimatland und ich werde die Brger, die sich zum Bleiben entschlossen haben, nicht verlassen. Wir, die wir frher Bauern waren, werden Widerstand leisten.$b$bEure Aufgabe, so Ihr sie denn annehmt, wird es sein, im Grasland von Westfall auf Patrouille zu gehen. Sprt die widerwrtigen Gnolle auf, die augenscheinlich mit den Dieben aus den Todesminen zusammenarbeiten, und ttet sie. Bringt mir 8 Gnolltatzen und ich werde Euren Mut zu belohnen wissen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (102, 'esES', 'En patrulla por los Pramos de Poniente', 'Lleva 8 garras de gnoll al capitn Danuvin en la Colina del Centinela.', 'Ventormenta nos ha abandonado. Nauseabundos aires de depravacin soplan por las llanuras de los Pramos de Poniente. Este era mi hogar y no dar la espalda a los ciudadanos que decidieron permanecer aqu. Nosotros, los antiguos granjeros, ofreceremos resistencia.$B$BTu tarea, si decidieras aceptar, consistir en patrullar las praderas de los Pramos de Poniente. Localiza y aniquila a los infames gnolls que parecen colaborar con los ladrones de Las Minas de la Muerte. Treme 8 garras de gnoll y sabr recompensar tu valenta.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (102, 'esMX', 'En patrulla por los Pramos de Poniente', 'Lleva 8 garras de gnoll al capitn Danuvin en la Colina del Centinela.', 'Ventormenta nos ha abandonado. Nauseabundos aires de depravacin soplan por las llanuras de los Pramos de Poniente. Este era mi hogar y no dar la espalda a los ciudadanos que decidieron permanecer aqu. Nosotros, los antiguos granjeros, ofreceremos resistencia.$B$BTu tarea, si decidieras aceptar, consistir en patrullar las praderas de los Pramos de Poniente. Localiza y aniquila a los infames gnolls que parecen colaborar con los ladrones de Las Minas de la Muerte. Treme 8 garras de gnoll y sabr recompensar tu valenta.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (102, 'frFR', 'Une patrouille dans la marche de l\'Ouest', 'Rapportez 8 Pattes de gnolls au capitaine Danuvin,  la Colline des Sentinelles.', 'Hurlevent nous a abandonns. Un vent de corruption souffle sur la marche de l\'Ouest. C\'est ma terre natale et je n\'abandonnerai pas les gens qui ont choisi de rester ici. Nous, les anciens fermiers, nous rsisterons.$b$bVotre mission, si vous l\'acceptez, sera de patrouiller dans les prairies de la marche. Dbusquez et tuez les infmes gnolls qui apparemment sont de connivence avec les voleurs des Mortemines. Apportez-moi 8 Pattes de gnolls et je vous rcompenserai pour votre courage.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (102, 'itIT', 'Patrolling Westfall', 'Bring 8 Gnoll Paws to Captain Danuvin on Sentinel Hill.', 'Stormwind has abandoned us.  A foul wind of depravity rustles through the plains of Westfall.  This was my homeland and I will not turn my back on the citizens who choose to remain here.  We, the former farmers, shall make our stand.$b$bYour task, should you choose to accept, is to patrol the grasslands of Westfall.  Track down and slay the vile Gnolls that seem to be working in conjunction with the Deadmines thieves. Bring me eight Gnoll Paws and I will reward your bravery.', '', '', '', '', '', '', 0);
