INSERT INTO `quest_template_locale` VALUES (103, 'deDE', 'Bewahrer der Flamme', 'Bringt 5 Flschchen l zu Kapitn Grausohn beim Leuchtturm von Westfall.', 'Die Nacht, in der die Familie des Leuchtturmwrters starb, war schrecklich. Hilflos musste ich mit ansehen, wie Trbauge der Alte den Angriff befehligte. Doch was geschehen ist, ist geschehen. Nun sorge ich mich vor allem um das Leben der Seeleute, die das Groe Meer besegeln und deren Schiffe den trgerischen Felsen vor der Kste gefhrlich nahe kommen. Da hier niemand mehr lebt, der die Flamme bewacht, obliegt die Verantwortung nun mir.$b$bHelft mir dabei, die Fackel am Leuchten zu erhalten, und bringt mir 5 Flschchen l von den Erntemonstern.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (103, 'esES', 'Guardin de la Llama', 'Lleva 5 botellas de aceite al capitn Grisillo en el Faro de Poniente.', 'La noche en que muri la familia del guardin del Faro fue horrible. Contempl, impotente, cmo el Viejo Ojosombro lideraba el ataque. Pero lo pasado, pasado est, y lo que ahora me preocupa son las vidas de los que navegan por el Mare Magnum y se acercan demasiado a las peligrosas rocas de la costa. Como no hay nadie que vigile la llama, la responsabilidad es ahora ma.$B$BAydame a mantener la antorcha iluminada trayndome 5 botellas de aceite de los monstruos de la cosecha.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (103, 'esMX', 'Guardin de la Llama', 'Lleva 5 botellas de aceite al capitn Grisillo en el Faro de Poniente.', 'La noche en que muri la familia del guardin del Faro fue horrible. Contempl, impotente, cmo el Viejo Ojosombro lideraba el ataque. Pero lo pasado, pasado est, y lo que ahora me preocupa son las vidas de los que navegan por el Mare Magnum y se acercan demasiado a las peligrosas rocas de la costa. Como no hay nadie que vigile la llama, la responsabilidad es ahora ma.$B$BAydame a mantener la antorcha iluminada trayndome 5 botellas de aceite de los monstruos de la cosecha.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (103, 'frFR', 'Le gardien de la flamme', 'Apportez 5 Flacons d\'huile au Capitaine Grayson, au Phare de l\'Ouest.', 'Je me souviens de cette terrible nuit, au cours de laquelle la famille du gardien de phare a t tue. J\'ai contempl, impuissant, lattaque du Vieux Troubloeil. Mais bon, ce qui est fait est fait. Ma proccupation maintenant est la scurit des marins et des navires qui croisent sur la Grande mer, car la zone est trs dangereuse prs des rcifs le long de la cte. Vu qu\'il n\'y a plus personne pour s\'occuper du phare, la tche m\'incombe  prsent de surveiller sa flamme.$b$bAidez-moi  garder la flamme allume, apportez-moi 5 flacons d\'huile provenant des monstres des moissons.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (103, 'itIT', 'Keeper of the Flame', 'Bring 5 Flasks of Oil to Captain Grayson at the Westfall Lighthouse.', 'The night the Lighthouse Keeper\'s family died was horrible.  I watched, helpless, as Old Murk-Eye led the attack.  But what\'s done is done and now my concern is for the lives of the sailors on The Great Sea whose ships come close to the perilous rocks of the coastline.  With no one to keep watch on the flame the responsibility has fallen upon me.$b$bHelp me keep the torch lit by bringing me 5 flasks of oil from the Harvest Monsters.', '', '', '', '', '', '', 0);
