INSERT INTO `quest_template_locale` VALUES (104, 'deDE', 'Bedrohung an der Kste', 'Bringt Kapitn Grausohn am Leuchtturm von Westfall eine Schuppe von Trbauge dem Alten.', 'Als ich auf den Felsen mein Leben aushauchte, hatte ich keine Ahnung, was das Leben nach dem Tode fr mich bereithalten wrde. In jener Nacht war der Leuchtturm erloschen, weil Trbauge der Alte die Familie des Leuchtturmwrters vertrieben hatte. Die Familie kehrte zurck und zndete die Flamme wieder an, doch Trbauge brachte die willensschwcheren Murlocs dazu, den Leuchtturm noch einmal mit ihm zusammen anzugreifen. Beim zweiten Mal hatte die Familie nicht so viel Glck. Vor meinen Augen starben sie alle, ohne sich wehren zu knnen.$b$bTtet Trbauge den Alten, wenn Ihr ihn am Ufer seht, und bringt mir eine seiner Schuppen, dann werdet Ihr eine Belohnung erhalten.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (104, 'esES', 'La amenaza costera', 'Lleva una escama del Viejo Ojosombro al capitn Grisillo en el Faro de Poniente.', 'Cuando acab mi vida contra las rocas, no tena ni idea de lo que me esperaba en el ms all. El Faro estaba sumido en la oscuridad aquella noche, ya que el Viejo Ojosombro haba asustado a la familia del guarda. Lograron regresar y volver a encender la llama, pero el Viejo Ojosombro coaccion a los mrlocs de mente ms dbil para que asaltaran el Faro con l de nuevo. La segunda vez, la familia no corri la misma suerte y pereci intilmente ante mis ojos.$b$bMata al Viejo Ojosombro si lo ves por la costa y treme una de sus escamas, te recompensar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (104, 'esMX', 'La amenaza costera', 'Lleva una escama del Viejo Ojosombro al capitn Grisillo en el Faro de Poniente.', 'Cuando acab mi vida contra las rocas, no tena ni idea de lo que me esperaba en el ms all. El Faro estaba sumido en la oscuridad aquella noche, ya que el Viejo Ojosombro haba asustado a la familia del guarda. Lograron regresar y volver a encender la llama, pero el Viejo Ojosombro coaccion a los mrlocs de mente ms dbil para que asaltaran el Faro con l de nuevo. La segunda vez, la familia no corri la misma suerte y pereci intilmente ante mis ojos.$b$bMata al Viejo Ojosombro si lo ves por la costa y treme una de sus escamas, te recompensar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (104, 'frFR', 'Menace sur la cte', 'Rapportez une Ecaille du Vieux Troubloeil au Capitaine Grayson, au Phare de l\'Ouest.', 'Quand ma vie a pris fin sur ces rochers, je ne savais pas que je pouvais esprer quelque chose aprs la mort. Cette nuit-l, le phare tait teint parce que le Vieux Troubloeil avait fait fuir la famille qui s\'en occupait. Mais les gens sont revenus et ont rallum la flamme. Alors le Vieux Troubloeil a contraint ces faibles d\'esprit de murlocs  attaquer le phare. Cette fois-ci, la famille n\'a pas eu le temps de fuir, et elle a t massacre par ces ignobles cratures, sans que personne ne puisse intervenir.$b$bTuez le Vieux Troubloeil si vous le rencontrez le long de la plage, et rapportez-moi une de ses cailles, je vous rcompenserai.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (104, 'itIT', 'The Coastal Menace', 'Bring a scale of Old Murk-Eye to Captain Grayson at the Westfall Lighthouse.', 'When my life was ended upon the rocks, I had no clue what the afterlife held for me.  The Lighthouse was black that night because Old Murk-Eye had scared the keeper\'s family off.  They returned and re-lit the flame but Old Murk-Eye coerced the weaker minded murlocs to raid the Lighthouse with him once again.  The second time the family was not so lucky and before my eyes they perished helplessly.$b$bSlay Old Murk-Eye if you see him along the shore and bring me one of his scales and I shall reward you.', '', '', '', '', '', '', 0);
