INSERT INTO `quest_template_locale` VALUES (105, 'deDE', 'Weh dir, Andorhal', 'Bringt den Splitter von Arajs Phylakterium zu Hochexekutor Derrington ins Bollwerk in den Westlichen Pestlndern.', 'Endlich ist die Zeit gekommen Andorhal anzugreifen und den Lich, der die Stadt kontrolliert, zu vertreiben.$B$BDer Lich - Araj der Beschwrer - herrscht von innerhalb der Ruinen der Stadt aus. Er wird von zahlreichen Angehrigen der Geiel bewacht, die ber die berreste des Stadtzentrums wachen, auch sein Gefolge an Leibwchtern ist ausgezeichnet. Ihr werdet einige Verbndete brauchen, um auch nur einen Hauch von einer Chance zu haben, wenn Ihr Euch ihm gegenberstellen wollt.$B$BVernichtet Araj, $n, und bringt mir einen Splitter seines Phylakteriums als Beweis!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (105, 'esES', 'Ah, Andorhal', 'Lleva el trozo de filacteria de Araj al sumo ejecutor Derrington en El Baluarte en las Tierras de la Peste del Oeste.', 'Ay, se acerca el momento de atacar Andorhal y de hacer salir al exnime que lo controla!$B$BEs en el interior de las ruinas de la ciudad donde el exnime, Araj el Invocador, tiene sus dominios. Est custodiado por numerosos miembros de la Plaga que rodean los restos del centro de la ciudad, y su squito personal de guardianes es realmente formidable. Necesitars muchos aliados para tener alguna oportunidad de enfrentarte a l con xito.$B$BAcaba con Araj, $n, y treme un trozo de su filacteria como prueba!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (105, 'esMX', 'Ah, Andorhal', 'Lleva el trozo de filacteria de Araj al sumo ejecutor Derrington en El Baluarte en las Tierras de la Peste del Oeste.', 'Ay, se acerca el momento de atacar Andorhal y de hacer salir al exnime que lo controla!$B$BEs en el interior de las ruinas de la ciudad donde el exnime, Araj el Invocador, tiene sus dominios. Est custodiado por numerosos miembros de la Plaga que rodean los restos del centro de la ciudad, y su squito personal de guardianes es realmente formidable. Necesitars muchos aliados para tener alguna oportunidad de enfrentarte a l con xito.$B$BAcaba con Araj, $n, y treme un trozo de su filacteria como prueba!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (105, 'frFR', 'Hlas, Andorhal', 'Apportez lclat phylactre d\'Araj au Grand excuteur Derrington  la Barricade, dans les Maleterres de lOuest.', 'Hlas, le temps est venu d\'attaquer Andorhal et d\'en finir avec la liche qui la contrle!$B$BAraj l\'Invocateur, la liche, rgne sur les ruines de la cit. Il est gard par de nombreuses cratures du Flau qui encerclent les restes du centre de la ville, et sa garde personnelle, qui lui est directement attache, est redoutable. Vous aurez besoin de plusieurs allis pour avoir la moindre chance de le vaincre.$B$BExcutez Araj, $n, et apportez-moi un clat de son phylactre comme preuve!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (105, 'itIT', 'Alas, Andorhal', 'Bring Araj\'s Phylactery Shard to High Executor Derrington at the Bulwark, Western Plaguelands.', 'Alas, the time to attack Andorhal and drive out the lich that controls it is upon us!$B$BInside the ruins of the city is where the lich - Araj the Summoner - holds dominion.  He is guarded by numerous Scourge surrounding the remains of city\'s center, and his personal retinue of guardians attached to him directly is formidable.  You will need numerous allies to even stand a chance of facing him successfully.$B$BDestroy Araj, $n, and bring me a shard from his phylactery as proof!', '', '', '', '', '', '', 0);
