INSERT INTO `quest_template_locale` VALUES (106, 'deDE', 'Junge Liebende', 'Gebt Tommy Joe Steinfeld Maybells Liebesbrief.', 'Oh, ein Fluch lastet auf mir! Mein Herz gehrt Tommy Joe Steinfeld, aber unsere Familien sind aufs rgste miteinander verfeindet. Daher kann ich mich nicht mit ihm treffen, obwohl ich mich doch so sehr danach sehne, sein geliebtes Gesicht zu sehen!$B$BBitte nehmt diesen Brief und gebt ihn Tommy Joe. Normalerweise hlt er sich am Fluss im Westen des Hofs der Steinfelds auf, das ist auch von hier aus genau westlich.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (106, 'esES', 'Jvenes enamorados', 'Entrega a Tommy Joe Pedregosa la carta de amor de Maybell.', 'Oh, estoy maldita! He entregado mi corazn a Tommy Joe Pedregosa, pero nuestras familias se odian a muerte. As que no puedo verlo, aunque me duelan los ojos por no poder mirar su hermoso rostro!$B$BTe lo ruego, lleva esta carta a Tommy Joe. Suele estar en el ro que est al oeste de La Granja Pedregosa, al oeste de aqu.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (106, 'esMX', 'Jvenes enamorados', 'Entrega a Tommy Joe Pedregosa la carta de amor de Maybell.', 'Oh, estoy maldita! He entregado mi corazn a Tommy Joe Pedregosa, pero nuestras familias se odian a muerte. As que no puedo verlo, aunque me duelan los ojos por no poder mirar su hermoso rostro!$B$BTe lo ruego, lleva esta carta a Tommy Joe. Suele estar en el ro que est al oeste de La Granja Pedregosa, al oeste de aqu.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (106, 'frFR', 'Jeunes amoureux', 'Donnez la Lettre d\'amour de Maybell  Tommy Joe Champierreux.', 'Je suis maudite! Mon cur appartient  Tommy Joe Champierreux, mais nos familles sont ennemies. Du coup, je ne peux pas le voir, et pourtant je languis dadmirer son magnifique visage!$B$BS\'il vous plat, portez-lui cette lettre de ma part. Gnralement, il va  la rivire  l\'ouest de la ferme des Champierreux, qui se trouve  l\'ouest d\'ici.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (106, 'itIT', 'Giovani amanti', 'Consegna la Lettera d\'Amore di Maybell a Tommy Joe Pietradura.', 'Povera me! Sono innamorata di Tommy Joe Pietradura, ma la rivalit che divide le nostre due famiglie mi impedisce di vederlo. Quanto vorrei posare il mio sguardo sul suo incantevole viso...$B$BPrendi questa lettera e consegnala a Tommy Joe da parte mia. Di solito si trova nei pressi del fiume a ovest della Fattoria dei Pietradura, a ovest di qui.', '', '', '', '', '', '', 0);
