INSERT INTO `quest_template_locale` VALUES (106, 'ptBR', 'Jovens amantes', 'Entregue a Carta de Amor de Mabel para Tomasino Campedra.', 'Ah, maldita sorte a minha! Meu corao pertence a Tomasino Campedra, mas nossas famlias se odeiam fervorosamente. Por isso no posso estar com ele, mesmo que meus olhos doam de vontade de ficar admirando aquele rosto lindo!$B$BPor favor, poderia entregar esta carta para ele, por mim? Ele costuma passar o tempo perto do rio a oeste daqui, depois da Fazenda dos Campedra.', '', '', '', '', '', '', 0);
