INSERT INTO `quest_template_locale` VALUES (107, 'deDE', 'Nachricht an William', 'Bringt Oma Steinfelds Nachricht zu William Pestle.', 'Ich mchte wetten, William Pestle hat einen Trank, der unsere beiden Liebenden zusammenbringen kann.$B$BHier, bringt William diese Nachricht. Er wohnt im Gasthaus \"Zur Hhle des Lwen\" in Goldhain.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (107, 'esES', 'Una nota para William', 'Lleva la nota de la abuela Pedregosa a William Mortero.', 'Seguro que William Mortero tiene una pocin que rena a los dos jvenes amantes!$B$BTen, llvale esta nota a William. Est en la Posada Orgullo de Len, en Villadorada.', '', '', '', '', '', '', 0);
