INSERT INTO `quest_template_locale` VALUES (107, 'frFR', 'Note pour William', 'Portez la Note de Mamie Champierreux  William Pilon.', 'Je suis sre que William Pilon a une potion qui permettrait de runir ces deux amoureux!$B$BTenez, prenez cette note et portez-la  William. Il habite  lauberge de la Fiert du lion  Comt-de-lOr.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (107, 'itIT', 'Nota per William', 'Consegna la Nota di Nonna Pietradura a William Pestel.', 'Scommetto che William Pestel ha una pozione per riunire i nostri due giovani innamorati!$B$BTieni, consegna questa nota a William. Si trova nella Locanda del Fiero Leone a Borgodoro.', '', '', '', '', '', '', 0);
