INSERT INTO `quest_template_locale` VALUES (109, 'deDE', 'Meldung bei Gryan Starkmantel', 'Sprecht mit Gryan Starkmantel. Normalerweise findet man ihn im Steinturm auf der Spherkuppe, ein kleines Stckchen von der Strae weg, mitten in Westfall.', 'Es scheint mir, $C, als httet Ihr schon etliche Kmpfe berstanden. Falls Ihr das noch nicht getan habt, solltet Ihr Euch bei Gryan Starkmantel melden. Er ist der Anfhrer der Volksmiliz, die es sich zur Aufgabe gemacht hat, das Ackerland von Westfall zu beschtzen. Ich mchte wetten, er knnte Eure Hilfe gebrauchen. Normalerweise findet man ihn im Steinturm auf der Spherkuppe, ein kleines Stckchen von der Strae weg, mitten in Westfall.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (109, 'esES', 'Habla con Gryan Mantorrecio', 'Habla con Gryan Mantorrecio. Puedes encontrarlo en la torre de piedra de la Colina del Centinela, saliendo de la carretera que cruza los Pramos de Poniente.', 'Parece que has visto bastantes combates en tu vida, $c. Si no has tenido suficiente, busca a Gryan Mantorrecio. Comanda la Milicia Popular que protege las granjas de los Pramos de Poniente. Seguro que le vendr bien tu ayuda. Puedes encontrarlo en la torre de piedra de la Colina del Centinela, saliendo de la carretera que cruza los Pramos de Poniente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (109, 'esMX', 'Habla con Gryan Mantorrecio', 'Habla con Gryan Mantorrecio. Puedes encontrarlo en la torre de piedra de la Colina del Centinela, saliendo de la carretera que cruza los Pramos de Poniente.', 'Parece que has visto bastantes combates en tu vida, $c. Si no has tenido suficiente, busca a Gryan Mantorrecio. Comanda la Milicia Popular que protege las granjas de los Pramos de Poniente. Seguro que le vendr bien tu ayuda. Puedes encontrarlo en la torre de piedra de la Colina del Centinela, saliendo de la carretera que cruza los Pramos de Poniente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (109, 'frFR', 'Aller voir Gryan Roidemantel', 'Parlez  Gryan Roidemantel. Il se trouve dans la tour de pierre sur la Colline des Sentinelles, prs de la route au centre de la marche de l\'Ouest.', 'J\'ai l\'impression que vous tes $grompu:rompue; au combat, $c. Si vous ne l\'avez pas dj fait, vous devriez aller voir Gryan Roidemantel. Il dirige la milice du peuple, dont le but est de dfendre les fermes de la marche de l\'Ouest. Je suis sr qu\'il aurait besoin de vous. Il se trouve gnralement dans la tour de pierre sur la colline des Sentinelles, prs de la route au centre de la marche de l\'Ouest.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (109, 'itIT', 'Report to Gryan Stoutmantle', 'Talk to Gryan Stoutmantle.  He usually can be found in the stone tower on Sentinel Hill, just off the road, in the middle of Westfall.', 'Looks to me you\'ve seen quite a bit of combat in your time, $c.  If you haven\'t already, you should report to Gryan Stoutmantle.  He heads up the People\'s Militia, aimed at protecting the farmlands of Westfall.  I bet he could use your help.  You can usually find him in the stone tower on Sentinel Hill, just off the road in the middle of Westfall.', '', '', '', '', '', '', 0);
