INSERT INTO `quest_template_locale` VALUES (110, 'deDE', 'Insektenteil-Analyse', 'Begebt Euch nach Gadgetzan zu Alchemist Stelbruch und erkundigt Euch nach der Analyse der Insektenteile.', 'Ich werde einige Zeit brauchen, um Kieselschliffs Feldmesserausrstung durchzusehen... und seine persnlichen Angelegenheiten zu regeln. Mein Bauch sagt mir, dass dies nicht der letzte Verlust ist, den wir durch die Kfer hinnehmen mssen.$B$BGeht bitte zu Alchemist Stelbruch, um zu sehen, ob er etwas mit den Insektenteilen anfangen konnte, die wir ihm geschickt haben. Wenn sie fertig sind, bringt sie mir.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (110, 'esES', 'Anlisis de trozos de insecto', 'Busca al alquimista Morterozugg en Gadgetzan y comprueba su anlisis de los trozos de insecto.', 'Voy a estudiar el equipo de anlisis de Patagolpe y a ordenar sus efectos personales. Tengo la extraa sensacin de que esta no es la ltima prdida que sufriremos ante estos bichos.$B$BQuiero que vayas a ver al alquimista Morterozugg y compruebes si ya ha tenido oportunidad de procesar los trozos de insecto que le enviamos. Si es as, vuelve aqu.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (110, 'esMX', 'Anlisis de trozos de insecto', 'Busca al alquimista Morterozugg en Gadgetzan y comprueba su anlisis de los trozos de insecto.', 'Voy a estudiar el equipo de anlisis de Patagolpe y a ordenar sus efectos personales. Tengo la extraa sensacin de que esta no es la ltima prdida que sufriremos ante estos bichos.$B$BQuiero que vayas a ver al alquimista Morterozugg y compruebes si ya ha tenido oportunidad de procesar los trozos de insecto que le enviamos. Si es as, vuelve aqu.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (110, 'frFR', 'Analyse des morceaux d\'insectes', 'Aller voir  Gadgetzan si l\'Alchimiste Pilonzugg a termin d\'analyser les morceaux d\'insectes.', 'Je vais passer un peu de temps  examiner l\'quipement d\'analyse de Scrimshank... et remettre de l\'ordre dans ses effets personnels. J\'ai le sentiment que ces insectes vont nous faire subir bien d\'autres pertes.$B$BPourriez-vous aller voir si l\'alchimiste Pilonzugg a analys les morceaux d\'insectes que nous lui avons envoys? S\'ils sont prts, rapportez-les-moi.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (110, 'itIT', 'Insect Part Analysis', 'Check in Gadgetzan for Alchemist Pestlezugg and his analysis of the insect parts.', 'I\'m going to spend some time taking a look at Scrimshank\'s surveying gear... as well as putting his personal effects in order.  I get the sneaking feeling behind my ears that this isn\'t the last loss we\'ll be facing against these bugs.$B$BI\'d like for you to check in with Alchemist Pestlezugg to see if he has had a chance to process the insect parts we sent him.  If they\'re ready, bring them to me.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (110, 'ptBR', 'Insect Part Analysis', 'Check in Gadgetzan for Alchemist Pestlezugg and his analysis of the insect parts.', 'I\'m going to spend some time taking a look at Scrimshank\'s surveying gear... as well as putting his personal effects in order. I get the sneaking feeling behind my ears that this isn\'t the last loss we\'ll be facing against these bugs.$B$BI\'d like for you to check in with Alchemist Pestlezugg to see if he has had a chance to process the insect parts we sent him. If they\'re ready, bring them to me.', '', '', '', '', '', '', 0);
