INSERT INTO `quest_template_locale` VALUES (111, 'deDE', 'Gesprch mit Oma', 'Sprecht mit Oma Steinfeld.', 'Bitte sprecht mit meiner Gromutter, $n. Wenn irgendjemand einen Weg wei, wie ich mit Maybell zusammen sein kann, dann ist sie das.$B$BIhr findet sie in unserem Haus, stlich von hier.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (111, 'esES', 'Habla con la abuelita', 'Habla con la abuela Pedregosa.', 'Por favor, $n, habla con mi abuelita. Si alguien puede encontrar la forma de reunirme con Maybell, esa es ella.$B$BEst en nuestra casa, al este de aqu.', '', '', '', '', '', '', 0);
