INSERT INTO `quest_template_locale` VALUES (111, 'frFR', 'Discuter avec Mamie', 'Parlez  Mamie Champierreux.', 'S\'il vous plat, $n, allez parler  Mamie. Si quelquun peut trouver une solution  notre problme, c\'est bien elle.$B$BElle habite dans notre ferme  l\'est d\'ici.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (111, 'itIT', 'A colloquio con la nonna', 'Parla con Nonna Pietradura.', 'Ti prego, $n, parla con mia nonna. Lei  l\'unica che pu aiutarmi a stare insieme a Maybell.$B$BSi trova nella nostra casa a est.', '', '', '', '', '', '', 0);
