INSERT INTO `quest_template_locale` VALUES (112, 'deDE', 'Die Suche nach dem Tang', 'Bringt 4 Kristalltangwedel nach Goldhain zu William Pestle.', 'Ich knnte einen Unsichtbarkeitsschnaps fr Maybell brauen, damit sie sich aus den Weinbergen der Maclures fortstehlen und Tommy Joe sehen kann. Aber um den Schnaps herzustellen, brauche ich etwas Kristalltang.$B$BDieser Tang wchst zwar normalerweise im Meer, aber manchmal wird er auch von den Murlocs gesammelt. Geht und schaut, ob die Murlocs am Kristallsee welchen haben. Der Kristallsee liegt ein kleines Stck stlich von Goldhain.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (112, 'esES', 'La recoleccin de algas', 'Lleva 4 hojas de alga de cristal a William Mortero a Villadorada.', 'Puedo hacer un licor de invisibilidad para Maybell, para que pueda salir de Los Viedos de Maclure y reunirse con Tommy Joe. Pero para hacer el licor necesito alga de cristal.$B$BAunque el alga normalmente crece en el ocano, tambin se puede conseguir de los mrlocs. Ve a ver si los mrlocs que hay cerca del Lago de Cristal tienen algo. El Lago de Cristal est al este de Villadorada.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (112, 'esMX', 'La recoleccin de algas', 'Lleva 4 hojas de alga de cristal a William Mortero a Villadorada.', 'Puedo hacer un licor de invisibilidad para Maybell, para que pueda salir de Los Viedos de Maclure y reunirse con Tommy Joe. Pero para hacer el licor necesito alga de cristal.$B$BAunque el alga normalmente crece en el ocano, tambin se puede conseguir de los mrlocs. Ve a ver si los mrlocs que hay cerca del Lago de Cristal tienen algo. El Lago de Cristal est al este de Villadorada.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (112, 'frFR', ' la recherche du varech', 'Apportez 4 Feuilles de Varech cristallin  William Pilon de Comt-de-lOr.', 'Je peux prparer une potion d\'invisibilit pour Maybell, qui lui permettra de s\'chapper du vignoble des Maclure et de rejoindre Tommy Joe. Mais pour prparer cette potion, j\'ai besoin de varech cristallin.$B$BCette plante pousse habituellement dans l\'ocan, mais parfois les Murlocs en rcoltent. Il faut aller voir si les Murlocs prs du lac de Cristal n\'en auraient pas en ce moment. Le lac de Cristal est  l\'est de Comt-de-lOr.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (112, 'itIT', 'Raccolta alghe', 'Porta 4 Fronde d\'Alga di Cristallo a William Pestel nella citt di Borgodoro.', 'Potrei preparare un Liquore dell\'Invisibilit per Maybell, in modo che possa fuggire dalle Vigne dei Maclure senza essere vista per andare da Tommy Joe. Per fare il liquore per mi servono delle alghe di cristallo.$B$BLe alghe di solito crescono in mare, ma a volte vengono raccolte dai Murloc. Vedi se i Murloc vicino al Lago di Cristallo, a est di Borgodoro, ne hanno qualcuna.', '', '', '', '', '', '', 0);
