INSERT INTO `quest_template_locale` VALUES (112, 'ptBR', 'Coletando alga', 'Leve 4 Folhas de Cristalga para Durval Pilo em Vila d\'Ouro.', 'Posso preparar um elixir de invisibilidade para Mabel. Assim, ela poder fugir dos Vinhedos dos Madruga e procurar Tomasino. Mas para fazer o elixir, vou precisar de cristalgas.$B$BEmbora algas cresam no mar, s vezes os murlocs as coletam. Veja se os murlocs do Lago de Cristal tm cristalgas. O Lago de Cristal fica a leste de Vila d\'Ouro.', '', '', '', '', '', '', 0);
