INSERT INTO `quest_template_locale` VALUES (113, 'deDE', 'Insektenteil-Analyse', 'Bringt den Bericht nach Gadgetzan zum Leitenden Feldmesser Rutenwnschels. Lasst Euch von ihm eine Kopie des Berichts geben, wie Alchemist Stelbruch gefordert hat.', 'Der Leitende Feldmesser Rutenwnschels muss diesen Bericht sofort sehen. Eigentlich muss jeder, der lesen kann, diesen Bericht sehen. Wir stehen einer groen und ernsten Bedrohung gegenber, die nicht nur Tanaris und Gadgetzan, sondern das ganze sdliche Kalimdor betrifft, wenn wir nichts unternehmen. Mglicherweise ist sogar ganz Azeroth gefhrdet. Dieses Ding macht nicht den Eindruck, als wrde es das Interesse verlieren.$B$BLasst Rutenwnschels ein Duplikat des Berichts anfertigen, den Ihr dann an Eure Verbndeten verteilen knnt. Jeder muss von dieser Bedrohung erfahren!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (113, 'esES', 'Anlisis de trozos de insecto', 'Entrgale el informe al perito jefe Picoflojo de Gadgetzan. Asegrate de que te da una copia del informe, tal y como el alquimista Morterozugg ha pedido.', 'El perito jefe Picoflojo tiene que ver este informe inmediatamente. En realidad... todo el que sepa leer debera echarle un vistazo. Nos enfrentamos a una grave y seria amenaza no solo para Tanaris y Gadgetzan, sino tambin para toda la zona meridional de Kalimdor si no le ponemos solucin pronto. Qu diablos! Incluso es posible que afecte a la totalidad de Azeroth pues no hay ningn indicio de que vaya a mejorar la situacin.$B$BPdele a Picoflojo una copia del informe para poder distribuirlo. Todos deben conocer la existencia de esta amenaza!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (113, 'esMX', 'Anlisis de trozos de insecto', 'Entrgale el informe al perito jefe Picoflojo de Gadgetzan. Asegrate de que te da una copia del informe, tal y como el alquimista Morterozugg ha pedido.', 'El perito jefe Picoflojo tiene que ver este informe inmediatamente. En realidad... todo el que sepa leer debera echarle un vistazo. Nos enfrentamos a una grave y seria amenaza no solo para Tanaris y Gadgetzan, sino tambin para toda la zona meridional de Kalimdor si no le ponemos solucin pronto. Qu diablos! Incluso es posible que afecte a la totalidad de Azeroth pues no hay ningn indicio de que vaya a mejorar la situacin.$B$BPdele a Picoflojo una copia del informe para poder distribuirlo. Todos deben conocer la existencia de esta amenaza!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (113, 'frFR', 'Analyse des morceaux d\'insectes', 'Apportez le rapport au Grand gomtre Radisthflop  Gadgetzan. Obtenez une copie de ce rapport, comme l\'alchimiste Pilonzugg vous l\'a demand.', 'Le grand gomtre Radisthflop doit tre inform immdiatement. En fait... toute personne sachant lire doit voir ce rapport. Nous sommes confronts  une menace trs srieuse et trs grave non seulement pour Tanaris et Gadgetzan, mais si on ne s\'en occupe pas, pour tout le Sud de Kalimdor. Oups, et mme pour tout Azeroth; cette menace n\'a donn aucun signe de dclin.$B$BDemandez  Radisthflop de faire des copies du rapport pour que vous le distribuiez le plus largement possible. Tout le monde doit tre inform de cette menace!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (113, 'itIT', 'Insect Part Analysis', 'Deliver the report to Senior Surveyor Fizzledowser in Gadgetzan.  Be sure he gives you a copy of the report, as Alchemist Pestlezugg has requested.', 'Senior Surveyor Fizzledowser needs to see this report immediately.  Actually... everyone who can read needs to see this report.  We are facing a grave and serious threat to not only Tanaris and Gadgetzan, but if left unchecked, the entirety of southern Kalimdor.  Heck, even quite possible the whole of Azeroth; this thing has given no indication it will subside.$B$BHave Fizzledowser make a duplicate of the report for you to distribute freely to your allegiance. Everyone must know about this threat!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (113, 'ptBR', 'Insect Part Analysis', 'Deliver the report to Senior Surveyor Fizzledowser in Gadgetzan. Be sure he gives you a copy of the report, as Alchemist Pestlezugg has requested.', 'Senior Surveyor Fizzledowser needs to see this report immediately. Actually... everyone who can read needs to see this report. We are facing a grave and serious threat to not only Tanaris and Gadgetzan, but if left unchecked, the entirety of southern Kalimdor. Heck, even quite possible the whole of Azeroth; this thing has given no indication it will subside.$B$BHave Fizzledowser make a duplicate of the report for you to distribute freely to your allegiance. Everyone must know about this threat!', '', '', '', '', '', '', 0);
