INSERT INTO `quest_template_locale` VALUES (114, 'deDE', 'Die Flucht', 'Bringt Maybell Maclure den Unsichtbarkeitsschnaps.', 'Bringt der jungen Maybell diesen Unsichtbarkeitsschnaps. Seine Wirkung sollte so lange anhalten, dass sie Tommy Joe besuchen kann.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (114, 'esES', 'La fuga', 'Lleva el licor de invisibilidad a Maybell Maclure.', 'Lleva este licor de invisibilidad a la joven Maybell. Debera durar lo suficiente para que haga una visita a Tommy Joe.', '', '', '', '', '', '', 0);
