INSERT INTO `quest_template_locale` VALUES (115, 'deDE', 'Schattenmagie', 'Bringt 3 Mitternachtskugeln nach Seenhain zu Marschall Marris.', 'Von den Orcs des Schwarzfelsklans wurden zur Untersttzung ihrer Angriffe auf das Rotkammgebirge Schattenzauberer rekrutiert, die von einer dunklen Macht erfllte Vorrichtungen mit sich fhrten - Mitternachtskugeln. Diese Kugeln haben den Verteidigern vom Rotkammgebirge schwere Verluste zugefgt und es ist von uerster Wichtigkeit, dass wir diese dmonbesudelten Gegenstnde aus dem Konflikt entfernen.$B$BDurchsucht erschlagene Schattenzauberer des Schwarzfels nach Mitternachtskugeln und bringt sie mir. Ich werde die Kugeln dann vernichten lassen, denn ohne sie wre die Welt ein wesentlich besserer Ort.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (115, 'esES', 'Magia de las Sombras', 'Lleva 3 orbes de medianoche al alguacil Marris a Villa del Lago.', 'Los Roca Negra han trado taumaturgos oscuros a los ataques en Crestagrana. Tienen unos objetos de poder oscuro, los orbes de medianoche. Estos orbes han malherido a muchos de los que luchan en Crestagrana; tenemos que hacernos con esos objetos demonacos.$B$BTreme los orbes de medianoche de los cadveres de taumaturgos umbros Roca Negra. Me encargar de destruirlos; el mundo estar mejor sin ellos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (115, 'esMX', 'Magia de las Sombras', 'Lleva 3 orbes de medianoche al alguacil Marris a Villa del Lago.', 'Los Roca Negra han trado taumaturgos oscuros a los ataques en Crestagrana. Tienen unos objetos de poder oscuro, los orbes de medianoche. Estos orbes han malherido a muchos de los que luchan en Crestagrana; tenemos que hacernos con esos objetos demonacos.$B$BTreme los orbes de medianoche de los cadveres de taumaturgos umbros Roca Negra. Me encargar de destruirlos; el mundo estar mejor sin ellos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (115, 'frFR', 'Magie des Tnbres', 'Apportez 3 Orbes de minuit au Marchal Marris,  Comt-du-Lac.', 'Les orcs rochenoires ont engag des exhalombres pour les aider dans leurs attaques contre les Carmines; ils ont emport des orbes de minuit. Ces orbes ont inflig de graves dgts aux dfenses des Carmines et il est impratif que nous ne soyons plus confronts  leur puissance.$B$BRetrouvez et rapportez-moi les orbes de minuit, aprs avoir tu les exhalombres rochenoires qui les possdent. Je dtruirai ces orbes; le monde ne se portera que mieux sans eux!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (115, 'itIT', 'Shadow Magic', 'Bring 3 Midnight Orbs to Marshal Marris in Lakeshire.', 'The Blackrock orcs enlisted shadowcasters to aid their attacks in Redridge, and they have brought with them devices of dark power--midnight orbs.  These orbs have struck telling blows against Redridge\'s defenders, and it\'s imperative we remove the demon-tainted items from the conflict.$B$BFind and deliver to me midnight orbs from slain Blackrock shadowcasters.  I will then have them disposed of, for this world would be a better place without them!', '', '', '', '', '', '', 0);
