INSERT INTO `quest_template_locale` VALUES (116, 'deDE', 'Trockene Zeiten', 'Barkeeper Daniels aus Seenhain braucht ein Fsschen Donnerbru Lagerbier, ein Fsslein Merlot, eine Flasche Fusel und einen Schlauch mit sem Rum.', 'Mir werden hier gerade die Vorrte knapp, $n. Alle Flaschen sind fast leer, und die letzte Schnapslieferung htte schon lngst hier eintreffen sollen. Die Orcinvasion ist einfach die Hlle.$b$bVielleicht knnt Ihr Euch ja fr mich an die Arbeit machen?$b$bIhr msst fr mich bei Schnapsbart Donnerbru in den Hgeln von Westfall ein Fsschen Donnerbru Lagerbier besorgen, ebenso ein Fsslein Merlot aus Sturmwind, eine Flasche Fusel aus Dunkelhain und einen Schlauch mit sem Rum aus Goldhain. Bringt mir all diese Dinge, dann werde ich dafr sorgen, dass Ihr belohnt werdet.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (116, 'esES', 'Tiempos de sequa', 'Lleva 1 barril de cerveza Cebatruenos, 1 barril de vino dulce, 1 botella de licor de luna y 1 botella de ron dulce al posadero Daniels a Villa del Lago.', 'Tengo un problema, $n. Nos estamos quedando sin bebida y el envo se est retrasando mucho. Esta invasin orca ha sido terrible.$B$BBuscas trabajo?$B$BNecesito que vayas a recoger un barril de cerveza Cebatruenos de Tragoamargo Cebatruenos, que est en las colinas de los Pramos de Poniente, uno de Merlot en Ventormenta, una botella de licor de luna en Villa Oscura y una de ron dulce en Villadorada. Treme todo eso y te ganars una recompensa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (116, 'esMX', 'Tiempos de sequa', 'Lleva 1 barril de cerveza Cebatruenos, 1 barril de vino dulce, 1 botella de licor de luna y 1 botella de ron dulce al posadero Daniels a Villa del Lago.', 'Tengo un problema, $n. Nos estamos quedando sin bebida y el envo se est retrasando mucho. Esta invasin orca ha sido terrible.$B$BBuscas trabajo?$B$BNecesito que vayas a recoger un barril de cerveza Cebatruenos de Tragoamargo Cebatruenos, que est en las colinas de los Pramos de Poniente, uno de Merlot en Ventormenta, una botella de licor de luna en Villa Oscura y una de ron dulce en Villadorada. Treme todo eso y te ganars una recompensa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (116, 'frFR', 'Rgime sec', 'Le tavernier Daniels de Comt-du-Lac a besoin d\'un Tonneau de Tonnebire, d\'un Tonneau de merlot, d\'une Bouteille de tord-boyaux et d\'une Outre de rhum doux.', 'Je suis dans une situation dsespre, $n. Mes rserves sont presque  sec. La dernire cargaison de boisson aurait d arriver il y a bien longtemps. L\'invasion des orcs a t un enfer.$b$bPeut-tre pouvez-vous travailler pour moi?$b$bJ\'ai besoin que vous rcupriez un tonneau de Tonnebire de chez Tristevin Tonnebire dans les collines de la marche de l\'Ouest, un tonneau de merlot de Hurlevent, une bouteille de tord-boyaux de Sombre-Comt et une outre de rhum doux de Comt-de-lOr. Rapportez-les-moi et je ferai en sorte que vous soyez $grcompens:rcompense;.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (116, 'itIT', 'Dry Times', 'Barkeep Daniels of Lakeshire needs a keg of Thunderbrew Lager, a cask of Merlot, a bottle of Moonshine and a skin of Sweet Rum.', 'I find myself in quite a pinch here, $n.  The bottles are close to running dry.  The latest booze shipment is long overdue.  The orc invasion has been hell.$b$bPerhaps you can go to work for me?$b$bI need you to pick up a keg of Thunderbrew Lager from Grimbooze Thunderbrew in the Westfall hills, a cask of Merlot from Stormwind, a bottle of Moonshine from Darkshire and a skin of Sweet Rum from Goldshire.  Bring those back to me and I will see to it you are rewarded.', '', '', '', '', '', '', 0);
