INSERT INTO `quest_template_locale` VALUES (117, 'deDE', 'Donnerbru Lagerbier', 'Bringt Schnapsbart Donnerbru 5 Hopfen, damit er sein besonderes Bier brauen kann.', 'Ihr msst eilen, $gmein Freund:Madame;, sollt nicht ruhen, noch rasten$bDenn fr unser Lagerbier lohnt sich\'s zu hasten$bEs schmeckt allen Mnnern, es schmeckt allen Frauen$bDoch ich brauche noch Hopfen, um das Bier zu brauen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (117, 'esES', 'Cerveza Cebatruenos', 'Entrega a Tragoamargo Cebatruenos 5 lpulos para que pueda terminar su cerveza especial.', 'Rpido, $gamigo:amiga; y date prisa$bNuestra cerveza est de risa$bMs cerveza y menos comida,$bDadnos lpulo para hacer birra.', '', '', '', '', '', '', 0);
