INSERT INTO `quest_template_locale` VALUES (117, 'frFR', 'Hymne  la Tonnebire', 'Apportez 5 Pieds de Houblon  Tristevin Tonnebire pour qu\'il prpare son breuvage spcial.', 'Allez donc, $gmon ami:mon amie;, sans tarder htez-vous!$bPour que notre breuvage, fidle  mes dosages,$bTienne plus de la bire que dun mauvais ragot,$bIl me manque du houblon pour en faire le brassage.', '', '', '', '', '', '', 0);
