INSERT INTO `quest_template_locale` VALUES (118, 'deDE', 'Der Preis fr Hufeisen', 'Bringt Verners Nachricht zu Schmied Argus nach Goldhain im Wald von Elwynn.', 'Ich habe so viel Eisen dafr verwenden mssen, die Wachen von Sturmwind auszursten, dass ich nicht mehr genug Eisen brig habe, um die Pferde im Stall zu beschlagen!$B$BBringt diese Nachricht zu Schmied Argus nach Goldhain. Darin erklre ich ihm mein Problem und bitte ihn um eine Lieferung Hufeisen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (118, 'esES', 'El precio de unas herraduras', 'Lleva la nota de Verner al herrero Argus a Villadorada, en el Bosque de Elwynn.', 'He necesitado tanto hierro para abastecer a la guardia de Ventormenta que no tengo bastante para hacer herraduras!$B$BVe a Villadorada y dale esta nota al herrero Argus; le cuento mi problema y le hago un pedido de herraduras.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (118, 'esMX', 'El precio de unas herraduras', 'Lleva la nota de Verner al herrero Argus a Villadorada, en el Bosque de Elwynn.', 'He necesitado tanto hierro para abastecer a la guardia de Ventormenta que no tengo bastante para hacer herraduras!$B$BVe a Villadorada y dale esta nota al herrero Argus; le cuento mi problema y le hago un pedido de herraduras.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (118, 'frFR', 'Le prix des fers', 'Apportez la Note de Verner  Argus le forgeron  Comt-de-lOr, dans la Fort d\'Elwynn.', 'J\'ai utilis tellement de mtal pour quiper les gardes de Hurlevent que je n\'en ai mme plus pour ferrer les chevaux!$B$BApportez cette note  Argus le forgeron de Comt-de-lOr. Elle explique mon problme et lui demande une livraison de fers  cheval.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (118, 'itIT', 'The Price of Shoes', 'Take Verner\'s Note to Smith Argus at Goldshire in Elwynn Forest.', 'I\'ve been using so much iron keeping the Stormwind Guards outfitted, I don\'t have enough to supply the stable\'s horses with shoes!$B$BTake this note to Blacksmith Argus in Goldshire.  It explains to him my problem and requests a shipment of horseshoes.', '', '', '', '', '', '', 0);
