INSERT INTO `quest_template_locale` VALUES (119, 'deDE', 'Zurck zu Verner', 'Kehrt zu Verner Gutmark nach Seenhain im Rotkammgebirge zurck. Gebt ihm die Kiste mit Hufeisen.', 'Gut, er soll seine 50 Hufeisen haben.$B$BHier sind sie, schn in eine Kiste verpackt und bereit zum Abmarsch. Sagt Verner, dass es ein Vergngen war, mit ihm Geschfte zu machen, und sagt ihm, dass er unbedingt die Nachricht lesen soll, die ich ihm an die Kiste geheftet habe!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (119, 'esES', 'Regresa junto a Verner', 'Vuelve a Villa del Lago, en Crestagrana, y entrega la caja de herraduras a Verner Osbien.', 'Muy bien, 50 herraduras...$B$BAqu las tienes, listas para llevar! Dile a Verner que ha sido un placer y que lea la nota que he pegado a la caja.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (119, 'esMX', 'Regresa junto a Verner', 'Vuelve a Villa del Lago, en Crestagrana, y entrega la caja de herraduras a Verner Osbien.', 'Muy bien, 50 herraduras...$B$BAqu las tienes, listas para llevar! Dile a Verner que ha sido un placer y que lea la nota que he pegado a la caja.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (119, 'frFR', 'Le retour chez Verner', 'Retournez chez Verner Bongoulot,  Comt-du-Lac, dans les Carmines, et donnez-lui la caisse de Fers  cheval.', 'D\'accord, je lui envoie 50 fers  cheval$B$BLes voil, tout empaquets et prts  emporter! Dites  Verner que cest un plaisir de faire affaire, et faites en sorte qu\'il trouve la facture accroche  la caisse!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (119, 'itIT', 'Return to Verner', 'Return to Verner Osgood at Lakeshire in Redridge.  Give him the Crate of Horseshoes.', 'Ok, I\'ll give him his 50 horseshoes...$B$BHere they are, all boxed up and ready to go!  Tell Verner it was a pleasure doing business, and be sure he reads the note attached to this crate!', '', '', '', '', '', '', 0);
