INSERT INTO `quest_template_locale` VALUES (120, 'deDE', 'Botschaft nach Sturmwind', 'Magistrat Solomon hat Euch einen Bericht bergeben, der bei General Marcus Jonathan in Sturmwind abgeliefert werden muss. Der Richter mchte, dass Ihr zu ihm zurckkehrt, sobald Ihr die Nachricht zugestellt habt.', 'Wir leben in schwierigen Zeiten, $C. Unsere Ortschaft ist einer stndigen Belagerung ausgesetzt. Wenn wir keine Verstrkung bekommen, ist unsere Niederlage so gut wie besiegelt. Die Botschaft, die ich Euch nun anvertrauen werde, ist von uerster Wichtigkeit. Bringt diesen Bericht unverzglich zu General Marcus Jonathan nach Sturmwind. Sobald Ihr die Nachricht abgeliefert habt, kehrt umgehend zu mir zurck und berbringt mir alle Neuigkeiten, ganz gleich, ob gut oder schlecht. $b$bDoch nun eilt!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (120, 'esES', 'Mensajero a Ventormenta', 'El magistrado Solomon te ha dado un informe para el general Marcus Jonathan de Ventormenta. Quiere que vuelvas en cuanto lo hayas entregado.', 'Estamos en tiempos difciles, $c. Vivimos bajo un asedio constante. Si no llegan refuerzos, solo nos queda la derrota. El mensaje que te confo es de la mayor importancia. Llvaselo al general Marcus Jonathan de Ventormenta inmediatamente. Despus vuelve, ya sean tus noticias buenas o malas.$B$BApresrate!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (120, 'esMX', 'Mensajero a Ventormenta', 'El magistrado Solomon te ha dado un informe para el general Marcus Jonathan de Ventormenta. Quiere que vuelvas en cuanto lo hayas entregado.', 'Estamos en tiempos difciles, $c. Vivimos bajo un asedio constante. Si no llegan refuerzos, solo nos queda la derrota. El mensaje que te confo es de la mayor importancia. Llvaselo al general Marcus Jonathan de Ventormenta inmediatamente. Despus vuelve, ya sean tus noticias buenas o malas.$B$BApresrate!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (120, 'frFR', 'Un message pour Hurlevent', 'Le magistrat Salomon vous a remis un rapport qui doit tre transmis au gnral Marcus Jonathan de Hurlevent. Il exige que vous reveniez vers lui aussitt que vous aurez donn le message.', 'Nous vivons un moment crucial, $c. Le bourg est assig. Sans renforts, nous allons succomber. Le rapport dont je vous charge est de la plus haute importance. Remettez-le au gnral Marcus Jonathan de Hurlevent le plus rapidement possible. Ds que vous le lui aurez remis, revenez avec sa rponse, qu\'elle soit bonne ou mauvaise.$b$bMaintenant htez-vous!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (120, 'itIT', 'Messenger to Stormwind', 'Magistrate Solomon has given you a report which must be delivered to General Marcus Jonathan in Stormwind.  The judge wants you to return to him as soon as the delivery has been made.', 'These are trying times, $c.  The township is under constant siege.  Without reinforcements, we will certainly face defeat.  The message I now entrust to you is of utmost importance.  Get this report to General Marcus Jonathan of Stormwind immediately.  Once your delivery is made, return to me at once with any news, be it good or bad. $b$bNow make haste!', '', '', '', '', '', '', 0);
