INSERT INTO `quest_template_locale` VALUES (121, 'deDE', 'Botschaft nach Sturmwind', 'Bringt General Marcus Jonathans Antwortschreiben nach Seenhain zu Magistrat Solomon.', 'Whrend ich auf Antwort vom Knig warte, mchte ich, dass Ihr diesen Brief zu Magistrat Solomon bringt. $b$bWeggetreten, $C!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (121, 'esES', 'Mensajero a Ventormenta', 'Lleva la respuesta del general Marcus Jonathan al magistrado Solomon a Villa del Lago.', 'Mientras espero la respuesta del Rey, llvale esta carta al magistrado Solomon.$B$BPuedes retirarte, $c.', '', '', '', '', '', '', 0);
