INSERT INTO `quest_template_locale` VALUES (121, 'frFR', 'Un message pour Hurlevent', 'Apportez la rponse du Gnral Marcus Jonathan au Magistrat Salomon,  Comt-du-Lac.', 'Pendant que j\'attends la rponse du roi, je veux que vous portiez cette lettre au magistrat Salomon.$b$bRompez, $c!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (121, 'itIT', 'Messenger to Stormwind', 'Take General Marcus Jonathan\'s letter of response to Magistrate Solomon in Lakeshire.', 'While I wait for a response from the King I want you to carry this letter to Magistrate Solomon. $b$bDismissed, $c!', '', '', '', '', '', '', 0);
