INSERT INTO `quest_template_locale` VALUES (122, 'deDE', 'Bauchschuppen', 'Sammelt 6 Welpenbauchschuppen von schwarzen Grodrachenwelpen ein und bringt sie ins Rotkammgebirge zu Verner Gutmark.', 'Ich brauche einige Bauchschuppen von schwarzen Grodrachenwelpen, damit ich die Hufeisen bezahlen kann, die Argus mir aus Goldhain geschickt hat. Wenn Ihr mir 6 solcher Schuppen besorgt, dann kann ich mit einem Teil davon Argus bezahlen - und habe dann immer noch einen Rest brig, aus dem ich etwas fr Euch herstellen kann.$B$BSchwarze Grodrachenwelpen fliegen hufig ber das Gebiet sdlich von Seenhain, aber sie wandern auch gern herum. Haltet einfach die Augen offen und jagt sie, wenn Ihr sie seht.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (122, 'esES', 'Escamas de barriga', 'Lleva 6 escamas de barriga de cachorro de dragn Negro a Verner Osbien a Crestagrana.', 'Necesito escamas de barriga de cachorro de dragn Negro para pagarle las herraduras que Argus me envi desde Villadorada. Si me traes 6 escamas, tendr para pagarle y tambin para hacerte un regalo.$B$BEsos bichos vuelan al sur de Villa del Lago, pero a menudo se alejan. Tendrs que estar ojo avizor para cazarlos en cuanto los veas.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (122, 'esMX', 'Escamas de barriga', 'Lleva 6 escamas de barriga de cachorro de dragn Negro a Verner Osbien a Crestagrana.', 'Necesito escamas de barriga de cachorro de dragn Negro para pagarle las herraduras que Argus me envi desde Villadorada. Si me traes 6 escamas, tendr para pagarle y tambin para hacerte un regalo.$B$BEsos bichos vuelan al sur de Villa del Lago, pero a menudo se alejan. Tendrs que estar ojo avizor para cazarlos en cuanto los veas.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (122, 'frFR', 'Les cailles de dragonnet', 'Rassemblez 6 Ecailles ventrales de dragonnet noir et apportez-les  Verner Bongoulot, dans les Carmines.', 'J\'ai besoin d\'cailles ventrales de dragonnet noir pour payer les fers qu\'Argus m\'a envoys de Comt-de-lOr. Si vous pouviez m\'en trouver six, je rglerais ma dette... et il m\'en resterait suffisamment pour vous faonner quelque chose.$B$BLes dragonnets noirs errent souvent au sud de Comt-du-Lac, mais ils aiment aussi se balader. Vous devrez vous embusquer et les chasser quand vous les verrez.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (122, 'itIT', 'Underbelly Scales', 'Gather 6 Underbelly Whelp Scales from Black Dragon Whelps, and bring them to Verner Osgood in Redridge.', 'I need some underbelly scales from black dragon whelps to pay for the shoes Argus sent me from Goldshire.  If you can get 6 of them for me, then I can pay Argus with some... and have enough left to fashion something for you.$B$BBlack dragon whelps are often flying around south of Lakeshire, but they like to wander.  You might have to just keep an eye out and hunt them when you see them.', '', '', '', '', '', '', 0);
