INSERT INTO `quest_template_locale` VALUES (123, 'deDE', 'Der Sammler', 'Begebt Euch zu Marschall Patterson ins Holzfllerlager des Osttals und gebt ihm den Zeitplan des Sammlers.', 'Bei der Notiz handelt es sich um eine Tabelle mit Daten und Zeiten, zu denen jemand, der in der Notiz nur als \"der Sammler\" bezeichnet wird, je eine Lieferung Gold aus den Minen des Waldes von Elwynn erhalten soll.$B$BAus dem Plan geht hervor, dass sich der Sammler anscheinend in der Nhe von Brackbrunns Krbisbeet in Ost-Elwynn aufhlt.$B$BDas klingt, als sei es wichtig. Ihr solltet Marschall Patterson im Holzfllerlager des Osttals davon berichten.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (123, 'esES', 'El Coleccionista', 'Ve a ver al alguacil Patterson en el Aserradero de la Vega del Este, que est en el Bosque de Elwynn, y dale la lista del Coleccionista.', 'Esta nota es un horario de los das y las horas a las que una persona descrita como \"el Coleccionista\" recibir cargamentos de oro provenientes de las minas del Bosque de Elwynn.$B$BPor lo que pone en el horario, parece que el Coleccionista vive cerca de la Plantacin de Calabazas de Brackwell, al este de Elwynn.$B$BParece importante. Deberas informar al alguacil Patterson en el Aserradero de la Vega del Este.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (123, 'esMX', 'El Coleccionista', 'Ve a ver al alguacil Patterson en el Aserradero de la Vega del Este y dale la lista del coleccionista.', 'Esta nota es un horario de los das y las horas a las que una persona descrita como \"el Coleccionista\" recibir cargamentos de oro provenientes de las minas del Bosque de Elwynn.$B$BPor lo que pone en el horario, parece que el Coleccionista vive cerca de la Plantacin de Calabazas de Brackwell, al este de Elwynn.$B$BParece importante. Deberas informar al alguacil Patterson en el Aserradero de la Vega del Este.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (123, 'frFR', 'Le collecteur', 'Allez voir le Marchal Patterson, au Camp de bcherons du Val dEst, et donnez-lui le Plan de route du Collecteur.', 'Cette note est un tableau des heures et des jours auxquels une personne  un certain Collecteur  doit recevoir une livraison dor en provenance des mines de la fort dElwynn.$B$BDaprs le tableau, il semblerait que le Collecteur habite prs du champ de potirons des Saumepuits,  lest dElwynn.$B$BCest une information importante. Vous devriez en faire part au marchal Patterson au camp de bcherons du Val dEst.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (123, 'itIT', 'Il Collezionista', 'Vai dal Maresciallo Patterson al Campo di Taglio di Vallevante nella Foresta di Elwynn e consegnagli il Programma del Collezionista.', '<Questa nota contiene il programma con i giorni e gli orari in cui un fantomatico \"Collezionista\" prelever un carico d\'oro dalle miniere nella Foresta di Elwynn.>$B$B<Leggendo il programma, sembra che il Collezionista viva vicino al Campo di Zucche dei Pozzonero, nella parte orientale di Elwynn.>$B$B<Dovresti informare il Maresciallo Patterson al Campo di Taglio di Vallevante.>', '', '', '', '', '', '', 0);
