INSERT INTO `quest_template_locale` VALUES (123, 'ptBR', 'O Coletor', 'Fale com o Delegado Pedrosa na Madeireira Vale do Leste, que fica na Floresta de Elwynn, e d a ele a Escala do Coletor.', 'O bilhete contm uma escala com os dias e horrios em que uma pessoa  referida apenas como \"o Coletor\"  receber um carregamento de ouro das minas da Floresta de Elwynn.$B$BPela escala, parece que o Coletor mora perto da Plantao de Abboras dos Braga, na parte leste de Elwynn.$B$BIsso parece importante. Voc deveria relatar tudo ao delegado Pedrosa, na Madeireira Vale do Leste.', '', '', '', '', '', '', 0);
