INSERT INTO `quest_template_locale` VALUES (124, 'deDE', 'Das Bellen der Gnolle', 'Ttet 10 Schlger der Rotkammgnolle und 8 Mystiker der Rotkammgnolle und kehrt anschlieend zu Verner Gutmark zurck.', 'Als ob Orcangriffe nicht genug wren! Jetzt schleichen auch noch Gnollschlger und Gnollmystiker auf dem Hgelkamm nrdlich von meinem Stall herum und fallen meine Pferde an, wenn diese sich auch nur etwas zu weit vom Stall entfernen...$B$BWenn Ihr diese Gnolle beseitigen knntet, wren meine Pferde und ich Euch sehr dankbar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (124, 'esES', 'El aullido de los gnolls', 'Mata a 10 toscos y 8 msticos Crestagrana y ve a ver a Verner Osbien.', 'Como si no tuviera bastante con los orcos! Ahora tengo toscos y msticos gnolls en la cresta que hay al norte de mi establo y se llevan mis caballos cuando se pierden.$B$BSi nos libras de los gnolls, mis caballos y yo te lo agradeceremos eternamente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (124, 'esMX', 'El aullido de los gnolls', 'Mata a 10 toscos y 8 msticos Crestagrana y ve a ver a Verner Osbien.', 'Como si no tuviera bastante con los orcos! Ahora tengo toscos y msticos gnolls en la cresta que hay al norte de mi establo y se llevan mis caballos cuando se pierden.$B$BSi nos libras de los gnolls, mis caballos y yo te lo agradeceremos eternamente.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (124, 'frFR', 'Le hurlement des gnolls', 'Tuez 10 Brutes des Carmines et 8 Mystiques des Carmines, puis retournez chez Verner Bongoulot.', 'Comme si les attaques des orcs ne suffisaient pas! Maintenant j\'ai des brutes et des mystiques gnolls qui rdent au nord de mon curie et qui massacrent mes chevaux ds qu\'ils s\'loignent...$B$BSi vous pouviez nous dbarrasser de ces gnolls, mes chevaux et moi vous en serions trs reconnaissants.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (124, 'itIT', 'A Baying of Gnolls', 'Kill 10 Redridge Brutes and 8 Redridge Mystics, then return to Verner Osgood.', 'As if the attacking orcs weren\'t enough!  Now I have gnoll brutes and mystics prowling along the ridge north of my stable, taking my horses when they stray...$B$BIf you can get rid of those gnolls, my horses and I would be very grateful.', '', '', '', '', '', '', 0);
