INSERT INTO `quest_template_locale` VALUES (125, 'deDE', 'Die verlorenen Werkzeuge', 'Groknecht Oslow aus Seenhain mchte, dass Ihr seinen Werkzeugkasten vom Grunde des Immerruhsees heraufholt.', 'Ich knnte hier wirklich etwas Hilfe gebrauchen, $n. Jetzt, wo die Stadt belagert wird, bekommen wir hier nur schwer Nachschub. Meine Werkzeuge sollten mit dem Karren von Goldhain aus angeliefert werden, aber die Brcke wurde in die Luft gejagt. Also legten wir die Werkzeuge in ein Boot, aber die Orcs beschossen es mit einem Katapult und trafen auch noch. Na, und bei meinem Pech ist mein Werkzeugkasten natrlich geradewegs bis auf den Grund des Sees gesunken.$b$bWenn Ihr mir meinen Werkzeugkasten wiederbeschafft, $n, dann soll es Euer Schaden nicht sein.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (125, 'esES', 'Las herramientas perdidas', 'El supervisor Olento de Villa del Lago quiere que recojas su caja de herramientas del fondo del Lago Sempiterno.', 'chame una mano, $n. Con todo esto del asedio, es difcil conseguir suministros. Mis herramientas venan de camino de Villadorada, pero hicieron explotar el puente. Pusimos las herramientas en una barca, pero los orcos atacaron con una catapulta y todo acab en el fondo del lago.$B$BRecupera mi caja de herramientas, $n, y te ganars una buena recompensa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (125, 'esMX', 'Las herramientas perdidas', 'El supervisor Olento de Villa del Lago quiere que recojas su caja de herramientas del fondo del Lago Sempiterno.', 'chame una mano, $n. Con todo esto del asedio, es difcil conseguir suministros. Mis herramientas venan de camino de Villadorada, pero hicieron explotar el puente. Pusimos las herramientas en una barca, pero los orcos atacaron con una catapulta y todo acab en el fondo del lago.$B$BRecupera mi caja de herramientas, $n, y te ganars una buena recompensa.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (125, 'frFR', 'Les outils perdus', 'Le contrematre Oslow de Comt-du-Lac veut que vous rcupriez sa Bote d\'outils au fond du Lac Placide.', 'J\'apprcierais vraiment votre aide, $n. La ville est assige, l\'approvisionnement devient difficile. On devait me livrer des outils par chariot depuis Comt-de-lOr, mais le pont a saut. Nous avons alors mis les outils dans un bateau, mais les orcs l\'ont touch avec une catapulte. videmment, ma bote d\'outils a coul tout droit au fond du lac.$b$bRcuprez-la, $n, et je ferai en sorte que vous ne le regrettiez pas.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (125, 'itIT', 'The Lost Tools', 'Foreman Oslow of Lakeshire wants you to retrieve his toolbox from the bottom of Lake Everstill.', 'I could really use a hand here, $n.  With the town under siege, it\'s been hard to get supplies.  My tools were being delivered from Goldshire by wagon but the bridge was blown out.  We put the tools in a boat but the orcs hit it with a catapult.  Just my luck, my toolbox sank right to the bottom of the lake.$b$bRetrieve my toolbox, $n, and I\'ll make it worth your while.', '', '', '', '', '', '', 0);
