INSERT INTO `quest_template_locale` VALUES (126, 'deDE', 'Geheul in den Hgeln', 'Bringt Jaulers Tatze nach Seenhain zu Verner Gutmark.', 'Die Gnolle sind immer noch da drauen, $n. Ich kann sie bellen hren, wenn sie in den Hgeln oberhalb von Seenhain jagen. Und das Geheul eines Gnolls ist lauter als das aller anderen - das von Jauler, ihrem Anfhrer.$B$BTtet Jauler und vertreibt sein Rudel in alle vier Winde! Bringt mir seine Tatze zum Beweis.$B$BAber seid vorsichtig! Dieser Gnoll ist nicht umsonst der Anfhrer seines Rudels. Er ist kein einfacher Kter...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (126, 'esES', 'El aullido de las colinas', 'Lleva la zarpa de Ululante a Verner Osbien a Villa del Lago.', '$n, los gnolls siguen ah. Los oigo aullar mientras cazan en las colinas de Villa del Lago. El que ms fuerte alla es Ululante, el jefe.$B$BMtalo! Su manada se asustar y huir! Treme su garra como prueba.$B$BY ten cuidado; si es el jefe, ser por algo. Ya sabes lo que dicen de los perros viejos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (126, 'esMX', 'El aullido de las colinas', 'Lleva la zarpa de Ululante a Verner Osbien a Villa del Lago.', '$n, los gnolls siguen ah. Los oigo aullar mientras cazan en las colinas de Villa del Lago. El que ms fuerte alla es Ululante, el jefe.$B$BMtalo! Su manada se asustar y huir! Treme su garra como prueba.$B$BY ten cuidado; si es el jefe, ser por algo. Ya sabes lo que dicen de los perros viejos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (126, 'frFR', 'Les collines aux hurlements', 'Apportez la patte de Couineur  Verner Bongoulot,  Comt-du-Lac.', '$n, les gnolls sont toujours l. Je peux entendre leurs hurlements quand ils chassent dans les collines de Comt-du-Lac. Et l\'un d\'eux hurle plus fort que les autres: Couineur, leur chef.$B$BTuez Couineur et dispersez sa meute! Rapportez-moi sa patte comme preuve.$B$BMais faites attention! Ce gnoll n\'est pas leur chef pour rien! Ce n\'est pas un btard!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (126, 'itIT', 'Howling in the Hills', 'Bring Yowler\'s Paw to Verner Osgood in Lakeshire.', '$n, the gnolls are still out there.  I can hear their baying as they hunt in the hills above Lakeshire.  And one cry is louder than the rest - Yowler,  their leader.$B$BKill Yowler and send his pack scattering!  Bring me his paw as proof.$B$BAnd be careful, this gnoll is their leader for a reason.  He is no Mongrel...', '', '', '', '', '', '', 0);
