INSERT INTO `quest_template_locale` VALUES (127, 'deDE', 'Fischhandel', 'Bringt 10 gefleckte Sonnenfische nach Seenhain zu Dockmeister Baren.', 'Der Immerruhsee ist fr seinen gefleckten Sonnenfisch berhmt. Die Nachfrage nach diesen Fischen ist enorm hoch - und ich habe bald keine mehr vorrtig!$B$BBringt mir 10 Stck, dann werden wir uns schon handelseinig werden. Und wenn Ihr nicht selbst angeln mchtet oder knnt - na ja, vielleicht bekommt Ihr die Fische ja von den Murlocs!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (127, 'esES', 'Pescado a la venta', 'Lleva 10 peces luna moteados al maestro de embarcadero Baren a Villa del Lago.', 'El Lago Sempiterno es famoso por su pez luna moteado. Tiene mucha demanda, pero me estoy quedando sin existencias!$B$BTreme 10 peces luna moteados; te pagar bien. Y si no sabes pescar, intenta robrselo a los mrlocs.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (127, 'esMX', 'Pescado a la venta', 'Lleva 10 peces luna moteados al maestro de embarcadero Baren a Villa del Lago.', 'El Lago Sempiterno es famoso por su pez luna moteado. Tiene mucha demanda, pero me estoy quedando sin existencias!$B$BTreme 10 peces luna moteados; te pagar bien. Y si no sabes pescar, intenta robrselo a los mrlocs.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (127, 'frFR', 'Crie aux poissons', 'Rapportez 10 Poissons-lunes au Chef des docks Baren,  Comt-du-Lac.', 'Le lac Placide est connu pour son poisson-lune. C\'est un poisson qui se vend bien et j\'ai justement besoin d\'argent!$B$BRapportez-m\'en 10; je paierai bien. Si vous ne savez pas pcher, peut-tre pourrez-vous en voler aux murlocs!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (127, 'itIT', 'Selling Fish', 'Bring 10 Spotted Sunfish to Dockmaster Baren in Lakeshire.', 'Lake Everstill is famous for its spotted sunfish.  There\'s always demand for them...and I\'m running low!$B$BBring me a batch of 10 and I\'ll barter well for them.  If you can\'t fish yourself, then...maybe you can get them off the murlocs!', '', '', '', '', '', '', 0);
