INSERT INTO `quest_template_locale` VALUES (128, 'deDE', 'Kopfgeld auf den Schwarzfelsklan', 'Ttet 15 Helden des Schwarzfels, dann erhaltet Ihr von Wache Howe aus Seenhain eine Belohnung.', 'Der Schwarzfelsklan muss vernichtet werden. Der Feind ist in unser Land eingedrungen. Diese Berge unterliegen der Oberhoheit des Knigs von Sturmwind. Aus bestimmten Quellen haben wir erfahren knnen, dass die Anfhrer jeder Einheit im Klan Helden genannt werden. Ihr findet sie in ihrem Lager im Norden, ein kleines Stck westlich von der Strae, die in die Brennende Steppe fhrt.$b$bMagistrat Solomon mchte diese garstigen Bestien tot sehen. Erschlagt 15 Helden des Schwarzfels und kehrt zu mir zurck.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (128, 'esES', 'La recompensa de Roca Negra', 'Mata a 15 campeones Roca Negra y el guardia Howe te recompensar en Villa del Lago.', 'Tenemos que acabar con esos Roca Negra. El enemigo ha invadido nuestra tierra. Estas montaas pertenecen al rey de Ventormenta. Nuestras fuentes nos dicen que el jefe de cada unidad del clan se llama Campen. Encontrars su campamento hacia el norte, justo al oeste del camino a Las Estepas Ardientes.$B$BEl magistrado Solomon quiere que mueran. Acaba con 15 Campeones Roca Negra y vuelve a verme.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (128, 'esMX', 'La recompensa de Roca Negra', 'Mata a 15 campeones Roca Negra y el guardia Howe te recompensar en Villa del Lago.', 'Tenemos que acabar con esos Roca Negra. El enemigo ha invadido nuestra tierra. Estas montaas pertenecen al rey de Ventormenta. Nuestras fuentes nos dicen que el jefe de cada unidad del clan se llama Campen. Encontrars su campamento hacia el norte, justo al oeste del camino a Las Estepas Ardientes.$B$BEl magistrado Solomon quiere que mueran. Acaba con 15 Campeones Roca Negra y vuelve a verme.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (128, 'frFR', 'La prime rochenoire', 'Tuez 15 Champions rochenoires et le garde Howe de Comt-du-Lac vous rcompensera.', 'Le clan Rochenoire doit tre dmantel. L\'ennemi a envahi nos terres. Ces montagnes sont cependant sous le rgne souverain du roi de Hurlevent. Nos sources nous indiquent que les chefs de chaque unit du clan sont appels des champions. Vous les trouverez dans leur campement au nord, juste  l\'ouest de la route menant aux steppes Ardentes.$B$BLe magistrat Salomon veut que ces brutes abjectes soient tues. Tuez quinze champions rochenoires et revenez me voir.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (128, 'itIT', 'Blackrock Bounty', 'Kill 15 Blackrock Champions and Guard Howe in Lakeshire will reward you.', 'The Blackrock Clan must be destroyed. The Enemy has invaded our lands. These mountains fall under the sovereign right of the King of Stormwind. Our sources tell us that the leaders of each unit within the Clan are known as Champions. You\'ll find them in their encampment to the north, just west of the road to the Burning Steppes.$b$bMagistrate Solomon wants these foul brutes dead. Slay 15 Blackrock Champions and return to me.', '', '', '', '', '', '', 0);
