INSERT INTO `quest_template_locale` VALUES (129, 'deDE', 'Ein geschenktes Mittagessen', 'Bringt Parkers Mittagessen zu Wache Parker. Er ist auf der Strae nach Dunkelhain auf Patrouille.', 'Knntet Ihr mir einen Gefallen tun? Ich habe fr Wache Parker ein Mittagessen gemacht, aber er ist gerade auf Patrouille unterwegs... Er ist gro und stark und noch dazu eine Wache von Sturmwind, also kann er auf sich selbst aufpassen, aber ich bin nur eine kleine Stadtbewohnerin - fr mich ist das da drauen viel zu gefhrlich!$B$BWenn Ihr ihm also sein Mittagessen bringt und anschlieend wieder herkommt, dann bekommt Ihr auch ein Mittagessen von mir - umsonst! Parker patrouilliert die Strae, die in den Dmmerwald fhrt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (129, 'esES', 'Una comida gratis', 'Llvale su comida al guardia Parker. Est de patrulla en el camino a Villa Oscura.', 'Puedes hacerme un favor? Le he preparado la comida al guardia Parker, pero ha salido de patrulla. Es un guardia de Ventormenta grande y fuerte que puede defenderse, pero para m es demasiado peligroso.$B$BSi le llevas la comida, cuando vuelvas te invitar a comer! Qu me dices? Est de patrulla en el camino a Bosque del Ocaso.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (129, 'esMX', 'Una comida gratis', 'Llvale su comida al guardia Parker. Est de patrulla en el camino a Villa Oscura.', 'Puedes hacerme un favor? Le he preparado la comida al guardia Parker, pero ha salido de patrulla. Es un guardia de Ventormenta grande y fuerte que puede defenderse, pero para m es demasiado peligroso.$B$BSi le llevas la comida, cuando vuelvas te invitar a comer! Qu me dices? Est de patrulla en el camino a Bosque del Ocaso.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (129, 'frFR', 'Un repas gratuit', 'Apportez son djeuner au Garde Parker. Il patrouille sur la route qui mne au Sombre-Comt.', 'Vous pouvez me faire une faveur? J\'ai prpar un djeuner pour le garde Parker, mais il est en patrouille... C\'est un homme grand et fort, un garde de Hurlevent, qui peut se dfendre, mais pour une citadine comme moi, c\'est beaucoup trop dangereux dehors.$B$BSi vous lui apportez ce repas  ma place, revenez me voir, je vous offre un djeuner gratuit! Parker patrouille le long de la route qui mne au bois de la Pnombre.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (129, 'itIT', 'A Free Lunch', 'Bring Parker\'s lunch to Guard Parker.  He patrols the road leading to Darkshire.', 'Can you do me a favor?  I\'ve prepared a lunch for Guard Parker, but he\'s out on patrol...he\'s a big, strong Stormwind guard who can defend himself, but it\'s much too dangerous out there for a townsperson like me.$B$BSo if you deliver his lunch for me, then come back here and I\'ll give you a free lunch!  Parker patrols the stretch of road leading to Duskwood.', '', '', '', '', '', '', 0);
