INSERT INTO `quest_template_locale` VALUES (130, 'deDE', 'Besuch im Kruterladen', 'Sprecht mit der Kruterkundigen des Rotkammgebirges, Martie Jainrose.', 'Knnt Ihr Darcy ein paar Blumen von mir bringen, wenn Ihr wieder zu ihr geht? Die Blumen bekommt Ihr im Kruterladen von Seenhain, am westlichen Ende des Ortes.$B$BAber wenn Ihr die Blumen holt, dann sagt Martie, der Kruterkundigen, nicht, fr wen sie bestimmt sind oder wer Euch beauftragt hat, ja?', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (130, 'esES', 'Una visita al herborista', 'Habla con Martie Jainrose, la herborista de Crestagrana.', 'Te importa entregarle unas flores a Darcy de mi parte? Cmpralas en el herbolario de Villa del Lago, en el extremo oeste de la ciudad.$B$BPero no vayas a decir en la tienda para quin son o quin las enva...', '', '', '', '', '', '', 0);
