INSERT INTO `quest_template_locale` VALUES (130, 'frFR', 'Une visite chez l\'herboriste', 'Parlez  Martie Jainrose, l\'Herboriste des Carmines.', 'Puisque vous retournez voir Darcy, pouvez-vous lui apporter des fleurs de ma part? Vous en trouverez chez l\'herboriste, quand vous serez de retour  Comt-du-Lac,  l\'extrmit ouest de la ville.$B$BMais quand vous prendrez les fleurs, ne dites pas  l\'herboriste, Martie, qui les achte, ni pour qui elles sont...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (130, 'itIT', 'Visit the Herbalist', 'Speak with the Redridge Herbalist, Martie Jainrose.', 'Before you go back to Darcy, can you bring her some flowers for me?  You can get them at the herbalist shop back in Lakeshire, at the west end of town.$B$BBut when you get the flowers...don\'t tell the herbalist, Martie, whom they\'re from, or whom they\'re for...', '', '', '', '', '', '', 0);
