INSERT INTO `quest_template_locale` VALUES (131, 'deDE', 'Narzissen fr eine Dame', 'Gebt Darcy den Narzissenstrau.', 'Hier habt Ihr Euren Blumenstrau. Ich habe Narzissen fr Euch ausgesucht. Narzissen sind meine Lieblingsblumen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (131, 'esES', 'Un ramo de narcisos', 'Dale el ramo de narcisos a Darcy.', 'Aqu tienes el ramo. Lo he hecho de narcisos, mis flores favoritas.', '', '', '', '', '', '', 0);
