INSERT INTO `quest_template_locale` VALUES (131, 'frFR', 'Bouquet de jonquilles', 'Donnez  Darcy le bouquet de jonquilles.', 'Voil votre bouquet. J\'ai choisi des jonquilles pour vous. Ce sont mes fleurs prfres!', '', '', '', '', '', '', 0);
