INSERT INTO `quest_template_locale` VALUES (132, 'deDE', 'Die Bruderschaft der Defias', 'Bringt Wileys Nachricht nach Westfall zu Gryan Starkmantel.', 'Was ich Euch jetzt erzhle, knnte mich das Leben kosten. Die Bande der Defias plant irgendwas Groes. Das Letzte, was ich gehrt habe, war, dass sie mit unterschiedlichen Gnollen, Kobolden und sogar Goblins zusammenarbeiten.$b$bBringt Starkmantel diese Nachricht. Darin steht alles, was ich zu dem Thema sagen kann.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (132, 'esES', 'La hermandad de los Defias', 'Lleva la Nota de Wiley a Gryan Mantorrecio en los Pramos de Poniente.', 'Lo que voy a contarte puede costarme la vida. La banda Defias est preparando algo grande. Lo ltimo que o fue que estaban colaborando con varios gnolls, kbolds e incluso goblins.$B$BLlvale esta nota a Mantorrecio. Explica todo lo que s sobre este asunto.', '', '', '', '', '', '', 0);
