INSERT INTO `quest_template_locale` VALUES (132, 'frFR', 'La Confrrie dfias', 'Apportez la Note de Wiley  Gryan Roidemantel, dans la marche de l\'Ouest.', 'Ce que je vais vous dire peut me coter la vie. Le gang dfias est en train de prparer un gros coup. Il parat qu\'ils se sont acoquins avec des gnolls, des kobolds et mme des gobelins.$b$bApportez ce message  Roidemantel. Il donne tous les dtails de ce que je sais  ce sujet.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (132, 'itIT', 'The Defias Brotherhood', 'Take Wiley\'s Note to Gryan Stoutmantle in Westfall.', 'What I am about to tell you could cost me my life.  The Defias gang is up to something big.  Last I heard they were working in conjunction with various gnolls, kobolds and even goblins.$b$bTake this note to Stoutmantle.  It explains as much as I know on the subject.', '', '', '', '', '', '', 0);
