INSERT INTO `quest_template_locale` VALUES (133, 'deDE', 'Ein Ghulbildnis', 'Sammelt 7 Ghulrippen und bringt sie zu Calvinius in seiner Htte.', 'Ich wohne so weit weg von der Stadt und dem Schutz, den sie bietet, dass es ein Wunder ist, dass die Ghule und die wandelnden Toten mich noch nicht aufgefressen haben! Tatschlich hat erst gestern ein Rudel Knochenkauer gegen die Wnde meines Hauses gehmmert.$B$BIch mchte ein Bildnis herstellen - eine Art \"Vogelscheuche\", nur fr Ghule. Dafr brauche ich ein paar Ghulrippen. Die bekommt Ihr von Fleischfressern, Knochenkauern, Hirnfressern, Verfaulten und Seuchenverbreitern.$B$BWenn Ihr mir die Rippen beschafft, bezahle ich Euch in barer Mnze.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (133, 'esES', 'Un espantapjaros para necrfagos', 'Rene 7 costillas de necrfago y llvaselas a Abercrombie a su cabaa.', 'Vivo tan lejos de la proteccin de la ciudad que es un milagro que los necrfagos y los muertos andantes no me hayan devorado. De hecho, ayer, sin ir ms lejos, una manada de Mascahuesos intent tirar abajo las paredes de mi casa!$B$BQuiero hacer un monigote... una especie de espantapjaros para necrfagos. Y para hacerlo necesito costillas de necrfago. Puedes conseguirlos de comecarnes, Mascahuesos, comesesos, podridos y propagadores de peste.$B$BConsgueme esas costillas y yo te pagar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (133, 'esMX', 'Un espantapjaros para necrfagos', 'Rene 7 costillas de necrfago y llvaselas a Abercrombie a su cabaa.', 'Vivo tan lejos de la proteccin de la ciudad que es un milagro que los necrfagos y los muertos andantes no me hayan devorado. De hecho, ayer, sin ir ms lejos, una manada de Mascahuesos intent tirar abajo las paredes de mi casa!$B$BQuiero hacer un monigote... una especie de espantapjaros para necrfagos. Y para hacerlo necesito costillas de necrfago. Puedes conseguirlos de comecarnes, Mascahuesos, comesesos, podridos y propagadores de peste.$B$BConsgueme esas costillas y yo te pagar.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (133, 'frFR', 'L\'pouvantail  goules', 'Trouvez 7 Ctes de goule. Apportez-les  Abercrombie dans sa cabane.', 'Je vis tellement loin de la sret de la ville que c\'est un miracle que les morts-vivants ne m\'aient pas dvor! En fait, juste hier, un groupe de Mcheurs est venu rder prs de ma maison!$B$BPour les loigner, je voudrais faire une sorte dpouvantail  goules. Il me faut des ctes de goules. On peut se les procurer sur les Dvoreurs, les Mcheurs, les Mangeurs de cervelle, les Pourris et les Rpandeurs de peste.$B$BTrouvez-moi des ctes et je vous donnerais une rcompense.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (133, 'itIT', 'Ghoulish Effigy', 'Gather 7 Ghoul Ribs and bring them to Abercrombie at his shack.', 'I live so far from the protection of town, it\'s a wonder the ghouls and the walking dead haven\'t eaten me!  In fact, just yesterday a pack of Bone Chewers was pounding on the walls of my house!$B$BI want to make an effigy - a kind of \"scarecrow\" for Ghouls.  To do that I need some Ghoul Ribs.  You can get them from Flesh Eaters, Bone Chewers, Brain Eaters, Rotted Ones and Plague Spreaders.$B$BGet the ribs for me, and I will repay you with some coin.', '', '', '', '', '', '', 0);
