INSERT INTO `quest_template_locale` VALUES (134, 'deDE', 'Ogerdiebe', 'Bringt Calvinius\' Kiste zu Calvinius.', 'Vor ein paar Wochen wurde ich von einer Bande Ogern angegriffen, als ich drauen Kruter sammelte, ziemlich weit von meinem Haus entfernt. Ich lief davon und musste eine Kiste mit wertvollen Werkzeugen und Krutern zurcklassen.$B$BNachdem sie mich vertrieben hatten, stolzierten die Oger zurck zum Ogerhort im sdlichen Dmmerwald. Ich bin mir sicher, dass meine Kiste irgendwo in der Nhe des Hgels sein muss.$B$BBitte, $n, beschafft mir diese Kiste wieder, denn sie fehlt mir sehr.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (134, 'esES', 'Ladrones ogros', 'Devuelve a Abercrombie el cajn de Abercrombie.', 'Hace unas pocas semanas, mientras recoga hierbas lejos de mi casa, me atac una manada de ogros. Hu a toda prisa y tuve que dejar atrs un cajn lleno de valiosas herramientas y hierbas.$B$BLos ogros volvieron a su tmulo del sur del Bosque del Ocaso pavonendose de su hazaa. Tengo la seguridad de que mi cajn est cerca de ese tmulo.$B$BPor favor, $n, recupera ese cajn, lo necesito.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (134, 'esMX', 'Ladrones ogros', 'Devuelve a Abercrombie el cajn de Abercrombie.', 'Hace unas pocas semanas, mientras recoga hierbas lejos de mi casa, me atac una manada de ogros. Hu a toda prisa y tuve que dejar atrs un cajn lleno de valiosas herramientas y hierbas.$B$BLos ogros volvieron a su tmulo del sur del Bosque del Ocaso pavonendose de su hazaa. Tengo la seguridad de que mi cajn est cerca de ese tmulo.$B$BPor favor, $n, recupera ese cajn, lo necesito.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (134, 'frFR', 'Les ogres voleurs', 'Rapporter sa caisse  Abercrombie.', 'Il y a quelques semaines, je cueillais des herbes assez loin de chez moi et j\'ai t attaqu par une bande d\'ogres! Je me suis enfui, en laissant derrire moi une caisse pleine dherbes et de prcieux outils.$B$BLes ogres m\'ont pourchass un moment, puis ils sont retourns  leur tertre, au sud du bois de la Pnombre. Je suis sr que ma caisse est l-bas, pas trs loin du tertre des ogres.$B$BJe vous en prie, $n, rcuprez cette caisse pour moi. Elle me fait gravement dfaut.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (134, 'itIT', 'Ogre Thieves', 'Return Abercrombie\'s Crate to Abercrombie.', 'A few weeks ago I was picking herbs far from my house, and a band of ogres attacked me!  I ran, and I was forced to leave behind a crate of precious tools and herbs.$B$BAfter they chased me off, the ogres swaggered back to the ogre mound in southern Duskwood.  I\'m sure my crate is somewhere near the mound.$B$BPlease, $n, retrieve this crate for me for I miss it sorely.', '', '', '', '', '', '', 0);
