INSERT INTO `quest_template_locale` VALUES (135, 'deDE', 'Die Bruderschaft der Defias', 'Bringt Wileys Nachricht nach Sturmwind zu Mathias Shaw.', 'Ich mchte zu gern wissen, was Wiley meinte, als er die Steinmetze erwhnte. Vielleicht ist ihm da nur etwas rausgerutscht. Knnten die Defias irgendwas mit den Steinmetzen zu tun haben? Nur ein Mann wei das mit Sicherheit: Mathias Shaw, Kopf von SI:7. Zeigt ihm Wileys Nachricht und stellt fest, ob er noch etwas zu diesem immer verzwickter werdenden Rtsel beitragen kann. Falls Ihr Probleme habt, Shaw zu finden, seht in der Kaserne in der Altstadt nach.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (135, 'esES', 'La hermandad de los Defias', 'Lleva la Nota de Wiley a Mathias Shaw de Ventormenta.', 'Me pregunto qu querra decir Wiley cuando habl de los Albailes. Quizs fue un lapsus. Podra estar relacionada la banda Defias con los Albailes? El nico que podra saberlo es Mathias Shaw, lder del IV:7. Ensale la nota de Wiley, tal vez tenga algo que aadir a este misterio. Si tienes problemas para encontrarlo, busca en el Cuartel, en el Casco Antiguo.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (135, 'esMX', 'La hermandad de los Defias', 'Lleva la Nota de Wiley a Mathias Shaw de Ventormenta.', 'Me pregunto qu querra decir Wiley cuando habl de los Albailes. Quizs fue un lapsus. Podra estar relacionada la banda Defias con los Albailes? El nico que podra saberlo es Mathias Shaw, lder del IV:7. Ensale la nota de Wiley, tal vez tenga algo que aadir a este misterio. Si tienes problemas para encontrarlo, busca en el Cuartel, en el Casco Antiguo.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (135, 'frFR', 'La Confrrie dfias', 'Apporter la Note de Wiley  Mathias Shaw  Hurlevent.', 'Je me demande de quoi parlait Wiley quand il a mentionn les Maons. C\'tait peut-tre un lapsus? Les Dfias pourraient-ils tre relis aux Maons? Le seul qui pourrait le savoir  coup sr, c\'est Mathias Shaw, le chef du SI:7. Montrez-lui la note de Wiley et voyez s\'il a quelque chose  tirer de ce mystre qui s\'paissit. Si vous avez du mal  trouver Shaw, cherchez du ct de la caserne de la Vieille ville.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (135, 'itIT', 'The Defias Brotherhood', 'Take Wiley\'s Note to Mathias Shaw in Stormwind.', 'I wonder what Wiley meant when he mentioned the Stonemasons.  Perhaps that was a slip of tongue.  Could the Defias gang be related to the Stonemasons?  Only one man would know for sure:  Mathias Shaw, head of SI:7. Show him Wiley\'s Note and see if he has anything to add to this growing mystery. If you have trouble finding Shaw, check the Barracks in Old Town.', '', '', '', '', '', '', 0);
