INSERT INTO `quest_template_locale` VALUES (136, 'deDE', 'Kpt\'n Sanders\' versteckter Schatz', 'Findet Kpt\'n Sanders Schliekiste und durchsucht sie, um den nchsten Hinweis zu erhalten.', 'Wenn Ihr das hier lesen tut, dann heit das, dass der alte Kpt\'n Sanders in den Fluten begraben is\'. Also tut mein Schatz jetz\' Euch gehr\'n, Ihr braucht blo den Hinweisen folgen. $b$bErst msst Ihr ma\' meine Schliekiste finden. Wahrscheinlich is\' die jetz\' da an der Westkste von Westfall in der Nhe von dem Schiffswrack schon halb im Sand verschwunden. \'s gibt da an der Kste massig Schiffswracks, aber blo einen rostigen Anker. Wenn Ihr den Anker finden tut, dann habt Ihr auch meine Schliekiste gefunden. Da msst ihr reingucken, denn da steht der nchste Hinweis drin.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (136, 'esES', 'El tesoro escondido del capitn Sanders', 'Encuentra el bal del capitn Sanders y busca la siguiente pista.', 'Si ests leyendo esto, el capitn Sanders estar sepultado bajo el agua. As que mi tesoro es tuyo, solo tienes que seguir las pistas.$B$BPrimero tienes que encontrar mi bal. Seguramente estar enterrado en la arena, en la costa Oeste de los Pramos de Poniente, cerca de los restos de naufragios. Habr muchos restos, pero solo un ancla oxidada en la costa. Encuentra el ancla y encontrars mi bal! All encontrars tambin la siguiente pista.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (136, 'esMX', 'El tesoro escondido del capitn Sanders', 'Encuentra el bal del capitn Sanders y busca la siguiente pista.', 'Si ests leyendo esto, el capitn Sanders estar sepultado bajo el agua. As que mi tesoro es tuyo, solo tienes que seguir las pistas.$B$BPrimero tienes que encontrar mi bal. Seguramente estar enterrado en la arena, en la costa Oeste de los Pramos de Poniente, cerca de los restos de naufragios. Habr muchos restos, pero solo un ancla oxidada en la costa. Encuentra el ancla y encontrars mi bal! All encontrars tambin la siguiente pista.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (136, 'frFR', 'Le trsor cach du capitaine Sanders', 'Trouvez le Coffre du capitaine Sanders. Fouillez-le pour trouver l\'indice suivant.', 'Si vous lisez ceci, c\'est que le vieux capitaine Sanders repose sous six pieds de flotte. Mon trsor est  vous. Il vous suffit de suivre le jeu de piste.$b$bD\'abord, trouvez mon coffre. Il doit tre  moiti enterr dans le sable, depuis le temps, sur la cte de la marche de l\'Ouest,  ct de l\'pave. Il y a des tas d\'paves sur la cte, mais une seule ancre rouille. Qui trouve cette ancre trouve mon coffre! Et avec le coffre, l\'indice suivant!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (136, 'itIT', 'Captain Sanders\' Hidden Treasure', 'Find Captain Sanders\' footlocker and search it for the next clue.', 'If ye be readin\' this, it means that Ol\' Captain Sanders is in a watery grave.  So my treasure is yours now, ye jest need to follow the clues. $b$bFirst ye need to find me footlocker.  It\'s probably half-buried in sand by now, along the Western Coast of Westfall near the shipwreck.  There be lots of shipwrecks but only one rusty anchor on the coast.  Find that anchor and you\'ll find me locker!  Look in there for the next clue.', '', '', '', '', '', '', 0);
