INSERT INTO `quest_template_locale` VALUES (137, 'deDE', '<NYI> <TXT> Sturmwind Commendation', 'General Marcus Jonathan aus Sturmwind wird eine Belobigung, die Ihr von jemandem im Wald von Elwynn erhaltet, honorieren. Wenn Ihr ihm ein solches Dokument bringt, belohnt er Euch mit einem Rstungsteil.', 'Wenn Ihr von einem unserer Marschalls eine Belobigung erhaltet, dann bringt sie mir. Ihr bekommt dafr einen unserer Handschuhe mit Lwenemblem.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (137, 'esES', '<NYI> <TXT> Mencin honorfica de Ventormenta', 'El general Marcus Jonathan en Ventormenta aceptar una mencin honorfica del Bosque de Elwynn. Si le entregas ese documento, como recompensa, podrs elegir una armadura.', 'Si consigues una mencin de honor de uno de nuestros Mariscales, tremela. Ser til para uno de nuestros guantes del Emblema del Len.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (137, 'esMX', '<NYI> <TXT> Mencin honorfica de Ventormenta', 'El general Marcus Jonathan en Ventormenta aceptar una mencin honorfica del Bosque de Elwynn. Si le entregas ese documento, como recompensa, podrs elegir una armadura.', 'Si consigues una mencin de honor de uno de nuestros Mariscales, tremela. Ser til para uno de nuestros guantes del Emblema del Len.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (137, 'frFR', '<NYI> <TXT> Hurlevent Commendation', 'Le gnral Marcus Jonathan de Hurlevent acceptera une recommandation de la fort d\'Elwynn. Si vous lui apportez un tel document, vous pourrez choisir une armure.', 'Seulement si vous obtenez une recommandation de l\'un des marchaux et que vous me l\'apportez. Cela sera du meilleur effet sur nos gants frapps d\'un lion.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (137, 'itIT', '<NYI> <TXT> Stormwind Commendation', 'General Marcus Jonathan in Stormwind will accept a commendation from Elwynn Forest.  Bringing him such a document will reward you with a choice of armor.', 'If you earn a commendation from one of our Marshals, then bring it to me.  It will be good for one of our Lion Emblem gloves.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (137, 'ptBR', '<NYI> <TXT> Comenda de Ventobravo', 'O general Marcos Jonas, de Ventobravo, est aceitando uma comenda da Floresta de Elwynn. Se entregar um documento desses para ele, voc vai poder escolher uma arma como recompensa.', 'Se por acaso voc receber alguma comenda de um dos delegados, traga-a para mim. Vai servir para uma das nossas luvas do Emblema de Leo.', '', '', '', '', '', '', 0);
