INSERT INTO `quest_template_locale` VALUES (138, 'deDE', 'Kpt\'n Sanders\' versteckter Schatz', 'Findet das alte Fass in der Nhe des verfallenen Kamins und durchsucht es nach Eurem nchsten Hinweis.', 'Der Hinweis auf den Schatz lautet folgendermaen: Gut gemacht, Kumpel! Jetz\' msst Ihr Euch imma nach Osten halten. Im Osten die Steilhnge hoch, dann weiter nach Osten bis zur Strae. Schaut Euch nach so \'nem ollen verfallenen Kamin nahe bei der Strae um. Dort findet Ihr \'n altes Fass mit Eurem nchsten Hinweis drin.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (138, 'esES', 'El tesoro escondido del capitn Sanders', 'Busca el viejo barril junto a la chimenea en ruinas y busca la siguiente pista.', 'Esto es lo que dice la siguiente pista: Buen trabajo, compaero! Ahora tienes que ir al Este. Al Este hacia los riscos, al Este hacia el camino. Busca las ruinas de chimeneas a orillas del camino. All encontrars un viejo barril con la siguiente pista.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (138, 'esMX', 'El tesoro escondido del capitn Sanders', 'Busca el viejo barril junto a la chimenea en ruinas y busca la siguiente pista.', 'Esto es lo que dice la siguiente pista: Buen trabajo, compaero! Ahora tienes que ir al Este. Al Este hacia los riscos, al Este hacia el camino. Busca las ruinas de chimeneas a orillas del camino. All encontrars un viejo barril con la siguiente pista.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (138, 'frFR', 'Le trsor cach du capitaine Sanders', 'Trouvez le Tonneau  ct des chemines en ruine. Fouillez-le pour trouver l\'indice suivant.', 'L\'indice que vous trouvez est le suivant: Bon travail, matelot! Maintenant il va falloir cingler vers l\'est.  l\'est, vers le haut des falaises,  l\'est vers la route. Cherchez les ruines des vieilles chemines, au bord de la route. L, vous trouverez un vieux tonneau qui contient l\'indice suivant.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (138, 'itIT', 'Captain Sanders\' Hidden Treasure', 'Find the old barrel near the ruined chimney and search it for your next clue.', 'The clue to the treasure reads: Good work, matey!  Now ye need to head due east.  East up the bluffs, east to the road.  Look for the ol\' chimney ruins near the side of the road.  There you\'ll find an old barrel with your next clue.', '', '', '', '', '', '', 0);
