INSERT INTO `quest_template_locale` VALUES (139, 'deDE', 'Kpt\'n Sanders\' versteckter Schatz', 'Durchsucht den leeren Henkelkrug neben der Windmhle nach dem nchsten Hinweis.', 'Als Ihr das Fass durchsucht, findet Ihr ein weiteres Stck Pergament. Darauf steht: Also, von dem Fass dort msst Ihr Euch nach Norden halten tun. Un\' dann geht Ihr immer der Nase nach schnurstracks geradeaus, bis Ihr den leeren Henkelkrug sehen tut, der da irgendwo bei so \'ner einzeln stehenden Windmhle oben auf dem Steilhang ber dem Meer liegt. Wenn Ihr Euch den Henkelkrug mal genau anguckt, dann findet Ihr vielleicht sogar, was Ihr sucht.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (139, 'esES', 'El tesoro escondido del capitn Sanders', 'Busca la jarra vaca junto al molino de viento para encontrar la siguiente pista.', 'Buscando en el barril descubres otro fragmento de papiro. En este se puede leer: Desde este barril, ve hacia el Norte. Tan recto como vuela el cuervo, anda hasta que veas una jarra vaca junto al solitario molino de viento sobre los riscos del mar. Si buscas alrededor de la jarra encontrars lo que ests buscando.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (139, 'esMX', 'El tesoro escondido del capitn Sanders', 'Busca la jarra vaca junto al molino de viento para encontrar la siguiente pista.', 'Buscando en el barril descubres otro fragmento de papiro. En este se puede leer: Desde este barril, ve hacia el Norte. Tan recto como vuela el cuervo, anda hasta que veas una jarra vaca junto al solitario molino de viento sobre los riscos del mar. Si buscas alrededor de la jarra encontrars lo que ests buscando.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (139, 'frFR', 'Le trsor cach du capitaine Sanders', 'Cherchez la Cruche vide  ct de l\'olienne pour trouver le prochain indice.', 'En fouillant le tonneau, vous dcouvrez un autre parchemin. Il y est crit:  partir de ce tonneau, dirigez-vous vers le nord. Marchez droit comme une bande de cadets qui va au rfectoire, jusqu\' ce que vous voyiez la cruche vide,  ct de l\'olienne solitaire, sur les falaises. Si vous farfouillez autour de cette cruche, vous pourrez bien trouver ce que vous cherchez.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (139, 'itIT', 'Captain Sanders\' Hidden Treasure', 'Search the empty jug next to the windmill for the next clue.', 'Searching through the barrel you discover another piece of parchment.  This one reads:  Now from this here barrel, face ye North.  Straight as the crow flies, keep ye walkin\' till you see the empty jug next to the lone windmill on the sea bluffs.  If ye poke around that jug, ye just might find what you\'re lookin\' for.', '', '', '', '', '', '', 0);
