INSERT INTO `quest_template_locale` VALUES (140, 'deDE', 'Kpt\'n Sanders\' versteckter Schatz', 'Findet Kpt\'n Sanders\' Truhe und ffnet sie. Darin befindet sich Eure Belohnung.', 'Und tatschlich, ganz unten, fast am Boden des alten Henkelkruges findet sich der nchste Hinweis auf Sanders Schatz. An manchen Stellen ist die Tinte verwischt und das Papier riecht nach Whisky, aber zum Teil kann man den Text noch lesen: Jetz\', wo Ihr mein\'n alten Whiskykrug gefunden habt, habt Ihr den Schatz schon so gut wie in der Tasche. Von der Flasche aus msst Ihr Euch einfach nach Westen halten und runter zum Strand geh\'n. Und dann heit es schwimmen! Schwimmt schnurstracks nach Westen, bis Ihr an der Insel seid, da wo meine Schatztruhe drauf is\'!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (140, 'esES', 'El tesoro escondido del capitn Sanders', 'Localiza la arqueta del capitn Sanders y brela para obtener tu recompensa.', 'Ciertamente, dentro de la vieja jarra hay otra pista sobre el tesoro de Sanders. La tinta se ha borrado en algunas partes y el papel huele a whisky, pero an puedes entender algo: Ahora que has encontrado mi vieja jarra de whisky casi has llegado al tesoro! Dirgete hacia el Oeste desde la botella y baja hasta la costa. Cuando llegues al agua, sigue adelante! Nada directo hacia el Oeste hasta encontrar la isla con la arqueta!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (140, 'esMX', 'El tesoro escondido del capitn Sanders', 'Localiza la arqueta del capitn Sanders y brela para obtener tu recompensa.', 'Ciertamente, dentro de la vieja jarra hay otra pista sobre el tesoro de Sanders. La tinta se ha borrado en algunas partes y el papel huele a whisky, pero an puedes entender algo: Ahora que has encontrado mi vieja jarra de whisky casi has llegado al tesoro! Dirgete hacia el Oeste desde la botella y baja hasta la costa. Cuando llegues al agua, sigue adelante! Nada directo hacia el Oeste hasta encontrar la isla con la arqueta!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (140, 'frFR', 'Le trsor cach du capitaine Sanders', 'Localisez le Coffre au trsor du capitaine Sanders et ouvrez-le pour prendre votre rcompense.', 'Bien vu! Il y a un autre indice au fond de la cruche. L\'encre a coul par endroits et le papier sent le whisky, mais vous arrivez  reconstituer une partie du texte. Maintenant que vous avez trouv la vieille cruche de whisky, vous tes presque au trsor! Tournez-vous vers l\'ouest et descendez vers le rivage. Ne vous arrtez pas au bord de l\'eau, continuez! Nagez vers l\'ouest jusqu\' l\'le o se trouve mon coffre au trsor!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (140, 'itIT', 'Captain Sanders\' Hidden Treasure', 'Locate Captain Sanders\' chest and open it for your reward.', 'Sure enough, deep within the Old Jug there is another clue to Sanders\' treasure.  The ink has run in some places and the paper smells like whiskey but you can make out some of the text:  Now that ye found me ol\' whiskey jug, you\'re almost to the treasure!  Just face West from the bottle and walk down to the shore.  Once ye get to the water, keep going!  Swim straight west till you find the island with me treasure chest!', '', '', '', '', '', '', 0);
