INSERT INTO `quest_template_locale` VALUES (141, 'deDE', 'Die Bruderschaft der Defias', 'Bringt Shaws Bericht nach Westfall zu Gryan Starkmantel.', 'Die Gilde der Steinmetze wurde von einem Mann namens Edwin van Cleef gefhrt. Van Cleef war dafr verantwortlich, dass Sturmwind wieder aufgebaut wurde, nachdem die Orcs es im Ersten Krieg dem Boden gleichgemacht hatten. Anscheinend waren van Cleef und seine Leute nicht zufrieden damit, wie der Knig sie behandelte, nachdem der Wiederaufbau vollendet war. Das knnte den einen oder anderen Sachverhalt erklren.$b$bIch habe Eurem Meister in Westfall einen ausfhrlicheren Bericht geschrieben. Bringt ihn sofort zu ihm!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (141, 'esES', 'La hermandad de los Defias', 'Lleva el informe de Shaw a Gryan Mantorrecio de los Pramos de Poniente.', 'La Hermandad de los Albailes estaba dirigida por un tal Edwin VanCleef. VanCleef fue responsable de la reconstruccin de Ventormenta cuando la ciudad fue arrasada por los orcos en la Primera Guerra. Al parecer, VanCleef y sus hombres no estaban satisfechos con el tratamiento que les brind el rey cuando termin la reconstruccin. Pero eso solo explicara algunas cosas.$B$BHe redactado un informe ms detallado para tu maestro en los Pramos de Poniente. Llvaselo de una vez!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (141, 'esMX', 'La hermandad de los Defias', 'Lleva el informe de Shaw a Gryan Mantorrecio de los Pramos de Poniente.', 'La Hermandad de los Albailes estaba dirigida por un tal Edwin VanCleef. VanCleef fue responsable de la reconstruccin de Ventormenta cuando la ciudad fue arrasada por los orcos en la Primera Guerra. Al parecer, VanCleef y sus hombres no estaban satisfechos con el tratamiento que les brind el rey cuando termin la reconstruccin. Pero eso solo explicara algunas cosas.$B$BHe redactado un informe ms detallado para tu maestro en los Pramos de Poniente. Llvaselo de una vez!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (141, 'frFR', 'La Confrrie dfias', 'Apporter le Rapport de Shaw  Gryan Roidemantel, dans la marche de l\'Ouest.', 'La Guilde des Maons est dirige par un homme du nom d\'Edwin VanCleef. C\'est lui qui a rebti Hurlevent aprs sa destruction par les orcs au cours de la Premire Guerre. Apparemment, VanCleef et ses quipes n\'ont pas apprci la faon dont ils ont t traits par le roi  la fin de la reconstruction. a pourrait expliquer une ou deux petites choses.$b$bJ\'ai rdig un rapport dtaill pour ton matre, dans la marche de l\'Ouest. Apporte-le-lui tout de suite!', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (141, 'itIT', 'The Defias Brotherhood', 'Take Shaw\'s report to Gryan Stoutmantle in Westfall.', 'The Stonemasons\' Guild was run by a man named Edwin VanCleef.  VanCleef was responsible for rebuilding Stormwind after the orcs razed it in the First War.  Apparently, VanCleef and his men were unhappy with their treatment by the King after the reconstruction was complete.  That just might explain a thing or two.$b$bI have written a more detailed account for your Master in Westfall.  Take this to him at once!', '', '', '', '', '', '', 0);
