INSERT INTO `quest_template_locale` VALUES (141, 'ptBR', 'The Defias Brotherhood', 'Take Shaw\'s report to Gryan Stoutmantle in Westfall.', 'The Stonemasons\' Guild was run by a man named Edwin VanCleef. VanCleef was responsible for rebuilding Stormwind after the orcs razed it in the First War. Apparently, VanCleef and his men were unhappy with their treatment by the King after the reconstruction was complete. That just might explain a thing or two.$b$bI have written a more detailed account for your Master in Westfall. Take this to him at once!', '', '', '', '', '', '', 0);
