INSERT INTO `quest_template_locale` VALUES (142, 'deDE', 'Die Bruderschaft der Defias', 'Sprt den Boten der Defias in Westfall auf und bringt die Nachricht, die er bei sich hat, zu Starkmantel.', 'Wir mssen herausfinden, wo genau sich das Versteck der Defias befindet. $n, meine Spher berichten mir, dass ein Bote der Defias auf der Strae zwischen Mondbruch, dem Goldkstensteinbruch und dem Jangoschacht gesehen worden ist. Ich mchte, dass Ihr ihn fangt. Wenn er Widerstand leistet, ttet ihn und bringt mir alles, was er bei sich trgt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (142, 'esES', 'La hermandad de los Defias', 'Localiza al mensajero Defias de los Pramos de Poniente y lleva su mensaje a Mantorrecio.', 'Tenemos que descubrir la localizacin de la Ladronera Defias. $n, segn los informes de mi explorador se ha visto a un mensajero Defias en los caminos entre el Arroyo de la Luna, la Mina de la Costa del Oro y la Mina de Jango. Quiero que le captures. Si ofrece resistencia, mtalo y treme lo que est llevando.', '', '', '', '', '', '', 0);
