INSERT INTO `quest_template_locale` VALUES (142, 'frFR', 'La Confrrie dfias', 'Traquer le Messager dfias dans la marche de l\'Ouest et apporter les documents qu\'il transporte  Roidemantel.', 'Nous devons dbusquer les Dfias de leur cache, $n. Mes claireurs ont rendu compte qu\'un Messager Dfias a t vu sur les routes entre Ruisselune, la carrire de la cte de l\'Or et la mine Veine-de-Jango. Je veux que vous le capturiez. S\'il rsiste, tuez-le, et apportez-moi tout ce que vous trouverez sur lui.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (142, 'itIT', 'The Defias Brotherhood', 'Track down the Defias Messenger in Westfall and bring his message to Stoutmantle.', 'We need to discover the location of the Defias hideout.  $n, my scout reports that a Defias Messenger has been seen on the roads between Moonbrook, the Gold Coast Quarry and the Jangolode Mine.  I want you to capture him.  If he resists, kill him and bring me whatever he is carrying.', '', '', '', '', '', '', 0);
