INSERT INTO `quest_template_locale` VALUES (143, 'deDE', 'Botschaft nach Westfall', 'Magistrat Solomon mchte, dass Ihr sein Hilfegesuch nach Westfall zu Gryan Starkmantel bringt.', 'Irgendetwas stimmt mit der Armee von Sturmwind nicht. Sie htte lngst mit einem greren Aufgebot hier sein mssen. Doch Zeit ist ein Luxus, den wir nicht haben. Ich werde nicht dabeistehen und tatenlos zusehen, wie die Bewohner von Seenhain ihr Leben geben. Nein. Ich muss versuchen, von anderer Stelle her Hilfe zu gewinnen. Ich habe gehrt, dass sich in Westfall eine Volksmiliz gebildet hat.$b$bBringt dieses Hilfegesuch ihrem Anfhrer, Gryan Starkmantel. Vielleicht knnen Starkmantels Mnner uns hier untersttzen, bis der Knig Verstrkung schickt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (143, 'esES', 'Mensajero a los Pramos de Poniente', 'El magistrado Solomon quiere que lleves su peticin a Gryan Mantorrecio a los Pramos de Poniente.', 'En el ejrcito de Ventormenta pasa algo raro; ya deberan haber llegado. No tenemos tiempo que perder. No voy a quedarme a mirar cmo se sacrifica la gente de Villa del Lago sin intentar conseguir ayuda. He odo que en los Pramos de Poniente se ha formado una Milicia Popular.$B$BLleva nuestra splica a su jefe, Gryan Mantorrecio; puede que sus hombres nos ayuden hasta que llegue la Reserva.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (143, 'esMX', 'Mensajero a los Pramos de Poniente', 'El magistrado Solomon quiere que lleves su peticin a Gryan Mantorrecio a los Pramos de Poniente.', 'En el ejrcito de Ventormenta pasa algo raro; ya deberan haber llegado. No tenemos tiempo que perder. No voy a quedarme a mirar cmo se sacrifica la gente de Villa del Lago sin intentar conseguir ayuda. He odo que en los Pramos de Poniente se ha formado una Milicia Popular.$B$BLleva nuestra splica a su jefe, Gryan Mantorrecio; puede que sus hombres nos ayuden hasta que llegue la Reserva.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (143, 'frFR', 'Un message pour la marche de l\'Ouest', 'Le magistrat Salomon veut que vous portiez sa Demande d\'aide  Gryan Roidemantel dans la marche de l\'Ouest.', 'Il y a quelque chose d\'trange dans le comportement de l\'arme de Hurlevent. Elle devrait se trouver l en force  l\'heure qu\'il est. De toute faon, le temps est un luxe que nous ne pouvons pas nous offrir. Je ne resterai pas l  regarder couler le sang du peuple de Comt-du-Lac sans essayer de trouver de l\'aide. J\'ai entendu dire qu\'une milice populaire s\'tait forme dans la marche de l\'Ouest.$b$bApportez cette demande d\'aide  leur chef, Gryan Roidemantel. Ses hommes pourront peut-tre nous apporter leur soutien en attendant que le roi envoie ses rserves.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (143, 'itIT', 'Messenger to Westfall', 'Magistrate Solomon wants you to take his written plea to Gryan Stoutmantle in Westfall.', 'Something odd is afoot with the Stormwind Army.  They should have been here in force by now.  Time is a luxury we don\'t have, however.  I will not stand by and watch the people of Lakeshire give their lives without trying to enlist more help.  I\'ve heard word of a people\'s militia forming in Westfall.$b$bTake this plea to their leader, Gryan Stoutmantle.  Perhaps Stoutmantle\'s men can lend some support here until the King sends reserves.', '', '', '', '', '', '', 0);
