INSERT INTO `quest_template_locale` VALUES (144, 'deDE', 'Botschaft nach Westfall', 'Kehrt mit Gryan Starkmantels Antwort zu Magistrat Solomon zurck.', 'Es schmerzt mich, Magistrat Solomons Schreiben zu lesen. Offensichtlich hat er von dem Krieg, der hier in Westfall tobt, keine Ahnung. Sonst wre er nicht so naiv, Hilfe von der Miliz zu erwarten. Wenn Sturmwind nicht auch uns im Stich gelassen htte, dann htte es keinen Grund gegeben, die Miliz ins Leben zu rufen.$b$bBringt Eurem Herrn im Rotkammgebirge diese Antwort, $C. Und lasst ihn wissen, dass mir das Herz schwer wird, wenn ich an all die tapferen Leute denke, die ihr Leben verloren haben.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (144, 'esES', 'Mensajero a los Pramos de Poniente', 'Lleva la respuesta de Gryan Mantorrecio al magistrado Solomon.', 'Me duele leer la nota del magistrado Solomon. Evidentemente, no sabe que hay guerra en los Pramos de Poniente, si no, no pedira ayuda a la Milicia. Si Ventormenta no nos hubiera abandonado tambin a nosotros, no necesitaramos una milicia.$B$BLlvale la respuesta a tu seor en Crestagrana, $c. Dile que lamento la prdida de tantos hombres buenos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (144, 'esMX', 'Mensajero a los Pramos de Poniente', 'Lleva la respuesta de Gryan Mantorrecio al magistrado Solomon.', 'Me duele leer la nota del magistrado Solomon. Evidentemente, no sabe que hay guerra en los Pramos de Poniente, si no, no pedira ayuda a la Milicia. Si Ventormenta no nos hubiera abandonado tambin a nosotros, no necesitaramos una milicia.$B$BLlvale la respuesta a tu seor en Crestagrana, $c. Dile que lamento la prdida de tantos hombres buenos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (144, 'frFR', 'Un message pour la marche de l\'Ouest', 'Retourner voir le Magistrat Salomon avec la rponse de Gryan Roidemantel.', 'La demande du magistrat Salomon me peine plus que je ne saurais le dire. Visiblement, il ignore que la guerre a clat dans la marche de l\'Ouest, sinon il saurait qu\'aucune aide n\'est  attendre de la Milice. Si Hurlevent ne nous avait pas abandonns elle aussi, nous n\'aurions pas eu besoin de la Milice.$B$BApportez cette rponse  votre matre dans les Carmines, $c. Et dites-lui que mon cur est lourd  la pense de la mort de tant de braves.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (144, 'itIT', 'Messenger to Westfall', 'Return to Magistrate Solomon with Gryan Stoutmantle\'s response.', 'Magistrate Solomon\'s note pains me to read.  But it is obvious he knows not the war which is waged in Westfall or else he would know better than to expect aid from the Militia.  If Stormwind had not deserted us as well, we would not have the need for the Militia.$b$bTake this response to your master in Redridge, $c.  And let him know that my heart is heavy with the loss of good men.', '', '', '', '', '', '', 0);
