INSERT INTO `quest_template_locale` VALUES (145, 'deDE', 'Botschaft nach Dunkelhain', 'Magistrat Solomon mchte, dass Ihr einen Brief zu Lord Schwarzhaupt nach Dunkelhain bringt.', 'Ein weiteres Mal brauche ich Eure Hilfe. Ich habe an Lord Schwarzhaupt geschrieben und ihn gebeten, seine gut ausgebildete Nachtwache hierher zu schicken, damit diese bei der Verteidigung von Seenhain hilft. Es ist von ausnehmender Wichtigkeit, dass diese Nachricht ihn so bald wie mglich erreicht. Doch Ihr msst uerste Vorsicht walten lassen. Schwarzhaupt ist der Brgermeister von Dunkelhain, und das liegt im Herzen des Dmmerwalds. Entfernt Euch nicht von der Strae.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (145, 'esES', 'Mensajero a Villa Oscura', 'El magistrado Solomon quiere que lleves una carta a Lord Cerranegro a Villa Oscura.', 'Necesito tu ayuda una vez ms. He escrito a Lord Cerranegro para pedir que mande a su Guardia Nocturna como refuerzo de la defensa de Villa del Lago. Es imprescindible que reciba este mensaje cuanto antes, pero debes ser extremadamente prudente. Cerranegro es el alcalde de Villa Oscura, en pleno corazn del Bosque del Ocaso. No te salgas de los caminos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (145, 'esMX', 'Mensajero a Villa Oscura', 'El magistrado Solomon quiere que lleves una carta a Lord Cerranegro a Villa Oscura.', 'Necesito tu ayuda una vez ms. He escrito a Lord Cerranegro para pedir que mande a su Guardia Nocturna como refuerzo de la defensa de Villa del Lago. Es imprescindible que reciba este mensaje cuanto antes, pero debes ser extremadamente prudente. Cerranegro es el alcalde de Villa Oscura, en pleno corazn del Bosque del Ocaso. No te salgas de los caminos.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (145, 'frFR', 'Un message pour Sombre-Comt', 'Le magistrat Salomon veut que vous apportiez une lettre au seigneur Bouclenoire de Sombre-Comt.', 'Je sollicite votre aide une nouvelle fois. J\'ai crit au seigneur Bouclenoire pour lui demander de m\'envoyer ses gardes les plus expriments, les Veilleurs, afin de renforcer les dfenses de Comt-du-Lac. Il est primordial que ce message lui soit remis rapidement. Vous devez faire preuve de la plus grande vigilance. Bouclenoire est le maire de Sombre-Comt, au cur du bois de la Pnombre. Ne vous cartez pas des chemins.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (145, 'itIT', 'Messenger to Darkshire', 'Magistrate Solomon wants you to take a letter to Lord Ebonlocke in Darkshire.', 'I require your assistance once again.  I have written to Lord Ebonlocke, requesting that he sends his trained guards, the Night Watch, to help with Lakeshire\'s defense.  It is imperative this message makes it to him swiftly.  You must exercise extreme caution.  Ebonlocke is the mayor of Darkshire, in the heart of Duskwood.  Do not stray from the roads.', '', '', '', '', '', '', 0);
