INSERT INTO `quest_template_locale` VALUES (146, 'deDE', 'Botschaft nach Dunkelhain', 'Kehrt mit Lord Schwarzhaupts Antwortschreiben zu Magistrat Solomon zurck.', 'Wenn mir Magistrat Solomon nicht persnlich bekannt wre, wrde ich sagen, der Mann hat den Verstand verloren. Die Nachtwache nach Seenhain schicken, weil Sturmwind die Hilfe verweigert? Die Nachtwache wurde gegrndet, weil Sturmwind uns verlie, als diese elende Magie langsam das Land berzog. Wenn ich meine Nachtwache jetzt fortschicke, dann wrde diese Stadt vom Bsen berrannt werden, noch ehe die Wachen den Waldrand erreicht htten.$b$bBringt Eurem Meister in Seenhain dieses Antwortschreiben.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (146, 'esES', 'Mensajero a Villa Oscura', 'Lleva la respuesta de Lord Cerranegro al magistrado Solomon.', 'Si no conociera a Solomon, dira que se ha vuelto loco. Que enve a La Guardia Nocturna a Villa del Lago porque Ventormenta no enva ayuda? La Guardia Nocturna se cre porque Ventormenta nos abandon cuando nos infest esta magia inmunda. Si envo a la Guardia, esta ciudad sera invadida antes de que mis guardias lleguen al Linde del Bosque.$B$BLlvale la respuesta a tu seor en Villa del Lago.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (146, 'esMX', 'Mensajero a Villa Oscura', 'Lleva la respuesta de Lord Cerranegro al magistrado Solomon.', 'Si no conociera a Solomon, dira que se ha vuelto loco. Que enve a La Guardia Nocturna a Villa del Lago porque Ventormenta no enva ayuda? La Guardia Nocturna se cre porque Ventormenta nos abandon cuando nos infest esta magia inmunda. Si envo a la Guardia, esta ciudad sera invadida antes de que mis guardias lleguen al Linde del Bosque.$B$BLlvale la respuesta a tu seor en Villa del Lago.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (146, 'frFR', 'Un message pour Sombre-Comt', 'Retourner voir le Magistrat Salomon avec la rponse du Seigneur Bouclenoire.', 'Si je ne connaissais pas personnellement le magistrat Salomon, je penserais qu\'il a perdu la tte! Envoyer les Veilleurs  Comt-du-Lac simplement parce que Hurlevent lui refuse son aide? Nous avons d crer le corps des Veilleurs justement parce que Hurlevent nous avait abandonns au moment o cette horrible magie a commenc  se rpandre. Si j\'envoie mes Veilleurs, notre rgion sera la proie du Mal avant mme que les soldats naient atteint la lisire de la fort.$B$BPortez cette lettre en rponse  votre matre  Comt-du-Lac.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (146, 'itIT', 'Messenger to Darkshire', 'Return to Magistrate Solomon with Lord Ebonlocke\'s letter of response.', 'If I did not know Magistrate Solomon personally, I would say the man has gone mad.  Send the Night Watch to Lakeshire because Stormwind refuses aid?  The Night Watch was formed because Stormwind left us when this foul magic seeped into the land.  If I sent my Night Watch, this town would be overrun by evil before the guards even reached the forest\'s edge.$b$bTake this letter of response to your Master in Lakeshire.', '', '', '', '', '', '', 0);
