INSERT INTO `quest_template_locale` VALUES (147, 'deDE', 'Menschenjagd', 'Findet den \"Sammler\" und ttet ihn, dann kehrt mit dem Ring des Sammlers zu Marschall Patterson zurck.', 'Wenn der \"Sammler\" Gold aus unseren Minen entnimmt, dann bestiehlt er das Knigreich! Fhrt den Sammler seiner gerechten Strafe zu und bringt mir den Ring, der in dem Abholplan, den Ihr mir gegeben habt, erwhnt wurde.$B$BIm Abholplan steht, dass der Sammler sich bei Brackbrunns Krbisbeet versteckt hlt. Dort solltet Ihr nach ihm suchen.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (147, 'esES', 'La persecucin', 'Encuentra y mata al Coleccionista y vuelve junto al alguacil Patterson con la sortija del coleccionista.', 'Si el Coleccionista se est llevando oro de nuestras minas, est robando al Rey! Lleva al Coleccionista ante la justicia. Y treme a m el anillo que se mencionaba en la nota. Podra indicarnos para quin trabaja el Coleccionista...$B$BLa nota dice que el Coleccionista se esconde en la Plantacin de Calabazas de Brackwell. Deberas buscarlo all\".', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (147, 'esMX', 'La persecucin', 'Encuentra y mata al Coleccionista y vuelve junto al alguacil Patterson con la sortija del coleccionista.', 'Si el Coleccionista se est llevando oro de nuestras minas, est robando al Rey! Lleva al Coleccionista ante la justicia. Y treme a m el anillo que se mencionaba en la nota. Podra indicarnos para quin trabaja el Coleccionista...$B$BLa nota dice que el Coleccionista se esconde en la Plantacin de Calabazas de Brackwell. Deberas buscarlo all.\"', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (147, 'frFR', 'Chasse  l\'homme', 'Trouvez et tuez le Collecteur, puis rapportez lAnneau du Collecteur au Marchal Patterson.', 'Si le Collecteur prend de l\'or dans nos mines, il le vole au royaume ! Tranez-le devant la justice et apportez-moi l\'anneau dont parlait le plan de route que vous m\'avez donn. Cela pourrait bien donner une indication sur l\'employeur du Collecteur...$B$BCe plan de route indique que le Collecteur se cache prs du champ de potirons des Saumepuits. Cherchez-le dans ce secteur.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (147, 'itIT', 'Caccia all\'uomo', 'Trova e uccidi \"il Collezionista\", poi torna dal Maresciallo Patterson con l\'Anello del Collezionista.', 'Questo \"Collezionista\" sta rubando l\'oro dalle nostre miniere! Voglio che lo consegni alla giustizia e mi porti l\'anello citato nel programma di raccolta che mi hai consegnato. Potrebbe dirci per chi lavora...$B$BSecondo il programma, il Collezionista si nasconderebbe nel Campo di Zucche dei Pozzonero. Vai l e trovalo.', '', '', '', '', '', '', 0);
