INSERT INTO `quest_template_locale` VALUES (147, 'ptBR', 'Perseguio implacvel', 'Encontre e mate \"o Coletor\". Depois, entregue o Anel do Coletor para o Delegado Pedrosa.', 'Se o \"Coletor\" est pegando o ouro das nossas minas, ento ele est roubando do reino! Faa o Coletor sentir o peso da justia, alm de me trazer o anel mencionado na escala de coleta que voc me trouxe. Talvez possamos descobrir para quem o Coletor trabalha...$B$BA escala informa que o Coletor est escondido na Plantao de Abboras dos Braga. Procure por ele l.', '', '', '', '', '', '', 0);
