INSERT INTO `quest_template_locale` VALUES (148, 'deDE', 'Lieferung aus Dunkelhain', 'Sprecht mit Madame Eva.', 'Ach, was soll ich armer, alter Mann nur machen? Ich brauche einige Vorrte aus Dunkelhain, aber das Dorf ist so weit weg und ich bin so alt und schwach... ich wrde die Reise niemals berstehen.$B$BKnnt Ihr nach Dunkelhain reisen und mir etwas Geisterhaarfaden mitbringen? Den bekommt Ihr im Haus von Madame Eva am Dorfplatz von Dunkelhain.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (148, 'esES', 'Suministros de Villa Oscura', 'Habla con Lady Eva.', 'Ay, qu puede hacer un anciano como yo? Necesito suministros de Villa Oscura, pero est tan lejos y yo soy tan viejo y tan dbil... No sobrevivira al viaje.$B$BPodras ir a Villa Oscura y traerme un poco de hilo de cabello de fantasma? Puedes conseguirlo de Lady Eva. Ve a su casa en la plaza de Villa Oscura.', '', '', '', '', '', '', 0);
