INSERT INTO `quest_template_locale` VALUES (148, 'frFR', 'Fournitures en provenance de Sombre-Comt', 'Sadresser  Madame Eva.', 'Oh! Comment doit faire un pauvre vieillard? J\'ai besoin d\'aller chercher des fournitures  Sombre-Comt, mais le village est si loin et je suis si vieux, si faible... Je n\'y arriverai jamais.$B$BPouvez-vous aller  Sombre-Comt et me rapporter des mches de cheveux fantmes? Vous les obtiendrez chez Madame Eva, qui habite la place de Sombre-Comt.', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (148, 'itIT', 'Supplies from Darkshire', 'Speak with Madame Eva.', 'Oh, what is a poor old man to do?  I need some supplies from Darkshire, but the village is so far away and I am so old and feeble...I would never make the trip.$B$BCan you go to Darkshire and bring me back some Ghost Hair Thread?  You can get it from Madame Eva at her home on the Darkshire square.', '', '', '', '', '', '', 0);
