INSERT INTO `quest_template_locale` VALUES (149, 'deDE', 'Geisterhaarfaden', 'Bringt der blinden Mary den spektralen Kamm.', 'Es gibt da einen armen, traurigen Geist, die blinde Mary, die in einem alten Bauernhaus in den Hgeln sdlich von Dunkelhain spukt.$B$BHier, nehmt diesen spektralen Kamm und bittet die blinde Mary, sich die Haare zu kmmen. Bringt mir anschlieend den Kamm zurck, dann entnehme ich ihm das Geisterhaar, das ich fr den Faden brauche.$B$BUnd seht Euch vor, denn in der Nhe dieses Hauses lauern ble Dinge...', '', '', '', '', '', '', 0);
INSERT INTO `quest_template_locale` VALUES (149, 'esES', 'Hilo de cabello de fantasma', 'Lleva el peine espectral a Mary la Ciega.', 'Mary la Ciega es un desgraciado y triste espritu que mora en una vieja granja en las colinas del sur de Villa Oscura.$B$BTen, coge este peine espectral y pide a Mary la Ciega que se peine el cabello. Luego treme el peine y yo extraer de l el cabello de fantasma que necesito para crear el hilo.$B$BY ten cuidado... cerca de la casa acechan seres oscuros...', '', '', '', '', '', '', 0);
